  `citizen_id` varchar(12) COLLATE utf8mb4_vietnamese_ci NOT NULL,
  `hometown` varchar(255) COLLATE utf8mb4_vietnamese_ci NOT NULL,
  `salary` decimal(19,3) NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date DEFAULT NULL,
  PRIMARY KEY (`tour_operator_id`),
  UNIQUE KEY `phone_number` (`phone_number`),
