INSERT INTO `tour_program` VALUES (1636,1,'17:00 Hng dn vin Vietravel n Qu khch ti s 53, ng 30/04, khu ph 1, Dng ng, Ph Quc. on i dc con ng 30/04 n Ph Th Quan Thnh  Qun hi t y  nhng chun mc o c phong kin nh: nhn, l, ngha, dng, tr, tn nn th ng l th hin s  cao lng trung thnh, hip ngha, tr gian, tc nhng c mong tt p gi gm vo yu t tm linh.\r\nDinh Cu - biu tng vn ho v tn ngng ca o Ph Quc. Ni ng dn a phng gi gm nim tin cho mt chuyn ra khi nh bt y p c khi tr v.\r\nDinh B Thy Long Thnh Mu - th Thn N Kim Giao, ngi ph n c ngi dn Ph Quc rt mc tn knh v c cng khai ph huyn o ny.\r\nTri nghim ch m Ph Quc - khu ch c phn thnh 2 khu vc ring bit vi hng trm gian hng khc nhau:\r\nKhu u ch (Khu s 1) - khu m thc - ni tp trung hng trm gian hng n ung t hi sn, bnh ko n cc chng loi c sn kh  du khch c th la chn mua sm lm qu.\r\nKhu cui ch (Khu s 2) - khu qu lu nim, khi n y Qu khch c th kinh ngc bi nhng mn trang sc t ngc trai n  th cng m ngh cc k tinh xo v a dng mu m.\r\nTham qua thnh Tht Cao i nm trong khu vc ch m c lch s kh lu i ti Ph Quc, Cao i l o dung ha gia Pht Gio, Thin Cha Gio, Lo Gio, Thn o, Khng Gio, nn ngi ta cn gi l ngi nh ca ch thnh. Thnh Tht Cao i ti Ph Quc c xem l ni pht tch ca o Cao i v  thu ht rt nhiu du khch tham quan tm hiu v lch s ngi cha, s ra i ca tn gio ny, nn ni y  tr thnh mt a im ni ting ti Ph Quc c nhiu ngi bit n.','Ngy 1: FREE WALKING TOUR  PH QUC','(sng, ti)','T991-2222-3N2D'),(1637,1,'Qu khch tp trung ti Sn bay Tn Sn Nht, ga i Trong Nc, hng dn vin h tr lm th tc p chuyn bay i Ph Quc.\r\nXe n on ti sn bay a n nh ga cp treo An Thi tham quan Sun World Hon Thom Nature Park vi nhng hot ng th v:\r\n- Tri nghim cp treo 3 dy vt bin di nht th gii - 7.899.9 mt.\r\n- Phn khch tt  cng th thch \"Mc X thnh n\" - tr chi tu ln bng g u tin ti Vit Nam, c tc  ti a 80km/h vi nhiu gc ln ngon mc; i quan st \"Mt i bng\" cao 120m - du khch nh c bay ln khng trung, thng ngon i dng xanh ngt bao la, nhng cnh rng nhit i xanh mt, nhng o nh nhp nh gia bin tri khong t (tr chi c th tm dng v lch bo tr)\r\n- Vui chi ti cng vin nc Aquatopia: mt trong nhng cng vin nc ch  hng u ng Nam , tri nghim 6 khu check-in ch  hp dn mang phong cch th dn huyn b.\r\nLng du trn con ng Th trn Hong Hn - c thit k vi kin trc c o, rc r sc mu ca mt th trn chu u c knh: check-in 1001 kiu bc thang, Qung trng La M, k quan Khi Hon Mn, Thp ng h cao 75m - ly  tng t thp chung St. Marks Campanile ca ; chim ngng Kiss Bridge - cy cu ni ln nh mt di la gia b bin trong xanh, vi hai nhp cu vn mnh m trn b ct trng, hng n nhau, hp vo lm mt th thng nht nhng khng chm nhau.\r\nBui ti, Qu khch c th t do khm ph mt s hng mc ni bt ti thnh ph khng ng Grand World nh:\r\n- Cng vin Ngh Thut ng i: s giao thoa c sc gia ngh thut ng i v thin nhin o Ngc.\r\n- Huyn thoi Tre: cng trnh tre ln nht Vit Nam.\r\n- Tn b bn dng knh o Venice v nhn ngm nhng chic thuyn Gondola, khu ph shophouse lng ly sc mu, cng lu i trng l, ba cy cu vm bn nguyt mang m kin trc chu u ...\r\n- Tham quan bo tng Gu Teddy: lu gi nhiu hin vt qu gi v ti hin chuyn phiu lu hi hc ca nh thm him ti ba Teddy Jones (chi ph t tc)\r\n- Mn nhn vi show din thc cnh Tinh Hoa Vit Nam quy t hn 200 din vin (chi ph t tc)\r\n- Thng thc ba tic nh sng nh cao vi show din Sc mu Venice\r\nNgh m ti Ph Quc.','Ngy 1: TP H CH MINH - PH QUC - HN THM - TH TRN HONG HN - GRAND WORLD\r\n','02 ba n (tra, chiu)','T991-2223-2N1D'),(1638,2,'Qu khch bt u hnh trnh tr v vi thin nhin ti Vinpearl Safari Ph Quc - Vn th bn hoang d u tin ti Vit Nam: vi quy m 180 ha, hn 130 loi ng vt qu him, du khch thng thc cc chng trnh biu din, chp nh vi ng vt; tri nghim vn th m trong rng t nhin, gn gi v thn thin vi con ngi.\r\nBui chiu, Qu khch tham quan khm ph Khu vui chi gii tr VinWonders - Cng vin ch  ln nht Vit Nam, quy m hng u Chu , du khch s c:\r\n- Tri nghim 12 nn vn minh nhn loi t c ch kim;\r\n- Khm ph 06 phn khu vi hn 100 hot ng gii tr siu c l;\r\n- Cung nhit ti Cng Vin Nc ln nht ng Nam ;\r\n- Chinh phc 20 tr chi mo him khng nht hnh tinh nh ng trt nhanh nht th gii Cn thnh n ca Zeus, ng trt kh Cuc chin Chn tinh cao 15m u tin ca Vit Nam, ng trt trong nh ti Chin binh i bng v Li nguyn c long - tr chi tng tc trong nh ti u tin ca Vit Nam,\r\n- Ng ngng vi show din triu  Once ng cp th gii;\r\n- Chong ngp trc th gii i dng huyn o vi tm nhn v cc qua tm knh acrylic khng l 8x25m bn trong Cung in Hi vng - thy cung hnh ra ln nht th gii.\r\nQu khch thng thc ba ti ti VinWonders.\r\nNgh m ti Ph Quc.','Ngy 2: VUI CHI THA THCH TI CNG VIN CH  VINWONDERS PH QUC - KHU BO TN THIN NHIN SAFARI\r\n','03 ba n (sng, tra, chiu)','T991-2223-2N1D'),(1639,3,'Qu khch dng ba sng, th gin ti khch sn n gi tr phng. Sau , xe a on tham quan v mua sm c sn ni ting ti Nh thng nc mm Hng c 1 / Khi Hon / Phng Hng, c sn c Thnh, C s sn xut ngc trai Ph Quc - Trng by cc trang sc bng ngc trai chnh hiu c nui cy ti Ph Quc.\r\nXe a Qu khch ra sn bay p chuyn bay tr v TP H Ch Minh. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nLu :\r\nKhch c quc tch nc ngoi (tn nc ngoi & vit kiu  i tn hon ton): ph thu 850,000 VN/khch x 2 khch/phng\r\nTheo quy nh resort khch check-in cn t cc 1,000,000 /phng/m. S tin ny s c hon tr khi khch check-out.\r\nPh thu gi v tham quan i vi tr em di 12 tui cao trn 1m4 (gi c th thay i ph thuc nh cung cp)\r\n- Combo Hn Thm: ph thu 300,000 VN/khch\r\n- Combo Vinwonder + Safari: ph thu 300,000 VN/khch\r\ni vi cc khch khng ph thu khi mua tour, khi c pht sinh ti im tham quan, khch t chu chi ph pht sinh ti im tham quan.\r\nGi bay ph thuc vo hng hng khng, s ba n ph thuc vo gi bay. Cc ba n c th hon i  ph hp vi chng trnh.\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t\r\ny l chng trnh du lch trn gi, Vietravel khng c trch nhim hon tr chi ph chnh lch cho cc khch hng thuc din min gim hoc i tng u tin nh tr nh, ngi ln tui, ngi c cng vi cch mng Chnh sch min gim, u tin (nu c) ch dnh cho khch l ca cc im tham quan','Ngy 3: PH QUC - TP H CH MINH\r\n','01 ba n (sng)','T991-2223-2N1D'),(1640,1,'n Qu khch ti Vietravel 190 Pasteur, qun 3, thnh ph H Ch Minh, khi hnh i min M Tho theo tuyn cao tc thnh ph H Ch Minh - Trung Lng ngm nhn nhng cnh ng la v mu xanh vn tc hai bn ng. \r\non dng chn n sng dc ng. n bn tu du lch M Tho, Qu khch bt u hnh trnh du ngon trn sng Mekong:\r\nChim ngng Cu Rch Miu: cu dy vng u tin do k s Vit Nam thit k v xy dng, nghe gii thiu cc c lao Long - Ln - Quy - Phng.\r\nNgm nhn cng c M Tho, lng nui c b dc sng Tin, thng thc nc da ti trn tu.\r\nn c lao Thi Sn, tn b trn ng lng, tham quan vn cy n tri.\r\ni xung cho len li trong rch nh ngm nhn phong cnh bnh d vng sng nc, n tham quan tri nui ong mt, thng thc tr mt ong, ru chui ht\r\nTip tc, xui dng sng Tin n Tn Thch (Bn Tre) tham quan l ko da c sn Bn Tre, lng ngh th cng m ngh truyn thng. Dng  my khm ph con Rch (Tn Thch) tm hiu cuc sng thng nht ca ngi dn min qu. \r\nTri nghim lm bnh kht nhn tm nc ct da chun v min Ty.\r\n\r\nSau khi n tra, on nm vng ngh ngi, tham quan tri nui c su, nhm, ch v i xe p quanh vn da. Ngoi ra, Qu khch c th tham gia cc tr chi dn gian nh: u dy, chy xe p mo him qua vn, ua xung cho trn h, nhy xa.\r\n Tr v t lin, Qu khch khi hnh i Cn Th theo 2 tuyn cao tc Trung Lng - M Thun v M Thun - Cn Th; Chim ngng cu M Thun 2 - D n trng im quc gia c chiu di 1,9km ni lin tnh Vnh Long v Tin Giang. \r\n Sau khi dng ba ti ti thnh ph Cn Th, Qu khch t do do ph m khm ph Ty  lung linh sc mu: ngm cnh cu Cn Th v m, check-in cu Tnh Yu - Thit k un ln hnh ch S cng hai i sen v h thng n led rc r sc mu.\r\n\r\nNgh m ti Cn Th\r\n                                                                                                   ','Ngy 1: TP.H Ch Minh  M Tho  Cn Thi Sn  Bn Tre  Cn Th\r\n','03 ba n (sng, tra, chiu)','T883-2119-4N3D'),(1641,2,'on tr phng v khi hnh ra Bn Ninh Kiu, xung thuyn du ngon trn sng Cn Th, nghe gii thiu v ch thy sn nc ngt Cn Th; tri nghimch ni Ci Rng - mt hnh thc hp ch c trng ti cc ng sng ca vng ng bng sng Cu Long  c cng nhn Di Sn Vn Ha Phi Vt Th Quc Gia.\r\nTip tc, Qu khch tham quan:\r\nLng du lch M Khnh - im du lch sinh thi hp dn vi cc im tham quan Nh c Nam b hn 115 nm tui; vn hoa M Khnh; khu nh vn ho 4 dn tc Kinh - Hoa - Chm - Khmer; lng ngh truyn thng...\r\nThng thc cc loi tri cy ti theo ma v nghe n ca ti t Nam B.\r\nTri nghim tr chi Thm trt Cu vng - chinh phc cu trt phao kh u tin ca min Ty vi  cao 20m, ng trt di 160m (chi ph t tc)\r\nThin Vin Phng Nam - mt trong nhng ngi thin vin rng nht ng bng sng Cu Long, tham quan lu trng, lu chung, l Pht ti chnh in.\r\nSau khi dng chn tham quan v mua sm ti siu th c sn v qu lu nim Hng o, on khi hnh v thnh ph H Ch Minh, kt thc chng trnh du lch ti im n ban u.\r\nLu : Chng trnh ca Vietravel l chng trnh trn gi, khng c p dng chnh sch min gim, u tin vo im tham quan (nu c) dnh cho tr em, ngi cao tui, ngi c cng vi cch mng v vy Vietravel s khng hon li phn chnh lch cho cc khch hng thuc din u tin ny.','Ngy 2: Cn Th  Ch Ni Ci Rng  M Khnh  TP.H Ch Minh\r\n',' 02 ba n (sng, tra)','T883-2119-4N3D'),(1642,1,'Qu khch tp trung ti sn bay Tn Sn Nht (Ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n Qu khch i H Giang - ni c ch Shan Tuyt, ru mt ong v thng c, x s ca o phai, hoa l, truyn thng v no nhit trong bui ch phin. n ni, Qu khch chp hnh lu nim Ct mc s 0 - nh du im khi cng ca con ng Hnh Phc ni H Giang v 4 huyn vng cao nguyn .\r\nXe a Qu khch v khch sn nhn phng v dng cm chiu, hoc t do thng thc mn Ch Shan Tuyt, mt ong Bc H v m bng vi mn cho u Tu (chi ph t tc).\r\nNgh m ti H Giang','Ngy 1: Sn bay Ni Bi - H Giang\r\n','02 ba n (tra, chiu)','T001-7878-6N5D'),(1643,2,'Qu khch dng ba sng v tr phng khch sn. Xe v hng dn vin khi hnh a Qu khch khm ph Cng vin a cht ton cu Cao nguyn  ng Vn (Bao gm a gii hnh chnh ca 4 huyn pha Bc tnh H Giang vi din tch 2.356 km2) vi nhng im check-in c sc:\r\nNgm Ni i Qun B - biu tng v p ca vng cao nguyn , Qu khch i b ln Cng tri Qun B ngm ton b v p th mng ca th trn Tam Sn v ht th bu khng kh mt m trong lnh quanh nm.\r\nSau khi n tra, Qu khch tip tc hnh trnh i tham quan:\r\nDc Thm M - nhng con ng o khc khuu, quanh co ta nh mt di la un ln mm mi tri di theo trin ni.\r\nLng vn ha Lng Cm - Thung lng Sng L: c mnh danh l  a hoa hng trong lng cao nguyn  lun cun ht du khch bi v p ht sc bnh d, mc mc. Ni y tng l bi cnh quay b phim t gii phim truyn nha xut sc nht ca Hi in nh Vit Nam - phim Chuyn ca Pao, du khch tm hiu vn ha ngi Mng.\r\nKhu kin trc ngh thut nh Vng (Dinh Vua Mo), cng trnh kin trc p, him c v rt c o ca vng cao nguyn ni .\r\nChinh phc Ct c Lng C hay cn gi l nh ni Rng, ni a u Cc Bc T Quc vi l c 54m2 tng trng cho 54 dn tc anh em. T trn cao, Qu khch s ngm nhng mng xanh mt ca rung bc thang v cc bn lng L L Chi, Thn P, xa xa c 2 h nc pha xa, nm i xng nhau c ngi dn ni y v nh mt rng.\r\nQu khch v ng Vn dng cm chiu v nhn phng khch sn ngh ngi.\r\nNgh m ti ng Vn hoc Mo Vc\r\nGhi ch: im tham quan Ct C Lung Cu se khng tham quan c trong trng hp thi tit khng thun li.','Ngy 2: H Giang - Qun B - Yn Minh - ng Vn\r\n','03 ba n (sng, tra, chiu)','T001-7878-6N5D'),(1644,3,'Qu khch n sng, tr phng khch sn. Xe a Qu khch i tham quan:\r\no M P Lng  Sng Nho Qu - Hm Tu Sn: o M P Lng ni ting l 1 trong t i nh o  vng ni pha Bc Vit Nam.\r\nPanorama Caf M P Lng - mt trong nhng im check-in cc chill nm trn nh o M P Lng thu ht du khch n chp hnh, thng thc c ph trong khung cnh cc k xn s bao trn dng sng Nho Qu (cha bao gm nc ung).\r\nHoc Qu khch c th la tri nghim sau (t tc phng tin vn chuyn v chi ph tham quan):\r\n- La chn :\r\nQu khch ln xe trung chuyn i xung hm vc Tu Sn, thng ngon cnh p hm vc trn dng sng Nho Qu mm mi nh di la mu ngc bch vi dng chy un ln vt ngang qua hm Tu Sn c mnh danh l hm vc su nht ng Nam  (Gi v tham kho 120.000vn/ngi ln; 60.000vn/tr em bao gm thuyn v xe trung chuyn t im bn v xung bn thuyn.)\r\nDng chp hnh lu nim ti Lng Vn ha Du lch Cng ng P Vi, nm di chn o M P Lng, bn cnh dng sng xanh nho Qu. Ni y thu ht s quan tm ca du khch bi thit k n tng ca cng cho hnh dng chic khn Mng khng l, nhng homestay mang m nt vn ha, phong cch ca ngi Mng,\r\nTip tc hnh trnh n Cao Bng, Qu khch dng ti Bo Lc dng cm tra ti nh hng a phng. n Cao Bng, Qu khch nhn phng ngh ngi v dng cm ti.\r\nNghi m ti Cao Bng\r\nLu : Do cung ng i xung sng ang sa cha khng m bo an ton cho Qu khch nn chng trnh i thuyn trn sng Nho Qu s tm ngng cho n khi c thng bo mi.','Ngy 3: ng Vn - Mo Vc - Cao Bng\r\n','03 ba n (sng, tra, chiu)','T001-7878-6N5D'),(1645,4,'Qu khch n sng, tr phng khch sn. Xe khi hnh a Qu khch i tham quan:\r\nThc Bn Gic - mt trong nhng thc nc p nht ca Vit Nam c ng ranh gii t nhin vi Trung Quc. Thc nc p v hng v vi dng nc cun cun chy quanh nm bt ngun t dng sng Quy Sn nc xanh ngt mt mu ngc Bch. p nht vo ma la chn (thng 9) khung cnh ng vo thc sng rc mt mu vng ng v dng nc trng xa mm mi nh tc tin cng lm khung cnh thm nn th, hng v.\r\nCha Pht Tch Trc Lm Bn Gic: c xy dng theo li kin trc thun Vit trn din tch 3 ha, y l ngi cha u tin c xy dng ti ni bin cng pha Bc ca t quc.\r\nQu khch dng cm tra v tip tc tham quan:\r\nng Ngm Ngao - mt ng ln c hnh thnh t s phong ho lu i ca  vi; bc vo ng, du khch nh bc vo mt th gii k o, chong ngp trc nhng di thch nh mun mu, nhng tng  quyn r vi nhiu kiu dng khc nhau mang dng dp hnh ngi, cy rng, sc vt..., cc nh  th t trn xung hay mc t di t ln v cng sng ng\r\nLng  Khui Ky: vi mt  nim  l khi ngun ca s sng v trung tm ca v tr m ngi Ty  Trng Khnh lun gn gi ngi nh sn, ni sinh hot xung quanh mnh l , iu   to nn im nhn cho ngi lng nhn t xa nh mt bc tranh vng chi gia my tri ni non hng v. n y vo homestay v thng thc tch caf gia khung cnh ni rng s cho qu khch cm gic bnh yn n l.\r\nXe a Qu khch v thnh ph Cao Bng dng cm ti ti nh hng a phng, mua sm c san ia phng: Min dong, thach en, lap xng, ... Qu khch nhn phng khch sn ngh ngi.\r\nNgh m ti Cao Bng','Ngy 4: Thc Bn Gic - ng Ngm Ngao - Lng  Khui Ky\r\n','03 ba n (sng, tra, chiu)','T001-7878-6N5D'),(1646,5,'Qu khch n sng v tr phng khch sn. Xe khi hnh a Qu khch tham quan:\r\nKhu di tch Pc P - ni ch tch H Ch Minh tng sng v lm vic vi khung cnh nn th, hu tnh. Dng sui trong xanh, th mng trc ca hang c Bc t tn l Sui L Nin, ngn ni hng v cnh bn l Ni Cc Mc\r\nKhu di tch Kim ng - Ni ghi nh anh hng lit s c cng bo v cn b cch mng trong thi k khng chin.\r\nSau khi dng cm tra, Qu khch khi hnh i Bc Cn, nhn phng v ngh ngi t Ba B.\r\nNghi m ti Ba B','Ngy 5: Cao Bng - Khu di tch Pc P - Ba B\r\n','03 ba n (sng, tra, chiu)','T001-7878-6N5D'),(1647,6,'Qu khch ra bn thuyn tham quan:\r\nH Ba B (2 ting) - Khm ph bc tranh sn thy hu tnh v cng sng ng, mt nc h trong xanh nh gng lm quyn r bit bao du khch lm quyn r bit bao du khch, thin nhin v con ngi nh ha quyn vo nhau, ngm Ao Tin, n An M, hn B Ga. Thuyn dng trn mt h, Qu khch giao lu ht then v n tnh ca ngi Ty, hoc tham gia cho thuyn kayak xung quanh o B Ga (chi ph t tc).\r\non khi hnh v H Ni. Qu khch dng cm chiu, nhn phng khch sn ngh ngi v t do khm ph ph c H Ni v m.\r\nNgh m ti H Ni','Ngy 6: Ba B - Bc Cn - H Ni\r\n','03 ba n (sng, tra, chiu)','T001-7878-6N5D'),(1648,7,'Qu khch n sng v tr phng. Tip tc hnh trnh, xe khi hnh a Qu khch ra sn bay Ni Bi lm th tc n chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n*Lu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.','Ngy 7: H Ni - Sn bay Ni Bi\r\n','01 ba n (n sng hp mang i)','T001-7878-6N5D'),(1649,1,'Qu khch tp trung ti sn bay Tn Sn Nht (Ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n Qu khch i H Ni nhn phng khch sn ngh ngi hoc t do i tham quan. \r\nNgh m ti H Ni.  \r\n ','Ngy 1: Sn bay Ni Bi - H Ni','(sng, ti)','T001-3077-4N3D'),(1650,2,'Qu khch n sng v tr phng.  Xe khi hnh a Qu khch i tham quan:\r\nDo quanh H Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc. \r\nTip tc hnh trnh n vi vng t H Giang - ni c ch Shan Tuyt, ru mt ong v thng c, x s ca o phai, hoa l, truyn thng v no nhit trong bui ch phin n ni, Qu khch tham quan: \r\nNgha Trang Lit S Quc Gia V Xuyn - ni y t nm 1979 n nm 1989, ti mnh t H Giang, c bit ti a phn huyn V Xuyn  tr thnh Bin la trn mt trn chng qun xm lc. Trong cuc chin u bo v T quc, hng ngn chin s  anh dng hy sinh.\r\nCt mc s 0: nh du im khi cng ca con ng Hnh Phc ni H Giang v 4 huyn vng cao nguyn \r\nXe a Qu khch v khch sn nhn phng v t tc dng cm chiu, hoc t do thng thc mn Ch Shan Tuyt, mt ong Bc H v m bng vi mn cho u Tu. \r\nNgh m ti H Giang. \r\n ','Ngy 2: H Ni - H Giang\r\n','S ba n: 01 (sng)','T001-3077-4N3D'),(1651,3,'n sng v tr phng khch sn. Xe v hng dn vin khi hnh a Qu khch khm ph Cng vin a cht ton cu Cao nguyn  ng Vn (Bao gm a gii hnh chnh ca 4 huyn pha Bc tnh H Giang vi din tch 2.356 km2) vi nhng im check-in c sc:\r\nNgm Ni i Qun B - biu tng v p ca vng cao nguyn , Qu khch i b ln Cng tri Qun B ngm ton b v p th mng ca th trn Tam Sn v ht th bu khng kh mt m trong lnh quanh nm. \r\nSau khi n tra, Qu khch tip tc hnh trnh i tham quan:\r\nDc Thm M  nhng con ng o khc khuu, quanh co ta nh mt di la un ln mm mi tri di theo trin ni. \r\nLng vn ha Lng Cm  Thung lng Sng L: c mnh danh l  a hoa hng trong lng cao nguyn  lun cun ht du khch bi v p ht sc bnh d, mc mc. Ni y tng l bi cnh quay b phim t gii phim truyn nha xut sc nht ca Hi in nh Vit Nam - phim Chuyn ca Pao, du khch tm hiu vn ha ngi Mng. \r\nKhu kin trc ngh thut nh Vng (Dinh Vua Mo), cng trnh kin trc p, him c v rt c o ca vng cao nguyn ni . \r\nChinh phc Ct c Lng C hay cn gi l nh ni Rng, ni a u Cc Bc T Quc vi l c 54m2 tng trng cho 54 dn tc anh em. T trn cao, Qu khch s ngm nhng mng xanh mt ca rung bc thang v cc bn lng L L Chi, Thn P, xa xa c 2 h nc pha xa, nm i xng nhau c ngi dn ni y v nh mt rng.\r\nQu khch t tc dng cm chiu v nhn phng khch sn ngh ngi. \r\n  Ngh m ti ng Vn hoc Mo Vc\r\n\r\nGhi ch: im tham quan Ct C Lung Cu se khng tham quan c trong trng hp thi tit khng thun li.\r\n ','Ngy 3: H Giang - Qun B - Yn Minh  ng Vn\r\n','S ba n: 01 (sng)','T001-3077-4N3D'),(1652,4,'n sng v tr phng khch sn. Xe v hng dn vin khi hnh i tham quan:\r\no M P Lng: Mt trong T i nh o hng v ca min Bc Vit Nam di 24km, dng chn ngh ngi, chp nh ni b chia ct v a hnh su nht ca Vit Nam. Trn ng dng chp hnh ti tng i Thanh Nin trc Bo tng Con ng Hnh Phc, M P Lng caf (chi ph t tc), ngm con ng hnh phc v ton cnh dng sng Nho Qu t trn cao. \r\n  Dng chp hnh lu nim ti Lng Vn ha Du lch Cng ng P Vi, nm di chn o M P Lng, bn cnh dng sng xanh nho Qu. Ni y thu ht s quan tm ca du khch bi thit k n tng ca cng cho hnh dng chic khn Mng khng l, nhng homestay mang m nt vn ha, phong cch ca ngi Mng,  \r\nTip tc hnh trnh n Cao Bng, Qu khch dng ti Bo Lc t tc dng cm tra ti nh hng a phng. n Cao Bng, Qu khch nhn phng ngh ngi v t tc dng cm ti.\r\nNghi m ti Cao Bng.\r\n ','Ngy 4: ng Vn  Mo Vc  Cao Bng\r\n','S ba n: 01 (sng)','T001-3077-4N3D'),(1653,5,'Qu khch n sng, tr phng khch sn. Xe khi hnh a Qu khch i tham quan: \r\nThc Bn Gic - mt trong nhng thc nc p nht ca Vit Nam c ng ranh gii t nhin vi Trung Quc. Thc nc p v hng v vi dng nc cun cun chy quanh nm bt ngun t dng sng Quy Sn nc xanh ngt mt mu ngc Bch. p nht vo ma la chn (thng 9) khung cnh ng vo thc sng rc mt mu vng ng v dng nc trng xa mm mi nh tc tin cng lm khung cnh thm nn th, hng v.\r\nCha Pht Tch Trc Lm Bn Gic: c xy dng theo li kin trc thun Vit trn din tch 3 ha, y l ngi cha u tin c xy dng ti ni bin cng pha Bc ca t quc.\r\nQu khch t tc dng cm tra v tip tc tham quan: \r\nng Ngm Ngao - mt ng ln c hnh thnh t s phong ho lu i ca  vi; bc vo ng, du khch nh bc vo mt th gii k o, chong ngp trc nhng di thch nh mun mu, nhng tng  quyn r vi nhiu kiu dng khc nhau mang dng dp hnh ngi, cy rng, sc vt..., cc nh  th t trn xung hay mc t di t ln v cng sng ng\r\nLng  Khui Ky: vi mt  nim  l khi ngun ca s sng v trung tm ca v tr m ngi Ty  Trng Khnh lun gn gi ngi nh sn, ni sinh hot xung quanh mnh l , iu   to nn im nhn cho ngi lng nhn t xa nh mt bc tranh vng chi gia my tri ni non hng v. n y vo homestay v thng thc tch caf gia khung cnh ni rng s cho qu khch cm gic bnh yn n l.\r\nXe a Qu khch v thnh ph Cao Bng t tc dng cm ti ti nh hng a phng, mua sm c san ia phng: Min dong, thach en, lap xng, ... Qu khch nhn phng khch sn ngh ngi. \r\nNgh m ti Cao Bng.\r\n ','Ngy 5: Thc Bn Gic  ng Ngm Ngao  Lng  Khui Ky\r\n','S ba n: 01 (sng)','T001-3077-4N3D'),(1654,6,'Qu khch n sng v tr phng khch sn. Xe khi hnh a Qu khch tham quan:\r\nKhu di tch Pc P - ni ch tch H Ch Minh tng sng v lm vic vi khung cnh nn th, hu tnh. Dng sui trong xanh, th mng trc ca hang c Bc t tn l Sui L Nin, ngn ni hng v cnh bn l Ni Cc Mc\r\nKhu di tch Kim ng - Ni ghi nh anh hng lit s c cng bo v cn b cch mng trong thi k khng chin.\r\nQu khch khi hnh i Bc Cn, nhn phng v ngh ngi t Ba B.\r\nNghi m ti Ba B.','Ngy 6: Cao Bng  Khu Di Tch Pc P  Ba B\r\n','S ba n: 01 (sng)','T001-3077-4N3D'),(1655,7,'Qu khch ra bn thuyn tham quan: \r\nH Ba B (2 ting)  Khm ph bc tranh sn thy hu tnh v cng sng ng, mt nc h trong xanh nh gng lm quyn r bit bao du khch lm quyn r bit bao du khch, thin nhin v con ngi nh ha quyn vo nhau, ngm Ao Tin, n An M, hn B Ga. Thuyn dng trn mt h, Qu khch giao lu ht then v n tnh ca ngi Ty, hoc tham gia cho thuyn kayak xung quanh o B Ga (chi ph t tc).\r\nQu khch tr phng v t tc dng cm tra. Xe khi hnh a Qu khch i H Ni. n sn bay Ni Bi, Hng dn vin h tr Qu khch lm th tc p chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.  \r\n  KT THC CHNG TRNH, TM BIT QU KHCH!\r\n\r\n*Lu  :\r\n- Hnh trnh c th thay i th t im n ty vo iu kin thc t. \r\n- Lch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\n- Khch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\n- V nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.\r\n ','Ngy 7: Ba B - Bc Cn  H Ni  Sn bay Ni Bi\r\n','S ba n: 01 (sng)','T001-3077-4N3D'),(1656,1,'Qu khch tp trung ti Cng ty Vietravel (190 Pasteur, P. V Th Su, Q3, TP.HCM). on khi hnh i Bun Ma Thut. Trn ng i Qu khch dng chn dng ba sng, ngm ng Trng Sn huyn thoi (Quc L 14), on tham quan:\r\nn TP. Bun Ma Thut, on tip tc khm ph:\r\nBo Tng Th Gii C Ph - hin vt trng by trong bo tng c su tm t khp ni trn th gii. c bit trong  l hn 10.000 vt dng lin quan n c ph qua nhiu thi k lch s v vn ho trn th gii ca Bo tng c ph th gii Jens Burg, mt trong nhng im du lch c sc ca thnh ph Hamburg (c). Bo tng c xy dng nng theo kin trc khng gian nh di quen thuc c trng ca vng t Ty Nguyn linh thing, nhng ng cong a hnh v uyn chuyn c giao thoa vi nhau to nn hnh khi kin trc c bit.\r\non dng ba ti v nhn phng ngh ngi. Qu khch t do khm ph thnh ph Bun Ma Thut cng nhiu hot ng nh: ha mnh vo nhp sng ca ngi dn ph ni nh thng thc ly c ph Ban M tr danh ngm ph ln n. Gh ch m Ng Su thng thc m thc ng ph nh bn , bn riu, bn gi, canh c dm hoc n gin l ngi nhm nhi ly sa nng trong tit tri se lnh.\r\nNgh m ti Bun Ma Thut ','Ngy 1: TP. H Ch Minh - Bun Ma Thut | S ba n: 03 (sng, tra, chiu)','(sng, ti)','T666-3333-6N5D'),(1657,2,'on dng ba sng ti khch sn v lm th tc tr phng, xe v HDV a on i tham quan:\r\nThc Dray Nur - mt thng cnh p nh s kt hp gia hai dng sng Krng N v Krng A Na m ngi   v ngi M\'Nng gi l song Chng, song V gp nhau m thnh. Thc Dray Nur nh mt bc thnh nc khng l, hung trng gia mt vng hoa nc long lanh tuyt tc thin nhin gia i ngn. Qu khch c dp c tri nghim ngm thc vi ln nc mt trong veo, chp nh check-in bn hang ng sau lng thc, i qua cu treo hay nhm nhi ly c ph (chi ph t tc) ngm nhn v p ca thin nhin.\r\nVn Caf Ru Phong - tn mt xem vn ca cao, loi tri cy c trng ch yu  ly ht lm nn cc sn phm kinh t cao trn th trng hin nay  l bt ca cao v chocolate. Ngoi ra, Qu khch s c thng thc c sn ca qun sinh t ca cao c lm t cm ca tri ca cao, v chua chua ngt ngt to nn mt thc ung gii nhit l ming nhng cng khng km phn hp dn.\r\nQu khch dng ba tra ti nh hng a phng, sau  khi hnh n vi thnh ph Pleiku xinh p, on tham quan:\r\nBin H T Nng - ming ni la  ngng hot ng hng trm triu nm v c v nh  i mt Pleiku lm say lng ngi bi v p th mng, mt nc mnh mng, my tri lng lng, nghe thong trong gi ting thng vi vu, tit tri du mt quanh nm. y cn l h cha nc ngt cung cp nc cho thnh ph Pleiku. Qu khch chim bi tng Quan m cao 15 mt c lm bng cht liu  cm thch trng, im nhn mi va a vo khai thc t nhng thng cui nm 2018.\r\nTr v trung tm TP. Pleiku, on nhn phng ngh ngi v n ti ti nh hng a phng\r\nNgh m ti Pleiku ','Ngy 2: Bun Ma Thut - Pleiku | S ba n: 03 (sng, tra, chiu)','(sng, ti)','T666-3333-6N5D'),(1658,3,'Sau khi dng ba sng v tr phng, on khi hnh i tham quan Mng en c v nh Nng th mi ca i ngn:\r\nCu treo Kon Klor - cy cu treo dy vng ln nht tnh Kon Tum bc ngang qua dng sng k Bla, mt dng sng gn vi nhiu huyn thoi ca ng bo dn tc Ba Na trong vng. Cu treo Kor Klor gy n tng vi du khch bng mu cam ni bt nm gia ni Ty Nguyn hng v.\r\nNgm nhn nh rng Kon Klor - vn gi nguyn vn kin trc Ba Na c o vi mu g nu trm\r\nNh th Chnh Ta - c tui i hn 100 nm tui, c ngi dn gi thn mt l nh th g bi cng trnh c o ny c xy dng hon ton bng g, thit k theo li kin trc Roman c in kt hp vi kin trc nh sn truyn thng ca ng bo Ba Na ni y.\r\nn Mng en, Qu khch tham quan:\r\nKDL h kke - khng gian ni y yn bnh vi h nc trong xanh c bao bc bi nhng dy ni cng nhng cnh rng xanh ngt, quanh nm hoa n quanh h hi ha cng nhng ngi nh sn mc mc, mng m nt c trng ring ca ngi bn a. to nn mt bc tranh sn thy hu tnh. y cng l ni mi ma xun v c nhiu du khch la chn  ngm hoa mai anh o.\r\nKDL Sinh thi - Vn ha Thc Pa S - qun th du lch bao gm khu vn tng vi hn 100 bc tng c c th cng bng g do cc ngh nhn ng bo bn a to nn v c bit nht l Thc Pa S vi dng thc tung bt trng xa, quyn r nh c gi p min sn cc. \r\nCha Khnh Lm - ta lc ngay trn nh i cao, tn nghim n hin di nhng tn cy rng xum xu mang n mt v p yn bnh, thanh khit lm say m lng ngi. Ngi cha c kin trc nh cha c truyn vi kin trc nh Rng, mang m bn sc vn ha Ty Nguyn, ni bt vi tng Quan th m B tt cao 17m v h sen i xng, to nn mt cnh quan hi ha, hp dn.\r\nSau ba n ti, Qu khch t do ngh ngi v tn hng khng kh trong lnh ti Mng en.\r\nNgh m ti Mng en ','Ngy 3: Pleiku - Mng en | S ba n: 03 (sng, tra, chiu)','(sng, ti)','T666-3333-6N5D'),(1659,4,'Qu khch dng ba sng ti khch sn v lm th tc tr phng. Xe v HDV a on tham quan:\r\nKhu hnh hng c M Mng en - ni ni ting linh thing thu ht hng trm lt khch ving thm mi ngy. Ti y du khch c nghe gii thiu v lch s ca tng c M.\r\nSau  khi hnh v Pleiku, dng chn tham quan:\r\nHng Thng Trm Tui - vi hng thng c th tuyt p cnh rung ch xanh bt ngn. y c mnh danh l con ng Hn Quc ti Pleiku Gia Lai. Ni y rt thu ht lng khch n tham quan, cc bn tr th ghi du thanh xun v tnh iu ni con ng tuyt p ny.\r\nBin H Ch - c dn li bi hai hng thng l kim ph kn, ni y cn ht hn du khch vi mu xanh ti ri ca l ch mnh mng v bt ngn v u  cn thoang thong hng thm ca l ch. Vo ma thu hoch, Qu khch c dp chim ngng nhng bn tay kho lo ca ngi trng ch ngt nhng ngn ch xanh mn mn.\r\nCha Bu Minh - ta lc gia lng i ch yn bnh, ngi cha kt hp hi ha gia li kin trc cha c  min Bc v min Trung cng kiu dng cha Nht Bn v i Loan.\r\non dng cm tra ti nh hng sau  khi hnh v TP. Bun Ma Thut\r\nChp nh check-in vi biu tng Hai Ch Voi  Song Tng Thnh Vng ti khu EcoCity Premia, mt trong nhng im thu ht khch tham quan.\r\nKhu du lch Bun Kotam: tm hiu nt p t nhng phong tc bn a ca ngi  gia mnh mng i ngn. \r\nBui ti, Qu khch nhn phng khch sn v t do tham quan Qung Trng 10/3 - Khng gian sinh hot a phng nhn nhp ca ngi dn ph ni vo mi ti.\r\nNgh m ti Bun Ma Thut','Ngy 4: Mng en - Pleiku - Bun Ma Thut | S ba n: 03 (sng, tra, chiu)','(sng, ti)','T666-3333-6N5D'),(1660,5,'Qu khch dng ba sng ti khch sn v lm th tc tr phng. on khi hnh tham quan:\r\nMua sm c sn Ty Nguyn ti Qu Ph Qu Bun Ma Thut nh (chi ph t tc): cc loi c ph, tiu, ht n lin, cc loi bnh c sn, Macca, rau c sy gin, ru cn ,cc loi tr, cc mt hng qu lu nim Ty Nguyn,\r\nXe a Qu khch khi hnh v li TP. HCM. n tra trn cung ng v. Chiu v n TP. HCM chia tay Qu khch v kt thc chng trnh du lch.\r\n*** Lu : cc im tham quan c th c sp xp li ty theo tnh hnh thc t.\r\nVn  tham quan cc im tn ngng/tn gio ph thuc vo tnh hnh m ca ca cc im ny.','Ngy 5: Bun Ma Thut - TP. H Ch Minh | S ba n: 02 (sng, tra)','(sng, ti)','T666-3333-6N5D'),(1661,1,'Qu khch tp trung ti Vietravel (190 Pasteur, Phng V Th Su, Qun 3, TP. HCM). Xe a on khi hnh n im n sng. Sau , theo ng dn vo cao tc, khm ph nhng cung ng cao tc mi ca khu vc pha Nam: TP.HCM - Long Thnh - Du Giy - Phan Thit - Vnh Ho. Trn ng i, Qu khch dng chn chp hnh ti:\r\nBin C N: mt trong nhng bi bin p nht min Trung, vn c mnh danh l Nng cng cha ng qun bi v p hoang s ca n.\r\nn tra ti Ninh Ch v tip tc hnh trnh. Trn ng i, on chim ngng:\r\nNgm Cnh ng in gi vi nhng cnh qut tuabin nh nhng ci xay gi khng l to nn khung cnh hng v, p n nao lng.\r\nn Nha Trang, Qu khch tham quan cn nh c m p cha ng nhng mm cm mc mc ngy xa ti Nha Trang Xa - Qu khch tr v vi nhng k nim ca mt thi, check-in gc lng ngh truyn thng nui ln nhiu i ngi Nha Trang nh dt chiu, c ng, an nn,...\r\nHo thn thnh cc giai nhn thi Nguyn vi tri nghim mc c phc t o di, o tc, nht bnh ti tm o nu(chi ph t tc)\r\nThng thc m thc m v qu dn d ca X Trm Hng.\r\nBui ti, Qu khch c th t do tri nghim do ph bin v m hoc n Vega City, check in Nh Ht , vi li kin trc c ly cm hng t chic  - mt ng c rt ph bin trong dn gian Vit dng  nh bt thy sn. Nh ht mang dng dp ca mt chic  khng l nm ni bt bn vnh Nha Trang l a im check-in y hp dn.\r\nNgh m ti Nha Trang','Ngy 1: TP. H Ch Minh - C N - Nha Trang Xa\r\n','03 ba n (sng, tra, chiu)  ','T556-4058-7N6D'),(1662,2,'Sau khi dng ba sng ti khch sn, Qu khch khi hnh tham quan:\r\nBin Nh Tin - m mnh trong ln nc bin trong xanh, mt m, c bao bc bi bi ct di trng xa v nhng hng da lao xao trong gi. Vi v p hoang s, th mng, bin Nh Tin ta nh nng tin ang ng vi gia khng gian mnh mng ca sng, ca gi, ca ni v ca my.\r\nSau khi n tra, Qu khch tr v khch sn ngh ngi, trn ng dng chn tham quan v mua sm c sn ph bin ti Hng  Nha Trang (chi ph t tc)\r\nBui chiu, Qu khch t tc la chn mt trong cc chng trnh sau  tham quan:\r\nTh Gii Gii Tr VinWonders (chi ph t tc) - ngm ton cnh Vnh Nha Trang t nh vng xoay mt tri ln nht Vit Nam, tham quan b su tp k hoa, d tho ti i Vn Hoa, khu vn th m - vn Qu Vng, tham gia cc tr chi tng tc v lin hon ti qung trng Thn Thoi hay vng t Yu Thng, xem phim 4D ti lu i i Dng, khm ph khu tr chi cm gic mnh, khu tr chi trong nh hay tm bin, tm h bi ln nht ng Nam  v thng thc chng trnh biu din show nh sng ngh thut k v ti qung trng Thn Thoi mi ti.\r\nSui khong nng I-Resort (chi ph t tc) vi khng gian yn tnh, cy ci xanh ti, I-Resort s hin ra nh mt bc tranh thin nhin m cht Vit, Qu khch s c tri nghim dch v tm khong th gin. Ngoi ra, Qu khch cn c th tm bn khong hoc massage cho ln da thm ti tr.\r\non t do dng ba ti ti nh hng a phng v tr v khch sn ngh ngi. Bui ti, Qu khch t do tham quan thnh ph bin v m vi Skylight Havana: 360 Skydeck & Rooftop Beach Club  l mt trong nhng cu lc b bi bin c tm nhn ngm cnh gc rng 360 ) ngoi tri cao nht ti Nha Trang (chi ph t tc).\r\n***Lu : Chi ph v v i li t tc***\r\nNgh m ti Nha Trang','Ngy 2: Bin Nh Tin - VinWonders Nha Trang\r\n','02 ba n (sng, tra)','T556-4058-7N6D'),(1663,3,'Sau khi dng ba sng, Qu khch tr phng khch sn. on tham quan:\r\nCha Long Sn - ngi cha c knh c quy m ln nht trong s hn 20 ngi cha  Nha Trang. Cha nm ngay trong ni thnh Nha Trang, di chn i Tri Thy. y cng l mt trong nhng thng cnh ni ting ca Nha Trang.\r\nLng Yn Mai Sinh - hang ng Yn nhn to rng v quy m. Du khch c dp tn mt ngm m hnh nui chim yn trong nh t quy trnh dn d chim Yn cho n quy trnh ch bin t yn v thng thc tr yn min ph.\r\nXe a on chinh phc tuyn cao tc mi Vnh Ho - Cam Lm - Nha Trang. on tham quan:\r\nVn nho Cng 2 - tri nghim cm gic hi tn tay nhng chm nho ti ngon, mng nc ca min nng gi.\r\nQu khch n tra ti Phan Rang v khi hnh v Thnh ph H Ch Minh. Trn ng, on dng chn\r\nLng gm Bu Trc - mt lng ngh truyn thng lu i ca ngi Chm c a vo danh sch Di sn vn ha phi vt th cn bo v khn cp ngy 15/06/2023. n y, du khch s cm nhn c tnh cm, tm t ca nhng ngi ngh nhn gi vo tng sn phm v chim ngng nhng i bn tay kho lo lm nn tuyt tc.\r\nChiu v n TP. H Ch Minh, xe a Qu khch v im n ban u. Chia tay Qu khch v kt thc chng trnh du lch.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\nLu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch sn c th  xa trung tm thnh ph vo cc ma Cao im.','Ngy 3: Nha Trang - Cha Long Sn - Lng yn Mai Sinh - Lng gm Bu Trc - TP. H Ch Minh\r\n','02 ba n (sng, tra)                            ','T556-4058-7N6D'),(1664,1,'Qu khch tp trung ti Sn bay  Nng, Ga i Trong Nc. Hng dn vin lm th tc cho Qu khch p chuyn bay i H Ni. Qu khch n tra ti nh hng a phng v tham quan nhng di tch vn ha ni ting ti th : \r\nMt vng H Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc.\r\nVn Miu: ni th Khng T v cc bc hin trit ca Nho Gio, Quc T Gim - trng i hc u tin ca Vit Nam, tm v ci ngun lch s ca cc v Nho hc.\r\nQu khch dng cm chiu v nhn phng khch sn ngh ngi. Bui ti, Qu khch t do khm ph 36 ph phng H Ni. \r\nNgh m ti H Ni','Ngy 1:  Nng - Ni Bi (H Ni) - H Ni\r\n','2 ba (tra, ti)','T222-6502-4N3D'),(1665,2,'n sng v tr phng khch sn. Xe khi hnh a Qu khch n vi Ninh Bnh - vng t mnh danh l Ni m n, chn mong v vi nhiu di tch vn ha, thin nhin v cng c sc. n ni, Qu khch tham quan: \r\nCha Bi nh - mt qun th cha vi nhiu k lc Vit Nam nh pho tng pht Di Lc bng ng nng 80 tn, hnh lang vi 500 tng v La Hn, ta Bo Thp cao 99m\r\nKhu Du lch Trng An - Qu khch ln thuyn truyn thng i tham quan thng cnh h thng ni  vi hng v v cc thung lng ngp nc, thng vi nhau bi cc dng sui to nn cc hang ng ngp nc quanh nm. im xuyn trong khng gian hoang s, tnh lng l hnh nh ru phong, c knh ca cc mi nh, n, ph nm np mnh di chn cc dy ni cao. \r\nQu khch dng cm ti v nhn phng khch sn ngh ngi. Bui ti qu khch t do khm ph Ph c Hoa L, mt khng gian check-in c, p, trm mc p tr nn lung linh, huyn o hn vi sc mu ca nhng chic n lng v Bo Thp trn H K Ln; tri nghim nhiu hot ng tr chi dn gian v nhiu loi hnh vn ha ngh thut t dn tc nh ma ri nc, nhy ma Tc Xnh, ht xm, ... n nhng bui trnh din acoustic s c din ra vo cc bui ti ngy cui tun.\r\nNgh m ti Ninh Bnh','Ngy 2: H Ni - Ninh Bnh - Trng An - Bi nh\r\n','3 ba ( sng, tra, chiu )','T222-6502-4N3D'),(1666,3,'Qu khch n sng v tr phng khch sn. Xe khi hnh a Qu khch n thnh ph bin H Long tham quan:\r\nXung thuyn i du ngon Vnh H Long - Thng cnh thin nhin tuyt p v v cng sng ng, c UNESCO cng nhn l di sn thin nhin Th gii nm 1994.\r\nT trn tu ngm nhn cc hn o ln nh trong Vnh H Long: Hn G Chi, Hn L Hng.\r\nng Thin Cung l mt trong nhng ng p nht  H Long. V p nguy nga v lng ly bi nhng lp thch nh v nhng lung nh sng lung linh.\r\nXe n Qu khch ti bn tu v khi hnh i tham quan chp hnh bn ngoi Bo tng Qung Ninh, Cung C Heo - Cung Quy Hoch, Hi Ch, Trin Lm V Vn Ha Qung Ninh, tham quan mua sm c sn ti Hi Sn Hng  H Long vi nhiu mt hng hi sn ti, kh, ch mc,..\r\nQu khch dng cm chiu v nhn phng khch sn ngh ngi. Bui ti, Qu khch t do khm ph nhiu hot ng dch v gii tr si ni ti ph c Bi Chy - nm cnh cng vin Sun World H Long t nhng m thc ng ph n cc qun c ph siu d thng nh Hn Gai Coffee & Lounge hay thoi mi bung xa ti The Mini Bar, Brothers Pub,\r\nNgh m ti H Long.\r\nHoc la chn mt s dch v khm ph H Long v m (t tc phng tin v chi ph tham quan):\r\n- Tri nghim dch v Cp Treo N Hong ti Sun World H Long Complex trn Ni Ba o, chim ngng cnh p v m ca thnh ph H Long di nh n lung linh (thi gian hot ng cp treo d kin t 10h n 18h cc ngy th 7 v CN).','Ngy 3: H Long - ng Thin Cung\r\n','03 ba (sng, tra, chiu )','T222-6502-4N3D'),(1667,4,'Qu khch n sng v tr phng khch sn. Xe a Qu khch i tham quan:\r\nVng t thing Yn T: Qu khch ln cp treo du ngon thng cnh thin nhin ng Yn T (chi ph cp treo t tc), ni cn lu gi nhiu di tch lch s mnh danh t t Pht gio Vit Nam, chim bi cha Mt Mi, cha Hoa Yn  ni tu hnh ca pht hong Trn Nhn Tng khai sinh ra dng mi Thin Phi Trc Lm, nm trn lng chng ni   cao 516m. Theo du chn Pht Hong ving Cha ng c tn Thin Trc T (cha Ci Pht), ta lc  nh cao nht dy Yn T (1.068m)  ngi cha bng ng ln nht Vit Nam.\r\nDng ti trm dng chn Hi Dng mua c sn: bnh u xanh, bnh kho\r\nXe khi hnh a Qu khch ra sn bay Ni Bi lm th tc n chuyn bay v Tp. Nng. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay  Nng.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n*Lu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.','Ngy 4: H Long - SB Ni Bi -  Nng\r\n','02 ba (sng, tra)','T222-6502-4N3D'),(1668,1,'Qu khch tp trung ti Sn bay  Nng, Ga i Trong Nc. Hng dn vin lm th tc cho Qu khch p chuyn bay i H Ni. Qu khch n tra ti nh hng a phng v tham quan nhng di tch vn ha ni ting ti th : \r\nMt vng H Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc.\r\nVn Miu: ni th Khng T v cc bc hin trit ca Nho Gio, Quc T Gim - trng i hc u tin ca Vit Nam, tm v ci ngun lch s ca cc v Nho hc.\r\nQu khch dng cm chiu v nhn phng khch sn ngh ngi. Bui ti, Qu khch t do khm ph 36 ph phng H Ni hoc la chn tri nghim v m ti H Ni (chi ph t tc):\r\nTri nghim tuyn xe but 02 tng khm ph khp ph phng H Ni t trn cao vi nhng con ph, nhng hng gnh va h, nhng con ng rn rng sc Xun, nhng danh lam thng cnh ni ting ti H Ni: Nh ht ln, bu in H Ni, n Qun Thnh, Cha Trn Quc, Lng Ch Tch, Nh t Ha L, Nh th ln, \r\nNgh m ti H Ni\r\n ','Ngy 1:  Nng - H Ni\r\n','02 Ba n (tra, ti)','T222-8805-2N1D'),(1669,2,'n sng v tr phng khch sn. Xe khi hnh a Qu khch n vi Ninh Bnh - vng t mnh danh l Ni m n, chn mong v vi nhiu di tch vn ha, thin nhin v cng c sc. n ni, Qu khch tham quan: \r\nCha Bi nh - mt qun th cha vi nhiu k lc Vit Nam nh pho tng pht Di Lc bng ng nng 80 tn, hnh lang vi 500 tng v La Hn, ta Bo Thp cao 99m\r\nKhu Du lch Trng An - Qu khch ln thuyn truyn thng i tham quan thng cnh h thng ni  vi hng v v cc thung lng ngp nc, thng vi nhau bi cc dng sui to nn cc hang ng ngp nc quanh nm. im xuyn trong khng gian hoang s, tnh lng l hnh nh ru phong, c knh ca cc mi nh, n, ph nm np mnh di chn cc dy ni cao. \r\nQu khch dng cm ti v nhn phng khch sn ngh ngi. Bui ti qu khch t do khm ph Ph c Hoa L (chi ph t tc) mt khng gian check-in c, p, trm mc p tr nn lung linh, huyn o hn vi sc mu ca nhng chic n lng v Bo Thp trn H K Ln; tri nghim nhiu hot ng tr chi dn gian v nhiu loi hnh vn ha ngh thut t dn tc nh ma ri nc, nhy ma Tc Xnh, ht xm, ... n nhng bui trnh din acoustic s c din ra vo cc bui ti ngy cui tun.\r\nNgh m ti Ninh Bnh\r\n ','Ngy 2: H Ni - Trng An - Bi nh\r\n','03 Ba n (sng, tra, ti)','T222-8805-2N1D'),(1670,3,'n sng v tr phng sm. Xe khi hnh a Qu khch i H Long tham quan Vnh H Long thng cnh thin nhin tuyt p v v cng sng ng, c UNESCO cng nhn l di sn thin nhin Th gii t nm 1994. n ni, Qu khch lm th tc check-in ln Du Thuyn bt u hnh trnh tham quan 2 ngy 1 m:\r\nThng thc Welcome-drink v nghe cc thuyn vin thng bo chng trnh, hng dn cc quy nh an ton trn thuyn.\r\nThng ngon nhng khung cng tuyt p ca Vnh H Long - k quan thin nhin th gii:  hn Trng Mi, hn Ch , nh Hng, hang sng st hay hang lun .. \r\nQu khch vo thm hang o Titop - mt trong nhng o ni ting trong qun th Vnh H Long, Qu khch s t do bi li v leo ni ln nh o Titop ngm ton cnh vnh H Long\r\nTham gia lp hc nu cc mn n truyn thng Vit Nam\r\nThng thc khung cnh hong hn lng mn.\r\nHa mnh trong khng gian m cng lng mn ti nh hng  thng thc ba ti vi cc mn n thm ngon hp dn do chnh u bp trn tu thc hin.\r\nTh mnh th gin cng gi v sng bin m trn tng thng ca tu.\r\nNgh m trn du thuyn.\r\n ','Ngy 3: Ninh Bnh - H Long - Du thuyn cao cp\r\n','03 Ba n (sng, tra, ti)','T222-8805-2N1D'),(1671,4,'Qu khch thc dy vi bi hng dn tp Thi Cc Quyn trn tng thng ca tu. Thng thc ba n sng nh (tr, c ph, bnh cookies, ph, m, bn, min,). Qu khch t do ngm cnh Vnh H Long v lm th tc tr phng, xung thuyn.\r\n11 gi, xe n Qu khch ti bn thuyn khi hnh i H Ni, dng cm tra ti nh hng a phng. n sn bay Ni Bi, Hng dn vin h tr Qu khch lm th tc n chuyn bay v  Nng. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay  Nng.\r\n*Lu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.\r\nTrong trng hp on gom di 10 khch th tour khng khi hnh. Cng ty s t vn cho Qy khch chuyn tour sang ngy khi hnh ln cn hoc thng bo chi ph pht sinh  khi hnh c on.','Ngy 4: H Long - SB Ni Bi -  Nng\r\n','n 2 ba (n sng,n tra)','T222-8805-2N1D'),(1672,1,'Qu khch tp trung ti ga i trong nc, sn bay Tn Sn Nht, hng dn vin Vietravel h tr lm th tc cho on p chuyn bay i  Nng, ti sn bay  Nng xe v HDV n on v khch sn ngh ngi.\r\nNgh m ti  Nng\r\n ','Ngy 1: TP. H Ch Minh -  Nng\r\n','0 ba n (t tc n ngy u tin)','T448-7016-3N2D'),(1673,2,'Qu khch dng ba sng ti khch sn v t do tm bin M Kh. \r\n\r\nSau khi tm bin, xe v HDV s a on i tham quan:\r\nKhu du lch B N (chi ph cp treo & n tra t tc) - tn hng khng kh se lnh ca  Lt ti min Trung, on t do tham quan Cha Linh ng, Hm ru Debay, vn hoa Le Jardin DAmour, Khu Tm linh mi ca B N ving n Lnh Cha Linh T, khu vui chi Fantasy Park. \r\nCu Vng - t do chp hnh ti im tham quan siu hot ca  Nng. \r\nTri nghim Tu ha leo ni n vi Lu i Mt Trng. \r\nQu khch t tc dng ba tra ti KDL. on t do vui chi cho n gi xung cp. on tham quan:\r\nVn tng Apec - nm bn b sng Hn t hp cng trnh bao gm khu cng vin cy xanh, thm c, li i b, vn do.\r\nCu Tnh Yu - Cu Tnh Yu   Nng c ly cm hng t nhng cy cu tnh yu ni ting trn th gii nh: , Php, Nga, c. y l ni minh chng, c hn cho cc i la,  ngha ca  kha tnh yu th hin mt tnh yu bn cht, vnh cu. \r\nMua sm c sn ph bin ti Qu  Nng vi hn 2000 sn phm c sn  Nng, Min Trung v cc vng min ln cn, ni bt nht l ch b, b kh, mc rim me, mc kh, gh sa st v y  cc loi kh c,...\r\nQu khch dng ba ti ti nh hng a phng. Bui ti, on t do tham quan ch m,  Nng Downtown...\r\nNgh m ti  Nng\r\n ','Ngy 2:  Nng - B N - Cu Vng\r\n','02 ba n (sng, chiu)','T448-7016-3N2D'),(1674,3,'Qu khch dng ba sng ti khch sn v t do tm bin M Kh. Sau  on khi hnh tham quan: \r\nBn o Sn Tr v ving Cha Linh ng - vi tng Pht Quan Th m cao nht Vit Nam, ng ni y, Qu khch s c chim ngng ton cnh thnh ph, ni rng v bin o Sn Tr mt cch hon ho nht. \r\nLng  Non Nc Quc Hip - ni ch tc cc sn phm  m ngh to phong thy.\r\nPh C Hi An - Cha Cu, Nh c, Hi qun, do ph n lng cm nhn s yn bnh, c knh, lng mn Hi An, thng thc c sn ni ting a phng Cao lu, M Qung, Cm g,. T do tham quan thnh ph v m, ngm cu Rng, cu Tnh Yu hay do chi dc b sng Hn.\r\nTham quan Cao su thin nhin WE - ng lng ngh ngi trn nhng chic nm c lm t cao su thin nhin hoc mua sm sn phm nh chn, ga, gi m mang n cho Qu khch mt gic ng tt cho ngy mi trn y nng lng. \r\nQu khch c th tri nghim cc dch v massage th gin c th ti Chloe Luxury Spa cng h thng (chi ph tri nghim t tc).\r\nTi gi bay, HDV v xe tin Qu khch ra sn bay  Nng n chuyn bay tr v Tp. H Ch Minh. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.   \r\n***KT THC CHNG TRNH  TM BIT QU KHCH***\r\nLu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t. \r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\n ','Ngy 3:  Nng - Bn o Sn Tr - Ph c Hi An - TP. H Ch Minh\r\n','02 ba n (sng, tra)','T448-7016-3N2D'),(1675,1,'Qu khch tp trung ti Vietravel (190 Pasteur, P. V Th Su, Q3, TP.HCM), khi hnh i  Lt. on dng ba sng v ba tra trn ng i.\r\n\r\nTrn hnh trnh n vi thnh ph sng m, xe v HDV a khch i trn cung ng QL27 ni vo DT725 chinh phc o T Nung mt trong nhng trc ng dn vo thnh ph  Lt. on dng chn tham quan: \r\n\r\n- Cha Linh n: c xy dng theo th lng ta ni mt hng thy vi rng thng bt ngn bao quanh v trc mt l thc Voi hng v. Ni y mang li kin trc c knh, em n khng gian bnh yn, thanh tnh ti chn thin mn cho Qu khch. Ngi cha cn ni ting vi Bc tng Quan Th m cao nht Vit Nam.\r\n\r\n- KDL Chun Chun: im n mi ti x M Linh, n y du khch tha thch to dng ti h c cc, h chun chun, thc vng cnh v nhiu tiu cnh ln nh khc. Chim ngng hng trm loi hoa c sc ca  Lt. Thng thc c ph cht lng cao hay nhng thc ung thm ngon a dng (chi ph nc ung t tc).\r\n\r\nChiu on tip tc hnh trnh v  Lt, nhn phng ngh ngi. Bui ti, Qu khch t do thng thc caf ngm h Xun Hng v m\r\n\r\nNgh m ti  Lt\r\n ','Ngy 1: TP. H CH MINH  KDL CHUN CHUN  LINH N T -  LT S ba n: 03 ba (Sng, Tra, Chiu)','(sng, ti)','T668-5113-3N2D'),(1676,2,'Qu khch dng ba sng ti khch sn, xe a on i tham quan:\r\n\r\n- Khm ph Thung Lng Tnh Yu  i Mng M: n y du khch nh lc vo khng gian c tch vi nhiu hot ng th v nh:\r\n\r\n+ Khm ph nh m cung tnh yu hnh tri tim mu xanh tri rng trn din tch 4.000m, thung lng ngn hoa, cng trnh 30 k quan, bo tng tng sp \r\n\r\n+ Check-in cc khng gian sc mu ca dy ph c Hi An, vn hoa lavender, cy tnh yu, cu thang sch, i vng cnh. \r\n\r\n+ Chinh phc Cu Knh Ngn Thng 7D  l cy cu knh th 4 ti Vit Nam v l u tin ca khu vc Min Trung  Ty Nguyn. Nm   cao 1500m, cu knh ha hn s l mt a im sng o v mang li nhiu cm xc mi l cho qu khch. (chi ph cu knh t tc)\r\n\r\n+ Tham qua cc hot ng nh: p vt, Pedalo trn h a Thin, khu tr chi lin hon vi cc tr chi nh: gi thng bng trn dy cp (highwire); u dy mo him t do (zipline)... v xe in tham quan Thung Lng Tnh Yu.\r\n\r\nSau ba tra, on dng chn mua sm c sn lm qu cho ngi thn, bn b v tr v khch sn ngh ngi, t do khm ph thnh ph sng m. \r\n\r\n- Mua sm c sn  Lt ti c s mt Thanh Nhu: cc loi tri cy sy gin, sy do, nc ct du tm  du ti, tr atiso, tr hoa, ...\r\n\r\n\r\nBui ti, on ngh ngi ti khch sn hoc t do khm ph Thnh ph  Lt:\r\n- Vo 16h30 n hong hn v thng thc ba tic m nhc cng Lululola Show vi khng gian ngoi tri v c tm nhn xung thnh ph  Lt th mng. Hoc vo 20h00 thng thc nhng bn nhc tr tnh xa, nhc Trnh, nhc Bolero ti m sc  Lt  Cung n Xa, Qu khch c dp tri nghim mt phong cch sng chm v tn hng tng pht giy, lu gi nhng khonh khc tuyt vi  tn su trong tm hn mi ngi. (Chi ph t tc)\r\n\r\n- Tri nghim tm khong nng & xng hi ti Dlats gip bn th gin v ngh ngi, gii ta cng thng (Chi ph t tc)\r\n***Lu : Chi ph v v i li t tc***\r\n\r\n\r\nBui ti, Qu khch t do tn b Ch  Lt. \r\n\r\nNgh m ti  Lt\r\n ','Ngy 2:  LT - KHM PH THUNG LNG TNH YU  CU KNH NGN THNG 7D S ba n: 02 ba (Sng, Tra, n chiu t tc)','(sng, ti)','T668-5113-3N2D'),(1677,3,'Qu khch dng ba sng ti khch sn, xe cng hng dn vin Vietravel a on di chuyn n tham quan:\r\n\r\n- Mongo Land: mang v p hon ton mi l - mt \"tiu Mng C thu nh\" trong lng  Lt c thit k nh mt nng tri vi nhng chic lu  mu sc. Tt c u c bi tr c o, bt mt theo phong cch Mng C c trng. n y, ngoi vic tn hng bu khng kh trong lnh v chim ngng v p ca thin nhin hng v, Qu khch s c tri nghim: \r\n+ Tha thch chp nh ti lu mng c, xch u, nng tri u, thm c, sa mc xng rng,\r\n+ Ha mnh vo th gii ca ng vt: hu sao, d mini, cu, th Vit, th Holland Lop H Lan, th S T, chim Yn, Chinchilla, sc Chipmunk, v t tay cho th n (thc n s c Mongo Land chun b sn cho qu khch).\r\n+ Tri nghim cm gic siu  ti ng trt phao kh p v di nht  Lt\r\n+ Tham gia cc hot ng vui chi nh: trt c, bn cung\r\n+ Tr thnh nhng c nng, chng trai du mc thc th khi din trn mnh trang phc ngi Mng C. (Chi ph thu trang phc t tc).\r\nBui tra, on dng ba tra ti nh hng a phng. Sau  tip tc tham quan:\r\n\r\n- Nh Th Domain de Marie: theo dng n tu Bc i, ta lc trn i Mai Anh, ni bt vi mu hng sng rc. Qu khch c th chn cho mnh nhng mn  t len trong khun vin pha sau nh th.\r\n\r\n- Thin vin Trc Lm: vi qun th cng trnh kin trc c o, du khch cn c ngm nhn cc vn hoa xinh p khoe sc v ton cnh H Tuyn Lm vi thin nhin, ni i, rng thng  Lt. \r\n\r\nSau ba ti, on t do ung caf quanh khu vc H Xun Hng hay thng thc ly sa u nnh nng hi, bnh trng nng c sn  Lt khu vc Tng Bt H. \r\n\r\nNgh m ti  Lt\r\n ','Ngy 3:  LT  MONGO LAND - NH TH DOMAIN DE MARIE  THIN VIN TRC LM S ba n: 03 ba (Sng, Tra, Chiu)','(sng, ti)','T668-5113-3N2D'),(1678,4,'Qu khch dng ba sng ti khch sn v lm th tc tr phng, hng dn vin a on i tham quan:\r\n\r\n- Hong Long Ohayo: t ho l mt trong nhng khu vn bonsai l kim ln nht Vit Nam vi nhng chu cy bonsai c chm sc v un nn k lng v cng p mt. Ngoi ra, qu khch cn c chim ngng nhng loi hoa ni ting ca  Lt, h c Koi t tiu chun Nht Bn, hng lot tiu cnh mang m sc mu Nht Bn nh hng cng Tori, khu thc nc, khu ph Nht, con ng tre, Tt c s to nn mt khng gian th thi ho quyn vi thin nhin. \r\n\r\non khi hnh v TP. HCM v dng ti Bo Lc dng cm tra, sau  khi hnh v im n ban u. Chia tay on v kt thc chng trnh du lch.\r\n ','Ngy 4:  LT  HONG LONG OHAYO - TP. H CH MINH S ba n: 02 ba (Sng, Tra)','(sng, ti)','T668-5113-3N2D'),(1679,1,'Qu khch tp trung ti Vietravel (190 Pasteur, Qun 3). Xe a on n sng v khm ph tuyn cao tc TP.HCM - Long Thnh - Du Giy - Phan Thit - Vnh Ho. Trn ng i, Qu khch dng chn chp nh ti Bin C N - c mnh danh Nng cng cha ng qun bi v p hoang s.\r\nn tra ti Ninh Thun v tip tc hnh trnh n vi thnh ph bin Nha Trang. Trn ng i, on chim ngng Cnh ng in gi m Ni - vi nhng cnh qut tuabin khng l to nn khung cnh hng v.\r\nn Nha Trang, Qu khch nhn phng khch sn ngh ngi. Bui chiu, on khi hnh n Vega City - thnh ph nh sng pha Bc Nha Trang.\r\nCheck in bn ngoi Nh ht  - c thit k nh chic  khng l & Bc tng danh vng - lu danh nhng ng gp cho in nh Vit.\r\nTip tc tham quan Bn du thuyn Ana Marina - bn du thuyn c u t theo chun quc t u tin ti Vit Nam.\r\nTha thch ha mnh vo ln nc bin trong xanh, ct trng.\r\nChim ngng ni C Tin v sn khonh khc hong hn trn vnh ngc gia bin xanh.\r\nThng thc ba chiu vi view bin t  cng vnh Nha Trang v du thuyn.\r\nNgh m ti Nha Trang','Ngy 1: TP. H Ch Minh - C N - Nha Trang - Bn du thuyn Ana Marina V iu bin khi\r\n','03 ba n (sng, tra, chiu)','T556-6100-6N5D'),(1680,2,'Qu khch dng ba sng ti khch sn, xe a on tham quan\r\nHn Chng - qua bn tay k diu ca to ha nhng tng  ln xp chng ln nhau to ra b cc thin nhin n tng.\r\nNha Trang Xa - xuyn khng tri nghim nt vn ha m cht c xa\r\nCheck-in nh c trm tui, khng gian ti hin i sng ngi Nha Trang qua nhng nm 1970 v gc lng ngh truyn thng: dt chiu, c ng, an nn,...\r\nQuay v tui th vi cc tr chi dn gian:  n quan, nhy l c,\r\nMc c phc ha thn thnh cc giai nhn thi Nguyn (chi ph t tc)\r\nBui chiu, on tip tc hnh trnh tham quan v th gin ti\r\nThp B Ponagar - qun th n th tiu biu ca ngh thut kin trc v iu khc dn tc Chm.\r\nSui khong nng I-Resort - hin ra nh mt bc tranh thin nhin m cht Vit, Qu khch th gin trong dng khong nng hoc kt hp tm bn khong cho ln da thm ti tr (t tc chi ph tm bn cc loi)\r\nSau khi dng ba ti, on t do khm ph khu ch m - thng thc m thc a phng; Qung trng 2/4, check in Thp Trm Hng - biu tng ca thnh ph Nha Trang.\r\nNgh m ti Nha Trang','Ngy 2: Nha Trang Xa - Thp B Ponagar - Sui khong nng I-Resort - Hn Chng\r\n','03 ba (n sng, tra, chiu)','T556-6100-6N5D'),(1681,3,'Qu khch dng ba sng ti khch sn, xe a on tham quan:\r\nBin Nh Tin - m mnh trong ln nc bin trong xanh, mt m, c bao bc bi bi ct di trng xa v nhng hng da lao xao trong gi.\r\nSau khi n tra, Qu khch tr v khch sn ngh ngi, trn ng dng chn tham quan v mua sm c sn ph bin ti Hng  Nha Trang (chi ph t tc)\r\nBui chiu, Qu khch t do khm ph Nha Trang theo chng trnh gi  sau\r\nTh gii gii tr VinWonders - tri nghim trng thi bay gia khng trung\" ti rp phim bay, zipline t 3 k lc; ngm ton cnh vnh bin t nh vng xoay mt tri; khm ph khu vn nm chu trong truyn thuyt v m chm trong th gii thn tin vi siu phm thc cnh Tata show \r\nVinpearl Harbour p ta tri u - thng thc m thc phong ph ti Harbour Market v tn hng Party all night cng m nhc bng n v nhng cuc vui bt tn\r\nTn hng tuyt tc thin nhin, khm ph lng du lch xanh thc hin Net Zero - tri nghim ngh thut tm rng ca ngi Nht, ha mnh vo dng sui Vng Sa Khong giu khong cht, tm thc 9 tng v du h bng b tre thn thin mi trng\r\n*** Lu : chi ph v tham quan, i li v n ti t tc ***\r\nNgh m ti Nha Trang','Ngy 3: Bin Nh Tin - VinWonders - Vinpearl Harbour - Lng Nh\r\n','02 ba (sng, tra, t tc n chiu)','T556-6100-6N5D'),(1682,4,'Sau khi dng ba sng ti khch sn, xe a on khi hnh v TP. H Ch Minh. Trn ng v Qu khch dng tham quan:\r\nCha Long Sn - ngi c t mang m du n kin trc  ng vi bc tng Pht trng to trn i Tri Thu.\r\nXe a on chinh phc tuyn cao tc mi Vnh Ho - Cam Lm - Nha Trang. on dng chn mua sm c sn Phan Rang ti Vn nho Cng 2 - tri nghim cm gic hi tn tay nhng chm nho ti ngon, mng nc ca min nng gi.\r\nBui chiu v n TP. H Ch Minh, xe a Qu khch v im n ban u. Chia tay Qu khch v kt thc chng trnh du lch.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\nLu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch sn c th  xa trung tm thnh ph vo cc ma Cao im.','Ngy 4: Nha Trang - TP. H Ch Minh\r\n','02 ba n (sng, tra)','T556-6100-6N5D'),(1683,1,'06h30 Xe v hng dn vin n qu khch ti Vietravel Hanoi - S 3 Hai B Trng, Hoan Kim, Ha Ni khi hnh i H Giang, trn ng dng tham quan:\r\nn Thc Ci - c xy dng t th k XV, ngi n c knh bt ngun t tc th Mu ca nhn dn Lc Vit c t xa xa trong lch s. Sau lng n l i ni, mt trc hng v pha sng L to nn kh thing sn thy hi t, bn ma thi tit trong lnh mt m, tnh mch.\r\nQu khch dng cm ti v nhn phng khch sn ngh ngi.\r\nNg m ti TP. H Giang','Ngy 1: H Ni - Tuyn Quang - H Giang\r\n','02 ba n (tra, chiu)','T002-3219-3N4D'),(1684,2,'Qu khch tr phng, n sng. Xe v hng dn vin a Qu khch i th trn ng Vn tham quan:\r\non dng chn ngh ngi ti Cng tri Qun B - Ni tip gip gia tri v t, ngm th trn Tam Sn v danh thng Ni i.\r\nQu khch dng ba tra ti Yn Minh, sau ba tra on thm quan:\r\nPh Co, tm hiu np nh cn gi nguyn truyn thng, chup anh hoa tam gic mch hoa ao, hoa m, hoa mn bn canh nhng b rao  mt co c sc cua ngi dn vung cao ( nu vao dip hoa ao n), tham quan va chup anh thung lung Sung La ( c goi la thung lung hoa hng) ni tng l phim trng ca b phim Chuyn Cua Pao ni ting.\r\nLng vn ha Lng Cm (thuc x Sng L), men theo nhng hng ng xanh mt dc hai bn ng on vo tham quan lng vi nhng nt vn ho c sc ca 3 dn tc L L, Mng v Hn v nhng cnh ng hoa rc r sc mu\r\nDinh nh Vng (Dinh Vua Mo) y l 1 cng trnh kin trc p him c v rt c o ca vng cao nguyn ni . Sau  on tip tc khi hnh i Lng C. Qu khch c th dng chn chp hnh nhng dy ni  chp trng hng v hay nhng cnh ng hoa tam gic mch rc r sc hng khu vc Lng To.\r\nchinh phc ct c Lng C  Ni a u im Cc Bc T Quc vi l c 54m2 tng trng cho 54 dn tc anh em.\r\nXe a on v ng Vn, nhn phng khch sn, ngh ngi v n ti.\r\nNg m ti ng Vn','Ngy 2: H Giang - Lng C - ng Vn\r\n','03 ba n (sng, tra, chiu)','T002-3219-3N4D'),(1685,3,'Qu khch tr phng, n sng. Xe a Qu khch i tham quan:\r\nBc tranh sn thy hng v ca mt trong t i nh o vng ni pha Bc - M P Lng nm dc theo dng sng xanh Nho Qu chy qua khe vc ni Tu Sn. Trn ng dng chp hnh ti tng i Thanh Nin trc bo tng Con ng Hnh Phc, ngm con ng hnh phc v ton cnh dng sng Nho Qu t trn cao.\r\nLu : Chi phi M P Lng Panorama caf, cho chuyn trn sng Nho Qu ngm hm vc Tu Sn (chi ph t tc)\r\nSau khi n tra, Qu khch khi hnh v Tp H Giang nhn phng khch sn, ngh ngi.\r\nNgh m ti khch sn H Giang','Ngy 3: ng Vn - M P Lng - Nho Qu - H Giang\r\n','03 ba n (sng, tra, chiu)','T002-3219-3N4D'),(1686,4,'Qu khch tr phng & n sng, khi hnh v H Ni, trn ng dng tham quan:\r\nCao im 468, V Xuyn - thuc thn Nm Ngt x Thanh Thy, xuyn qua cc con ng dc chy quanh vng ni ng Bc cnh ca khu Thanh Thy. Ni y l v tr chin lc qun s, tr thnh trn tuyn nng bng, c lit ko di duy nht trn ton tuyn bin gii pha bc  bo v bnh yn cho lnh th hnh ch S.\r\nQu khch dng ngh chn ti Trm Dng Pao 78 - H Giang mua sm c sn min ni Tr Shan Tuyt, mt ong Bc H, tru kh gc bp, nm Hng, mng kh.\r\nTip tc hnh trnh v li H Ni, Qu khch dng dng cm tra ti Tuyn Quang. Chng trnh du lch kt thc ti im n ban u.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n(*) Th t cc im thm quan c th thay i theo tnh hnh thc t ti thi im xut pht nhng vn m bo y  cc quyn li v cc im thm quan theo chng trnh','Ngy 4: H Giang - H Ni\r\n','02 ba n (sng, tra)','T002-3219-3N4D'),(1687,1,'Qu khch tp trung ti sn bay Tn Sn Nht (ga trong nc), hng dn vin lm th tc cho Qu khch p chuyn bay i H Ni. n sn bay Ni Bi, xe n on khi hnh i Mc Chu (Sn La) trn ng dng tham quan:\r\nChp hnh o Thung Khe hay con goi la eo a Trng, ni y quanh nm trng nh tuyt va my mu bao phu tao canh quan tuyt ep thu hut nhiu du khach n chup anh.\r\nChp nh ti i Ch Mc Sng  mt trong nhng i ch ln nht ti Mc Chu thu ht rt nhiu s quan tm ca cc tn  am m chp nh.\r\nQun th phc hp vui chi gii tr v ngh dng Mc Chu Island chim ngng v p Cu knh Bch Long c chiu di 632m,   cao cch mt t 150m, l Cy cu knh i b di nht th gii c xc lp k lc Guinness vo thng 28/5/2022. Tri nghim cc tr chi: Chinh phc cu knh Bch Long, trt Airslide, zipline, Mc Chu Space, (chi ph t tc).\r\nQu khch nhn phng khch sn ngh ngi. Bui ti, Qu khch c th t do tham quan khu ph Nht Bn  vi nhiu khu vc khc nhau mang m phong cch Nht Bn nh: khu qung trng; Sakura Caf, tr o phong cch Nht, tham gia cc hot ng cui tun ti Ph i b Mc Chu hoc tn hng khng kh thanh bnh vng cao nguyn vi tch tr nng m .\r\nNgh m ti Mc Chu','Ngy 1: Tphcm - H Ni - o Thung Khe - Mc Chu Island\r\n','02 ba n (tra, chiu)','T001-5916-7N6D'),(1688,2,'Qu khch dng ba sng v lm th tc tr phng sm, xe v hng dn vin khi hnh tham quan:\r\nThc Di Ym - thc ngy m  xung trng xa, m o, khng ch mang n cho du khch s thch th trc mt khung cnh va huyn b va k v ca t tri m cn cm gic sng khoi khi c ha mnh vo nhng ngn gi mang hi nc mt lnh.\r\nTip tc hnh trnh, qu khch khi hnh i in Bin. Trn ng ngm o Pha in - y cng l mt trong \"t i o\" vng ng Ty Bc v c xp cng nhm 6 con o gy n tng nht Vit Nam.\r\nQu khch nhn phng khch sn v dng cm chiu. Bui ti, Qu khch t do tham quan Tng i chin thng in Bin Ph khm ph thnh ph in Bin v m.\r\nNgh m in Bin','Ngy 2: Mc Chu - Tp. Sn La - in Bin\r\n','03 ba n (sng, tra, chiu)','T001-5916-7N6D'),(1689,3,'Sau khi n sng v lm th tc tr phng, Qu khch tham quan:\r\nBo tng Chin thng lch s in Bin Ph: trng by hn 1.000 t liu hnh nh, ti liu, hin vt, cnh tng lch s ti hin li cuc chin ho hng ca qun v dn ta trong Chin dch in Bin Ph nm 1954.\r\nChim ngng kit tc bc tranh Panorama ton cnh Trn chin in Bin Ph sng ng: Ti hin chn thc nhng khonh khc in hnh nht trong Chin dch in Bin Ph.\r\nNgm cu Mng Thanh, sng Nm Rm v con ng hoa ban trong trung tm thnh ph.\r\nTham quan v mua sm c sn Qu Ty Bc in Bin v lm qu cho ngi thn v gia nh nh go in Bin, mt ong, su cht, tht tru hun khi, chm cho, mng, cc sn phm my tre an, cc sn phm thu, dt th cm,..\r\nQu khch khi hnh i Lai Chu, trn ng ngm cnh rng ni Ty Bc dc theo dng sng Nm Na v vng ngp nc do p nh my Thy in Sn La dng ln ti ng ba sng: sng , sng Nm Na v sng Nm Rm.\r\nQu khch dng cm chiu v nhn phng khch sn ngh ngi. Bui ti, qu khch t do khm ph, thng tr v ngm ton cnh thnh ph Lai Chu v m ti Tam ng Tea (chi ph t tc).\r\nNgh m ti Lai Chu','Ngy 3: in Bin - Lai Chu\r\n','03 ba n (sng, tra, chiu)','T001-5916-7N6D'),(1690,4,'Qu khch dng im tm sng v lm th tc tr phng. Xe a Qu khch chinh phc o  Quy H - con o p, hng v v di nht trong T i nh o min Bc.\r\nn vi thanh ph trong sng Sapa, Qu khch tham quan khu du lch Fansipan Legend thng ngon bc tranh phong cnh y mu sc ca cnh rng nguyn sinh, thung lng Mng Hoa.\r\nChinh phc nh ni Fansipan vi  cao 3.143m hng v bng cp treo (chi ph t tc).\r\nL Pht ti cha Trnh hay cu phc lc, bnh an cho gia nh ti Bch Vn Thin T trong h thng cnh quan tm linh trn nh Fansipan.\r\nTri nghim tuyn tu la Mng Hoa hin i nht Vit Nam.\r\nBn Ct Ct - Thm nhng np nh ca ngi Mng, Dao, Giy trong bn, ti y du khch s khng khi ng ngng trc v p ca mt trong nhng ngi lng c p nht Sapa v c dp c thng thc chng trnh biu din vn ngh ca ngi H\'Mng (chng trnh vn ngh din ra vo cc thi im c nh trong ngy).\r\nQu khch dng cm chiu v nhn phng khch sn ngh ngi.\r\nBui ti Qu khch t do do ph, ngm nh th  Sapa v thng thc c sn vng cao ti Ch m Sapa nh: tht ln cp nch nng, trng nng, ru to mo, giao lu vi ngi dn tc vng cao.\r\nNgh m ti Sapa\r\nLu :\r\n- Trong trng hp, Fansipan khng hot ng chng trnh s c thay th bng im tham quan Cu Knh Rng My (khng bao gm v tham quan).\r\n- Chng trnh tng v tri nghim tu ha leo ni Mng Hoa s khng c hon li chi ph v khng thay th dch v khc trong trng hp Qu khch khng tham gia hoc phi hy do iu kin khch quan v thi tit, cung ng, thng bo t n v cung ng.','Ngy 4: Lai Chu - Sapa\r\n','03 ba n (sng, tra, chiu)','T001-5916-7N6D'),(1691,5,'Tr phng khch sn, on khi hnh tham quan M Cang Chi, ngang qua:\r\nNgm Bn Lm Mng t trn cao: y l Bn ca dn tc Mng v l ni c rung la p nht M Cang Chi. Qu khch s b m hoc bi v p ht hn ca cung ng rung bc thang ni ting ti 3 x: La Pn Tn, Ch Cu Nha v Z Xu Phnh. Qu khch chim ngng nhng thung lng rng ht tm mt, cc tha rung tng tng lp lp ln sng theo sn ni, ngn ni ny ni tip ngn ni khc.\r\no Khau Ph: on o di nht trn tuyn quc l 32 c mnh danh l mt trong t i nh o vi  di trn 30km.\r\nT L: qu khch s ngi c mi hng thoang thong theo gi bng lng trn mi nh ca cm mi, ni y ni ting vi xi np, cm kh.\r\nBui ti, Qu khch dng cm chiu v thng thc chng trnh biu din ma Xe, giao lu v tm hiu nt vn ha c sc ca dn tc Thi (chng trnh biu din dnh tng cho on t 20 khch tr ln).\r\nNgh m ti Ngha L','Ngy 5: Sapa - M Cang Chi - Ngha L\r\n','03 ba n (sng, tra, chiu)','T001-5916-7N6D'),(1692,6,'Qu khch dng ba sng, tr phng khch sn v khi hnh tham quan:\r\nn Hng: ni th cc vua Hng c cng dng nc, t tin ca dn tc Vit Nam, mt qun th kin trc thm nghim trn ni Ngha Lnh. Qu khch dng hng t t, thm quan n Thng, n Trung, n H, Ging Ngc, Lng vua Hng.\r\nNgh m ti H Ni','Ngy 6: Ngha L - Yn Bi - H Ni\r\n','03 ba n (sng, tra, chiu)','T001-5916-7N6D'),(1693,7,'Qu khch n sng v tr phng. Tip tc hnh trnh n sn bay Ni Bi, Hng dn vin h tr Qu khch lm th tc p chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nKT THC CHNG TRNH, CM N V TM BIT QU KHCH!\r\n*Lu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im. C cu phng s ph thuc vo tnh hnh thc t ca khch sn khi lm th tc nhn phng.\r\nVietravel h tr 1 ba n nh ti sn bay i vi cc chuyn bay v sau 20:00 ti.','Ngy 7: H Ni - Tp. HCM\r\n','01 ba n (n sng hp mang i)','T001-5916-7N6D'),(1694,1,'16h00: Qu khch tp trung ti Cung Vn ha Vit Nht xut pht hnh trnh thng ngon hong hn bn b di sn.\r\nQu khch di chuyn n Trung tm Vn ha Ni Bi Th - c xy dng gia trung tm thnh ph H Long, y l mt trong nhng cng trnh cho mng 50 nm ngy thnh lp tnh Qung Ninh. Trung tm c ta lc trn i cao, t rng v bng phng, ng trn khun vin ca Trung tm c th bao qut mt phn vnh H Long v l im sinh hot vn ha tn ngng v l ni gio dc truyn thng yu nc, ung nc nh ngun cho th h sau. Qu khch di chuyn tham quan:\r\nn c ng Trn Quc Nghin: nm di chn ni Bi Th, th Hng V Vng Trn Quc Nghin, mt trong nhng tng lnh ti ba, l con trai ca Hng o i Vng Trn Quc Tun. Vi v tr p, mt hng ra Vnh H Long, c xy dng vo cui th k XIII, l mt di tch p v l mt ngi n c ting linh thing.\r\nCu Bi Th - l h thng cu nm trong trong tuyn ng bao bin quanh Ni Bi Th, Qu khch s c ngm hong hn bung xung, lng lnh c mt vng bin tri H Long.\r\nBi th c nm trong khu vc n Bi th c ni Bi Th. ng ni y Qu khch s c ngm nhn ton cnh Ni Bi Th - l mt ngn ni  vi cao hn 200m, c kin to a cht c bit mt na chn ni gn vi t lin, na kia ngm trong nc bin. Khng ch l mt trong nhng cnh p ca thnh ph, ni y cn l di tch vn ha lch s quan trng vi bi th c khc trn ni ca Vua L Thnh Tng trong dp i kinh l v  c Cha Trnh Cng lm li, khc gn  cng du tch ca nhng bi th khc t cc thi nhn  tng rung ng trc cnh p ni y.\r\nTrung tm Thng mi Vincom Plaza - nm  v tr c a hng u, l t hp mua sm vi cc thng hiu hng u trong nc v th gii, vui chi gii tr hin i t tiu chun quc t nh h thng m thc phong ph, rp chiu phim, sn trt bng t nhin Vinpearlland Ice Rink H Long vi quy m 1.086 m2 u tin ti thnh ph bin,\r\nCng vin Ln B thuc a bn phng Bch ng (TP H Long) vi 12,3ha. Nm  v tr p, ngay trung tm thnh ph, ven theo b Vnh H Long, cng vin thc s  tr thnh ni sinh hot cng ng ca ngi dn TP H Long.\r\nBo tng Qung Ninh, th vin Qung Ninh - mt thit k c o ca kin trc s ngi Ty Ban Nha Salvador Perez Arroyo,  ot gii Cng trnh ca nm 2013. Bt mt Qu khch u tin l khi than nguyn khi ln nht t k lc Vit Nam 28 tn c t ti khu trng by ngoi tri.\r\nCung Quy Hoch Hi Ch & Trin Lm Qung Ninh - c s dng  lm Cung Quy hoch, Hi ch v Trin lm tnh vi hnh dng l mt con c heo khng l nm st vnh H Long.\r\nH Hi Thnh (hay cn gi l H Hn Mt) c v tr c a,  trung tm ca thnh ph (thuc phng Hng Hi), nm i din nhiu cng trnh ni ting ca tnh nh: Qung trng 30/10, Cung Quy hoch - Hi ch v Trin lm tnh, Th vin - Bo tng tnh. H khng ch to l phi xanh cho thnh ph m cn l im nhn v cnh quan, thu ht khch du lch.\r\nKt thc hnh trnh, Qu khch c th thng thc mt ba ti m cng ti Qun Ngon hoc thng thc sa chua Tun Lin, C Phng,.. cng nhng mn n c sc ca ph bin H Long xinh p (chi ph t tc).\r\nThng tin chung Free Walking tour:\r\nThi gian thc hin: khong 3 ting 30 pht, d kin 16:00  18:30 th 7 hng tun.\r\n di hnh trnh khong: 3,6 km.\r\nim tp trung: Cung vn ha Vit Nht  TP H Long (16 L Thnh Tng, Hng Gai, Tp. H Long).\r\nim kt thc: H Hi Thnh (i din cung quy hoch, hi ch v trin lm tnh).','Ngy 1: Thng ngon hong hn bn b di sn\r\n','00 ba n (t tc chi ph n ung)','T222-9146-2N1D'),(1695,1,'Qu khch tp trung ti sn bay Tn Sn Nht (Ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n Qu khch di chuyn n vng t thing Yn T, ni c mnh danh l Vng t to nn Di Sn.\r\nCheck-in ti Lng Nng, ha mnh vo khng gian thanh tnh, yn bnh gia ni rng. Qu khch thng thc nhng mn n m  hng v a phng ti nh hng Cm Qu, mang n tri nghim m thc mc mc nhng y tinh t.\r\nTri nghim cp treo (chi ph t tc), a Qu khch bng qua nhng rng ni trng ip, thu trn vo tm mt khung cnh thin nhin hng v. Vo ma xun, i Lo Mai Vng n r, khoe sc rc r trn nh ni, to nn khung cnh ngon mc. Chim bi cha Mt Mi v cha Hoa Yn, ha mnh vo khng gian linh thing, lng ng trong s tnh ti v an nhin. Ni y tng l chn tu hnh ca Pht Hong Trn Nhn Tng, v t khai sng Thin phi Trc Lm. Theo du chn Pht Hong ving Cha ng c tn Thin Trc T (cha Ci Pht), ta lc  nh cao nht dy Yn T (1.068m) - ngi cha bng ng ln nht Vit Nam.\r\nTip tc hnh trnh n TP H Long, Qu khch nhn phng khch sn v dng cm chiu. Bui ti, Qu khch t do khm ph \"ph c\" Bi Chy si ng, ni hi t nhng hot ng gii tr hp dn, t m thc ng ph c sc n nhng qun bar si ng Valley Beach Club. Hoc, Qu khch c th ha mnh vo khng gian cc qun c ph c o nh Thng Zeo, 1900, Luna.\r\nNgh m ti H Long\r\nHoc la chn mt s dch v khm ph H Long v m (t tc phng tin v chi ph tham quan):\r\nTri nghim dch v cp treo N Hong ti Sun World H Long Complex trn Ni Ba o - tng ot 2 ln k lc t t chc K lc Guinness th gii; chim ngng cnh p v m ca thnh ph H Long di nh n lung linh (thi gian hot ng cp treo d kin t 10h n 18h cc ngy th 7 v CN) hay check-in vi vng quay Mt tri Sun Wheel - mt trong nhng vng quay cao nht th gii.','Ngy 1: Sb Ni Bi (H Ni)  Yn T - H Long\r\n','02 ba n (tra, chiu)','T001-5912-7N6D'),(1696,2,'Qu khch dng ba sng v tr phng khch sn. Xe khi hnh a Qu khch n cng tu, Qu khch lm th tc ln thuyn, bt u hnh trnh du ngon Vnh H Long, di sn thin nhin th gii c UNESCO cng nhn nm 1994.\r\nng Thin Cung l mt trong nhng ng p nht  H Long. V p nguy nga v lng ly bi nhng lp thch nh v nhng lung nh sng lung linh.\r\nT trn tu ngm nhn cc hn o ln nh trong Vnh H Long: Hn G Chi, Hn L Hng\r\nTham quan mua sm c sn ti Hi Sn Hng  H Long vi nhiu mt hng ni ting ch mc gi tay H Long, tht chng mm tp, ruc tm, s sng kh, c cm, c ch vng,..\r\nXe n Qu khch ti bn thuyn khi hnh i Ninh Bnh - vng t c mnh danh l Ni m n, chn mong v, ni ting vi nhng danh thng thin nhin hng v v cc di tch vn ha c sc. n ni, Qu khch dng cm chiu v nhn phng khch sn ngh ngi.\r\nBui ti, Qu khch t do ngm Ph c Hoa L v m mang mt v p lung linh, huyn o, l ni du khch c th ha mnh vo khng gian vn ha truyn thng rc r mu sc: tri nghim tr chi dn gian v cc loi hnh ngh thut nh ma ri nc, nhy Tc Xnh, ht Xm.. hay Do thuyn trn h K Ln, thng tr, th n hoa ng, ngm ph c lung linh trong nh n (chi ph t tc).\r\nNgh m ti Ninh Bnh','Ngy 2: Vnh H Long  Ninh Bnh\r\n','03 ba n (Sng, Tra, Chiu)','T001-5912-7N6D'),(1697,3,'Qu khch dng ba sng v tr phng khch sn. Xe a Qu khch i tham quan:\r\nTi khu du lch Trng An, Qu khch s c tri nghim tuyt vi ln thuyn, th mnh trn dng sng Ng ng xanh bic, lt qua nhng hang ng k b, ngm nhn thin nhin hng v ca nhng ngn ni  vi cao vt v nhng thung lng nc mnh mang hin ra trc mt. Gia khng gian tnh mch, nhng mi nh, n, ph c knh, ph y ru phong, n mnh di chn ni, to nn mt bc tranh thin nhin tuyt m.\r\nNghing mnh trc Cha Bi nh, mt qun th kin trc Pht gio trng l mang n cho du khch cm gic trang nghim v thanh tnh. Ni y lu gi nhiu k lc Vit Nam nh pho tng pht Di Lc bng ng nng 80 tn, bc i trong hnh lang La Hn di hun ht vi 500 pho tng sng ng, v ngm nhn ta Bo Thp cao 99m, sng sng gia tri xanh.\r\nXe khi hnh a Qu khch v H Ni, do quanh H Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc. Qu khch nhn phng khch sn ngh ngi hoc t do do khu ph Ty T Hin , thng thc c sn H Ni nh: ngang chy ti, bn c ngui, ch ri, kem Trng Tin, (chi ph t tc)\r\nNgh m ti H Ni','Ngy 3: Ninh Bnh - H Ni\r\n','03 ba n (sng, Tra, Chiu)','T001-5912-7N6D'),(1698,4,'Qu khch dng ba sng v tr phng khch sn. Xe khi hnh a Qu khch ra sn bay Ni Bi, Hng dn vin h tr Qu khch lm th tc n chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\nLu :\r\nHnh trnh c th thay i th t im n ty theo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) c th b nh hng bi thi tit. y l trng hp bt kh khng, mong Qu khch thng cm.\r\nVo ma cao im, khch sn c th nm xa trung tm thnh ph.\r\nDo cc yu t khch quan, mt s im tham quan c th ng ca v s c thay th bng a im ph hp khc.','Ngy 4: H Ni  Sn bay Ni Bi  Tp. H Ch Minh\r\n','n sng hp mang i','T001-5912-7N6D'),(1699,1,'Qu khch t tc tp trung ti bn Ninh Kiu xung thuyn du ngon trn sng Cn Th, nghe gii thiu v Ch thy sn nc ngt Cn Th; tri nghim Ch ni Ci Rng - mt hnh thc hp ch c trng ti cc ng sng ca vng ng bng sng Cu Long, ch ni quy t hng trm ghe xung, to thnh ni mua bn, giao thng cc loi tri cy, c sn sm ut trn sng nc. Ch Ni Ci Rng  c cng nhn Di sn Vn ha Phi vt th Quc Gia. on khi hnh i Bc Liu tham quan:\r\nNh cng t Bc Liu - do k s ngi Php thit k vo nm 1919, y c xem l ngi bit th b th nht  Nam k lc tnh lc by gi. on nghe k v giai thoi vng son mt thi ca cu Ba Huy - Ngi c mnh danh l Cng t Bc Liu.\r\nSau khi n tra, on khi hnh i C Mau. Trn ng i, on dng chn tham quan Nh th Tc Sy - ni an ngh ca Linh mc Trng Bu Dip c nhiu ngi bit n vi lng sng m, ni y gn lin vi nhng cu chuyn cm ng v cuc i ca cha Trng Bu Dip.\r\nn C Mau, on nhn phng ngh ngi.\r\nNgh m  C Mau','Ngy 1: Cn Th - Ch ni Ci Rng - Bc Liu - C Mau\r\n','02 ba n (tra, chiu)','T992-5555-3N2D'),(1700,2,'on tr phng v ln xe khi hnh n t Mi. n ni, on di chuyn bng cano len li trong rng c, khm ph khu rng ngp mn ln th hai th gii vi h sinh thi a dng, mang v p hoang di cng bu khng kh trong lnh.\r\nTi t Mi, Qu khch chinh phc cc Nam t quc, khm ph Ct mc ta  quc gia GPS 0001; Pano biu tng mi C Mau; im cui ng H Ch Minh 2436Km; n th Cha Lc Long Qun v tng M u C; chinh phc Ct c t Mi - chim ngng v p cm o Hn Khoai th mng nm gia bin ng.\r\nQu khch dng ba tra ti khu du lch cng ng Hong Hn vi nhng mn n c sn a phng nh c thi li, vp...\r\non khi hnh v Bc Liu tham quan:\r\nCha Xim Cn - vi sc vng lng ly cng thit k nhiu hoa vn t m mang m du n Khmer Nam B. Ngoi ra Qu khch cn c nghe thuyt php gii thiu v pht gio Nam Tng v nt p vn ha kin trc Khmer.\r\nCnh ng in gi - chim ngng v p nhng tua-bin gi khng l cao hn 80 m sng sng trn nn tri xanh vi  ngha to mt ngun nng lng sch v tn trn mt bin, gim thiu tc ng gy hiu ng nh knh\r\nNgh m  Bc Liu','Ngy 2: C Mau - t Mi - Bc Liu - Ngm hong hn cnh ng in gi\r\n','03 ba n (sng, tra, chiu)','T992-5555-3N2D'),(1701,3,'Sau ba sng, Qu khch tham quan:\r\nQung trng Hng Vng - hnh nh cy n km cch iu (cao 18,6 m) nhc c khng th thiu trong n ca ti t ci lng, biu tng vn ha ca tnh Bc Liu.\r\nKhu lu nim ngh thut n Ca Ti T Nam B v c nhc s Cao Vn Lu: mt cng trnh khi qut v thn th, s nghip ca c nhc s Cao Vn lu, ghi nhn cng lao v tn vinh nhng ng gp to ln ca ng cho ngh thut n ca ti t Nam b v l ngi sn sinh ra bn D c Hoi lang bt h.\r\non khi hnh i Sc Trng, tham quan hai ngi cha ni ting:\r\nCha S Ln - cn c gi l \"cha Chn Kiu\" th hin c nt vn ha c o ca ngi Khmer cng cch thit k sng to t hng vn mnh chn c p trn cc cng trnh kin trc ca cha.\r\nCha Wat Ptum Wngsa Som Rng - mt qun th kin trc Pht gio rng ln, gm nhiu cng trnh nh: Chnh in, ngi bo thp vn ngi m p ta cha Arun ti Thi Lan, c bit, tng Pht Thch Ca nhp nit bn uy nghim vi kch thc chiu di 63 mt\r\non quay v kt thc tour trn ng v li Cn Th.\r\ni vi cc khch ghp t Cn Th sau n tra s t tc tch on ra sn bay Cn Th hoc  li Cn Th (xe tour khng a khch ra sn bay Cn Th)\r\n* Lu \r\n- y l chng trnh du lch trn gi, Vietravel khng c trch nhim hon tr chi ph chnh lch cho cc khch hng thuc din min gim hoc i tng u tin nh tr nh, ngi ln tui, ngi c cng vi cch mng Chnh sch min gim, u tin (nu c) ch dnh cho khch l ca cc im tham quan.\r\n- Hnh trnh c th thay i th t im n ty vo iu kin thc t.\r\n- Lch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\n- Khch sn c th  xa trung tm thnh ph vo cc ma cao im.','Ngy 3: Bc Liu - Sc Trng - Cn Th\r\n','02 ba n (sng, tra)','T992-5555-3N2D'),(1702,1,'Qu khch tp trung ti sn bay Tn Sn Nht (Ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n Qu khch i khi hnh theo cao tc H Ni  Lo Cai a Qu khch n ph ni Sapa. Qu khch dng cm tra ti nh hng a phng. n ni, Qu khch tham quan: \r\nBn Ct Ct - p nh mt bc tranh gia vng ph c Sapa, ni y thu ht du khch bi cu treo, thc nc, gung nc v nhng mng mu hoa m hoc du khch khi lc bc n y. Thm nhng np nh ca ngi Mng, Dao, Giy trong bn, du khch s khng khi ng ngng trc v p mng m ca mt trong nhng ngi lng c p nht Sapa. Ti y Qu khch xem chng trnh biu din vn ngh ca ngi H\'Mng.\r\nQu khch dng cm ti v nhn phng ngh ngi hoc t do do ph ngm nh th  Sapa, t do thng thc c sn vng cao ti Ch m Sapa nh: tht ln cp nch nng, trng nng, ru to mo, giao lu vi ngi dn tc vng cao.\r\nNgh m ti Sapa\r\n ','Ngy 1: TPHCM - SB Ni Bi (H Ni) - Sapa\r\n',' 02 ba n (tra, chiu)','T222-1465-6N5D'),(1703,2,'Qu khch dng im tm sng ti khch sn. Xe a Qu khch ra Sun Plaza tri nghim Tu ha leo ni Mng Hoa hin i nht Vit Nam vi tng chiu di gn 2000m, thng ngon bc tranh phong cnh y mu sc ca cnh rng nguyn sinh, thung lng Mng Hoa. n khu du lch Fansipan Legend, Qu khch t do tham quan:\r\nChinh phc nh ni Fansipan vi  cao 3.143m hng v bng cp treo (chi ph t tc).\r\nL Pht ti cha Trnh hay cu phc lc, bnh an cho gia nh ti Bch Vn Thin T trong h thng cnh quan tm linh trn nh Fansipan.\r\nTip tc hnh trnh, Qu khch dng cm tra v tham quan: \r\nChinh phc o  Quy H - con o p, hng v v di nht trong T i nh o min Bc.\r\nKhu du lch Cng Tri  Quy H - mt trong nhng im sn my, ngm hong hn cc p ti Sapa.\r\nQu khch dng cm ti ti Sapa v t do ngh ngi.\r\nNgh m ti Sapa\r\nLu : \r\n- Trong trng hp, Fansipan khng hot ng chng trnh s c thay th bng im tham quan Cu Knh Rng My (khng bao gm v tham quan).\r\n\r\n- Chng trnh tng v tri nghim tu ha leo ni Mng Hoa s khng c hon li chi ph v khng thay th dch v khc trong trng hp Qu khch khng tham gia hoc phi hy do iu kin khch quan v thi tit, cung ng, thng bo t n v cung ng.\r\n ','Ngy 2: Sapa - Fansipan Legend - o  Quy H\r\n','03 ba n (sng, tra, chiu)','T222-1465-6N5D'),(1704,3,'Qu khch dng ba sng v tr phng khch sn. Xe khi hnh a Qu khch v H Ni, trn ng dng tham quan mua sm c sn v dng cm tra ti nh hng a phng. n H Ni nhn phng khch sn ngh ngi hoc t do i tham quan H Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc.\r\nNgh m ti H Ni','Ngy 3: Sapa - Lo Cai - H Ni\r\n','03 ba n (sng, tra, chiu)','T222-1465-6N5D'),(1705,4,'Qu khch dng ba sng v tr phng. Xe khi hnh a Qu khch i tham quan:\r\nLng H Ch Tch (khng ving vo th 2, th 6 hng tun v giai on bo tr nh k hng nm t 10/06 n ht ngy 12/8) tham quan v tm hiu cuc i v s nghip ca v cha gi dn tc ti Nh Sn Bc H, Bo Tng H Ch Minh, Cha Mt Ct.\r\nTip tc hnh trnh, xe a Qu khch i H Long, trn ng tham quan Danh thng Yn T:\r\nQu khch ln cp treo du ngon thng cnh thin nhin ng Yn T (chi ph cp treo t tc), ni cn lu gi nhiu di tch lch s mnh danh t t Pht gio Vit Nam, chim bi cha Mt Mi, cha Hoa Yn  ni tu hnh ca Pht hong Trn Nhn Tng khai sinh ra dng mi Thin Phi Trc Lm, nm trn lng chng ni   cao 516m. Vo thng 2-3 hng nm, Ni Yn T s khoc ln mnh chic o c sa vng rc r ca i lo mai vng, thu ht hng ngn du khch n thng ngon phong cnh hng v ca dy Yn T.\r\nn H Long, Qu khch dng cm ti nh hng a phng v nhn phng khch sn ngh ngi. Bui ti, Qu khch t do khm ph nhiu hot ng dch v gii tr si ni ti ph c Bi Chy - nm cnh cng vin Sun World H Long t nhng m thc ng ph n cc qun c ph siu d thng nh Hn Gai Coffee & Lounge hay thoi mi bung xa ti The Mini Bar, Brothers Pub,..\r\nNgh m ti H Long\r\nQu khch t do ngh ngi ti khu ngh hoc la chn tham gia vo mt trong cc hnh trnh sau (chi ph di chuyn v tri nghim t tc)\r\nTri nghim dch v Cp Treo N Hong ti Sun World H Long Complex trn Ni Ba o, chim ngng cnh p v m ca thnh ph H Long di nh n lung linh (thi gian hot ng cp treo d kin t 10h n 18h cc ngy th 7 v CN).','Ngy 4: H Ni - H Long\r\n','03 ba n (sng, tra, chiu)','T222-1465-6N5D'),(1706,5,'Qu khch n sng v tr phng khch sn. Xe a qu khch ra bn tu, xung thuyn du ngon Vnh H Long - Thng cnh thin nhin tuyt p v v cng sng ng, c UNESCO cng nhn l di sn thin nhin Th gii nm 1994. \r\nng Thin Cung l mt trong nhng ng p nht  H Long. V p nguy nga v lng ly bi nhng lp thch nh v nhng lung nh sng lung linh.\r\nT trn tu ngm nhn cc hn o ln nh trong Vnh H Long: Hn G Chi, Hn L Hng.\r\nSau khi tham quan, xe n Qu khch ti bn thuyn khi hnh i Ninh Bnh - vng t mnh danh l Ni m n, chn mong v vi nhiu di tch vn ha, thin nhin v cng c sc.\r\nn ni, Qu khch dng cm ti nh hng a phng v nhn phng khch sn ngh ngi. Bui ti qu khch t do khm ph Ph c Hoa L, mt khng gian check-in c, p, trm mc p tr nn lung linh, huyn o hn vi sc mu ca nhng chic n lng v Bo Thp trn H K Ln; tri nghim nhiu hot ng tr chi dn gian v nhiu loi hnh vn ha ngh thut t dn tc nh ma ri nc, nhy ma Tc Xnh, ht xm, ... n nhng bui trnh din acoustic s c din ra vo cc bui ti ngy cui tun.\r\nNgh m ti Ninh Bnh ','Ngy 5: H Long - Ninh Bnh\r\n','03 ba n (sng, tra, chiu)','T222-1465-6N5D'),(1707,6,'Qu khch dng ba sng v tr phng khch sn. Xe a qu khch tham quan\r\nKhu Du Lch Trng An - Qu khch ln thuyn truyn thng i tham quan thng cnh h thng ni  vi hng v v cc thung lng ngp nc, thng vi nhau bi cc dng sui to nn cc hang ng ngp nc quanh nm. im xuyn trong khng gian hoang s, tnh lng l hnh nh ru phong, c knh ca cc mi nh, n, ph nm np mnh di chn cc dy ni cao.\r\nCha Bi nh, mt qun th cha vi nhiu k lc Vit Nam nh pho tng pht Di Lc bng ng nng 80 tn, hnh lang vi 500 tng v La Hn, ta Bo Thp cao 99m \r\nTip tc hnh trnh, xe khi hnh a Qu khch ra sn bay Ni Bi lm th tc n chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\nLu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t. \r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.\r\n ','Ngy 6: Ninh Bnh - SB Ni Bi\r\n','02 ba n (sng, tra)','T222-1465-6N5D'),(1708,1,'Qu khch tp trung ti Vietravel (190 Pasteur, Phng V Th Su Qun 3, Tp.HCM), on khi hnh i Khnh Ha theo cung ng cao tc mi Du Giy - Phan Thit - Vnh Ho. on n sng trn cung ng i v dng chn tham quan:\r\nBi bin C N - mt trong nhng bi bin p nht min Trung, vn c mnh danh l Nng cng cha ng qun bi v p hoang s ca n.\r\nSau khi n tra, on tip tc khi hnh hnh trnh n vi vng t c mnh danh Rng trm, bin yn. Trn cung ng i, on dng chn ti:\r\nCnh ng in gi m Ni - gn nh th G Sn, n y du khch s trng thy nhng cnh qut tuabin nh nhng ci xay gi khng l to nn khung cnh hng v, p n nao lng.\r\nLng ngh Trng Sn - khm ph ni lu gi hn qu Vit gia lng ph bin, chim ngng 10 k lc Vit Nam v vn ha v th cng m ngh, khm ph cc cng on to ra nhng sn phm th cng: an my, dt chiu, chm nn l c bit, on cn c lng nghe thanh m ca vn ho qua mn ha tu nhc c dn tc vi s hin din ca n tranh, n bu, n , n trng \r\nT Cam Ranh xe a Qu khch i theo cung ng tuyt p dn li n thnh ph Nha Trang vi ng b bin di mnh mng, un ln theo nhng sn ni dc bin. on ngm cnh hong hn trn vnh Nha Trang tt c s to nn mt bc tranh p v bnh yn v cng.\r\n\r\non dng ba n c sn vi Nem nng tr danh ca x Trm xinh p. \r\n\r\nBui ti, Qu khch c th t do tri nghim do ph bin v m hoc n Vega City, check in Nh Ht , vi li kin trc c ly cm hng t chic  - mt ng c rt ph bin trong dn gian Vit dng  nh bt thy sn. Nh ht mang dng dp ca mt chic  khng l nm ni bt bn vnh Nha Trang l a im check-in y hp dn. Hoc tha sc thng thc cc loi hi sn ti ngon ca vng bin Khnh Ha (chi ph t tc).\r\nNgh m ti Nha Trang\r\n ','Ngy 1: TP. H Ch Minh - Nha Trang\r\n','03 ba n (sng, tra, chiu)','T556-3913-6N5D'),(1709,2,'Sau khi dng buffet sng ti khch sn, xe a Qu khch n bn cng, on xung tu du ngon v tham quan:\r\nHn Lao - o Kh - ni c hn 1000 ch kh ang c bo tn v sinh sng t nhin. Qu khch t do tm bin, th gin, tham quan xem chng trnh biu din xic Kh, ua ch, kh bi li hoc tri nghim cc mn th thao trn bi bin v tr chi: can ko d, m t nc, ua xe cng thc 1, bn sng sn, ci  iu  (chi ph t tc).\r\non quay v li khch sn t do ngh ngi. Bui chiu Qu khch t do la chn im tham quan nh sau:\r\nLa chn 1: VinWonders Nha Trang (chi ph cp treo & n chiu t tc) - ngm ton cnh vnh Nha Trang t nh vng xoay Mt Tri ln nht Vit Nam, tham quan b su tp k hoa, d tho ti i Vn Hoa, khu vn th m - vn Qu Vng, tham gia cc tr chi tng tc v lin hon ti qung trng Thn Thoi hay vng t Yu Thng, xem phim 4D ti lu i i Dng, khm ph khu tr chi cm gic mnh, khu tr chi trong nh hay tm bin, tm h bi ln nht ng Nam  v thng thc chng trnh biu din show nh sng ngh thut k v ti qung trng Thn Thoi mi ti.\r\nLa chn 2: Du ngon trn du thuyn Emperor (chi ph t tc) - tu s di chuyn dc thnh ph bin Nha Trang, du khch s c ngm cnh hong hn p nht trong khi thng thc tic cocktail, ba ti tinh t v ngh s ghi ta, violon chi nhng bn nhc du dng trong mt khung cnh lng mn di tri sao, nh trng v nh n rc r ca thnh ph.\r\nNgh m ti Nha Trang','Ngy 2: Nha Trang - Hn Lao - VinWonders Nha Trang\r\n','02 ba n (sng, tra)  ','T556-3913-6N5D'),(1710,3,'Qu khch dng ba sng ti khch sn v lm th tc tr phng. on khi hnh tham quan: \r\nLng Yn Mai Sinh - tn mt chim ngng m hnh hang Yn, tm hiu qu trnh chim Yn lm t, quy trnh thu hi, tinh ch, nm th cc sn phm lm t t Yn...\r\nTip tc hnh trnh xe v HDV a Qu khch tm bit ph bin  n vi ni cao nguyn ngn hoa. \r\n\r\non n tra trn ng i. n  Lt, on dng chn v tham quan:\r\nFresh Garden - mt trong nhng khu du lch c i hoa p ti  Lt vi view rng nguyn sinh. n y, qu khch s m chm trong khung cnh thin nhin rng ln y th mng vi ngn hoa ua n. Ni bt gia Fresh Garden l cnh ng hoa bt ngt ngp sc mu. Bn cnh  cn c cc tiu cnh v cng c o, mi l & duy nht nh: ng hm nhit i, ng hm thi gian, h view rng, cng tri,...\r\nQu khch nhn phng khch sn ngh ngi v dng cm chiu ti thnh ph sng m vi cc mn n mang m bn sc thun Vit nhng li ghi du n vi bn b quc t khi  t nhng gii thng v m thc, cng l nhng mn n lm nn tn tui nh: ba ch chy cnh, salad organic trn, g nng da gin v xi chin, lu b,... v c bit Qu khch s c thng thc nhng mn trng ming c sc theo ma. \r\n\r\nBui ti, on t do ung caf quanh khu vc H Xun Hng hay thng thc ly sa u nnh nng hi, bnh trng nng c sn  Lt khu vc Tng Bt H.\r\nNgh m ti  Lt ','Ngy 3: Nha Trang - Lng yn Mai Sinh -  Lt\r\n','03 ba n (sng, tra, chiu)','T556-3913-6N5D'),(1711,4,'Sau khi dng ba sng ti khch sn, Qu khch khi hnh tham quan:\r\nNh Th Domain de Marie - theo dng n tu Bc i, ta lc trn i Mai Anh, ni bt vi mu hng sng rc. Qu khch c th chn cho mnh nhng mn  t len trong khun vin pha sau nh th. \r\nNi Langbiang - ni y c mnh danh l nc nh ca cao nguyn Lm Vin vi chiu cao 2.167m so vi mc nc bin. n ni y khng ch c khm ph thin nhin, phng tm mt ra xung quanh ngm nhn nhng mng sc hnh t ph hoa, ph mu rn rng, phi phi, m khi n LangBiang l  c nghe mt cu chuyn tnh m say, y bi ai v thun khin nh tnh yu vi ni rng Ty Nguyn. (Chi ph xe jeep t tc)\r\nQu khch dng ba tra ti nh hng Buffet rau v thoi mi thng thc cc loi rau c qu, nm,...ti ngon, l nng sn ca vng t ny. Sau , on v khch sn ngh ngi. Bui chiu tip tc tham quan:\r\nKhm ph KDL thc Datanla ni ting vi v p hoang s, c trng ca i ngn Ty Nguyn. Qu khch s c dp c chinh phc nhng tr chi nh: h thng mng trt Alpine Coaster hin i, ng zipline 1000m bng rng, ... (Chi ph tr chi t tc).\r\nMua sm c sn  Lt ti c s mt Thanh Nhu - cc loi tri cy sy gin, sy do, nc ct du tm  du ti, tr atiso, tr hoa,...\r\nSau ba ti ti nh hng a phng. Qu khch t do do ph thng thc m thc ni ting ph ni: Lu g l  Tao Ng, Lu b qun G, Bnh t lng g, c nhi tht, Xe lu buffet, Ngi BBQ  hoc n Nhc Qun Dim Xa lng nghe nhng tnh khc bt h ca nhc s Trnh Cng Sn  (chi ph t tc)\r\nNgh m ti  Lt\r\n ','Ngy 4:  Lt - Thnh ph ngn hoa\r\n','03 ba n (sng, tra, chiu)','T556-3913-6N5D'),(1712,5,'Sau khi dng ba sng ti khch sn v lm th tc tr phng. on khi hnh tham quan \r\nTm hiu v quy trnh lm tr truyn thng x Blao v thm nh my ch c 1927 -  mt trong nhng nh my ch c nht ca Vit Nam, vi tui i gn 100 nm tui.\r\nXe v HDV a Qu khch khi hnh v TP. H Ch Minh. on dng ba tra ti Bo Lc, xe a on v li im n ban u v kt thc hnh trnh nhiu tri nghim.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n  Lu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch sn c th  xa trung tm thnh ph vo cc ma Cao im. ','Ngy 5:  Lt - Nh My Ch C 1927 - TP. H Ch Minh\r\n','02 ba n (sng, tra)','T556-3913-6N5D'),(1713,1,'Qu khch tp trung ti Cng ty Vietravel (190 Pasteur, Phng V Th Su, Qun 3, TP.H Ch Minh) khi hnh i Phan Thit. Qu khch n sng trn cung ng i. n ni xe a on dng tham quan:\r\nLu ai Ru Vang RD - nghe gii thiu v quy trnh sn xut, ng chai v thng thc mt trong nhng loi ru vang ho hng ni ting th gii c xut x t Thung Lng Napa (M). \r\non dng ba tra ti nh hng a phng v lm th tc nhn phng ngh ngi. \r\nBui chiu, Qu khch t do tm bin hoc h bi, tn hng v tri nghim cc dch v c ti khch sn/resort.\r\non dng ba ti ti nh hng a phng. Bui ti, Qu khch t do do ph khm ph Mi N v m hoc thng thc cc mn m thc a phng nh: bnh trng nng, kem da, da ba nht, hay cc loi hi sn ti sng. \r\nNgh m ti Mi N','Ngy 1: TP. H Ch Minh - Mi N\r\n','03 ba n (sng, tra, chiu)','T660-4009-2N1D'),(1714,2,'Qu khch dng ba sng ti khch sn. Sau  xe a on khi hnh theo cung ng ven bin Mi N - Bu Trng thng tp, check-in con ng i cong vt v chic xe ti bn nc mu vng cam ni bt c im xuyn bi hoang mc ct hai bn cng mu xanh ca bin tri.  \r\nn Bu Trng - ngm nhn bin h lp lnh nh bc di nh mt tri rc r cng s k v ca nhng cn ct trng xa. C  thng 05 - 08 nhng cnh hoa sen hng lp l sau chic l xanh mt to nn mt khung cnh thin nhin th mng. Qu khch th sc vi xe Jeep tc  cao, chinh phc i ct nng bng nht Vit Nam mang tn Trinh N (chi ph xe Jeep t tc). \r\non dng ba tra ti nh hng a phng, bui chiu xe v HDV a Qu khch n tham quan vui chi ti Mango Beach - t hp vui chi gii tr c o, th v trn ngp sc mu bn b bin thnh ph Phan Thit. Ti y, Qu khch s c:\r\nTn hng khng gian thong ng bn b bin v m mnh trong ln nc trong xanh ti bi tm ngay cnh Mango Beach.\r\nTham quan th gii th cng ti vn th mang phong cch Chu u cng cc bn Alpaca, Pony, ra, th hay b tuyt siu ng yu v thn thin (tham quan trc 17h hng ngy).\r\nThng thc cc chng trnh ca nhc c sc vi DJ trong khi ngm hong hn lng mn bn bin (chng trnh biu din vo ti th 7 hng tun).\r\nNhm nhi nhng mn nc gii nhit c bit l mn Da ba nht - thc ung ni ting ca vng t Bnh Thun ny.\r\nQu khch dng ba ti ti Mango Beach trong khng gian m nhc ho cng ting sng bin to nn mt bui ti cui tun th gin. Bui ti, t do do ph khm ph Mi N v m.\r\nNgh m ti Mi N ','Ngy 2: Mi N - Bu Trng - Mango Beach\r\n','03 ba n (sng, tra, chiu)','T660-4009-2N1D'),(1715,3,'Qu khch dng ba sng v t do tm bin. n gi tr phng, on i tham quan: \r\nBo tng Lng Chi Xa Mi N - vi lch s 300 nm ci ni ca ngh lm nc mm, tri nghim cm gic lao ng trn ng mui, i trn con ng rng xa, thm ph c Phan Thit, thm nh lu ca hm h nc mm xa, m chm cm xc trong bin 3D v thch th khi i ch lng chi xa vi bn tnh tay, bn cn xa th v,\r\nMua sm c sn Phan Thit ti c Sn Hng  (chi ph t tc) - nc mm Phan Thit, cc loi hn sn kh nh: mc kh cu, mc mt nng, c cm rt xng, c thu mt nng, c  mt nng.. v lm qu cho ngi thn v bn b. \r\nChiu on v n TP. H Ch Minh, xe a v im n ban u. Chia tay Qu khch v kt thc chng trnh du lch. ','Ngy 3: Mi N  Lng Chi Xa  TP. H Ch Minh\r\n','02 ba n (sng, tra)'