,'Qu khch tp trung ti bn tu Rch Gi, HDV hng dn khch ln tu khi hnh n Ph Quc.\r\nn ni xe a Qu khch n nh ga cp treo An Thi tham quan Sun World Hon Thom Nature Park vi nhng hot ng th v:\r\nTri nghim cp treo 3 dy vt bin di nht th gii - 7.899.9 mt.\r\nPhn khch tt  cng th thch \"Mc X thnh n\" - tr chi tu ln bng g u tin ti Vit Nam, c tc  ti a 80km/h vi nhiu gc ln ngon mc; i quan st \"Mt i bng\" cao 120m - du khch nh c bay ln khng trung, thng ngon i dng xanh ngt bao la, nhng cnh rng nhit i xanh mt, nhng o nh nhp nh gia bin tri khong t (tr chi c th tm dng v lch bo tr)\r\nTha thch tm bin Hn Thm: mt trong nhng bi bin quyn r nht hnh tinh, vi bi ct trng mn, hoang s, hng da nghing soi bng, mu nc bin xanh mu ngc bch, phn chiu long lanh di nh nng mt tri.\r\nTham gia cc hot ng gii tr trn bin: kayak, jetski, d ln, phao chui (chi ph t tc).\r\nVui chi ti cng vin nc Aquatopia: mt trong nhng cng vin nc ch  hng u ng Nam , tri nghim 6 khu check-in ch  hp dn mang phong cch th dn huyn b.\r\nLng du trn con ng Th trn Hong Hn - c thit k vi kin trc c o, rc r sc mu ca mt th trn chu u c knh: check-in 1001 kiu bc thang, Qung trng La M, k quan Khi Hon Mn, Thp ng h cao 75m - ly  tng t thp chung St. Marks Campanile ca ; chim ngng Kiss Bridge - cy cu ni ln nh mt di la gia b bin trong xanh, vi hai nhp cu vn mnh m trn b ct trng, hng n nhau, hp vo lm mt th thng nht nhng khng chm nhau.\r\nNgh m ti Ph Quc','Ngy 1: Rch Gi - Hn Thm - Th trn Hong Hn\r\n','S ba n: 02 (tra, chiu)','T991-1771-6N5D'),(1727,2,'Qu khch bt u hnh trnh tr v vi thin nhin ti Vinpearl Safari Ph Quc (chi ph t tc) - Vn th bn hoang d u tin ti Vit Nam: vi quy m 180 ha, hn 130 loi ng vt qu him, du khch thng thc cc chng trnh biu din, chp nh vi ng vt; tri nghim vn th m trong rng t nhin, gn gi v thn thin vi con ngi.\r\nBui chiu, Qu khch tham quan khm ph Khu vui chi gii tr VinWonders (chi ph t tc) - Cng vin ch  ln nht Vit Nam, quy m hng u Chu , du khch s c:\r\nTri nghim 12 nn vn minh nhn loi t c ch kim;\r\nKhm ph 06 phn khu vi hn 100 hot ng gii tr siu c l;\r\nCung nhit ti Cng Vin Nc ln nht ng Nam ;\r\nChinh phc 20 tr chi mo him khng nht hnh tinh nh ng trt nhanh nht th gii Cn thnh n ca Zeus, ng trt kh Cuc chin Chn tinh cao 15m u tin ca Vit Nam, ng trt trong nh ti Chin binh i bng v Li nguyn c long - tr chi tng tc trong nh ti u tin ca Vit Nam,\r\nChong ngp trc th gii i dng huyn o vi tm nhn v cc qua tm knh acrylic khng l 8x25m bn trong Cung in Hi vng - thy cung hnh ra ln nht th gii.\r\nBui ti, Qu khch c th t do khm ph mt s hng mc ni bt ti thnh ph khng ng Grand World nh:\r\nCng vin Ngh Thut ng i: s giao thoa c sc gia ngh thut ng i v thin nhin o Ngc.\r\nHuyn thoi Tre: cng trnh tre ln nht Vit Nam.\r\nTn b bn dng knh o Venice v nhn ngm nhng chic thuyn Gondola, khu ph shophouse lng ly sc mu, cng lu i trng l, ba cy cu vm bn nguyt mang m kin trc chu u ...\r\nTham quan bo tng Gu Teddy: lu gi nhiu hin vt qu gi v ti hin chuyn phiu lu hi hc ca nh thm him ti ba Teddy Jones (chi ph t tc)\r\nMn nhn vi show din thc cnh Tinh Hoa Vit Nam quy t hn 200 din vin (chi ph t tc)\r\nThng thc ba tic nh sng nh cao vi show din Sc mu Venice\r\nNgh m ti Ph Quc','Ngy 2: Vui chi tha thch ti cng vin ch  VinWonders Ph Quc - Khu bo tn thin nhin Safari\r\n','S ba n: 02 (sng, chiu)','T991-1771-6N5D'),(1728,3,'Qu khch dng ba sng, th gin ti khch sn n gi tr phng. Sau , xe a on tham quan v mua sm c sn ni ting ti Nh thng nc mm Hng c 1, c sn c Thnh, C s sn xut ngc trai Ph Quc - Trng by cc trang sc bng ngc trai chnh hiu c nui cy ti Ph Quc.\r\nXe a Qu khch ra bn tu khi hnh v Rch Gi. Chia tay Qu khch v kt thc chng trnh du lch!\r\n*Lu :\r\n- Hnh trnh c th thay i th t im n ty vo iu kin thc t','Ngy 3: Ph Quc - Rch Gi\r\n','S ba n: 01 (sng)','T991-1771-6N5D'),(1729,1,'Qu khch tp trung ti im hn (S 3 Hai B Trng, Hon Kim, H Ni) trc 2 ting ri so vi gi bay. Xe ca Vietravel n Qu khch khi hnh ra sn bay Ni Bi p chuyn bay i  Nng. n ni on i thm quan: \r\nBn o Sn Tr  ving cha Linh ng: Ni y c tng Pht Quan Th m cao nht Vit Nam, ng ni y, Qu khch s c chim ngng ton cnh thnh ph, ni rng v bin o Sn Tr mt cch hon ho nht. \r\nBi bin M Kh: Mt trong nhng bi bin quyn r nht hnh tinh. \r\nQu khch dng ba ti ti nh hng a phng v t do vui chi thnh ph  Nng v m hoc ngh ngi ti khch sn.\r\nNgh m ti  Nng','Ngy 1: H NI  SN TR  M KH (n ti)','(sng, ti)','T448-2979-3N2D'),(1730,2,'Qu khch dng ba sng buffet ti khch sn. Sau , xe a Qu khch i tham quan: \r\nKhu du lch B N: tn hng kh hu 4 ma trong mt ngy, c mnh danh l Chu u thu nh  pha Nam  Nng vi tng ngc ngch, khung cnh hay nhng ta lu i nguy nga thng thy trong nhng b phim hot hnh Walt Disney thu nh. \r\nT do tham quan Cha Linh ng, Hm Ru Debay, Vn hoa Le Jardin DAmour, Qung trng Nht Thc, Khu vui chi Fantasy Park.  \r\nCheck in im tham quan siu hot Cu Vng  Bc i c thn tin nng  nm un mnh gia thin nhin t tri rng ln. \r\nTri nghim tu ho leo ni n vi Lu i Mt Trng. \r\nn tra ti B N t tc. T do vui chi n gi xung Cp. \r\nQu khch dng ba ti ti nh hng a phng v t tc i do ph, thng ngon cnh p ca  Nng v m nh: ngm nhn Cu Rng, Cu Tnh Yu, Cu Trn Th L, Trung Tm Thng Mi, Khu ph m thc, Caf - Bar - Disco\r\nNgh m ti  Nng','Ngy 2:  NNG  B N  CU VNG (n sng, tra t tc, ti)','(sng, ti)','T448-2979-3N2D'),(1731,3,'Qu khch n sng ti khch sn. on khi hnh tham quan:\r\nVn tng Apec: Nm bn b sng Hn t hp cng trnh bao gm khu cng vin cy xanh, thm c, li i b, vn do\r\nCu Tnh Yu: c ly cm hng t nhng cy cu tnh yu ni ting trn th gii nh: , Php, Nga, c. y l ni minh chng, c hn cho cc i la,  ngha ca  kha tnh yu th hin mt tnh yu bn cht, vnh cu. \r\non n tra, sau  v khch sn ngh ngi. Bui chiu on khi hnh i tham quan: \r\nRng da By Mu: Qu khch s c tri nghim ngi thuyn thng tham quan khu rng da xanh mt gia khng gian yn bnh, c chim ngng tit mc ma thng, ua thuyn v thng thc c sn a phng\r\nPh c Hi An y l ph n lng p nht vo ban m. \r\nCha Cu Nht Bn, xy dng vo u th k 17, mt biu tng c o v rt thn thng ca ngi Hi An.\r\nHi Qun Qung ng, mt ni th cng ca ngi Qung ng  Trung Quc c lu gi n tn ngy nay, hng nm nhiu l hi vn c t chc ti ni y.\r\nNh c Phng Hng, ni c kin trc kt hp gia 3 nn vn ha Vit Nam - Nht Bn  Trung Quc.\r\nC s sn xut trm hng v nghe chnh ngi dn bn a thuyt minh v cc cng on lm trm.\r\nQu khch dng ba ti ti nh hng a phng v t do tham quan theo lch trnh ring. Thng thc Show K c Hi An - mt trong nhng show thc cnh p nht th gii (Chi ph v cng v i li t tc).   \r\nNgh m ti  Nng','Ngy 3:  NNG  RNG DA BY MU  HI AN (n sng, tra, ti)','(sng, ti)','T448-2979-3N2D'),(1732,4,'Qu khch n sng ti khch sn. Qu khch tr phng v i mua sm c sn, qu lu nim v cho ngi thn, bn b ti Ca hng Qu Min Trung.\r\nSau , on khi hnh ra sn bay p chuyn bay v H Ni. n sn bay Ni Bi xe n on v li im hn ban u. Chia tay v hn gp li Qu khch trong nhng chuyn du lch tip theo.\r\nTrng hp chuyn bay sau 13h, cng ty s b tr thm 1 ba n tra cho on. \r\n***\r\n Lu :\r\n- Gi bay c th thay i theo thng tin cp nht ca hng khng  nhn vin giao dch c trch nhim bo li cho khch hng ngay khi nhn c thng bo (nu c).\r\n- Lch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\n- Trong trng hp on gom di 10 khch th tour khng khi hnh. Cng ty s t vn cho Qy khch chuyn tour sang ngy khi hnh ln cn hoc thng bo chi ph pht sinh  khi hnh c on.\r\n- Khch Sn c th  xa trung tm thnh ph/bin vo cc ma Cao im.','Ngy 4:  NNG  H NI (n sng, (tra))','(sng, ti)','T448-2979-3N2D'),(1733,1,'Xe n Qu Khch ti Vietravel (190 Pasteur, Phng V Th Su Qun 3, thnh ph H Ch Minh) khi hnh i min Ty theo tuyn cao tc mi M Thun - Cn Th ngm nhn nhng cnh ng la hai bn ng; Chim ngng cu M Thun 2 - d n trng im quc gia c chiu di 1,9km ni lin tnh Vnh Long v Tin Giang.\r\nn bn  C Bc (Cn Th), Qu khch i  qua sng tham quan Cn Sn - ngi lng du lch cng ng c o gia lng ph th cng nhng tri nghim c bit:\r\nB C 7 Bon - tham quan m hnh nui c lng b v bo tn nhng ging c qu him trn sng Hu. Thng thc sn phm lm t c thc lc cm, tri nghim massage chn bng c c vy.\r\nNh vn Cng Minh - tr ti lm bnh v thng thc nhng chic bnh l mt thm mi go, mi l, chm vi nc ct da bo ngy.\r\nTn tay  bnh xo vng m, thm nc ti nh Thnh t, cun rau xanh, chm nc mm chua ngt  tri nghim dn d nhng kh qun!\r\nTri nghim Thc n bay c trng - mi nh mt mn ngon ch c  Cn Sn:\r\nm thc khn hoang cng c lc nng trui.\r\nc bit lu C t  nu vi tri bn - mn n c phc dng t kho tng m thc dn gian xa mang m v hng ng gi ni.\r\nTham quan vn tri cy c sc theo ma: nhn long, chm chm, v sa, i, bi (mi ma mi tri).\r\nChim ngng cc tit mc \"C lc bay - C tr g\" v Xic ch c l.\r\nThng thc bnh phu th nhn mn (gii nht bnh ngon Nam B 2015) v sm sm gii nhit c trng quanh vn ha quyn cng nc ct gng thm ngon.\r\nCheck-in cng l sen siu to khng l. Tham quan, tm hiu v \"Vn ha Ghe xung Nam B\" v mua sm cc sn phm OCOP.\r\nQuay tr v thnh ph Cn Th, on tip tc tham quan:\r\nn th vua Hng - vi hnh tng trng ng cch iu 18 cnh cung iu khc hoa vn i din cho 18 i Hng Vng (khch tham quan n th trang phc ph hp vi ni th t, th Hai hng tun n th ng ca  bo tr)\r\nSau khi dng ba ti ti thnh ph Cn Th, Qu khch t do do ph m khm ph Ty  lung linh sc mu, ngm cnh cu Cn Th v m, check-in cu Tnh Yu.\r\nNgh m ti Cn Th','Ngy 1: Thnh ph H Ch Minh - Cn Th - Lng du lch cng ng Cn Sn Ngt lng c sn min sng nc\r\n','03 ba n (sng, tra, chiu)','T992-1844-2N1D'),(1734,2,'Xe n Qu khch ti khch sn khi hnh ra bn Ninh Kiu, xung thuyn du ngon trn sng Cn Th tri nghim ch ni Ci Rng - mt hnh thc hp ch c trng ti cc ng sng ca vng ng bng sng Cu Long.\r\non gh tham quan l h tiu Qu Ti - tm hiu cc cng on lm h tiu th cng truyn thng nh vo go, ngm, xay, phi, ct... v thng thc nhng mn n b dng c ch bin t sn phm h tiu ca l (chi ph t tc)\r\nSau khi dng chn tham quan v mua sm ti siu th c sn v qu lu nim Hng o, on khi hnh i Bc Liu tham quan:\r\nNh cng t Bc Liu - do k s ngi Php thit k vo nm 1919, y c xem l ngi bit th b th nht  Nam k lc tnh lc by gi. on nghe k v giai thoi vng son mt thi ca cu Ba Huy - ngi c mnh danh l Cng t Bc Liu. on thng thc mn n tinh hoa m thc Bc Liu Lu cng t trong khng gian sang trng.\r\nSau khi n tra, on khi hnh i C Mau. Trn ng i, on dng chn tham quan nh th Tc Sy - ni y gn lin vi nhng cu chuyn cm ng v cuc i ca cha Trng Bu Dip.\r\nn C Mau, on n ti ti nh hng a phng v nhn phng ngh ngi. Bui ti, Qu khch t do khm ph thnh ph C Mau v m.\r\nNgh m ti C Mau','Ngy 2: Cn Th - Ch ni Ci Rng - m chm trong khng gian Hoi C Vng Gi trong cn nh bc t - C Mau\r\n','03 ba n (sng, tra, chiu)','T992-1844-2N1D'),(1735,3,'on tr phng v khi hnh n t Mi. n ni, on di chuyn bng cano len li trong rng c, khm ph rng ngp mn ln th hai th gii vi h sinh thi a dng.\r\nTi t Mi, Qu khch chinh phc cc Nam t quc, khm ph Ct mc ta  quc gia GPS 0001; Pano biu tng mi C Mau; im cui ng H Ch Minh 2436Km; n th Cha Lc Long Qun v tng M u C; chinh phc Ct c t Mi - chim ngng v p cm o hn Khoai th mng nm gia bin ng.\r\non nghe hng dn cch la cua ngon v thng thc ba tra ti Khu du lch cng ng Hong Hn vi:\r\nCua nng mui tuyt - cm nhn v ngt t nhin ca tht cua ho quyn vi v mn mn ca mui tuyt v tnh  to nn mn n bt v v cng.\r\nKhng th thiu c thi li nng mui t, vp hp gng, c kho tri gic v ru tri gic tr danh...\r\non khi hnh i Bc Liu, tham quan:\r\nCha Xim Cn - vi sc vng lng ly cng hoa vn t m mang m du n Khmer Nam B.\r\nCnh ng in Gi - chim ngng v p nhng tua-bin gi khng l sng sng trn nn tri xanh.\r\nSau khi dng ba ti ti nh hng a phng, on nhn phng ngh ngi. Bui ti, Qu khch t do do ch m Bc Liu - khm ph cc gian hng qu lu nim v thng thc m thc c trng x Cng t.\r\nNgh m  Bc Liu','Ngy 3: C Mau - Say m Thc t Mi - Du lch in gi X Cng T\r\n','03 ba n (sng, tra, chiu)','T992-1844-2N1D'),(1736,4,'Sau ba sng, Qu khch tham quan:\r\nQung trng Hng Vng - hnh nh cy n km cch iu (cao 18,6 m) nhc c khng th thiu trong n ca ti t ci lng, biu tng vn ha ca tnh Bc Liu.\r\nKhu lu nim ngh thut n Ca Ti T Nam B v c nhc s Cao Vn Lu - mt cng trnh khi qut v thn th, s nghip ca c nhc s Cao Vn lu, ghi nhn cng lao v tn vinh nhng ng gp to ln ca ng cho ngh thut n ca ti t Nam b v l ngi sn sinh ra bn D c Hoi lang bt h.\r\non khi hnh i Sc Trng, thng thc ba tra vi c sn bn nc lo - mn n mang m du n vn ha m thc Sc Trng kt hp hi ha ca 2 dn tc Kinh - Khmer, go ST25.\r\non tip tc tham quan hai ngi cha ni ting:\r\nCha S Ln - cn c gi l \"cha Chn Kiu\" th hin c nt vn ha c o ca ngi Khmer cng cch thit k sng to t hng vn mnh chn c p trn cc cng trnh kin trc ca cha.\r\nCha Ptum Wngsa Som Rng - mt qun th kin trc Pht gio rng ln, gm nhiu cng trnh nh: Chnh in, ngi bo thp vn ngi m p ta cha Arun ti Thi Lan c bit, tng Pht Thch Ca nhp nit bn uy nghim vi kch thc chiu di 63 mt\r\non quay v thnh ph H Ch Minh, kt thc chng trnh ti im n ban u.\r\nLu : Chng trnh ca Vietravel l chng trnh trn gi, khng c p dng chnh sch min gim, u tin vo im tham quan (nu c) dnh cho tr em, ngi cao tui, ngi c cng vi cch mng v vy Vietravel s khng hon li phn chnh lch cho cc khch hng thuc din u tin ny.\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch sn c th  xa trung tm thnh ph vo cc ma Cao im.','Ngy 4: Vi vu x cng t nghe iu Hoi Lang - Sc Trng - Thnh Ph H Ch Minh\r\n','02 ba n (sng, tra)','T992-1844-2N1D'),(1737,1,'Qu khch tp trung ti im hn (S 3 Hai B Trng, Hon Kim, H Ni) trc 2 ting ri so vi gi bay. Xe ca Vietravel n Qu khch khi hnh ra sn bay Ni Bi p chuyn bay i  Nng. Xe v HDV n Qu khch v bt u hnh trnh tham quan:\r\nBn o Sn Tr, thm v l cha Linh ng  Ni c tng Pht B cao nht Vit Nam v thp hng cu nguyn.\r\nn tra, nhn phng ngh ngi, bui chiu on i tham quan:\r\nRng da By Mu: Qu khch s c tri nghim ngi thuyn thng tham quan khu rng da xanh mt gia khng gian yn bnh, c chim ngng tit mc ma thng, ua thuyn v thng thc c sn a phng\r\nPh c Hi An y l ph n lng p nht vo ban m.\r\nCha Cu Nht Bn, xy dng vo u th k 17, mt biu tng c o v rt thn thng ca ngi Hi An.\r\nHi Qun Qung ng, mt ni th cng ca ngi Qung ng  Trung Quc c lu gi n tn ngy nay, hng nm nhiu l hi vn c t chc ti ni y.\r\nNh c Phng Hng, ni c kin trc kt hp gia 3 nn vn ha Vit  Nht  Trung.\r\nC s sn xut trm hng v nghe chnh ngi dn bn a thuyt minh v cc cng on lm trm.\r\nBui ti, Qu khch t do ngh ngi tham quan theo lch trnh ring. Thng thc Show K c Hi An - mt trong nhng show thc cnh p nht th gii hoc   Show - a bn tm v min k c xa  (Chi ph v cng v i li t tc).\r\nNgh m ti  Nng.','Ngy 1:  NNG  RNG DA BY MU  HI AN\r\n','(n tra, ti)','T448-1673-4N3D'),(1738,2,'Qu khch n sng ti khch sn v t do ngh ngi, th gin ti khch sn hoc tham quan thnh ph bin  Nng vi la chn:\r\nKhu du lch B N - Sui M (chi ph cp treo & n tra B N t tc; xe ca cng ty s a Qu khch n Nh ga cp treo): Tn hng khng kh se lnh ca  Lt ti min Trung, on t do tham quan Cha Linh ng, Hm Ru Debay, vn hoa Le Jardin DAmour, Khu Tm linh mi ca B N ving n Lnh Cha Linh T, khu vui chi Fantasy Park\r\nCu Vng: T do chp hnh ti im tham quan siu hot ca  Nng.\r\nT do vui chi n gi xung Cp.\r\nBui ti, xe s n Qu khch i dng ba ti nh hng.\r\nSau , Qu khch t tc i do ph, thng thc c sn a phng; thng ngon cnh p ca  Nng v m nh: ngm nhn Cu Rng, Cu Tnh Yu, Cu Trn Th L, Trung Tm Thng Mi, Khu ph m thc, Caf - Bar - Disco\r\nNgh m ti  Nng.','Ngy 2:  NNG  Mt ngy t do\r\n','(n sng, tra t tc, ti)','T448-1673-4N3D'),(1739,3,'n sng ti khch sn. on tr phng v khi hnh i tham quan\r\nVn tng Apec: Nm bn b sng Hn t hp cng trnh bao gm khu cng vin cy xanh, thm c, li i b, vn do\r\nCu Tnh yu: Cu tnh yu   Nng c ly cm hng t nhng cy cu tnh yu ni ting trn th gii nh: , Php, Nga, c. y l ni minh chng, c hn cho cc i la,  ngha ca  kha tnh yu th hin mt tnh yu bn cht, vnh cu.\r\nSau ba tra, xe cng HDV a on di chuyn n Hu mng m.\r\non v khch sn checkin ngh ngi ti khch sn\r\nQu khch di chuyn n nh hng a phng dng cm ti. Sau khi nhn phng, Qu khch t do ngh ngi hoc Do Ph m: Tri nghim mt Hu v m khng h trm mc vi cc cng trnh tri theo chiu di lch s m nh mt thiu n tr trung khoc ln mnh b cnh sc mu cng trn nha sng vi ti Ph i b ven sng Hng hi ha vi v lung linh cu Trng Tin, tranh thu XQ, t do thng thc cc mn ng ph x Hu nh bnh m lc, ch Hu, ngm nhn thuyn rng ngc xui bn bn Ta Khm vng vng m vang iu h Hu. Khm ph khu ph Ty si ng v m vi nhiu qun x ng vui, nhng hng qu lu nim.\r\nNgh m ti Hu','Ngy 3:  NNG  HU\r\n','(n sng, tra, ti)','T448-1673-4N3D'),(1740,4,'Qu khch dng ba sng buffet ti khch sn. Qu khch t do i tham quan mua sm  lu nim cho ngi thn ti mt s ch ni ting ti Hu nh: Ch ng Ba, Ch An Cu, Ch Bn Ng,...\r\nSau khi khi tr phng on s n tra v tham quan:\r\ni Ni: Hong cung xa ca 13 v vua triu Nguyn, tham quan Ng Mn, in Thi Ha, T Cm Thnh, Th Miu, Hin Lm Cc, Cu nh, Bo tng C Vt Cung nh Hu,\r\nin Kin Trung: kt hp gia kin trc Phc Hng ca Chu u v cc cng trnh c Vit Nam. Tm hiu Php lam - Ngh thut trang tr tht truyn 200 nm triu Nguyn c ti sinh.\r\nCha Thin M: Ngi cha c xem l biu tng x Hu v l ni lu gi nhiu c vt qu gi khng ch v mt lch s m cn c v ngh thut.\r\nMua sm c sn M xng Thin H.\r\non khi hnh ra sn bay p chuyn bay v H Ni. n sn bay Ni Bi xe n on v li im hn ban u. Chia tay v hn gp li Qu khch trong nhng chuyn du lch tip theo.\r\n***\r\nLu :\r\n- Gi bay c th thay i theo thng tin cp nht ca hng khng  nhn vin giao dch c trch nhim bo li cho khch hng ngay khi nhn c thng bo (nu c).\r\n- Hnh trnh c th thay i th t im n ty vo iu kin thc t.\r\n- Lch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\n- Trong trng hp on gom di 10 khch th tour khng khi hnh. Cng ty s t vn cho Qy khch chuyn tour sang ngy khi hnh ln cn hoc thng bo chi ph pht sinh  khi hnh c on.\r\n- Khch Sn c th  xa trung tm thnh ph/bin vo cc ma Cao im.','Ngy 4: HU - I NI - CHA THIN M - H NI\r\n','(n sng, tra)','T448-1673-4N3D'),(1741,1,'Qu khch tp trung ti sn bay Tn Sn Nht (ga trong nc), Hng dn vin lm th tc cho on p chuyn bay n Cn o.\r\nn ni, xe v Hng dn vin a on theo con ng quanh co tri di hng cy xanh ni lin t sn bay v trung tm th trn, chim ngng cnh quan thin nhin ca ni cao hng v, xa xa l nhng hn o n hin trong sc xanh ca bin c \r\nQu khch tham quan cc Di tch Vn ha - Lch s ho hng:\r\nBo tng Cn o: ni trng by nhng k vt v nm thng lch s ho hng ca dn tc Vit Nam.\r\nDinh Cha o: ni sng v lm vic cc i cha o t nm 1862 - 1975.\r\nTri Ph Hi: tri giam ln v c nht ca h thng nh t Cn o.\r\nChung cp kiu Php (tri Ph Tng): khm ph h thng chung Cp kin c c xy dng n gia cc ta nh nh m cung.\r\nChung cp kiu M (tri Ph Bnh): vi cc dy phng giam nh hp v m thp c xy dng vo nm 1971. Ni y ch yu tra tn t nhn v tinh thn v cng l ni nhn c tin Si Gn gii phng u tin.\r\nBui chiu, Qu khch tham quan:\r\nAn Sn Miu: nghe k v giai thoi th phi Phi Yn vi cu ht ru ni ting Gi a cy ci v tri, rau rm  li chu i ng cay.\r\nNgm nhn v p ca h An Hi tham quan Vn Sn T - Ngi cha Pht gio duy nht  Cn o nh rc r trong bc tranh thy mc ca mi ngi  ti gia nn xanh ca rng cy c th\r\nBui ti, Qu khch ving m c Su ni ting linh thing v m.\r\nQu khch t do tn b khm ph Cn o yn bnh v m; thng thc c ph Cn Sn ngm cu tu 914 hoc kem da t Cn o thm ngon, cun khch.\r\nNgh m ti Cn o','Ngy 1: TP. HCM - Cn o Oai Hng\r\n','02 ba n (tra, chiu)','T777-7295-6N5D'),(1742,2,'Sau khi dng ba sng ti khch sn. Xe a Qu khch tham quan:\r\nMiu Hong T Ci: ngi miu con trai ca Vua Gia Long v Th Phi Hong Phi Yn, gn lin vi cuc bn tu ca Vua Gia Long trc s truy ui ca qun Ty Sn.\r\nTho thch tm bin ti bi bin m Tru: vi bi ct vng mn c bao quanh bi nhng khu rng nhit i, nh o hnh ch C, mt bn l vch ni v  gia l nhng hng cy tri di soi bng; tri nghim sn khonh khc my bay h cnh\r\nBui chiu, xe a Qu khch khm ph mt trong nhng cung ng bin p nht Cn o chim ngng Mi C Mp - nh Tnh Yu; tham quan Bi Nht - Khi nc xung s l thin mt bi tm vi ct trng mn; ghi li ton cnh ni non nn th ang dn chuyn mnh khi hong hn dn bung xung i dng bao la.\r\nNgh m ti Cn o','Ngy 2: Khm ph Cn o Thin ng Ca Bin\r\n','03 ba n (sng, tra, chiu)','T777-7295-6N5D'),(1743,3,'Qu khch dng ba sng ti khch sn, t do ngh ngi th gin v tm bin.\r\nQu khch khi hnh ra ra sn bay Cn o tr v TP. H Ch Minh, trn ng dng chn mua sm c sn ni ting Cn o nh ht bng, cc loi kh v hi sn ti ngon ti ca hng Hng Bin.\r\nChia tay Qu khch v kt thc chuyn du lch ti sn bay Tn Sn Nht.\r\nQu khch lu :\r\nGi bay ph thuc vo hng hng khng, s ba n ph thuc vo gi bay. Cc ba n c th hon i  ph hp vi chng trnh.\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t\r\ny l chng trnh du lch trn gi, Vietravel khng c trch nhim hon tr chi ph chnh lch cho cc khch hng thuc din min gim hoc i tng u tin nh tr nh, ngi ln tui, ngi c cng vi cch mng Chnh sch min gim, u tin (nu c) ch dnh cho khch l ca cc im tham quan.','Ngy 3: Cn o - TP. HCM\r\n','01 ba n (sng)','T777-7295-6N5D'),(1744,1,'Qu khch tp trung ti sn bay Tn Sn Nht (ga trong nc), Hng dn vin lm th tc cho on p chuyn bay n Cn o.\r\nn ni, xe v Hng dn vin a on theo con ng quanh co tri di hng cy xanh ni lin t sn bay v trung tm th trn, chim ngng cnh quan thin nhin ca ni cao hng v, xa xa l nhng hn o n hin trong sc xanh ca bin c \r\nQu khch tham quan cc Di tch Vn ha - Lch s ho hng:\r\nBo tng Cn o: ni trng by nhng k vt v nm thng lch s ho hng ca dn tc Vit Nam.\r\nDinh Cha o: ni sng v lm vic cc i cha o t nm 1862 - 1975.\r\nTri Ph Hi: tri giam ln v c nht ca h thng nh t Cn o.\r\nChung cp kiu Php (tri Ph Tng): khm ph h thng chung Cp kin c c xy dng n gia cc ta nh nh m cung.\r\nChung cp kiu M (tri Ph Bnh): vi cc dy phng giam nh hp v m thp c xy dng vo nm 1971. Ni y ch yu tra tn t nhn v tinh thn v cng l ni nhn c tin Si Gn gii phng u tin.\r\nBui chiu, Qu khch tham quan:\r\nAn Sn Miu: nghe k v giai thoi th phi Phi Yn vi cu ht ru ni ting Gi a cy ci v tri, rau rm  li chu i ng cay.\r\nNgm nhn v p ca h An Hi tham quan Vn Sn T - Ngi cha Pht gio duy nht  Cn o nh rc r trong bc tranh thy mc ca mi ngi  ti gia nn xanh ca rng cy c th\r\nBui ti, Qu khch ving m c Su ni ting linh thing v m.\r\nQu khch t do tn b khm ph Cn o yn bnh v m; thng thc c ph Cn Sn ngm cu tu 914 hoc kem da t Cn o thm ngon, cun khch.\r\nNgh m ti Cn o','Ngy 1: Tp.Hcm - Cn o Oai Hng\r\n','02 ba n (tra, chiu)','T777-7949-2N1D'),(1745,2,'Qu khch dng ba sng ti khch sn, t do ngh ngi th gin v tm bin.\r\nXe n tin ca khch sn a du khch ra sn bay Cn o  tr v TP. H Ch Minh.\r\nLu : Ngy 2 tin sn bay khch s t tc lm th tc ti sn bay.\r\nQu khch lu :\r\nGi bay ph thuc vo hng hng khng, s ba n ph thuc vo gi bay. Cc ba n c th hon i  ph hp vi chng trnh.\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t\r\ny l chng trnh du lch trn gi, Vietravel khng c trch nhim hon tr chi ph chnh lch cho cc khch hng thuc din min gim hoc i tng u tin nh tr nh, ngi ln tui, ngi c cng vi cch mng Chnh sch min gim, u tin (nu c) ch dnh cho khch l ca cc im tham quan.','Ngy 2: Cn o - TP. HCM\r\n','01 ba n (sng)','T777-7949-2N1D'),(1746,1,'Qu khch tp trung ti sn bay Tn Sn Nht (Ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n Qu khch i H Ni. Xe a Qu khch i tham quan:\r\nHong thnh Thng Long - qun th cng trnh kin trc  s c cc triu vua xy dng trong nhiu giai on lch s v tr thnh di tch quan trng bc nht trong h thng cc di tch Vit Nam.\r\nVn Miu - ni th Khng T v cc bc hin trit ca Nho Gio, Quc T Gim - trng i hc u tin ca Vit Nam, tm v ci ngun lch s ca cc v Nho hc.\r\nQu khch nhn phng khch sn ngh ngi hoc t do do 36 ph phng H Ni, tri nghim khng gian si ni, no nhit ti Ph T Hin hay tm mt gc vi ly c ph quan st ph c hn cng rt th v.\r\nNgh m ti H Ni  ','Ngy 1: SB Ni Bi - H Ni | S ba n: 02 (tra, chiu)','(sng, ti)','T001-7918-4N3D'),(1747,2,'Qu khch dng ba sng v tr phng khch sn. Xe khi hnh a Qu khch i tham quan H Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc.\r\nTip tc hnh trnh, xe khi hnh a Qu khch n thnh ph bin H Long qua ng cao tc Hi Phng  H Long, trn ng ngm cnh Bch ng Giang. n ni, Qu khch xung thuyn i du ngon Vnh H Long - thng cnh thin nhin tuyt p v v cng sng ng, c UNESCO cng nhn l di sn thin nhin Th gii nm 1994.\r\nng Thin Cung l mt trong nhng ng p nht  H Long. V p nguy nga v lng ly bi nhng lp thch nh v nhng lung nh sng lung linh.\r\nT trn tu ngm nhn cc hn o ln nh trong Vnh H Long: Hn G Chi, Hn L Hng.\r\nTham quan mua sm c sn ti Trung Tm OCOP Central H Long vi nhiu mt hng hi sn ti, kh, ch mc,  t cht lng theo tiu chun OCOP.\r\nQu khch nhn phng khch sn ngh ngi hay t do khm ph nhiu hot ng dch v gii tr si ni ti ph c Bi Chy - nm cnh cng vin Sun World H Long t nhng m thc ng ph n cc qun c ph siu d thng nh Hn Gai Coffee & Lounge hay thoi mi bung xa ti The Mini Bar, Brothers Pub,..\r\nQu khch t do ngh ngi ti khu ngh hoc la chn tham gia vo mt trong cc hnh trnh sau (chi ph di chuyn v tri nghim t tc):\r\nTri nghim dch v Cp Treo N Hong ti Sun World H Long Complex trn Ni Ba o, chim ngng cnh p v m ca thnh ph H Long di nh n lung linh (thi gian hot ng cp treo d kin t 10h n 18h cc ngy th 7 v CN).\r\nNgh m ti H Long','Ngy 2: H Ni - H Long | S ba n: 03 (sng, tra, chiu)','(sng, ti)','T001-7918-4N3D'),(1748,3,'Qu khch dng ba sng ti khch sn. Xe a Qu khch i tham quan:\r\nBo Tng Qung Ninh v chp hnh bn ngoi Cung C Heo - Cung Quy Hoch, Hi Ch, Trin Lm V Vn Ha Qung Ninh, dng nh  tr thnh im n n tng trong du khch vi li kin trc c o.\r\nTip tc hnh trnh, Qu khch khi hnh i Ninh Bnh - vng t mnh danh l Ni m n, chn mong v vi nhiu di tch vn ha, thin nhin v cng c sc. n ni, Qu khch tham quan:\r\nCha Bi nh - mt qun th cha vi nhiu k lc Vit Nam nh pho tng pht Di Lc bng ng nng 80 tn, hnh lang vi 500 tng v La Hn, ta Bo Thp cao 99m\r\nDng cm ti v nhn phng khch sn ngh ngi. Bui ti, Qu khch t do khm ph Ph c Hoa L, mt khng gian check-in c, p, trm mc p tr nn lung linh, huyn o hn vi sc mu ca nhng chic n lng v Bo Thp trn H K Ln; tri nghim nhiu hot ng tr chi dn gian v nhiu loi hnh vn ha ngh thut t dn tc nh ma ri nc, nhy ma Tc Xnh, ht xm,.. n nhng bui trnh din acoustic s c din ra vo cc bui ti ngy cui tun.\r\nNgh m ti Ninh Bnh','Ngy 3: H Long - Ninh Bnh | S ba n: 03 (sng, tra, chiu)','(sng, ti)','T001-7918-4N3D'),(1749,4,'Qu khch dng ba sng v tr phng khch sn. Xe a Qu khch i tham quan:\r\nKhu Du Lch Trng An - Qu khch ln thuyn truyn thng i tham quan thng cnh h thng ni  vi hng v v cc thung lng ngp nc, thng vi nhau bi cc dng sui to nn cc hang ng ngp nc quanh nm. im xuyn trong khng gian hoang s, tnh lng l hnh nh ru phong, c knh ca cc mi nh, n, ph nm np mnh di chn cc dy ni cao.\r\nTuyt Tnh Cc - nm gia mnh t c  Hoa L (Ninh Bnh), ng Am Tin n mnh gia lng chng ni c mnh danh l thin ng ni h gii v c gii tr gi l Tuyt Tnh Cc Vit Nam.\r\nXe khi hnh a Qu khch ra sn bay Ni Bi lm th tc n chuyn bay v TP.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\n  KT THC CHNG TRNH, TM BIT QU KHCH!\r\n  *Lu  :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\n Lch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.','Ngy 4: Ninh Bnh - SB Ni Bi | S ba n: 02 (sng, tra)','(sng, ti)','T001-7918-4N3D'),(1750,1,'Qu khch tp trung ti Sn bay Tn Sn Nht, ga i trong nc. Hng dn vin lm th tc cho Qu khch chuyn bay chiu pht i Ph Quc. Xe n on ti sn bay a v khch sn nhn phng ngh ngi ti Ph Quc.\r\nNgh m ti Ph Quc','Ngy 1: Thnh ph H Ch Minh - Ph Quc - Show Din Sc Mu Venice\r\n','01 ba n (chiu)','T991-3797-2N1D'),(1751,2,'Sau khi dng ba sng, Qu khch s n khm ph Vinpearl Safari Ph Quc - Vn th hoang d u tin ti Vit Nam: vi quy m 180 ha, hn 130 loi ng vt qu him, du khch thng thc cc chng trnh biu din, chp nh vi ng vt; tri nghim vn th m trong rng t nhin, gn gi v thn thin vi con ngi.\r\nBui chiu, Qu khch tham quan khu vui chi gii tr VinWonders - cng vin ch  ln nht Vit Nam, quy m hng u Chu , Qu khch khm ph\r\nTri nghim 12 nn vn minh nhn loi t c ch kim;\r\nKhm ph 06 phn khu cng vin ch  vi hn 100 hot ng gii tr siu c l;\r\nCung nhit ti cng vin nc ln nht ng Nam ;\r\nChinh phc 20 tr chi mo him khng nht hnh tinh nh ng trt nhanh nht th gii Cn thnh n ca Zeus, ng trt kh Cuc chin Chn tinh cao 15m u tin ca Vit Nam, ng trt trong nh ti Chin binh i bng v Li nguyn c long - tr chi tng tc trong nh ti u tin ca Vit Nam,\r\nChong ngp trc th gii i dng huyn o vi tm nhn v cc qua tm knh acrylic khng l 8x25m bn trong Cung in Hi vng - thy cung hnh ra ln nht th gii;\r\nNg ngng vi show din triu  Once ng cp th gii.\r\nQu khch Thng thc ba tic nh sng nh cao vi show din Sc mu Venice\r\nNgh m ti Ph Quc.','Ngy 2: Vn th bn hoang d Vinpearl Safari - Vui chi tha thch ti cng vin ch  Vinwonders Ph Quc\r\n','03 ba n (sng, tra, chiu)','T991-3797-2N1D'),(1752,3,'Sau khi dng ba sng, Qu khch tr phng v khi hnh tham quan Grand World\r\nCng vin Ngh Thut ng i - s giao thoa c sc gia ngh thut ng i v thin nhin o Ngc.\r\nHuyn thoi Tre - cng trnh tre ln nht Vit Nam.\r\nTn b bn dng knh o Venice v nhn ngm nhng chic thuyn Gondola, khu ph shophouse lng ly sc mu, cng lu i trng l, ba cy cu vm bn nguyt mang m kin trc chu u ...\r\nTham quan bo tng Gu Teddy - lu gi nhiu hin vt qu gi v ti hin chuyn phiu lu hi hc ca nh thm him ti ba Teddy Jones (chi ph t tc)\r\non tip tc hnh trnh tham quan:\r\nDinh Cu - biu tng vn ho v tn ngng ca o Ph Quc. Ni ng dn a phng gi gm nim tin cho mt chuyn ra khi nh bt y p c khi tr v. Sau , on ving Dinh B Thy Long Thnh Mu - th Thn N Kim Giao, ngi ph n c ngi dn Ph Quc rt mc tn knh v c cng khai ph huyn o ny.\r\nMua sm c sn ni ting ti nh thng nc mm Hng c 1 / Khi Hon / Phng Hng, c sn c Thnh, c s sn xut ngc trai Ph Quc - trng by cc trang sc bng ngc trai chnh hiu c nui cy ti Ph Quc.\r\nXe a Qu khch ra sn bay Ph Quc p chuyn bay tr v TP H Ch Minh. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.','Ngy 3: Ph Quc - Grand World - Tp H Ch Minh\r\n','02 ba n (sng, tra)','T991-3797-2N1D'),(1753,1,'05h30 sng: Xe v hng dn vin Vietravel n Qu khch ti 60 Lc Hng, phng Vnh Lc, thnh ph Rch Gi, Kin Giang, sau  on khi hnh i Cn Th. Qu khch dng im tm sng trn ng i, n Cn Th on tham quan:\r\nThin vin Trc Lm Phng Nam - Qu khch va c th vn cnh thin vin, va c th check-in  rt nhiu hng mc p ti thin vin nh khu vc thp trng, khu vc tng cc v La Hn, 33 ng ha thn B Tt, khng gian mit vn  khu vc sinh hot, khu vc vn cy nh i din T in\r\nKhu du lch sinh thi M Khnh - chim ngng v tham quan kin trc ca cc gian nh c Nam B; khm ph quy trnh lm v thng thc cc mn c sn  nhng lng ngh truyn thng; tham quan v thng thc vn cy tru qu. Tri nghim mt s hot ng vui chi th v ti M Khnh. Qu khch dng ba tra ti khu du lch M Khnh.\r\nBui chiu: xe a Qu khch tham quan Cn nh mu tm - a im thng thc c ph, phim trng chp nh hot nht hin nay. ng nh tn gi, t cn nh, chi tit trang tr n chic xe p, xch u, gh ngi ni y u trn ngp sc tm. Ngoi ra, bn trong ngi nh c bi tr theo kiu nh trung lu Nam b thu xa vi nhng vt dng nhum mu thi gian, gi nh, gi thng cho bao ngi nh v bnh tch bng tri da kh, radio, cy n du ng khi tri bp hay thoi quay s.\r\n\r\nBui ti: Qu khch t do tham quan  khm bn Ninh Kiu, tng i H Ch Tch, cu Tnh Yu, mua sm ti thnh ph Cn Th.\r\nNgh m ti Cn Th','Ngy 1: Rch Gi - Cn Th - M Khnh - Cn nh mu tm\"\r\n','03 ba n (sng, tra, chiu)','T991-4523-2N1D'),(1754,2,'05h30 sng: Qu khch xut pht i tham quan Ch ni Ci Rng - mang nt c trng chung ca cc khu ch ni min Ty l nm ngay ng 3 sng (nhnh sng Ci Rng v sng Hu). n ch lc ny, Qu khch khng nhng s c ha mnh vo khng kh si ni, tp np k mua ngi bn m cn c c hi chim ngng bc tranh ch ni tuyt p khi bnh minh l rng. Qu khch thng thc im tm sng trn ch ni v tm hiu v cuc sng ngi dn thng hi\r\nSau , Qu khch i tham quan c s sn xut ko da, l sn xut h tiu min Ty, vn tri cy - tha thch thng thc v check-in ti vn (ty theo ma, Qu khch c th thng thc cc loi tri cy khc nhau). Sau khi dng ba tra ti vn, Qu khch khi hnh v li Rch Gi, kt thc chng trnh du lch v hn gp li Qu Khch.','Ngy 2: Cn Th - Ch ni Ci Rng - Vn tri cy - Rch Gi\r\n','02 ba n (sng, tra)','T991-4523-2N1D'),(1755,1,'Hng dn vin Vietravel n khch ti bn tu Rch Gi, sau  on lm th tc xung tu i Hn Sn thi gian d kin 07h30 - 09h00.\r\n  09h00: Tu cp bn, Qu khch di chuyn n nh ngh gi . on tip tc di chuyn bng xe my n bi tm Cy Da Nm - mt trong nhng bi tm p nht Hn Sn. n y ln nc trong vt cng bi ct mn sch s n cho du khch, ho cng ting sng v r ro, nhng hng da nghing nh ang nm ta lng trn ct m ra mt khung cnh tuyt vi nh mt bc tranh.\r\nTra: Qu khch dng ba tra, sau  nhn phng ngh ngi.\r\n14h30: on ln tu tham quan chng trnh cu c ln ngm san h ti Hn Sn, Qu khch s c thng thc cho mc trong hnh trnh cu c.\r\n18h00: on thng thc ba ti BBQ m p vi nhiu mn hi sn phong ph. Tham gia chng trnh ht vi nhau.\r\nNgh m ti Hn Sn','Ngy 1: Rch Gi - Hn Sn - Cu c & ln ngm san h\r\n','02 ba n (tra, chiu)','T991-3452-6N5D'),(1756,2,'06h30: Dng ba sng cng cc mn n c ch bin vi nc dng m  v hi sn, sau  on i theo cung ng ln ni, ngm nhn ton cnh o Hn Sn. Trn ng i on tham quan, chp nh sui  bc thang. Tip tc dng chn ti nh Yn Nga  Qu khch chp hnh v ngm nhn ton b Hn Sn t trn cao.\r\nTip tc di chuyn n tham quan dinh ng Nam linh thing, y l ni din ra L hi Nghinh ng Hn Sn vo ngy 15 v 16/10 m Lch hng nm.\r\nCheck-in chp hnh vi cc bi bin p v rt hoang s nh bi  Bng, bi  Chi - s hu nhng hnh th c sc v k th khng ni no c c. \r\n10h15: on dng ba tra vi nhng mn hi sn thm ngon, hp dn.\r\n11h00: Qu khch chun b hnh l v n chuyn tu cao tc (d kin 12h45 - 14h15) khi hnh v cng Rch Gi, kt thc chng trnh du lch. Chia tay v hn gp li Qy khch.','Ngy 2: Hn Sn - Rch Gi\r\n','02 ba n (sng, tra)','T991-3452-6N5D'),(1757,1,'06g30 on tp trung ti im hn trm dng chn Cao tc Long Thnh  Du Giy (nh v a im BTC s cung cp c th trong nhm). T tc n sng.\r\n07g30 Qu khch lm L Xut Pht  khi hnh chuyn Caravan v vi thin nhin. Trn ng i Qu khch s dng b m chia s kinh nghim ca cc dng xe v cc cu chuyn vui trn ng.\r\n09g30 on check-in tham quan vn ca cao Trng c - tm hiu v qu trnh xut hin cy ca cao ti Vit Nam, chp hnh check-in v thng thc ca cao.\r\n11g30 on dng ba tra ti nh hng KDL Sui M, nh Qun.\r\n13g30 Qu khch nhn phng, t do ngh ngi.\r\n16g00 - 17g30 on tri nghim p xe khm ph cung ng i tm chn bnh yn ca ngi dn Nam Ct Tin tham quan cnh ng la, vn bi da xanh theo ma v check-in cy cu treo kt ni 2 tnh ng Nai-Lm ng.\r\n19g00 Qu khch tri nghim BBQ, sum hp bn nh la tri, cng nhau ca ht v chia s nhng cu chuyn ca mt ngy b ph v rng\r\nQu khchngh m ti khu vc Nam Ct Tin.','Ngy 1: Vn Ca Cao - i Ngn Nam Ct Tin Sng Trn Vi Thin Nhin\r\n','02 ba n (tra, chiu)','T775-7393-7N6D'),(1758,2,'08g00 - 09g30on dng im tm sng v t do th gin ti khch sn.\r\n09g30 - 11g30Tri nghim hnh trnh xuyn Rng Quc Gia Ct Tin - ni c mnh danh l L Phi Xanh Ca Vng ng Nam B. M ra trc mt chng ta l nhng cnh rng nguyn sinh xanh mt, ting chim rng ht, r ro ca dng sui m. Nhng cnh vt v m thanh khin nhng mt mi tan bin, ch cn cm gic th thi, bnh yn.\r\nQu khch khm ph nhng im nhn c o trong Vn Quc Gia nh:\r\nCy Tung c th\r\nBng Lng 5 ngn\r\nGhnh Bn C\r\nCy G Bc ng 700 nm tui\r\nCy a Lc Giao\r\n11g30 on quay v khch sn lm th tc tr phng\r\n12g30 Qu khch dng ba tra\r\n14g00  18g30 on khi hnh v li TP. H Ch Minh. Kt thc hnh trnh, Hng dn vin chia tay on v hn gp li Qu khch trong nhng chng trnh c sc khc!\r\nLU :\r\nQu khch n im tp trung ng gi  kim tra xe + dn decal / S xe trc khi xut pht.\r\nTy Thi Gian Sm Hoc Tr Caravan S Linh ng Sp Sp Thay i Theo Tnh Hnh Thi Tit Thc T Ca Chuyn i Vn m Bo Cc im Tham Quan Theo Chng Trnh','Ngy 2: Lng Nghe Rng Ct Tin K Chuyn\r\n','02 ba n (sng, tra)','T775-7393-7N6D'),(1759,1,'Qu khch tp trung ti sn bay Tn Sn Nht (ga trong nc), hng dn lm th tc cho Qu khch p chuyn bay i H Ni. n sn bay Ni Bi, xe a Qu khch khi hnh theo cao tc H Ni - Lo Cai a Qu khch n ph ni Sapa. Trn ng, Qu khch dng cm tra ti nh hng a phng.\r\nn Sapa, nhn phng ngh ngi. Bui chiu qu khch thm:\r\nBn Ct Ct p nh mt bc tranh gia vng ph c Sapa, ni y thu ht du khch bi cu treo, thc nc, gung nc v nhng mng mu hoa m hoc du khch khi lc bc n y. Thm nhng np nh ca ngi Mng trong bn, du khch s khng khi ng ngng trc v p bnh d, mc mc.\r\nThng thc chng trnh biu din vn ngh c sc ca ngi dn a phng din ra vo cc thi im c nh trong ngy.\r\nBui ti, Qu khch do ph, ngm nh th  Sapa, t do thng thc c sn vng cao nh: tht ln cp nch nng, trng nng, ru to mo, giao lu vi ngi dn tc vng cao.\r\nNgh m ti Sapa','Ngy 1: Sn bay Ni Bi (H Ni) - Sapa - Bn Ct Ct\r\n','02 ba n (tra, chiu)','T001-9791-4N3D'),(1760,2,'Qu khch dng im tm sng v tr phng khch sn. Xe a on ra Sun Plaza, Qu khch tri nghim n khu du lch Fansipan Legend bng Tu ha leo ni Mng Hoa hin i nht Vit Nam vi tng chiu di gn 2000m, thng ngon bc tranh phong cnh y mu sc ca cnh rng nguyn sinh, thung lng Mng Hoa.\r\nChinh phc nh ni Fansipan vi  cao 3.143m hng v bng cp treo (chi ph t tc).\r\nL Pht ti cha Trnh hay cu phc lc, bnh an cho gia nh ti Bch Vn Thin T trong h thng cnh quan tm linh trn nh Fansipan.\r\nTip tc hnh trnh, Qu khch dng cm tra v tham quan:\r\nChinh phc o  Quy H - con o p, hng v v di nht trong T i nh o min Bc.\r\nQu khch khi hnh i Lo Cai dng cm chiu ti nh hng a phng v nhn phng khch sn ngh ngi. Bui ti, Qu khch t do khm ph Lo Cai v m.\r\nNgh m ti Lo Cai\r\nLu :\r\nTrong trng hp, Fansipan khng hot ng chng trnh s c thay th bng im tham quan Cu Knh Rng My (khng bao gm v tham quan).\r\nChng trnh tng v tri nghim tu ha Mng Hoa s khng c hon li chi ph v khng thay th dch v khc trong trng hp Qu khch khng tham gia hoc phi hy do iu kin khch quan v thi tit, cung ng, thng bo t n v cung ng.','Ngy 2: Sapa - Fansipan Legend -  Quy H - Lo Cai\r\n','03 ba n (sng, tra, chiu)','T001-9791-4N3D'),(1761,3,'Qu khch dng im tm sng v t do ngh ngi ti khch sn n gi tr phng. Qu khch s c thi gian khm ph v tri nghim s nhn nhp ca Lo Cai. T do mua sm ti:\r\nCh Cc Lu: c coi l mt trong nhng trung tm thng mi ln nht ca tnh. y l ni thu ht ng o du khch trong v ngoi nc n tham quan v mua sm. Qu khch c th mua c cc sn phm c trng ca a phng v lm qu cho gia nh.\r\nQu khch t do khm ph m thc a phng v mua sm ti gi nhp on t H Khu v  cng v li H Ni. Xe v HDV khi hnh a Qu khch v li H Ni tham quan H Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc.\r\non dng ba chiu v nhn phng khch sn ngh ngi.\r\nBui ti, Qu khch c th t do khm ph H Ni 36 ph phng v m.\r\nNgh m ti H Ni','Ngy 3: Lo Cai - H Ni\r\n','02 ba n (sng, chiu, n tra t tc)','T001-9791-4N3D'),(1762,4,'Xe khi hnh a Qu khch ra sn bay Ni Bi lm th tc n chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n*Lu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.','Ngy 4: H Ni - Sb Ni Bi - Tp.HCM\r\n','01 ba n (n sng hp mang i)','T001-9791-4N3D'),(1763,1,'Qu khch tp trung ti Sn bay Tn Sn Nht, ga i Trong Nc, hng dn vin h tr lm th tc p chuyn bay i Ph Quc. Xe n on ti sn bay a Qu khch khi hnh tham quan:\r\nDinh Cu: biu tng vn ho v tn ngng ca o Ph Quc. Ni ng dn a phng gi gm nim tin cho mt chuyn ra khi nh bt y p c khi tr v.\r\nCha S Mun (Hng Long T): ngi cha c kin trc dn gian, nm trn trin ni, mt hng ra bin, xung quanh cy ci xanh tt. n y du khch cm nhn v p thanh tnh, bnh yn v cu nguyn s an lnh v hnh phc n vi gia nh.\r\nTm bin Bi Sao: nm  pha Nam o - mt bi bin du m, bi ct di tnh lng v nguyn s ni o xanh. Ti y Qu khch s tht s cm thy yn bnh, th thi v dng nh cuc sng chm li khi ha mnh cng thin nhin.\r\nBui ti, Qu khch t do do ch m Ph Quc thng thc hi sn (chi ph t tc).\r\nNgh m ti Ph Quc','Ngy 1: TP. H Ch Minh - Ph Quc\r\n','02 ba n (tra, chiu)','T991-3413-4N3D'),(1764,2,'Sau khi n sng, xe a on n n nh ga cp treo An Thi tham quan Sun World Hon Thom Nature Park vi nhng hot ng th v:\r\nTri nghim cp treo 3 dy vt bin di nht th gii - 7.899.9 mt.\r\nPhn khch tt  cng th thch \"Mc X thnh n\" - tr chi tu ln bng g u tin ti Vit Nam, c tc  ti a 80km/h vi nhiu gc ln ngon mc; i quan st \"Mt i bng\" cao 120m - du khch nh c bay ln khng trung, thng ngon i dng xanh ngt bao la, nhng cnh rng nhit i xanh mt, nhng o nh nhp nh gia bin tri khong t (tr chi c th tm dng v lch bo tr)\r\nVui chi ti cng vin nc Aquatopia: mt trong nhng cng vin nc ch  hng u ng Nam , tri nghim 6 khu check-in ch  hp dn mang phong cch th dn huyn b.\r\nTm bnh yn trong hnh trnh i Theo nh Mt Tri ti Th trn Hong Hn - c thit k vi kin trc c o, rc r sc mu ca mt th trn chu u c knh:\r\nLng du trn con ng th trn, check-in 1001 kiu bc thang, ngm nhn Qung trng La M lp lnh di nh mai.\r\nSay p gia ngh thut ti Thp ng h cao 75m: ly  tng t thp chung St. Marks Campanile ca .\r\nThng thc tch tr B Tc kt hp cng nhng chic bnh ngt nh xinh, ngm nhn nhng tia nng cui ngy nhum vng mt bin cng Cu Hn  cy cu ni ln nh mt di la gia b bin vi hai nhp cu vn mnh m trn b ct trng, hng n nhau, hp vo lm mt th thng nht nhng khng chm nhau.\r\nNgh m ti Ph Quc','Ngy 2: Ph Quc - Hn Thm - Tri nghim cp treo vt bin - Cng vin nc Aquatopia - Th trn Hong Hn\r\n','03 ba n (sng, tra, chiu)','T991-3413-4N3D'),(1765,3,'Sau khi dng ba sng ti khch sn, Qu khch tr phng v tham quan:\r\nQun Th o Yn Ph Quc: ha vo khng gian xanh, du khch nghe gii thiu quy trnh s ch sn phm v mua sm c sn yn so b dng.\r\nTham quan v mua sm c sn ni ting ti Nh thng nc mm Hng c 1 / Khi Hon / Phng Hng, c sn c Thnh, C s sn xut ngc trai Ph Quc - Trng by cc trang sc bng ngc trai chnh hiu c nui cy ti Ph Quc.\r\nXe a on ra sn bay Ph Quc p chuyn bay tr v TP H Ch Minh. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\n*Lu :\r\nPh thu gi v tham quan i vi tr em di 12 tui cao trn 1m4\r\n- Combo Hn Thm: ph thu 300,000 VN/khch\r\ni vi cc khch khng ph thu khi mua tour, khi c pht sinh ti im tham quan, khch t chu chi ph pht sinh ti im tham quan.\r\n*Qu khch lu :\r\nGi bay ph thuc vo hng hng khng, s ba n ph thuc vo gi bay\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t\r\ny l chng trnh du lch trn gi, Vietravel khng c trch nhim hon tr chi ph chnh lch cho cc khch hng thuc din min gim hoc i tng u tin nh tr nh, ngi ln tui, ngi c cng vi cch mng Chnh sch min gim, u tin (nu c) ch dnh cho khch l ca cc im tham quan.','Ngy 3: Ph Quc - TP. H Ch Minh\r\n','01 ba n (sng)','T991-3413-4N3D'),(1766,1,'Qu khch tp trung ti sn bay Tn Sn Nht (Ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n Qu khch i H Ni nhn phng khch sn ngh ngi hoc t do i tham quan ph c H Ni.\r\nNgh m ti H Ni','Ngy 1: Tp. H Ch Minh - SB Ni Bi (H Ni)\r\n','t tc n ngy u tin','T001-2657-3N2D'),(1767,2,'Xe v hng dn vin Vietravel n on ti im hn, khi hnh cho hnh trnh Tinh hoa cc Bc - Sc mu vng cao - khm ph trn vn v p Vit Nam t kinh  ngn nm vn hin n a u T quc, vi nhng di tch vn ha lch s v cnh quan thin nhin hng v.\r\n07:30: n Qu khch ti im hn s 1 - Vietravel H Ni (03 Hai B Trng).\r\n07:45: n Qu khch ti im hn s 2 - Khch sn ti trung tm H Ni.\r\nXe khi hnh a Qu khch i Lng Sn tham quan:\r\nHong Thnh Thng Long: Mt qun th kin trc  ha c xy dng bi cc triu vua trong nhiu giai on lch s, ni y  tr thnh di tch quan trng bc nht trong h thng cc di tch Vit Nam v c UNESCO cng nhn l di sn vn ha th gii vo nm 2010. Qu khch c th tri nghim nh chp trong cc b trang phc c ca Vit Nam (chi ph thu trang phc t tc).\r\nQu khch s dng chn ngh ngi ti Trm dng ngh Hoa Hi, Chi Lng - khng gian thong ng v trng by nhiu sn vt a phng, c bit ni ting v tinh du hoa hi.\r\nThng thc cc c sn ni ting ca Lng Sn nh ph chua, vt quay, \r\nChp nh lu nim bn ct mc 1116 ti ca khu Hu Ngh (tn c l i Nam Quan), mt trong nhng ca khu quan trng trong giao thng vi Trung Quc  pha Bc.\r\nTip tc hnh trnh n thnh ph Cao Bng, Qu khch nhn phng khch sn ngh ngi v dng cm chiu. Vo bui ti, Qu khch c th t do do chi ti ph i b Kim ng (m ca vo th 6 v th 7 hng tun), mua sm cc c sn nh thch en, min dong, hng hng,... hoc th gin vi dch v massage chn, c vai gy.\r\nNgh m ti Tp. Cao Bng','Ngy 2: H Ni - Lng Sn - Cao Bng\r\n','03 ba n (sng, tra, chiu)','T001-2657-3N2D'),(1768,3,'Qu khch dng ba sng ti khch sn.\r\n7:30: Xe khi hnh, a Qu khch khm ph Cng vin a cht Non nc Cao Bng, di sn vn ha th gii c UNESCO cng nhn nm 2018. Hnh trnh s a Qu khch n vi nhng thng cnh ni ting:\r\nng Ngm Ngao: Chim ngng v p k o ca ng, c hnh thnh t qu trnh phong ha  vi hng triu nm, vi nhng di thch nh mun hnh vn trng, mang m du n vn ha ca ng bo Ty.\r\nLng  Khui Ky: m mnh trong khng gian yn bnh ca ngi lng  c hn 400 tui, ni nhng np nh sn c o c xy dng t nhng phin  t nhin.\r\nThc Bn Gic: Tn mt chim ngng v p hng v ca mt trong nhng thc nc p nht Vit Nam, ni dng Quy Sn hin ha chia i bin gii Vit - Trung.\r\nQu khch c th la chn tri nghim i thuyn trn dng sng Quy Sn, ngm nhn cnh sc hu tnh hai bn b Vit Nam - Trung Quc (chi ph t tc).\r\nGh thm c s sn xut dao Phc Sen, ni ni ting vi nhng sn phm dao rn th cng tinh xo.\r\nNi Mt Thn (Ni Thng): Ng ngng trc v p c o ca Ni Mt Thn, tuyt tc kin to a cht ca Non nc Cao Bng; ngm thung lng N Ma v lu li nhng khonh khc tuyt p ca thung lng vi sc xanh tho nguyn vo thng 4-5, hoc v p huyn o khi thung lng ngp nc vo thng 6 - 7.\r\nQu khch thng thc tinh hoa m thc Cao Bng ti nh hng a phng, vi nhng mn c sn tr danh nh thch en, g tim b ng ht dBui ti, Qu khch t do ngh ngi.\r\nNgh m ti Tp. Cao Bng','Ngy 3: Non nc Cao Bng - Trng Khnh\r\n','03 ba n (sng, tra, chiu)','T001-2657-3N2D'),(1769,4,'Qu khch dng ba sng v lm th tc tr phng khch sn.\r\n7:30 - 8:00: Xe v Hng dn vin n Qu khch, khi hnh n vi Cng vin a cht ton cu Cao nguyn  ng Vn, di sn vn ha th gii c UNESCO cng nhn nm 2010. Trn ng i, on dng chn tham quan:\r\nDc Khau Cc Ch: Chim ngng i dc 15 tng, mt trong nhng con dc him tr bc nht trn o M Pia.\r\non dng ngh ngi v dng ba tra ti nh hng a phng, thng thc hng v c trng ca ni rng ng Bc.\r\nTip tc hnh trnh, Qu khch khm ph vng Cao nguyn  k v ny qua 4 huyn pha Bc tnh H Giang: Mo Vc - ng Vn - Yn Minh - Qun B.\r\nLng vn ha du lch cng ng P Vi: Mt ngi lng yn bnh di chn o M P Lng. Ti y, qu khch c c hi chp hnh lu nim vi cng cho hnh dng chic khn Mng khng l, v chim ngng nhng homestay mang m nt vn ha c trng ca ngi Mng.\r\nChim ngng v p hng v ca Sng Nho Qu, Hm Tu Sn v o M P Lng, mt trong \"t i nh o\" ca vng ni pha Bc Vit Nam.\r\nCafe Panorama: Qu khch c tng combo v vo ca v nc ti Cafe Panorama, mt trong nhng im check-in \"cc chill\" nm trn nh o M P Lng, ni c tm nhn bao qut ton cnh Sng Nho Qu, Hm Tu Sn.\r\nChp hnh lu nim ti Tng i Thanh Nin Xung Phong v tham quan Bo tng Con ng Hnh Phc, ni lu gi nhng cu chuyn lch s ho hng.\r\nLa chn tri nghim (chi ph t tc):\r\nQu khch c th la chn tri nghim i thuyn trn sng Nho Qu, len li qua hm vc Tu Sn, hm vc su nht ng Nam ,  tn hng trn vn v p k v ca thin nhin (Gi v tham kho: 120.000 VN/ngi ln; 60.000 VN/tr em, bao gm thuyn v xe trung chuyn).\r\nn ng Vn, Qu khch nhn phng khch sn ngh ngi v thng thc m thc a phng \"gic m ca \", mn ch mn mn c trng ca vng cao nguyn . Bui ti, Qu khch t do do ph c ng Vn, giao lu vi ngi dn a phng, nhm nhi cc tr gng nng ti C Ph Ph C , hoc tri nghim ngm chn tho dc, massage th gin vi cao u Tu c trng.\r\nNgh m ti ng Vn','Ngy 4: Cao Bng - Mo Vc - ng Vn\r\n','03 ba n (sng, tra, chiu)','T001-2657-3N2D'),(1770,5,'Qu khch dng ba sng v lm th tc tr phng khch sn.\r\n7:00: Xe v Hng dn vin n Qu khch, tip tc hnh trnh khm ph Cao nguyn  ng Vn:\r\nChim ngng Ct c Lng C, ni qu khch c th phng tm mt ngm nhn nhng bn lng thanh bnh nh L L Chi, Thn P, v c bit l hai h nc nm i xng nhau, c ngi dn a phng v nh \"mt rng\".\r\nCheck-in ti im u Cc Bc, biu tng thing ling ni a u T quc, v ngm nhn dng sng Nho Qu un ln mm mi di chn ni.\r\nNgm v p th mng ca Con ng cy Sa Mc dc thn L L Chi n im Cc Bc, cng trnh Di xanh bin cng do du khch Vietravel v ngi dn a phng chung tay vun trng.\r\nThng thc ba tra m cng ti bn L L Chi, v lu li nhng khonh khc ng nh ti ngi nh Trng ng c o ca ngi L L.\r\n12:30: Xe tip tc a Qu khch n H Giang, trn ng dng tham quan:\r\nKhm ph Cng trnh kin trc ngh thut nh Vng, ngi dinh th hng trm tui vi li kin trc ngh thut c o v him c trn vng cao nguyn .\r\nn vi Lng Vn ha Lng Cm, thung lng Sng L, bi cnh ca b phim \"Chuyn ca Pao\" tng ot gii thng danh gi, ni qu khch c c hi tm hiu v vn ha c sc ca ngi Mng.\r\nNgm nhn ton cnh v p hng v ca Dc Thm M, v t do thng thc c ph ti y (chi ph nc ung t tc).\r\nChim ngng v p ca Ni i Qun B, biu tng ca vng cao nguyn  ng Vn.\r\nn ni, Qu khch thng thc mn c Bng, mt trong 121 mn m thc tiu biu ca Vit Nam nm 2022 v nhn phng khch sn ngh ngi. Bui ti, Qu khch c th t do do chi, thng thc c ph trn nh ni Cm, hoc thng thc mn cho u Tu c trng ca H Giang (chi ph t tc).\r\nNgh m ti Tp. H Giang','Ngy 5: ng Vn - Yn Minh - Qun B - H Giang\r\n','03 ba n (sng, tra, chiu)','T001-2657-3N2D'),(1771,6,'Qu khch dng ba sng v lm th tc tr phng.\r\n7:30: Xe khi hnh a Qu khch tham quan:\r\nChp hnh lu nim Ct mc Km0 - im khi u ca con ng Hnh Phc huyn thoi, ni lin H Giang vi bn huyn vng cao nguyn  - ni \"si  cng n hoa\".\r\nT do mua sm cc sn phm c sn OCOP a phng, nh tr Shan Tuyt, mang hng v ni rng v lm qu.\r\nTham quan Bo tng H Giang - bo tng s u tin ti H Giang, vi khng gian trng by n tng, c bit l m hnh ghp tn \"Bo tng H Giang\" ly hnh tng cc dy ni hnh vng cung m trn ly H Giang.\r\non dng ngh ngi v dng ba tra ti nh hng a phng, thng thc hng v m thc c trng ca Tuyn Quang.\r\nXe v Hng dn vin Vietravel tin khch ti hai im:\r\nim tin s 1: Sn bay Ni Bi, Hng dn vin hng dn khch khu vc nh hng v quy lm th tc check-in hng khng.\r\nim tin s 2: Vn phng Vietravel H Ni (03 Hai B Trng).\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n*Lu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.','Ngy 6: H Giang - Tuyn Quang - SB Ni Bi (H Ni)\r\n','02 ba n (sng, tra)','T001-2657-3N2D'),(1772,1,'Qu khch tp trung ti sn bay Tn Sn Nht (Ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n Qu khch i H Ni. Xe a Qu khch i tham quan:\r\nTrung tm Tinh hoa Lng Ngh Vit  mt im n c o ti hin khng gian lng ngh truyn thng.\r\nLn xe in do quanh lng c Bt Trng vi nhng con ng nh mang du n hn 1000 nm tui, ni mi sn phm u mang trong mnh hi th ca t, nc v i bn tay ti hoa ca nhng ngh nhn.\r\nCheck-in ti Qung Trng Bn Xoay, tham quan khng gian trng by gm Bt Trng xa v nay, khm ph qu trnh ch tc gm tinh xo ca 19 dng h lng ngh.\r\nTri nghim chng trnh Ti lm ngh nhn, t tay sng to sn phm gm mang du n ring.\r\nQu khch nhn phng khch sn ngh ngi v thng thc c sn ch c H Ni, mn n tinh ty vi cng thc gia truyn kt hp cng mm tm B Hnh, bn Mch Trng - loi bn ni danh hn 2000 nm, tng c tin vua An Dng Vng. Bui ti, Qu khch t do do quanh H Hon Kim, nhm nhi cc bia ti khu ph Ty T Hin.\r\nNgh m ti H Ni\r\nMt s chng trnh gi : (cc chng trnh c ngy din ra c nh trong tun, Qu khch t tc phng tin v chi ph).\r\nHnh trnh 1: Gii M Hong Thnh Thng Long (Th 6, Th 7)\r\nTri nghim khng gian Hong Thnh v m vi nhiu hot ng hp dn:L dng hng, chp nh cng cc cung n v lnh canh trong trang phc c xa; Chim ngng trnh din ngh thut trn sn knh kho c oan Mn; Tham gia tr chi gii m vi hiu ng laze n tng v nhn nhng phn qu  ngha.\r\nHnh trnh 2: m Vn Miu  Quc T Gim (Th 4, Th 7)\r\nTri nghim cng ngh trnh chiu hin i, ti hin lch s v vn ha mt cch sng ng; to cho du khch cm gic m chm trong khng gian k o v lung linh ca Vn Miu v m.\r\nHnh trnh 3: m Thing Ling ti Nh T Ha L (Th 6, Th 7, Ch Nht)\r\nHnh trnh tr v qu kh, sng li nhng nm thng ho hng ca dn tc, v cm nhn ctinh thn bt khut ca nhng chin s cch mng qua nhng cu chuyn y xc ng.\r\nNgoi ra, nu i vo nhng ngy khc, Qu khch c th la chn:\r\nTour m n Ngc Sn  khm ph v p huyn b ca ngi n linh thing gia lng h Hon Kim.\r\nTour xe but 2 tng  tn hng khng kh v m, chim ngng ph phng H Ni rc r nh n.\r\nThng thc c sn H Ni nh: bn c ngui, ch ri, kem Trng Tin','Ngy 1: H Ni - Trung tm tinh hoa Lng ngh Vit\r\n','01 ba n (chiu)','T001-9335-4N3D'),(1773,2,'Xe v Hng dn vin Vietravel n Qu khch ti im hn, khi hnh n Ninh Bnh  vng t c mnh danh l Ni m n, chn mong v, ni ting vi nhng danh thng thin nhin hng v v cc di tch vn ha c sc.\r\n6:30 sng: n Qu khch ti im hn s 1 - Vietravel H Ni (03 Hai B Trng).\r\n7:15 sng: n Qu khch ti im hn s 2 - Khch sn\r\nn ni, Xe n khch ti Ga Ninh Bnh chuyn tu ng Hi - Ninh Bnh (khch t tc n sng v v sinh trn tu - chuyn tu d kin SE20 23:45 - 09:15) bt u hnh trnh tham quan:\r\nn vi Hp tc x Sinh dc, Qu khch thng tr Kim Ngn, nghe gii thiu v lch s v truyn thng s dng thuc Nam  dng sinh v tr bnh ca ngi dn a phng. Tri nghim quy trnh sn xut th cng ti nh sn xut x bng tho dc vi hng thm nng nn, nh sn xut mui tho dc (tng 1) v cc sn phm th cng m ngh (tng 2): tranh b ,  ph kin c trang.... c bit, Qu khch cn c c hi tri nghim t tay nu x bng tho dc. Ngoi ra, qu khch c th in hnh lu nim trn L B   gi li nhng k nim ng nh (chi ph in hnh t tc).\r\nNghing mnh trc Cha Bi nh, mt qun th kin trc Pht gio trng l mang n cho du khch cm gic trang nghim v thanh tnh. Ni y lu gi nhiu k lc Vit Nam nh pho tng pht Di Lc bng ng nng 80 tn, bc i trong hnh lang La Hn di hun ht vi 500 pho tng sng ng, v ngm nhn ta Bo Thp cao 99m, sng sng gia tri xanh.\r\nTi khu du lch Trng An, Qu khch s c tri nghim tuyt vi ln thuyn, th mnh trn dng sng Ng ng xanh bic, lt qua nhng hang ng k b, ngm nhn thin nhin hng v ca nhng ngn ni  vi cao vt v nhng thung lng nc mnh mang hin ra trc mt. Gia khng gian tnh mch, nhng mi nh, n, ph c knh, ph y ru phong, n mnh di chn ni, to nn mt bc tranh thin nhin tuyt m.\r\nQu khch nhn phng khch sn ngh ngi v tn hng ba tic d c sc tr danh ca vng t C  vi nhng mn n hp dn nh: d ti chanh, d n, d nhng m, nem d... (thc n c th thay i ty theo thc t).\r\nBui ti, Qu khch t do ngm Ph c Hoa L v m mang mt v p lung linh, huyn o, l ni du khch c th ha mnh vo khng gian vn ha truyn thng rc r mu sc: tri nghim tr chi dn gian v cc loi hnh ngh thut nh ma ri nc, nhy Tc Xnh, ht Xm,... hay Do thuyn trn h K Ln, thng tr, th n hoa ng, ngm ph c lung linh trong nh n (chi ph t tc).\r\nNgh m ti Ninh Bnh','Ngy 2: H Ni - Ninh Bnh: Tm v non nc C \r\n','03 ba n (sng, tra, chiu)','T001-9335-4N3D'),(1774,3,'Qu khch dng ba sng v lm th tc tr phng khch sn.\r\n07:30: Xe khi hnh a Qu khch n H Long, theo tuyn cao tc CT06-CT04, trn ng Qu khch c th chim ngng v p hng v ca Bch ng Giang. n cng tu Quc t H Long, Qu khch lm th tc ln thuyn, bt u hnh trnh du ngon Vnh H Long, di sn thin nhin th gii c UNESCO cng nhn nm 1994.\r\nHang Sng St: Khm ph mt trong nhng hang ng ln nht Vnh H Long, ni nhng khi thch nh k o to nn mt khng gian lung linh, huyn b.\r\nLng ngc trai Tng Su: Tm hiu quy trnh nui cy ngc trai cng phu, chim ngng v p lp lnh ca nhng vin ngc qu v tri nghim t tay khai thc ngc trai.\r\no Ti Tp: Tn hng ln nc trong xanh, mt lnh ti mt trong nhng bi bin p nht Vnh H Long (thi gian tm bin l tng t thng 5 n thng 8).\r\nDu ngon trn vnh: Ngm nhn nhng k quan thin nhin c o nh Hang B Nu, o Soi Sim, ng M Cung, hn u Ngi, hn Con Ra, hn Nga, hang Lun...\r\nSau chuyn du ngon, xe a Qu khch v khch sn, nhn phng ngh ngi v thng thc ba ti lu hi sn 9 tng c sc.\r\nBui ti, Qu khch t do khm ph \"ph c\" Bi Chy si ng, ni hi t nhng hot ng gii tr hp dn, t m thc ng ph c sc n nhng qun bar si ng Valley Beach Club. Hoc, Qu khch c th ha mnh vo khng gian cc qun c ph c o nh Thng Zeo, 1900, Luna.\r\nMt s chng trnh gi : (t tc phng tin v chi ph)\r\nCheck-in ngn hi ng Qung Ninh - ngm nhn khung cnh ni rng hng v i lp vi khung cnh bao la th mng ca Vnh H Long k o t trn cao. y cng l mt trong nhng im ngm hong hn p nht ang c cc du khch sn n.\r\nTri nghim dch v cp treo N Hong ti Sun World H Long Complex trn Ni Ba o - tng ot 2 ln k lc t t chc K lc Guinness th gii; chim ngng cnh p v m ca thnh ph H Long di nh n lung linh (thi gian hot ng cp treo d kin t 10h n 18h cc ngy th 7 v CN) hay check-in vi vng quay Mt tri Sun Wheel - mt trong nhng vng quay cao nht th gii.\r\nNgh m ti H Long','Ngy 3: Ninh Bnh - H Long : Hnh trnh ni hai di sn\r\n','03 ba n (sng, tra, chiu)','T001-9335-4N3D'),(1775,4,'Qu khch t do tham quan, mua sm hi sn ti ngon v sn vt a phng ti ch Ci Dm. Sau , dng ba sng v lm th tc tr phng khch sn.\r\n07:30 : Xe v Hng dn vin a Qu khch n vng t thing Yn T, ni c mnh danh l Vng t to nn Di Sn.\r\nCheck-in ti Lng Nng, ha mnh vo khng gian thanh tnh, yn bnh gia ni rng. Qu khch thng thc nhng mn n m  hng v a phng ti nh hng Cm Qu, mang n tri nghim m thc mc mc nhng y tinh t.\r\nTri nghim cp treo (chi ph t tc), a Qu khch bng qua nhng rng ni trng ip, thu trn vo tm mt khung cnh thin nhin hng v. Vo ma xun, i Lo Mai Vng n r, khoe sc rc r trn nh ni, to nn khung cnh ngon mc. Chim bi cha Mt Mi v cha Hoa Yn, ha mnh vo khng gian linh thing, lng ng trong s tnh ti v an nhin. Ni y tng l chn tu hnh ca Pht Hong Trn Nhn Tng, v t khai sng Thin phi Trc Lm.\r\nXe khi hnh a Qu khch ra sn bay Ni Bi lm th tc n chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n*Lu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.','Ngy 4: Yn T linh thing - Du n lng c\r\n','03 ba n (sng, tra, chiu)','T001-9335-4N3D'),(1776,1,'Qu khch tp trung ti sn bay Tn Sn Nht (ga trong nc), hng dn lm th tc cho Qu khch p chuyn bay i H Ni. n sn bay Ni Bi, xe a Qu khch khi hnh theo cao tc H Ni - Lo Cai a Qu khch n ph ni Sapa. Trn ng, Qu khch dng cm tra ti nh hng a phng.\r\nn Sapa, nhn phng ngh ngi. Bui chiu qu khch thm:\r\nBn Ct Ct p nh mt bc tranh gia vng ph c Sapa, ni y thu ht du khch bi cu treo, thc nc, gung nc v nhng mng mu hoa m hoc du khch khi lc bc n y. Thm nhng np nh ca ngi Mng trong bn, du khch s khng khi ng ngng trc v p bnh d, mc mc.\r\nBui ti, Qu khch do ph, ngm nh th  Sapa, t do thng thc c sn vng cao nh: tht ln cp nch nng, trng nng, ru to mo, giao lu vi ngi dn tc vng cao.\r\nNgh m ti Sapa','Ngy 1: Sn bay Ni Bi (H Ni) - Sapa - Bn Ct Ct\r\n','02 ba n (tra, chiu)','T110-3282-3N2D'),(1777,2,'Qu khch dng im tm sng v tr phng khch sn. Xe a on ra Sun Plaza, Qu khch tri nghim n khu du lch Fansipan Legend bng Tu ha leo ni Mng Hoa hin i nht Vit Nam vi tng chiu di gn 2000m, thng ngon bc tranh phong cnh y mu sc ca cnh rng nguyn sinh, thung lng Mng Hoa.\r\nChinh phc nh ni Fansipan vi  cao 3.143m hng v bng cp treo (chi ph t tc).\r\nL Pht ti cha Trnh hay cu phc lc, bnh an cho gia nh ti Bch Vn Thin T trong h thng cnh quan tm linh trn nh Fansipan.\r\nTip tc hnh trnh, Qu khch dng cm tra v tham quan:\r\nChinh phc o  Quy H - con o p, hng v v di nht trong T i nh o min Bc.\r\nQu khch khi hnh i Lo Cai dng cm chiu ti nh hng a phng v nhn phng khch sn ngh ngi. Bui ti, Qu khch t do khm ph Lo Cai v m.\r\nNgh m ti Lo Cai\r\nLu :\r\nTrong trng hp, Fansipan khng hot ng chng trnh s c thay th bng im tham quan Cu Knh Rng My (khng bao gm v tham quan).\r\nChng trnh tng v tri nghim tu ha Mng Hoa s khng c hon li chi ph v khng thay th dch v khc trong trng hp Qu khch khng tham gia hoc phi hy do iu kin khch quan v thi tit, cung ng, thng bo t n v cung ng.','Ngy 2: Sapa - Fansipan Legend -  Quy H - Lo Cai\r\n','03 ba n (sng, tra, chiu)','T110-3282-3N2D'),(1778,3,'Qu khch dng im tm sng v t do ngh ngi ti khch sn n gi tr phng hoc t do mua sm ti ch Cc Lu.\r\nVi Qu khch i H Khu th s lm th tc tr phng khch sn. Xe a Qu khch n Ca Khu Quc T Lo Cai, lm th tc xut cnh cho on sang th trn H Khu (Vn Nam, Trung Quc). Dc ng i hng dn vin gii thiu v cu H Kiu 1, H Kiu 2, ranh gii Vit Nam v Trung Quc, sng Hng, sng Nm Thi...\r\nSau khi Qu khch lm th tc nhp cnh xong, HDV a qu khch i tham quan :\r\nMt vng th trn H Khu v gh thm Cng vin Sn Lm, cn gi l Cng Vin nh Sng.\r\nMua sm  ti siu th Phc Tm, Bch Ho i Lu, cc dy ph Thng mi, ph Qung ninh, Ph Nhn dn... cc mt hng nh giy dp, qun o, ti xch,  gia dng v cc mn n vt ang c a thch nh Chn g cay, bnh ph mai, ht d mt ong, khoai ty trn\r\n11h30 Qu khch dng ba tra ti nh hng Trung Quc - thng thc nhng mn n c trng ca nc bn nh Vt quay, khu nhc, u ph T Xuyn\r\n13h00 Qu khch c mt ti ca khu  lm th tc nhp cnh v Vit Nam.\r\non v n Ca Khu Vit Nam.\r\nXe v HDV khi hnh a Qu khch v li H Ni tham quan H Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc.\r\non dng ba chiu v nhn phng khch sn ngh ngi.\r\nBui ti, Qu khch c th t do khm ph H Ni 36 ph phng v m.\r\nNgh m ti H Ni','Ngy 3: Lo Cai - H Khu - H Ni\r\n','03 ba n (sng, tra, chiu)','T110-3282-3N2D'),(1779,4,'Xe khi hnh a Qu khch ra sn bay Ni Bi lm th tc n chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n*Lu  :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.\r\n*Cc giy t cn thit  lm th tc Xut Nhp Cnh:\r\nH s khch s dng dch v: Cn c gi trc t nht 7 ngy lm vic ( t th 2  th 6, khng tnh th 7 ch nht)\r\n- i vi ngi ln: nh Chn Dung + nh chp Cn Cc Cng Dn/ Chng Minh Th\r\n- i vi tr em : (cha c cn cc cng dn): cn chp hnh chn dung + nh giy khai sinh + Bn sao cng chng giy khai sinh tr em + giy  ngh xut cnh c xc nhn ca cng an a Phng ni khch hng c tr (mu TK08).\r\n- T khai Xut Nhp Cnh ca tr em (mu TK08) cn c du  gip lai trn nh v ch k nhy ca cn b k xc nhn k nhy ln nh. V phi np bn gc cho Vietravel trc ngy khi hnh t nht 7 ngy lm vic (t th 2  th 6, khng tnh th 7, ch nht).\r\nc bit giy TK08, yu cu ph huynh cn k c 2 t:\r\n+ Mt bn c in y  thng tin theo mu km ch k ca ph huynh.\r\n+ Mt bn khng cn in thng tin, ch cn ch k ca ph huynh vo phn Ngi  ngh\r\n*i vi tr em di 14 tui khng i cng b m: Ph huynh cn lm giy y quyn (c xc nhn ca chnh quyn a phng). Ph huynh cn lm 2 bn, 1 bn gc np cho Vietravel, 1 bn mang theo khi i tour\r\nLu  khi lm t khai: phi ng du cn thn, du hin r rng khng nhe khng m, nn ch mc du kh ri hy b vo th gi i. Trng hp khch quan, qu khch khng lm c t khai Xut Nhp Cnh ( TK08) ca tr em cha c cn cc cng dn , Vietravel s hon li ph tham quan H Khu v 1 ba tra ( Ngi ln 700.000/ khch , tr em 350.000/ khch). Qu khch s t do tham quan v t tc ba tra ti Lo Cai ti gi nhp on.\r\nHng dn chp nh chn dung:\r\nYu cu: Chn ni c nh sng hi ha, u, khng chy sng hoc qu ti hoc sng khng u, chp sc nt (nn ng ni c tng n ng mu). Khi chp nhn thng ngi chp, vn ht tc  l r trn v h tai, khng eo knh v  trang sc, khng eo knh mt.\r\nKhong cch t ngi c chp ti my nh/ in thoi: 1 - > 1.5 m\r\n**Lu :\r\nChng trnh i H Khu ch p dng nhn khch c Cn cc cng dn (CCCD)/H chiu Vit Nam.\r\nTrng hp bt kh khng, c thng bo t chi xut-nhp cnh t pha cng an s ti, VTV s hon li chi ph tham quan H Khu v 1 ba tra (700k/ khch). Qu khch t do tham quan v t tc ba tra ti Lo Cai  ch on. Cc dch v v im tham quan khc trong tour vn s c tin hnh bnh thng.\r\nTrng hp qu khch c yu cu hy/ chuyn tour do khng c cp giy thng hnh, Vietravel s h tr hy/ chuyn tour theo quy nh hy/ chuyn tour ca Vietravel.','Ngy 4: H Ni - Sn bay Ni Bi - Tp.HCM\r\n','01 Ba sng (n sng hp mang i)','T110-3282-3N2D'),(1780,1,'Qu khch tp trung ti sn bay Tn Sn Nht (Ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n Qu khch i H Ni. Xe a Qu khch i tham quan:\r\nHong thnh Thng Long - qun th cng trnh kin trc  s c cc triu vua xy dng trong nhiu giai on lch s v tr thnh di tch quan trng bc nht trong h thng cc di tch Vit Nam.\r\nVn Miu - ni th Khng T v cc bc hin trit ca Nho Gio, Quc T Gim - trng i hc u tin ca Vit Nam, tm v ci ngun lch s ca cc v Nho hc.\r\nH Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc.\r\nQu khch nhn phng khch sn ngh ngi hoc t do i tham quan ph c H Ni.\r\nNgh m ti H Ni ','Ngy 1: SB Ni Bi - H Ni | S ba n: 02 (tra, chiu)','(sng, ti)','T222-5047-4N3D'),(1781,2,'Qu khch n sng v tr phng, xe khi hnh a Qu khch n thnh ph bin H Long qua ng cao tc Hi Phng - H Long, trn ng ngm cnh Bch ng Giang. n ni, Qu khch lm th tc check-in ln du thuyn cao cp - Resort trn Vnh H Long bt u hnh trnh tham quan 2 ngy 1 m:\r\nThng thc Welcome-drink v nghe cc thuyn vin thng bo chng trnh, hng dn cc quy nh an ton trn thuyn.\r\nThng ngon nhng khung cng tuyt p ca Vnh H Long - k quan thin nhin th gii: hn Trng Mi, hn Ch , nh Hng,\r\nQu khch tp trung ti quy l tn, cc thuyn vin s hng dn a Qu khch vo thm hang o Titop v tm bin - mt trong nhng o ni ting trong qun th Vnh H Long.\r\nTham gia lp hc nu cc mn n truyn thng Vit Nam\r\nThng thc khung cnh hong hn lng mn.\r\nHa mnh trong khng gian m cng lng mn ti nh hng - thng thc ba ti vi cc mn n thm ngon hp dn do chnh u bp trn tu thc hin.\r\nTh mnh th gin cng gi v sng bin m trn tng thng ca tu.\r\nNgh m trn du thuyn','Ngy 2: H Ni - H Long - Ng m trn du thuyn | S ba n: 03 (sng, tra, chiu)','(sng, ti)','T222-5047-4N3D'),(1782,3,'Qu khch thc dy vi bi hng dn tp Thi Cc Quyn trn tng thng ca tu. Thng thc ba sng nh (tr, c ph, bnh cookies, ph, m, bn, min ). Qu khch t do ngm cnh Vnh H Long v lm th tc tr phng, xung thuyn.\r\nXe n Qu khch ti cng khi hnh i Ninh Bnh - vng t mnh danh l Ni m n, chn mong v vi nhiu di tch vn ha, thin nhin v cng c sc. n ni, Qu khch tham quan Cha Bi nh, mt qun th cha vi nhiu k lc Vit Nam nh pho tng pht Di Lc bng ng nng 80 tn, hnh lang vi 500 tng v La Hn, \r\nDng cm ti v nhn phng khch sn ngh ngi. Bui ti, Qu khch t do khm ph Ph c Hoa L, mt khng gian check-in c, p, trm mc p tr nn lung linh, huyn o hn vi sc mu ca nhng chic n lng v Bo Thp trn H K Ln; tri nghim nhiu hot ng tr chi dn gian v nhiu loi hnh vn ha ngh thut t dn tc nh ma ri nc, nhy ma Tc Xnh, ht xm,.. n nhng bui trnh din acoustic s c din ra vo cc bui ti ngy cui tun.\r\nNgh m ti Ninh Bnh','Ngy 3: H Long - Ninh Bnh | S ba n: 03 (sng, tra, chiu)','(sng, ti)','T222-5047-4N3D'),(1783,4,'Qu khch n sng v tr phng khch sn. Xe a Qu khch i tham quan:\r\nKhu Du Lch Trng An - Qu khch ln thuyn truyn thng i tham quan thng cnh h thng ni  vi hng v v cc thung lng ngp nc, thng vi nhau bi cc dng sui to nn cc hang ng ngp nc quanh nm. im xuyn trong khng gian hoang s, tnh lng l hnh nh ru phong, c knh ca cc mi nh, n, ph nm np mnh di chn cc dy ni cao.\r\nTuyt Tnh Cc - nm gia mnh t c  Hoa L (Ninh Bnh), ng Am Tin n mnh gia lng chng ni c mnh danh l thin ng ni h gii v c gii tr gi l Tuyt Tnh Cc Vit Nam. \r\nXe khi hnh a Qu khch ra sn bay Ni Bi lm th tc n chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\n  KT THC CHNG TRNH, TM BIT QU KHCH!\r\n  *Lu  :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\n Lch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.\r\n ','Ngy 4: Ninh Bnh - SB Ni Bi | S ba n: 02 (sng, tra)','(sng, ti)','T222-5047-4N3D'),(1784,1,'Qu khch tp trung ti sn bay  Nng  lm th tc p chuyn bay i H Ni. Xe Vietravel n on ti sn bay Ni Bi, khi hnh i Sa Pa theo cung ng cao tc hin i v di nht Vit Nam.\r\nn Sapa, Qu khch dng cm chiu v nhn phng khch sn ngh ngi. Bui ti, Qu khch do ph, ngm nh th  Sapa, t do thng thc c sn vng cao nh: tht ln cp nch nng, trng nng, ru to mo, giao lu vi ngi dn tc vng cao. \r\nNgh m ti Sapa.','Ngy 1: SB NI BI  LO CAI  SAPA 02 Ba n: (Tra, Chiu)','(sng, ti)','T001-1440-2N1D'),(1785,2,'Qu khch dng im tm sng ti khch sn. xe a on ra ga Sapa, Qu khch tri nghim n khu du lch Fansipan Legend bng Tu ha leo ni Mng Hoa hin i nht Vit Nam vi tng chiu di gn 2000m, thng ngon bc tranh phong cnh y mu sc ca cnh rng nguyn sinh, thung lng Mng Hoa.\r\nChinh phc nh ni Fansipan vi  cao 3.143m hng v bng cp treo (chi ph t tc).\r\nL Pht ti cha Trnh hay cu phc lc, bnh an cho gia nh ti Bch Vn Thin T trong h thng cnh quan tm linh trn nh Fansipan.\r\nTip tc hnh trnh, Qu khch dng cm tra v tham quan:\r\nBn Ct Ct p nh mt bc tranh gia vng ph c Sapa, ni y thu ht du khch bi cu treo, thc nc, gung nc v nhng mng mu hoa m hoc du khch khi lc bc n y. Thm nhng np nh ca ngi Mng trong bn, du khch s khng khi ng ngng trc v p bnh d, mc mc. \r\nQu khch dng cm ti ti Sapa v t do ngh ngi.\r\nNgh m ti Sapa.\r\nLu : Trong trng hp, Fansipan khng hot ng chng trnh s c thay th bng im tham quan Cu Knh Rng My (khng bao gm v tham quan).','Ngy 2: SAPA  FANSIPAN LEGEND  BN CT CT 03 ba n: (Sng, Tra, Chiu)','(sng, ti)','T001-1440-2N1D'),(1786,3,'Qu khch n sng, t do ngh ngi ti khch sn n gi hn tr phng. Xe khi hnh n thnh ph Lo Cai dng cm tra v tip tc hnh trnh i H Khu tham quan. Dc ng i hng dn vin gii thiu v cu H Kiu 1, H Kiu 2, ranh gii Vit Nam v Trung Quc, sng Hng, sng Nm Thi...  \r\nQu khch lm th tc nhp cnh xong, HDV a qu khch i tham quan 01 vng th trn H Khu v gh thm Cng vin Sn Lm (Cn gi l Cng Vin nh Sng). Sau  xe a on v khu ph trung tm.\r\nT do tri nghim nhng mn n c trng ca nc bn nh: Vt quay, khu nhc, u ph T Xuyn(chi ph t tc) \r\nTham quan v mua sm  ti siu th Quc Thi, Bch Ho i Lu, cc dy ph Thng mi, ph Qung ninh, Ph Nhn dn...Qu khch tha thch mua cc mt hng nh giy dp, qun o, ti xch,  gia dng v cc mn n vt ang c a thch nh: Chn g cay, bnh ph mai, ht d mt ong, khoai ty trn\r\nQu khch c mt ti ca khu  lm th tc nhp cnh v Vit Nam.on v n Ca Khu Vit Nam, Xe n on ti Ca Khu v khch sn nhn phng ngh ngi.\r\nNgh m ti Lo Cai\r\n***** Lu : H s cn chun b dnh cho khch quc tch Vit Nam gi trc ngy xut cnh t nht 3 ngy lm vic (khng tnh th 7 v ch nht).\r\n01 tm hnh chp chnh din (bn thn), nn trng mi nht, chp r nt khng m \r\nBn scan Cn cc cng dn (CCCD) / H chiu Vit Nam(passport Vit Nam)\r\ni vi tr em cha c CCCD: 01 tm hnh, scan giy khai sinh, giy  ngh cp giy thng hnh do Cng An x phng ni c tr xc nhn (c mu). ','Ngy 3: SAPA  LO CAI  H KHU (TRUNG QUC) 02 Ba n: (Sng, Tra, Chiu t tc)','(sng, ti)','T001-1440-2N1D'),(1787,4,'Sau khi n sng v tr phng khch sn, xe a Qu khch theo ng Cao Tc Lo Cai  H Ni. Xe a Qu khch ra sn bay Ni Bi p chuyn bay v  Nng. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay  Nng.\r\n  KT THC CHNG TRNH, TM BIT QU KHCH!\r\n*Lu  :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\n Lch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.\r\n Trong trng hp on gom di 10 khch th tour khng khi hnh. Cng ty s t vn cho Qy khch chuyn tour sang ngy khi hnh ln cn hoc thng bo chi ph pht sinh  khi hnh c on.','Ngy 4: LO CAI  H NI   NNG 01 Ba n: (Sng, n tra)','(sng, ti)','T001-1440-2N1D'),(1788,1,'Xe Vietravel n Qu khch ti im hn, khi hnh i Bc Yn mt hnh trnh sn my mi trong chng trnh ca chng ta. Trn ng i, qu khch tham quan:\r\nKhu Di tch lch s n Hng tham quan, dng hng tng nim cc vua Hng, tm hiu v nhng cu chuyn truyn thuyt thi k Hng Vng dng nc v gi nc, tm hiu v tn ngng th cng Hng Vng - di sn vn ho phi vt th ca nhn loi c Unessco cng nhn nm 2012 - tri n cng c t tin, cc bc tin nhn c cng dng nc, gi nc, cu mong cuc sng bnh an.\r\n- Dng cm tra ti nh hng a phng v chp hnh lu nim i Ch Long Cc Tuyt tc thin nhin vng Trung Du Ti y qu khch c ha mnh vo thin nhin trong lnh vi nhng i Ch mm xi xanh ngt trng ip c nh gi i Ch p nht Vit Nam.\r\nTip tc hnh trnh n th trn Bc Yn, Qu khch nhn phng khch sn v dng cm ti ti nh hng a phng. Bui ti, Qu khch ngh sm  chun b hnh trnh n bnh minh trn T Xa.\r\nNgh m ti Bc Yn.','Ngy 1: Ngy 1 : H NI  PH TH - XUN SN  BC YN n 2 ba: (Tra, Chiu)','(sng, ti)','T001-1520-7N6D'),(1789,2,'05:00 sng, Qu khch bt u hnh trnh i sn my v n bnh minh ti T Xa.\r\n(Lu : Qu khch vui lng khi hnh ng gi):\r\n- Check in Sng lng khng long: mt trong nhng im check-in thn thnh ca gii tr thi gian gn y. Nm   cao 1500 - 1800m so vi mc nc bin, Sng lng khng long tr nn v cng huyn o khi c nhng tng my trng  di trc mt, cng nhng gii nng vng trong bui sng tinh m s lm ly ng tm hn ca ngi yu x dch.\r\n- Qu khch dng ngh ngi nhm nhi tch c ph ti Tho Coffee (chi ph t tc)  qun c ph vi view ngm nhn ton cnh ni ting ti T Xa.\r\nXe a Qu khch v khch sn tr phng v dng cm tra. Khi hnh i Mc Chu. n ni, Qu khch dng cm ti v tham quan Rng Thng Bn ng v m  ni y c bao ph bi rng thng c th hng trm nm tui vi khng kh trong lnh, mt m. Vi din tch gn 50ha vi y  cc dch v: ngh dng, nh hng, sn tp golf, khu vui chi cm gic mnh, ... l mt trong nhng im tham quan c sc thu ht nhiu s quan tm ca du khch.\r\nQu khch nhn phng khch sn ngh ngi hoc t do tham quan.\r\nNgh m ti Mc Chu','Ngy 2: Ngy 2 : BC YN  T XA - MC CHU n 3 ba: (Sng, Tra, Chiu)','(sng, ti)','T001-1520-7N6D'),(1790,3,'Qu khch n sng ti khch sn v tr phng, xe a Qu khch i tham quan:\r\nQun th phc hp vui chi gii tr v ngh dng Mc Chu Island bao gm xe in i tham quan nh hng tre\r\nThn vi cc nh  t nhin v cc cng trinh iu khc trn  ca ngi Thi xa. Qu khch thng Tabamboo ln nht Vit Nam, khch sn on Tu bullet Train, h thng thy in, tham gia cc tr chi u Zipline, trt cu vng Airslide, khu vui chi tr em ngoi tri,\r\n- Chim ngng v p Cu knh Bch Long (chi ph t tc) c chiu di 632m,   cao cch mt t 150m, l Cy cu knh i b di nht th gii va c xc lp k lc Guinness vo thng 28/5/2022. Ni tip cui chn cu knh l hang Chim thc ba tra ti nh hng tre ln nht Vit Nam.\r\n- Mua sm c sn ni ting c ch bin t sa b ti ni ting ca Mc Chu v lm qu.\r\nn tra ti nh  hng sau  tham quan\r\nNordic Village s h khng gian vn ha c trng ca ngi Hmong, ni y mang nt p ta nh ngi lng Bc u c o ti Vn H.\r\nThung lng N Ka chim ngng v p tho nguyn bn ma, ni ting vi mu trng tinh khi ca hoa mn tri di ht thung lng bao la, rng ln, trn qua c nhng qu i v vch c cheo leo. Vi cnh sc yn bnh, hoang s c trng; Qu khch s d dng chp c nhng bc nh k nim p. (Ty theo iu kin thi tit, ma hoa mn s n r vo cc giai on 15.01-07.02, 08-21.02, ma mn chn 15-31.06.)\r\nNgh m ti Mc Chu','Ngy 3: Ngy 3: MC CHU  CU KNH BCH LONG n 3 ba: (Sng, Tra, Chiu)','(sng, ti)','T001-1520-7N6D'),(1791,4,'Qu khch n sng v lm th tc tr phng khch sn. Xe khi hnh a Qu khch i tham quan:\r\nBn Lc I, Lc II  Lng Vn Ha Mai Chu  Ni sinh sng ca ngi dn tc Thi vi 5 dng h H, L, V, Mc, Lc. Qu khch nh c bc vo mt th gii nh yn bnh vi nhng ngi nh sn vng chi m mc mc, n s nhng li rt i gn gi, quen thuc. Tn hng khung cnh ni rng Ty Bc va hng v, nn th va c nhng ng nt m du v th mng, vi nhng cnh ng la xanh mt, nhng nh ni n hin trong mn sng.\r\nNha may thuy in Hoa Binh: Trc khi nh my thy in Sn La khnh thnh y l cng trnh nh my thy in ln nht Vit Nam v ng Nam , 1 trong 3 nh my c xem l ngun vng trng thp sng vng Ty Bc.\r\nn H Ni, Xe a Qu khch ra sn bay, lm th tc kt thc chng trnh du lch.','Ngy 4: Ngy 4 : MAI CHU - H NI n 1 ba: (Sng, Tra)','(sng, ti)','T001-1520-7N6D'),(1792,1,'Qu khch tp trung ti sn bay  Nng (ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n qu khch tip tc khi hnh i H Long theo ng cao tc Hi Phng - H Long, trn ng ngm cnh Bch ng Giang.\r\nn ni, Qu khch ln thuyn i du ngon Vnh H Long - thng cnh thin nhin tuyt p v v cng sng ng, c UNESCO cng nhn l di sn thin nhin Th gii nm 1994.\r\nTham quan ng Thin Cung l mt trong nhng ng p nht  H Long. V p nguy nga v lng ly bi nhng lp thch nh v nhng lung nh sng lung linh.\r\nT trn tu ngm nhn cc hn o ln nh trong Vnh H Long: Hn G Chi, Hn L Hng.\r\nQu khch nhn phng khch sn v dng cm chiu ti nh hng a phng. Bui ti, Qu khch t do khm ph nhiu hot ng dch v gii tr si ni ti ph c Bi Chy - nm cnh cng vin Sun World H Long t nhng m thc ng ph n cc qun c ph siu d thng nh Hn Gai Coffee & Lounge hay thoi mi bung xa ti The Mini Bar, Brothers Pub,\r\nNgh m ti H Long\r\nQu khch t do ngh ngi ti khu ngh hoc la chn tham gia vo mt trong cc hnh trnh sau (chi ph di chuyn v tri nghim t tc)\r\nTri nghim Cp Treo N Hong ti Sun World H Long Complex trn Ni Ba o, chim ngng cnh p v m ca thnh ph H Long di nh n lung linh (thi gian hot ng cp treo d kin t 10h n 18h cc ngy th 7 v CN).','Ngy 1:  Nng - H Ni - H Long\r\n','02 ba n (tra, chiu)','T001-1590-2N1D'),(1793,2,'Qu khch dng ba sng v tr phng khch sn. Xe khi hnh a Qu khch i Sapa, trn ng dng tham quan mua sm c sn Ty Bc v dng cm tra ti nh hng a phng.\r\nn ni, Qu khch dng cm ti v nhn phng ngh ngi. Bui ti, Qu khch t do do ph ngm nh th  Sapa, thng thc c sn a phng ti ch Sapa: tht ln cp nch nng, trng nng, ru to mo, giao lu vi ngi dn tc vng cao.\r\nNgh m ti Sapa','Ngy 2: H Long - Lo Cai - Sapa\r\n','03 ba n (sng, tra, chiu) ','T001-1590-2N1D'),(1794,3,'Qu khch dng im tm sng ti khch sn. Xe a Qu khch ra Sun Plaza tri nghim Tu ha leo ni Mng Hoa hin i nht Vit Nam vi tng chiu di gn 2000m, thng ngon bc tranh phong cnh y mu sc ca cnh rng nguyn sinh, thung lng Mng Hoa. n khu du lch Fansipan Legend, Qu khch t do tham quan: \r\nChinh phc nh ni Fansipan vi  cao 3.143m hng v bng cp treo (chi ph t tc). \r\nL Pht ti cha Trnh hay cu phc lc, bnh an cho gia nh ti Bch Vn Thin T trong h thng cnh quan tm linh trn nh Fansipan.\r\nTip tc hnh trnh, Qu khch dng cm tra v tham quan:\r\nBn Ct Ct - p nh mt bc tranh gia vng ph c Sapa, ni y thu ht du khch bi cu treo, thc nc, gung nc v nhng mng mu hoa m hoc du khch khi lc bc n y. Thm nhng np nh ca ngi Mng, Dao, Giy trong bn, du khch s khng khi ng ngng trc v p mng m ca mt trong nhng ngi lng c p nht Sapa.\r\nQu khch dng cm ti ti Sapa v t do ngh ngi.\r\nNgh m ti Sapa\r\nLu : Trong trng hp, Fansipan khng hot ng chng trnh s c thay th bng im tham quan Cu Knh Rng My (khng bao gm v tham quan)','Ngy 3: Sapa - Fansipan Legend - Bn Ct Ct\r\n','03 ba n (sng, tra, chiu)','T001-1590-2N1D'),(1795,4,'Qu khch dng ba sng v tr phng khch sn. Theo cung ng cao tc ra sn bay Ni Bi. Trn ng qu khch dng chn ti Tp Lo Cai n tra v chp nh k nim ti Ca khu bin gii Vit - Trung Lo Cai- H Khu.  n ni, Hng dn vin h tr Qu khch lm th tc n chuyn bay v Tp.  Nng. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n*Lu  :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.','Ngy 4: Sapa - Lo Cai - SB Ni Bi (H Ni)\r\n','02 ba n (sng, tra)','T001-1590-2N1D'),(1796,1,'Qu khch tp trung ti sn bay  Nng, hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v hng dn vin n Qu khch khi hnh i H Giang - vng t c ch Shan tuyt, ru mt ong v thng c, x s ca hoa tam gic mch, ci vng, o phai, hoa l, hoa go truyn thng v no nhit trong bui ch phin Dng cm tra ti nh hng a phng.\r\nn H Giang, chp hnh lu nim ti Ct mc s 0 nh du im khi cng ca con ng Hnh Phc ni H Giang v 4 huyn vng cao nguyn  Qun B, Yn Minh, ng Vn, Mo Vc.\r\nQu khch nhn phng ngh ngi v dng cm chiu, t do tn b khm ph TP. H Giang v m,\r\nNgh m ti H Giang','Ngy 1:  Nng - H Ni - Tuyn Quang - H Giang\r\n','2 ba (tra, chiu)','T002-8009-7N6D'),(1797,2,'n sng v tr phng khch sn. Xe v hng dn vin khi hnh a Qu khch khm ph Cng vin a cht ton cu Cao nguyn  ng Vn (Bao gm a gii hnh chnh ca 4 huyn pha Bc tnh H Giang vi din tch 2.356 km2) vi nhng im check-in c sc:\r\nChinh phc Dc Bc Sum, t do tham quan chp hnh Thch Sn Thn (t tc chi ph v vo cng).\r\nNgm Ni i Qun B - biu tng v p ca vng cao nguyn .\r\nDc Thm M - nhng con ng o khc khuu, quanh co ta nh mt di la un ln mm mi tri di theo trin ni.\r\nLng vn ha Lng Cm - Thung lng Sng L: c mnh danh l  a hoa hng trong lng cao nguyn  lun cun ht du khch bi v p ht sc bnh d, mc mc. Ni y tng l bi cnh quay b phim ot gii phim truyn nha xut sc nht ca Hi in nh Vit Nam - phim Chuyn ca Pao, du khch tm hiu vn ha ngi Mng.\r\nCt c Lng C hay cn gi l nh ni Rng, ni a u Cc Bc T Quc vi l c 54m2 tng trng cho 54 dn tc anh em, bao gm v xe in i tham quan. T trn cao, Qu khch s ngm nhng mng xanh mt ca rung bc thang v cc bn lng L L Chi, Thn P, xa xa c 2 h nc pha xa, nm i xng nhau c ngi dn ni y v nh mt rng.\r\nQu khch v ng Vn dng cm chiu v nhn phng khch sn ngh ngi. Bui ti, Qu khch t do i do ph c ng Vn, thng thc c sn ch Thng Dn, nhm nhi tch c ph vng cao, \r\nNgh m ti ng Vn\r\nGhi ch: im tham quan Ct C Lung Cu se khng tham quan c trong trng hp thi tit khng thun li.','Ngy 2: H Giang - Lng C - ng Vn\r\n','3 ba (sng, tra, chiu)','T002-8009-7N6D'),(1798,3,'n sng ti khch sn. Xe khi hnh i khch i tham quan:\r\nM P Lng - Sng Nho Qu  Hm Tu Sn: o M P Lng ni ting l mt trong t i nh o  vng ni pha bc Vit Nam, ng t trn o nhn xung chnh l con sng Nho Qu mm mi nh di la mu ngc bch vi dng chy un ln vt ngang qua Hm Tu Sn c mnh danh l hm vc su nht ng Nam . Chp hnh hm vc Tu Sn v sng Nho Qu ti Qun C ph Panorama.\r\nKhu kin trc ngh thut nh Vng (Dinh Vua Mo), cng trnh kin trc p v rt c o ca vng cao nguyn ni .\r\nQu khch dng cm tra ti nh hng a phng v khi hnh v H Giang.\r\nBui ti, Qu khch ngh ngi hoc t do ung c ph trn nh ni Cm ngm ton cnh TP. H Giang v m v m bng vi mn cho u Tu (chi ph t tc).\r\nNgh m ti H Giang','Ngy 3: ng Vn - M P Lng - Mo Vc\r\n','3 ba n (sng, tra, chiu)','T002-8009-7N6D'),(1799,4,'Qu khch tr phng & n sng. Xe khi hnh a Qu khch ra sn bay Ni Bi, trn dng ngh chn mua sm c sn min ni Tr Shan Tuyt, mt ong Bc H, tru kh gc bp, nm Hng, mng kh.\r\nn sn bay Ni Bi, hng dn vin h tr Qu khch lm th tc n chuyn bay i thnh ph  Nng. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\nLu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.','Ngy 4: H Giang - H Ni -  Nng\r\n','2 ba n (sng, tra)','T002-8009-7N6D'),(1800,1,'Qu khch tp trung ti Vietravel (190 Pasteur, Qun 3, TP.HCM), khi hnh i An Giang theo tuyn cao tc TP.HCM - Trung Lng v Trung Lng - M Thun ngm nhn nhng cnh ng la v mu xanh vn tc hai bn ng.\r\n\r\nn C lao Ging - tng c mnh danh l \" nht c lao\" vi nhng  kin trc c mang m nt vn ha c o, khu sinh thi thun Nam B:\r\n- Thnh ng C Lao Ging: c xy dng t thi vua T c nm 1875, cng trnh c mang dng dp nguy nga, vi nhng hoa vn tinh t v t m, to nn mt khng gian c knh ca Php gia vng t c lao.\r\n- Tri nghim i  vt sng Tin tn hng v p yn bnh vng sng nc n KDL sinh thi Cn n. \r\n- Khm ph th gii ca g trm thu c nin i trm nm: c ch tc thnh tuyt phm c l nh ngi nh lng gi, thnh cu trn khng, c bit tc phm g di hng chc mt vi hng chc ch  mang in hay, tch l ; \r\n- Tm mnh trong ln nc mt lnh t bi tm nhn to ven sng mang n du khch cm gic sng khoi vn minh mit vn\r\n- Ghi li nhng khonh khc cc cht bn con tu g 3 tng ven sng; thng thc ba tra trong khng gian thin nhin sng nc chu th hu tnh.\r\nSau khi n ti, Qu khch khm ph Chu c vi cc im tm linh quan trng di chn ni Sam.\r\n- Miu B Cha X: ni linh thing  du khch gi gm nhng li nguyn cu n B.\r\n- Ty An C T: kt hp mu mc ca phong cch ngh thut n  v kin trc c dn tc u tin ti Vit Nam.\r\n\r\nNgoi ra, Qu khch c th tham quan KDL cp treo ni Sam - khm ph mt Chu c rt khc v m (chi ph t tc)\r\n- Chim bi n th Dc S lung linh nh n lng v m; Check-in cha Mt Ct v nh ga xy dng theo li kin trc Chu u\r\n- Tri nghim cp treo chinh phc nh ni Sam: ngm ton cnh TP. Chu c v m; tham quan Qun th kin trc tn gio c o theo phong cch Nht Bn nh n th Qun Th m B Tt, n Pht Ngc - vi tng Pht Thch Ca c ch tc t ngc nguyn khi; cu ti lc ti B  B Ng.\r\n\r\nNgh m ti TP.Chu c (An Giang)','Ngy 1: TP.HCM - AN GIANG - THNH NG C LAO GING - CN N - HUYN O NI SAM V M (n sng, tra, chiu)','(sng, ti)','T889-1365-7N6D'),(1801,2,'Qu khch tr phng, khi hnh theo ng N1 chy dc knh o Vnh T n check-in v tri nghim mua sm ti ch bin gii Tnh Bin.\r\n\r\nChinh phc Thin Cm Sn - Nc nh ca ng bng sng Cu Long bng cp treo di 3,5 km nh tm v chn an yn cho tm hn (chi ph cp treo t tc)\r\n\r\n- Tham quan Lm Vin Ni Cm: nm   cao trn 705 mt phong cnh sn thy hu tnh vi cc cnh p ngon mc nh H Thy Lim; Tng pht Di Lc ln nht trn nh ni  chu  cao 33,60 mt; Cha Vn Linh uy nghi vi bo thp 9 tng cao 35 mt, ni linh thing  Qu khch cu mong nhng iu bnh an trong cuc sng.\r\n\r\nThng thc mn n m nt m thc c trng ti Tht Sn K Bu v min qu sng nc:\r\n-  Bnh xo vng m, gin tan gi trn ci hng v ngt lnh ca sn vt ng bng chu th nh: tht ba ri, tp, u xanh, gi n km hng chc loi rau rng thin nhin tr danh\r\n- Lu C Lao - nt chm ph trong vn ha m thc ca ngi dn min Ty, gin d nhng mang d v d gy nghin\r\nSau khi n tra, Qu khch di chuyn theo cung ng T P (Tri Tn), thng ngon nhng cnh ng la bt ngn xen ln hng tht nt c trng vng bin gii An Giang\r\n- Dng chn ti C s tht nt Trn Gia: thng thc vang tht nt, ru tht nt, ng tht nt (sn phm chng nhn OCOP), tht nt rim do mm, mt nhy hoa tht nt v mua sm cc sn phm nguyn cht t tht nt v lm qu cho ngi thn.\r\n\r\nn TP.Rch Gi, on ngm hong hn v n ti trn khu  th ln bin ang vn mnh ra bin ln\r\n\r\nNgh m ti TP.Rch Gi (Kin Giang)','Ngy 2: AN GIANG - CH TNH BIN - C SN VNG BIN - LM VIN NI CM - RCH GI - HONG HN TRN KHU  TH LN BIN (n sng, tra, chiu)','(sng, ti)','T889-1365-7N6D'),(1802,3,'on tr phng v tham quan nh thn Nguyn Trung Trc: nm bn b sng hin ha cch ca bin khong hn 100m, y l ngi nh th ng sm v ln nht trong chn n th  Kin Giang.\r\n\r\nKhi hnh n khu vc Vn Quc Gia U Minh H - khm ph nt c trng ca h sinh thi rng ngp l di nhng tn rng trm xanh mt:\r\n- Ln tc rng (v li) nh nhng lt i trn mt nc khm ph nhng con knh thng tp, ngm nhn khng gian ng qu yn .\r\n- Tn b trn con ng di nhng tn rng trm bt ngn, Qu khch ng hnh cng ngi dn i gc ko ong, thu hoch ong v c t tay vt nhng t ong sng snh mt nguyn cht theo ma.\r\n\r\n*Lu : tri nghim ty tnh hnh thc t, nu khng i gc ko ong c, on chuyn qua tri nghim bi xung, d l v t lp.\r\n\r\n- Gia nh ch nh s tip i Qu khch ba cm t cung t cp ca thin nhin rng U Minh: gi ong non, c lc ng nng rm, canh chua c cng vi chung ru ong trm tinh khit.\r\n\r\nNgh m ti Nm Cn (C Mau)','Ngy 3: RCH GI - NH THN NGUYN TRUNG TRC - C MAU - VN QUC GIA U MINH H - NM CN (n sng, tra, chiu)','(sng, ti)','T889-1365-7N6D'),(1803,4,'on tr phng, khi hnh i t Mi - chm chn n Mi C Mau, cng ngi dn bn a tri nghim trn vn nt p phng khong ca min t cc Nam t quc \r\n\r\n- Vi vu trn v li n khu vc nui nghu ca ngi dn a phng nm ven bin ng, Qu khch t tay co nghu, ch bin v thng thc nghu ngay ti ch (khng gii hn s lng nghu bt v n ti ch, mang v s tnh ph)\r\n\r\n- Khm ph Ct mc ta  quc gia GPS 000; Pano biu tng mi C Mau; im cui ng H Ch Minh 2436Km; n th Cha Lc Long Qun v tng M u C; chinh phc Ct c t Mi - t trn k i cao hn 41 m, du khch c th chim ngng v p cm o Hn Khoai th mng nm gia bin ng hay nhng cnh rng c bt ngn.\r\n\r\n- Mua sm nhng sn vt ca min qu t Mi v thng thc ba tra ti khu du lch cng ng Hong Hn vi nhng mn n c sn nh: c thi li, ba kha,\r\n\r\n- Cm nhn trn vn nt p phng khong ca min t Phng Nam, Qu khch tip tc hnh trnh ln cano len li trong rng c khm ph khu rng ngp mn ln th hai th gii, vi h sinh thi a dng, mang v p hoang di cng bu khng kh trong lnh. Check-in trm dng chn c nht v nh trn bi bi bin Ty (ni hng nm ln bin t 80 - 100m) v tham quan nh l truyn thng a phng v cy cu kh xuyn rng c o.\r\n\r\nTm bit C Mau, Qu khch khi hnh v Bc Liu tham quan:\r\n\r\n- Cnh ng in Gi: chim ngng v p nhng tua-bin gi khng l cao hn 80 m sng sng trn nn tri xanh vi  ngha to mt ngun nng lng sch v tn trn mt bin, gim thiu tc ng gy hiu ng nh knh \r\n\r\nNgh m Bc Liu.','Ngy 4: N VNG CC NAM T QUC  MT NGY LM NGI DN BN A - BC LIU DU LCH IN GI T MNH T PH SA VEN BIN (n sng, tra, chiu)','(sng, ti)','T889-1365-7N6D'),(1804,5,'Sau khi tr phng, on khi hnh tham quan\r\n- Qung trng Hng Vng - lu gi k nim cng hnh nh cy n km cch iu (cao 18,6 m) nhc c khng th thiu trong n ca ti t ci lng, biu tng vn ha ca tnh Bc Liu; Nh ht Cao Vn Lu - hnh dng 3 chic nn l khng l ln nht Vit Nam.\r\n\r\n- Khu nh cng t Bc Liu: do k s ngi Php thit k vo nm 1919, y c xem l ngi bit th b th nht  Nam K Lc Tnh lc by gi. Khu nh gn lin vi giai thoi vng son mt thi ca cu Ba Huy - ngi c mnh danh l Cng t Bc Liu ni danh nht x Nam K.\r\nTip tc hnh trnh n Sc Trng, on tham quan \r\n\r\n- Cha Wat Ptum Wngsa Som Rng - Mt qun th kin trc Pht gio rng ln, gm nhiu cng trnh nh: Chnh in, ngi bo thp vn ngi m p ta cha Arun ti Thi Lan. c bit, tng Pht Thch Ca nhp nit bn uy nghim vi kch thc chiu di  63 mt\r\nTri nghim chng trnh cng ngh nhn lm cm dp trn da - do thm ng chun v min Ty\r\n- Thng thc ba tra vi c sn gy thng nh nh c ko nng ng sy - Dn d v ng qu; bnh cng - c sn ca ngi Khmer  Sc Trng; bn nc lo - Mn n mang m du n vn ha m thc Sc Trng kt hp hi ha ca 2 dn tc Kinh - Khmer; go ST25.\r\non quay v TP.HCM theo tuyn cao tc M Thun - Cn Th; Chim ngng cu M Thun 2 - D n trng im quc gia c chiu di 1,9km ni lin tnh Vnh Long v Tin Giang.\r\n\r\nKt thc chng trnh du lch ti im n ban u.\r\n\r\nLu :\r\n- Chng trnh ca Vietravel l chng trnh trn gi, khng c p dng chnh sch min gim, u tin vo im tham quan (nu c) dnh cho tr em, ngi cao tui, ngi c cng vi cch mng  v vy Vietravel s khng hon li phn chnh lch cho cc khch hng thuc din u tin ny.\r\n\r\n- Chng trnh i t Mi bng xe, nu Qu khch c nhu cu i t Nm Cn ra t Mi bng cano, vui lng bo cho nhn vin t vn Vietravel ngay khi ng k v thanh ton tin ph cano cng ph thu thm mt hng dn vin i theo.','Ngy 5: BC LIU - SC TRNG - KHM PH VN HA & M THC KHMER - TRI NGHIM LM CM DP CNG NGH NHN - TP.HCM (n sng, tra)','(sng, ti)','T889-1365-7N6D'),(1805,1,'Qu khch tp trung ti Cng ty Vietravel (190 Pasteur, Phng V Th Su, Qun 3, TP.H Ch Minh) khi hnh i Phan Thit. Qu khch dng ba sng trn cung ng i. \r\nNgi trn xe, Qu khch s c chim ngng cnh p ca vng t Bnh Thun nh: Lu ng Hong, Thp chm Poshanu, Bi  ng a, Rng Da Hm Tin, on dng chn tham quan:\r\nBo tng ngc trai Mi N - khu trng by c gii thiu mt cch ngh thut v sang trng theo tng chng loi, mu sc v kch c. T cc b su tp ngc trai  nguyn cho n cc loi trang sc nh ngc trai nh: vng eo c, mt dy chuyn, nhn, bng tai, lc, ng h nh ngc trai.\r\nn Phan Thit, on dng cm tra, nhn phng v t do ngh ngi. Bui chiu, xe a qu khch n tham quan ti: \r\ni Ct Vng - mt trong nhng khu vc p nht nm  Mi N thu ht kh nhiu du khch do hnh dng p ca ct v mu sc ca ct, ni y c xem l i ct c mt khng hai ti Vit Nam bt ngun t m st c tn ti hng trm nm to nn. \r\nBui ti, Qu khch t do thng thc m thc a phng c ch bin t cc loi hi sn ti ngon v do ph khm ph Mi N v m. \r\nNgh m ti Mi N','Ngy 1: TP. H Ch Minh - Phan Thit\r\n','02 ba n (sng, tra)','T660-3214-6N5D'),(1806,2,'Qu khch dng ba sng v t do tm bin/h bi n gi tr phng. on khi hnh i tham quan: \r\nMua sm c sn Phan Thit ti c Sn Hng  (chi ph t tc) - nc mm Phan Thit, cc loi hi sn kh nh: mc kh cu, mc mt nng, c cm rt xng, c thu mt nng, c  mt nng v lm qu cho ngi thn v bn b.\r\non dng ba tra v khi hnh v TP. H Ch Minh, xe a v im n ban u. Chia tay Qu khch v kt thc chng trnh du lch.','Ngy 2: Phan Thit - TP. H Ch Minh\r\n','02 ba n (sng, tra)','T660-3214-6N5D'),(1807,1,'Hng dn vin n Qu khch ti Vietravel Cn Th (103 ng Trn Vn Kho, phng Ci Kh, qun Ninh Kiu, TP Cn Th), khi hnh n Bn Tre - khm ph vng t c mnh danh l Th ph da Vit Nam vi bao iu mi l.\r\n  Trn cung ng i, on dng chn n sng (t tc chi ph) v tip tc hnh trnh n tham quan Nng tri Hi Vn - trong khung cnh bnh yn ca nng tri hu c, Qu khch c cho n bng nc tr sake hoc hoa u bic thanh mt do nng tri pha ch.\r\nTr ti lm bnh trng M Lng - di sn vn ha phi vt th quc gia.\r\nHi rau dc liu: chun b cho ba tra.\r\nKhm ph trang tri da c o ca min Ty - tm hiu v tm quan trng ca da trong vn ha ngi dn Bn Tre.\r\nTri nghim thu hoch da: hc cch m 1 qu da ng cch; lt v da bng cy Nm v thng thc nc da ti 3 nht\r\nTri nghim ngh thut tht l da c o; Tham gia  vui v da\r\nTham quan rng Vm H - khu bo tn chim ln nht tnh Bn Tre\r\n Tm rng v khm ph khu rng nguyn sinh y ma m, check-in vi Tam Tr C Ga Trm Tui\r\nTm hiu tn, cng dng, c im b su tp cy thuc nam v nhiu loi rau rng\r\nNghe cu chuyn th v v rng cng thng ip bo v mi trng v gim thiu bin i kh hu\r\nThng thc m thc x da c o: bnh xo hn cun da & rau nng tri; Bnh c lng tong da si; Lu bn Vm H; tp rang da; Rau dc liu & chao nc ct da; cm tri da \r\nThng ngon sng Ba Lai bng tu - tm hiu i sng ca ngi dn bn a:\r\nTm hiu ngh nh bt c ca ng dn v i sng ca ngi dn ven sng vi ch rm ln nht tnh Bn Tre.\r\nHi da nc bn sng v thng thc mn da nc theo cch t nhin nht ngay ti boong tu.\r\nTu dng ti rng bn  du khch t tay hi tri bn, thng thc mn cm Thy Liu.\r\nChim ngng Cng p Ba Lai - mt trong nhng cng trnh ngn mn ln nht ng bng sng Cu Long. \r\nThng thc v p thin nhin k o ca Sn chim Vm H t lng knh sng Ba Lai.\r\nHa thn thnh nng dn th thit tri nghim mit vn sng nc - tm mng sinh thi, i cu kh, vt cu dy, cho xung, cho SUP.\r\nQu khch ln xe khi hnh v TP.Cn Th, xe a on v im n ban u, kt thc chng trnh du lch.\r\nKT THC CHNG TRNH - TM BIT QU KHCH!\r\n  Lu : Chng trnh ca Vietravel l chng trnh trn gi, khng c p dng chnh sch min gim, u tin vo im tham quan (nu c) dnh cho tr em, ngi cao tui, ngi c cng vi cch mng  v vy Vietravel s khng hon li phn chnh lch cho cc khch hng thuc din u tin ny.','Ngy 1: Cn Th - Bn Tre - Nng tri Hi Vn - Rng nguyn sinh Vm H - Sng Ba Lai\r\n','01 ba n (tra)','T883-4223-3N4D'),(1808,1,'Qu khch tp trung ti Cng ty Vietravel (190 Pasteur, P. V Th Su, Qun 3, TP.H Ch Minh) khi hnh i Bnh Thun. on n sng trn cung ng i v tip tc hnh trnh theo cung ng cao tc Phan Thit - Du Giy  n vi nhng im tham quan ni ting ti Tin Thnh, bt u vui chi khm ph cc khu cng vin ch  ti Novaworld Phan Thit nh:\r\nKhm ph cng vin bn hoang d Safari Caf - Tiu chu Phi thu nh trong lng ph bin Phan Thit. Vi vu trn chuyn xe u ko vng quanh khu sinh thi, ngm cc ng vt n c siu thn thin (Chi ph xe u ko t tc).\r\nSau ba tra, on nhn phng v ngh ngi, tip tc vui chi ti:\r\nWonder Hill - khm ph Ngn i k quan ly cm hng t con tu Noah huyn thoi  gii cu mun loi khi trn i hng thy.\r\nBikini Beach - s hu bi bin di, trng mut ni bt cng nhng biu tng Iconic nh cng Cu Vng, cnh ca , u quay, nhng tng c gi, chng trai trong trang phc bin cao ngt phng khong s cho Qu khch tha sc sng to nhng bc nh cc cht.\r\nHoc Qu khch c th la chn mt trong cc khu sau  thay th cho Wonder Hill:\r\nCng vin gii tr Circus Land - mang phong cach giai tri thi thng kiu My vi m hinh nhng ganh xic lu ng ven bin y nao nhit vi nhng tr chi c o.\r\nDino Park - Cng vin khng long s hu m hnh khng long T-rex ng ln nht Vit Nam v cc m hnh khng long khc ti hin thi k tin s khi nhng loi khng long ang thng tr tri t.\r\nQu khch thng thc ba ti ti nh hng a phng. Bui ti t do do ph v th cc mn hi sn ti ngon ti khu ph m thuc Novaworld Phan Thit (Chi ph t tc).\r\nNgh m ti Novaworld Phan Thit','Ngy 1: TP. Hcm - Tin Thnh - Novaworld Phan Thit\r\n','03 ba n (sng, tra, ti)','T660-1873-6N5D'),(1809,2,'on dng ba sng ti resort v t do vui chi, tm bin ti Novaworld Phan Thit. Hoc c th la chn khm ph:\r\nWonderland Water Park (Chi ph t tc) - cng vin nc vi ch  i Dng quy t th gii sinh vt bin a sc mu.\r\nn gi Qu khch lm th tc tr phng, on dng ba tra ti nh hng v di chuyn v li TP.HCM.\r\nXe v HDV a v im n ban u. Chia tay Qu khch v kt thc chng trnh du lch.','Ngy 2: Novaworld Phan Thit - Tin Thnh - TP. HCM\r\n','02 ba n (sng, tra)','T660-1873-6N5D'),(1810,1,'5:30 Xe v Hng dn vin n Qu khch ti cng ty Vietravel (S 3, Hai B Trng, Hon Kim, H Ni) (Qu khch t tc n sng). Xe khi hnh i H Giang - vng t c ch shan, ru mt ong v thng c, x s ca o phai, hoa l, truyn thng v no nhit trong bui ch phin Trn ng, Qu khch c th tranh th ngm cnh rng ni ng bc v cng hng v v hoang s. V dc ng i, xe s dng ngh, Qu khch c th xung s th gin v chp hnh lu nim. Qu khch dng chn ti thnh ph H Giang  dng ba tra ti nh hng - thng thc cc mn n c sn a phng nh: c sui, xi go, np nng ng sc,...\r\nSau , Qu khch s i qua rng thng bt ngn p nht Vit Nam tri di trn cc sn ni cao  n vi n th trn Yn Minh. Qu khch di chuyn n a phn Huyn ng Vn chim ngng v p Cao nguyn  c UNESCO ghi nhn l cng vin a cht Ton Cu vo nm 2010. Qu khch c th dng chn thm quan:\r\nDc Thm M  nhng con ng o khc khuu, quanh co ta nh mt di la un ln mm mi tri di theo trin ni.\r\nPh Co, Sng L, vo lng vn ha Lng Cm ni ly bi cnh nhng thc phim ni ting Chuyn ca Pao - vo ma ng, ma xun n r nhng ng hoa ci vng hoc hoa o Tt, qu thch hp cho nhng thc hnh lng mn m m nt vn ha. Chp hnh gia vn hoa mua xun bt ngt v th mng.\r\nSau  on ln xe tip tc di chuyn v Ph C ng Vn/ Mo Vc. Qu nhn phng khch sn n ti t do khm ph ph c ng Vn/ Mo Vc v m.\r\nNg m ti ng Vn/Mo Vc','Ngy 1: H Ni - Qun B - Yn Minh - ng Vn/Mo Vc\r\n','02 ba n (tra, ti)','T002-3219-3N4D'),(1811,2,'Qu khch thc dy sm n sng v lm th tc tr phng. Xe a Qu khch theo hng Mo Vc dc theo dng sng Nho Qu, Qu khch s c tham quan:\r\nBc tranh sn thy hng v ca mt trong t i nh o vng ni pha Bc - M P Lng nm dc theo dng sng xanh Nho Qu chy qua khe vc ni Tu Sn. Trn ng dng chp hnh ti tng i Thanh Nin trc bo tng Con ng Hnh Phc, ngm ton cnh dng sng Nho Qu t trn cao.\r\nQu khch c th la chn (chi ph t tc): M P Lng Panorama caf, ln thuyn tham quan sng Nho Qu ngm hm vc Tu Sn.\r\nSau khi n tra, Qu khch gh thm:\r\nDinh th vua Mo Vng Ch Snh vi kin trc c o v nhng cu chuyn c sc.\r\nLng C - Ni a u T Quc, hay cn c miu t l: Ni ci mt st t, ngng mt ng tri. Qu khch thm quan Ct c T Quc v chp hnh lu nim. T ct c Lng C, Qu khch c th ngm phong cnh rung bc thang p mt xen k nhng nh trnh tng ca dn tc L L trong bn So Lng bn di.\r\nDng chp nh Ni i C Tin - tc phm ngh thut ca to ho ban tng cho vng t ny, ngoi ra Qu khch cn c dp nghe k v truyn thuyt v vng hp dn v th v v ni y.\r\nQu khch dng ba ti ti nh hng v nhn phng ngh ngi.\r\nNg m ti Thnh ph H Giang','Ngy 2: M P Lng - Ct c Lng C - Tp H Giang\r\n','03 ba n (sng, tra, ti)','T002-3219-3N4D'),(1812,3,'Qu khch thc dy sm n sng v lm th tc tr phng. Xe khi hnh a Qu khch tham quan:\r\nCt mc s 0: nh du im khi cng ca con ng Hnh Phc ni H Giang v 4 huyn vng cao nguyn \r\nThn H Thnh cch trung tm thnh ph khong 6km. y l thn ca ngi dn tc Ty, Qu khch chim ngng v p kin trc ca nhng ngi nh Sn rt c o tm hiu i sng vn ha ca bn Ty. Sau  on ln xe di chuyn v thnh ph Tuyn Quang dng ba tra ti nh hng.\r\nQu khch dng ngh chn mua sm c sn min ni Tr Shan Tuyt, mt ong Bc H, tru kh gc bp, nm Hng, mng kh.\r\nXe v Hng dn vin a Qu khch tr v H Ni.\r\non v ti im n ban u, chia tay Qu khch, kt thc chng trnh.\r\n(*) Th t cc im thm quan c th thay i theo tnh hnh thc t ti thi im xut pht nhng vn m bo y  cc quyn li v cc im thm quan theo chng trnh','Ngy 3: ng Vn - H Giang - Tuyn Quang - H Ni\r\n','02 ba n (sng, tra)','T002-3219-3N4D'),(1813,1,'Qu khch tp trung ti Cng ty Vietravel (190 Pasteur, Phng V Th Su, Qun 3, TP. H Ch Minh) khi hnh i Bnh Thun theo tuyn cao tc Du Giy - Phan Thit. on dng chn n sng trn cung ng i v tip tc hnh trnh n vi vng bin ni ting ca khu vc Nam Trung B. n Phan Thit, on tham quan:\r\nBo tng H Ch Minh - Ngi trng Dc Thanh ni lu du ca Ch tch H Ch Minh trn hnh trnh ra i tm ng cu nc.\r\non dng ba tra ti nh hng a phng. Sau , tip tc n Tin Thnh - Phan Thit theo cung ng bin xinh p, ngm nhng n ct di, hng thanh long xanh mn im xuyn tri hng  t im cho cnh quan.\r\nn ni, Qu khch lm th tc nhn phng v t do ngh ngi. Bui ti, on dng ba ti nh hng a phng v t do do ph khm ph Novaworld Phan Thit v m.\r\nNgh m ti Tin Thnh','Ngy 1: TP. H Ch Minh - Tin Thnh\r\n','03 ba n (sng, tra, chiu)','T660-3259-2N1D'),(1814,2,'Qu khch dng ba sng ti khch sn v t do vui chi ti Novaworld Phan Thit.\r\nWonderland Water Park - cng vin n