r\n Trng Sn C T: ni y c xem l a linh ca vng t nng gi, l thin vin ln nht tnh Ninh Thun. T thin vin, Qu Khch phng tm mt ra xa mt bn l th trn Khnh Hi v m Ni cng nhng tha rung ang mn mn.\r\n\r\non tr v Ninh Ch nhn phng v dng ba ti ti nh hng a phng, t do ngh ngi hoc do ph.\r\n\r\nNgh m ti Ninh Ch.\r\n ','Ngy 1: TP.HCM - NINH CH - TRNG SN C T S ba n: 03 ba (n sng, tra, chiu)','(sng, ti)','T558-7590-7N6D'),(1817,2,'Sau khi n sng ti khch sn, on khi hnh tham quan:\r\n- Vnh Vnh Hy: t y Qu khch s ln tu i chim ngng nhng cnh p ca vng vnh ni ting nht nh ti Vit Nam\r\n Chp nh vi mun kiu sng o ti cac im nh: Mui Ca ng, a Robot, hang Yn, hn Rua \r\n Tri nghim ha mnh vo th gii i dng v ln ngm nhng cm san h y mu sc, nhng n c, nhng con cu gai, nhng con sao bin, (thi gian tm bin v ln ngm khong 90 phut, ty vo iu kin thi tit thc t)\r\n Tr v Bi Cc: Qu khch t do tm bin, tham gia tri nghim cc hot ng th thao di nc nh phao chui, m t nc, v thng thc hi sn bin ti sng (chi ph t tc). \r\n\r\n***Lu : Qu khch s c trang b knh ln, ng th, o phao v hng dn cch s dng dng c ln trc khi xung bin. Qu khch khng c nhu cu ln bin s  li tu tham quan v chp nh..\r\n\r\non dng ba tra ti nh hng, on tip tc tham quan:\r\n- Hang Ri: l mt trong nhng im nhn khi du lch Vnh Hy, Hang Ri mang li cm gic tuyt ho cho du khch khi c lc vo x s ca cu chuyn c tch bi v p gn nh hon ho. T nhng hn  nhiu hnh th xp chng ln nhau to ra v s hang ng ln nh p mt. \r\n- Vn nho Ninh Thun  M Ly - loi nho c sn vng t nng gi Ninh Thun  mua v lm qu cho gia nh ngi thn \r\n- Thp Chm Poklong Giarai: l cm n thp cn nguyn vn nht trn lnh th Vit Nam mang v p c kn, li kin trc c o ca nn vn ho Chm Pa c xa. Hng nm, ti y cn l ni din ra l hi Kat c o ca ng bo Chm hng nm  Ninh Thun. \r\n\r\nQu khch n ti ti nh hng a phng v t do do ph bin v m. \r\n\r\nNgh m ti Ninh Ch.\r\n ','Ngy 2: NINH CH - HANG RI  VNH VNH HY  THP CHM  VN NHO S ba n: 03 ba (n sng, tra, chiu)','(sng, ti)','T558-7590-7N6D'),(1818,3,'n sng v lm th tc tr phng, on khi hnh v TP.H Ch Minh. Trn ng, qu khch dng t