nghim hc cch vt a v an vng: ngh truyn thng th cng ang dn mai mt nhng vn cn c lu gi ti y. c bit c tri nghim lm khun v thng thc bnh phu th min Ty (gii nht bnh ngon Nam B 2015).\r\n- Nh c tr v vi tui th t tri nghim lm bnh dn gian: bnh l mt/ bnh kp cun/ cm n qua s hng dn tn tnh ca cc ngh nhn cht phc\r\nQu khch cng nhau thng thc ba cm gia nh.\r\nSau ba chiu, tau a Qu khch quay li bn  C Bc. Xe on khach khi hnh v im n ban u. Kt thc chng trnh. Hng dn vin chia tay v hn gp li Qu khch','Ngy 1: NHA C BINH THUY - INH BINH THUY - CN SN (n tra)','(sng, ti)','T992-1123-7N6D'),(1820,1,'Qu khch tp trung ti Vietravel (190 Pasteur, P. V Th Su, Q 3, TP.HCM), xe a on khi hnh i  Lt. Trn ng on dng chn tham quan v n tra ti Bo Lc:\r\n Thc DamBri: c coi l ngn thc ln nht vng t Lm ng vi chiu cao 60m to thnh 2 dng chy cao thp rt hng v. Khu du lch thc amb\'ri l mt qun th du lch bao gm khu vui chi, h, thc v rng nguyn sinh rng hng nghn hecta. Ni y c ng trt di nht ng Nam  vi  di 1.650m.\r\nTip tc hnh trnh n vi thnh ph sng m, Qu khch dng ba ti v nhn phng ngh\r\nNgh m ti  Lt\r\n ','Ngy 1: TP. HCM - THC DAMBRI -  LT S ba n: 3 ba (n sng, tra, ti)','(sng, ti)','T668-8115-4N3D'),(1821,2,' Lt cho n qu khch vi khng kh se lnh thoang thong mi sng sm mai, sau khi dng ba sng, xe a on tham quan:\r\n\r\n Chim ngng i ch Cu t  check-in tua bin in gi: trn u l bu tri xanh ngt vi ln my trng bay bay, bn di l thm tr xanh ti tn,  gia l nhng cnh ng qut gi trng quay u tuyt p khng ch a l khch ha mnh vo thin nhin khong t m cn ngu nhin kt hp nhng gam mu hi ha, mang n nhng bc nh v cng nn th. Ngi nhm nhi ly c ph thm lng ti Panorama Cafe Cu t tn hng nhng iu bnh yn nht ca cuc sng. (Chi ph nc ung t tc)\r\n\r\n Tm hiu v thng thc ru vang ti Hm Vang  Lt, Qu khch s c: \r\n- Khm ph hm vang duy nht v ln nht t tiu chun chu u ti Vit Nam, m mnh trong mt khng gian c o ca kin trc v mi hng, ngm nhn nhng mi vm theo li kin trc Trung c \r\n- c lng nghe nhng cu chuyn y hp dn v ngi lm vang qua tng thi k\r\n- Tri nghim 01 ly ru vang vi hng v thanh khit c ngm  trong nhng thng g si s mang li cho khch tham quan y  tri nghim v mt hm vang Chu u c trng nht\r\n\r\nBui chiu, on tip tc tham quan: \r\n\r\n Mongo Land: mang v p hon ton mi l - mt \"tiu Mng C thu nh\" trong lng  Lt c thit k nh mt nng tri vi nhng chic lu  mu sc. Tt c u c bi tr c o, bt mt theo phong cch Mng C c trng. n y, ngoi vic tn hng bu khng kh trong lnh v chim ngng v p ca thin nhin hng v, Qu khch s c tri nghim: \r\n- Tha thch chp nh ti lu mng c, xch u, nng tri u, thm c, sa mc xng rng,\r\n- Tri nghim cm gic siu  ti ng trt phao kh p v di nht  Lt\r\n- Ha mnh vo th gii ca ng vt: hu sao, d mini, cu, th Vit, th Holland Lop H Lan, th S T, chim Yn, Chinchilla, sc Chipmunk, v t tay cho th n  (thc n s c Mongo Land chun b sn cho qu khch). \r\n- Tham gia cc hot ng vui chi nh: trt c, bn cung\r\n- Tr thnh nhng c nng, chng trai du mc thc th khi din trn mnh trang phc ngi Mng C. (Chi ph thu trang phc t tc).\r\n\r\non dng cm chiu ti nh hng Cm niu Nh Ngc ni ting ca thnh ph sng m vi cc mn n mang m bn sc thun Vit nhng li ghi du n vi bn b quc t khi  t nhng gii thng v m thc, cng l nhng mn n lm nn tn tui ca nh hng nh: ba ch chy cnh, salad organic trn, g nng da gin v xi chin, lu b,... v c bit Qu khch s c thng thc nhng mn trng ming c sc theo ma.\r\n\r\nNgh m ti  Lt.','Ngy 2:  LT - I CH CU T - HM VANG  LT - MONGO LAND S ba n: 3 ba (n sng, tra, ti)','(sng, ti)','T668-8115-4N3D'),(1822,3,'Sau khi dng ba sng ti khch sn, xe a on tham quan:\r\n\r\n Vn du Hip Lc: l mt trong nhng vn du ti  Lt t cht lng cao vi cc ging du a dng nh New Zealand v Php. n ni y, ngoi vic c tm hiu phng php trng du Qu khch cn c tho sc to dng check-in bn nhng gin du  mng, tri nghim hi du v mua v lm qu cho ngi thn, bn b (chi ph t tc)\r\n\r\n Qung trng Lm Vin: im nhn ca TP.  Lt bn b h Xun Hng vi cng trnh ngh thut bng hoa d qu v n hoa Atiso khng l c thit k bng knh mu, lp lnh phn chiu p mt bi nh sng.\r\n\r\n Mua sm c sn  Lt ti c s mt Thanh Nhu: cc loi tri cy sy gin, sy do, nc ct du tm  du ti, tr atiso, tr hoa, ...\r\n\r\nSau khi dng ba tra, xe a on v li khch sn t do ngh ngi. Bui chiu Qu khch c th la chn tham gia cc tri nghim c o nh:\r\n\r\n Vo 16h30 n hong hn v thng thc ba tic m nhc cng Lululola Show vi khng gian ngoi tri v c tm nhn xung thnh ph  Lt th mng. Hoc vo 20h00 thng thc nhng bn nhc tr tnh xa, nhc Trnh, nhc Bolero ti m sc  Lt  Cung n Xa, Qu khch c dp tri nghim mt phong cch sng chm v tn hng tng pht giy, lu gi nhng khonh khc tuyt vi  tn su trong tm hn mi ngi. (Chi ph t tc)\r\n\r\n Tri nghim tm khong nng & xng hi ti Dlats gip bn th gin v ngh ngi, gii ta cng thng (Chi ph t tc)\r\n***Lu : Chi ph v v i li t tc***\r\nBui ti Qu khch t do tn b Ch  Lt v thng thc m thc a phng: lu b, lu g l , bnh t lng g, bnh cn,.... \r\n\r\nNgh m ti  Lt.\r\n ','Ngy 3:  LT  THM VN DU TY  QUNG TRNG LM VIN S ba n: 2 ba (n sng, tra, t tc n ti)','(sng, ti)','T668-8115-4N3D'),(1823,4,'Qu khch dng ba sng, lm th tc tr phng. Sau  xe v HDV a khch i tham quan: \r\n\r\n Samten Hills Dalat: l mt khu du lch tri nghim v vn ha tm linh va i vo hot ng t cui thng 2/2023. Ly cm hng t kin trc c o ca vn ha Ty Tng, kt hp vi phong cch thit k hin i, tt c  to nn mt khng gian Vn ha Tm linh Pht gio Kim Cng Tha  Drigung Kagyu Samten Ling Vit Nam. Ti y, on s c khm ph v tri nghim:\r\n- Thng thc cc tc phm ngh thut ti Nh trng by Di Sn Pht Gio Kim Cng Tha c ch tc bi i bn tay ti hoa v s hp nht thn  tm ca cc ngh nhn n t n , Nepal  qu hng ca c Pht. \r\n- Chim ngng bc tng c Pht V Lng Th v c Pht Di Lc bng ng ngoi tri, cao 10.5m v c o him c ti Vit Nam\r\n- Vi im nhn ni bt l i bo thp Kinh Lun bng ng nguyn cht dt vng 24K ln nht th gii  c xc lp k lc Guinness. \r\n\r\nKhi hnh v TP. H Ch Minh, on dng ti Bo Lc dng cm tra, sau  khi hnh v im n ban u. Chia tay on v kt thc chng trnh du lch. ','Ngy 4:  LT  SAMTEN HILLS  CHIM NGNG I BO THP KINH LUN - TP. HCM S ba n: 2 ba (n sng, tra)','(sng, ti)','T668-8115-4N3D'),(1824,1,'Qu khch tp trung ti Cng ty Vietravel (S 103 ng Trn Vn Kho, P Ci Kh, Ninh Kiu, Cn Th) khi hnh i Phan Thit.\r\nQu khch n sng trn