chnh l mn c lng h nhng gim. c bit l loi c sng trn dng sng C Chin bo ngt l thng.\r\nTu h ky chin gin thm ngon - c sn xut pht ti lng ngh tu h ky M Ha, tri qua trm nm thng trm gi  tr thnh ti mt trong nhng mn n tiu biu Vit Nam\r\n Khi hnh i Cn Th theo tuyn cao tc mi M Thun - Cn Th, Qu khch nhn phng ti Cantho Eco Resort - Khng gian ngh dng xanh mt gn gi vi thin nhin sng nc min Ty.\r\n\r\nBui chiu, Qu khch t do th gin cng nhng tin ch ca khu ngh dng: \r\nTha thch tm mt trong h bi nc mn ln nht Cn Th.\r\nTham quan vn rau, vn hoa ti sc bn ma, khu tr chi dn gian di nc, khu trt nc, sn sasuke c l \r\nXut bn nhng b nh c o m cht min Ty mc mc pha cht hin i, c knh n t Style Indochine\r\n Ngh m ti Cantho Eco Resort','Ngy 1: Thnh ph H Ch Minh - Vnh Long - Nh gm T Bui - Nh da - Cn Th Eco Resort\r\n','03 ba n (sng, tra, ti)','T886-3719-6N5D'),(1828,2,'Bui sng, on xung thuyn du ngon trn sng Cn Th, tham quan ch ni Ci Rng - Mt hnh thc hp ch c trng ti cc ng sng ca vng ng bng sng Cu Long  c cng nhn Di Sn Vn Ha Phi Vt Th Quc Gia.\r\n\r\nQu khch tri nghim hnh trnh Ho mnh vo h sinh thi tri cy mit vn ca vng t Phong in\r\nNh lt trn nhng chic ghe tam bn vi vu min sng nc hoc phng tin xe lam m cht bn a tham quan vn tri cy sum su theo ma;\r\nc bit Qu khch c th t tay thu hoch v tn hng hng v ngt ngo ca nhng qu tri r ngay ti vn.\r\n\r\nQu khch tr phng v khi hnh n Du lch sinh thi Phi Yn - thng thc ba tra trong khung cnh bnh d ca bc tranh ng qu thanh bnh.\r\n\r\nKhi hnh v thnh ph H Ch Minh, Qu khch kt thc hnh trnh ti im n ban u.\r\n\r\nLu : Chng trnh ca Vietravel l chng trnh trn gi, khng c p dng chnh sch min gim, u tin vo im tham quan (nu c) dnh cho tr em, ngi cao tui, ngi c cng vi cch mng v vy Vietravel s khng hon li phn chnh lch cho cc khch hng thuc din u tin ny.','Ngy 2: Cn Th - Tri cy mit vn - Ch ni Ci Rng - thnh ph H Ch Minh\r\n','02 ba n (sng, tra)','T886-3719-6N5D'),(1829,1,'Qu khch Tp trung ti Vietravel (190 Pasteur, phng V Th Su, qun 3, thnh ph H Ch Minh), on n sng v khi hnh n huyn Tam Nng (ng Th