n17:00  19:00: on di chuyn v khu lu tr, ngh ngi vui chi t do.\r\n19:00  21:30: on dng cm ti, tham gia chng trnh giao lu t la tri, ht karaoke cy nh l vn ti Sn trc hi trng ca Vn Quc Gia B Gia Mp v tham gia cc hot ng tp th vui nhn cng nhau th hin s on kt gia cc thnh vin trong on caravan.\r\n21:30 Kt thc sinh hot. on v ngh ngi.\r\nNgh m ti Vn Quc Gia B Gia Mp','Ngy 1: Thnh ph H Ch Minh - Bnh Dng - Ni B R - Khm ph vn Quc Gia B Gia Mp\r\n','03 ba n (sng, tra, chiu)','T770-7717-6N5D'),(1834,2,'06:00 Qu khch dng ba sng, thng thc c ph ti cn Tin ca vn Quc Gia B Gia Mp.\r\n07:30 on bt u hnh trnh Trekking khm ph vn Quc Gia B Gia Mp\r\non li xe theo tuyn T741  Trm kim lm s 2. on dng chn ti ng 4 ng T 741  ng vnh ai pha Nam ca vn, gh thm nh bia tng nim im cui ca Tuyn ng ng xng du huyn thoi  tuyn ng di n 5000km, bt ngun t Mng Ci Qung Ninh, Lng Sn (Chp hnh lu nim). Sau  on tip tc hnh trnh trn tuyn ng T741 l con ng xuyn vo vng li ca vn Quc Gia B Gia Mp. Trn ng i Qu khch s c khm ph th gii ng thc vt ca ni rng ni y.\r\n8:30  12:30: on n trm Kim lm s 02, ngh ngi 10 pht. Bt u hnh trnh trekking xung sui c Ka. Du khch c ha mnh vo rng t nhin, i qua nhiu sinh cnh rng ca vn. Hng dn vin a phng s gii thiu v cc loi thc vt nh cy G , Cm Lai, Ging Hngnhng cy Du Ri, Sao en vi ng knh c chc ngi m, nhng loi thc vt c ngi bn a dng lm cc v thuc cha bnh v hay s dng trong i sng sinh hot hng ngy Qu khch cng c kh nng may mn bt gp nhiu loi ng vt qu him nh : Voc Ch V  loi vt c mnh danh l loi p nht trong vng quc ca cc loi th, ngm nhn nhng ch Vn en m vng ang chuyn cnh 1 cch iu luyn nh nhng vin xic on vui chi, tm tin bn b sui k Ka. on tri nghim nng g, tht ba ch, cm lam n tra d ngoi trong rng.\r\n13:00 on quay ra trm kim lm s 2 ly xe\r\n14:00 Di chuyn v Vn phng vn Quc Gia B Gia Mp lm th tc tr phng.\r\n15:00  19:00 on khi hnh v thnh ph H Ch Minh. Kt thc hnh trnh, Hng dn vin chia tay on v hn gp li Qu khch trong nhng chng trnh c sc khc!','Ngy 2: Hnh trnh Trekking khm ph vn Quc Gia B Gia Mp\r\n','02 ba n (sng, tra)','T7