hp 9 tng cao 35 mt, ni linh thing  Qu khch cu mong nhng iu bnh an trong cuc sng.\r\nSau khi n ti, Qu khch khm ph Chu c vi cc im tm linh quan trng di chn ni Sam.\r\nMiu B Cha X ni Sam: ni linh thing  du khch gi gm nhng li nguyn cu n B.\r\nLng ng Thoi Ngc Hu: vi cng c vi vi trong cng cuc xy dng con knh Vnh T v i.\r\nTy An C T: kt hp mu mc ca phong cch ngh thut n  v kin trc c dn tc u tin ti Vit Nam.\r\nNgh m ti TP.Chu c.','Ngy 1: Tp.Hcm - Tri Tn - Tht Sn Huyn B - Ni Cm - Chu c - Miu B Cha X\r\n','n sng, tra, chiu','T889-3424-7N6D'),(1849,2,'Bui sng, Qu khch tr phng v khi hnh tham quan:\r\nT do mua sm c sn ngon ni ting ti ch Chu c - Ni c mnh danh Vng quc mm ca min Ty.\r\nRng trm Tr S - Bo tng Trm nhit i c tng din tch gn 1.500 hc-ta cng h sinh thi ng-thc vt a dng. Du khch di chuyn bng xung my hay nhng chic ghe  len li gia cc li i nh xuyn qua khu rng trm ngm nhn nhng mng bo xanh ngt tri di; check-in nh trng - mi, bn tu t chim ng nghnh, Cy Cu Tre Vn Bc di nht Vit Nam; c bit, bi cnh phim trng \'t rng phng Nam\'.\r\nSau khi n tra, on khi hnh n Cn Th nhn phng khch sn ngh ngi. Bui ti, Qu khch t do do ph m khm ph Ty  lung linh sc mu: ngm cnh cu Cn Th v m; check-in cu Tnh Yu - Thit k un ln hnh ch S cng hai i sen v h thng n led rc r sc mu; chp nh ti cha ng c knh; khm ph ch m Ninh Kiu...\r\nNgh m ti Cn Th.','Ngy 2: Chu c - Rng Trm Tr S - Cn Th\r\n','n sng, tra, chiu','T889-3424-7N6D'),(1850,3,'on tr phng v khi hnh ra Bn Ninh Kiu, xung thuyn du ngon trn sng Cn Th, nghe gii thiu v Ch thy sn nc ngt Cn Th; tri nghim Ch ni Ci Rng - Mt hnh thc hp ch c trng ti cc ng sng ca vng ng bng sng Cu Long  c cng nhn Di Sn Vn Ha Phi Vt Th Quc Gia.\r\nTip tc, Qu khch tham quan:\r\nLng du lch M Khnh: im du lch sinh thi hp dn vi cc im tham quan Nh c Nam b hn 115 nm tui; Vn hoa M Khnh; Khu nh vn ho 4 dn tc Kinh - Hoa - Chm - Khmer; Lng ngh truyn thng \r\nTri nghim tr chi Thm trt Cu vng: chinh phc cu trt phao kh u tin ca min Ty vi  cao 20m, ng trt di 160m. (Chi ph t tc)\r\nThin Vin Phng Nam: mt trong nhng ngi thin vin rng nht ng bng sng Cu Long, tham quan lu trng, lu chung, l Pht ti chnh in.\r\nSau khi dng chn tham quan v mua sm ti siu th c sn v qu lu nim Hng o, on khi hnh v TP.HCM theo tuyn cao tc M Thun - Cn Th; Chim ngng cu M Thun 2 - D n trng im quc gia c chiu di 1,9km ni lin tnh Vnh Long v Tin Giang.\r\nKt thc chng trnh du lch ti im n ban u.\r\nLu : Chng trnh ca Vietravel l chng trnh trn gi, khng c p dng chnh sch min gim, u tin vo im tham quan (nu c) dnh cho tr em, ngi cao tui, ngi c cng vi cch mng v vy Vietravel s khng hon li phn chnh lch cho cc khch hng thuc din u tin ny.','Ngy 3: Cn Th - Ch Ni Ci Rng - Lng Du Lch M Khnh - Tp.H Ch Minh\r\n','n sng, tra','T889-3424-7N6D'),(1851,1,'Qu khch tp trung ti sn bay Tn Sn Nht, ga i trong nc. Hng dn vin h tr lm th tc cho Qu khch chuyn bay chiu i Ph Quc. Xe n on ti sn bay, Qu khch n ti v v khch sn nhn phng ngh ngi.\r\nBui ti, Qu khch c th t do khm ph mt s hng mc ni bt ti thnh ph khng ng Grand World nh: \r\nCheck in Huyn thoi tre - cng trnh tre ln nht Vit Nam.\r\nTham quan Cng vin Ngh thut ng i Urban Park - ni quy t nhng tc phm ngh thut c o n mnh gia thin nhin, l s giao thoa c sc gia ngh thut ng i v thin nhin o Ngc.\r\nTn b bn dng knh o Venice v nhn ngm nhng chic thuyn Gondola, khu ph shophouse lng ly sc mu, cng lu i trng l, ba cy cu vm bn nguyt...\r\nThng thc ba tic nh sng nh cao vi show din Sc mu Venice.\r\nTham quan Bo Tng Gu Teddy - ni lu gi nhiu hin vt qu gi v ti hin chuyn phiu lu hi hc ca nh thm him ti ba Teddy Jones (chi ph t tc).\r\nMn nhn vi chng trnh biu din ngh thut Tinh Hoa Vit Nam quy t hn 200 din vin (chi ph t tc).\r\nNgh m ti Ph Quc','Ngy 1: Thnh ph H Ch Minh - Ph Quc - Grand World\r\n','S ba n: 01 (chiu)','T991-1257-6N5D'),(1852,2,'Sau khi n sng, Qu khch s n khm ph Vinpearl Safari Ph Quc - vn th bn hoang d u tin ti Vit Nam - vi quy m 180ha, vi hn 130 loi ng vt qu him v cc chng trnh biu din ng vt, chp nh vi ng vt, khm ph v tri nghim vn th m trong rng t nhin, gn gi v thn thin vi con ngi. \r\n\r\nBui chiu, Qu khch tham quan khm ph Khu vui chi gii tr VinWonders - cng vin ch  ln nht Vit Nam, quy m hng u Chu , du khch s c:\r\nTri nghim 12 nn vn minh nhn loi t c ch kim\r\nKhm ph 06 phn khu vi hn 100 hot ng gii tr siu c l\r\nCung nhit ti cng vin nc ln nht ng Nam \r\nChinh phc 20 tr chi mo him khng nht hnh tinh nh ng trt nhanh nht th gii Cn thnh n ca Zeus, ng trt kh Cuc chin Chn tinh cao 15m u tin ca Vit Nam, ng trt trong nh ti Chin binh i bng v Li nguyn c long - tr chi tng tc trong nh ti u tin ca Vit Nam,\r\nNg ngng vi show din triu  Once ng cp th gii\r\nChong ngp trc th gii i dng huyn o vi tm nhn v cc qua tm knh acrylic khng l 8x25m bn trong Cung in Hi vng - thy cung hnh ra ln nht th gii\r\nQu khch thng thc ba ti ti VinWonders v quay v khch sn ngh ngi. \r\nNgh m ti Ph Quc','Ngy 2: Vui chi tho thch ti Cng vin ch  VinWonders Ph Quc - Khu bo tn thin nhin Safari\r\n','S ba n: 03 (sng, tra, chiu)','T991-1257-6N5D'),(1853,3,'Sau khi n sng, xe n on tham quan Hon Thom Nature Park:\r\nTri nghim cp treo xc lp k lc th gii mi Cp treo 3 dy vt bin di nht th gii - 7.899.9m vi gc nhn 360  ngang qua Hn Ri, Hn Da v dng chn ti Hn Thm. Ch khong 15 pht trn cp treo, Qu khch s nhng khonh khc tuyt vi vi bc tranh bin tri ti Nam o Ph Quc.\r\nQu khch tham gia vo hnh trnh khm ph Cng vin nc ch  hin i nht ng Nam  - Aquatopia, tri nghim 6 khu check in ch  hp dn mang phong cch th dn huyn b.\r\nLng du trn con ng Th trn Hong Hn - c thit k vi kin trc c o, rc r sc mu ca mt th trn chu u c knh: check-in 1001 kiu bc thang, Qung trng La M, k quan Khi Hon Mn, Thp ng h cao 75m - ly  tng t thp chung St. Marks Campanile ca ; chim ngng Kiss Bridge - cy cu ni ln nh mt di la gia b bin trong xanh, vi hai nhp cu vn mnh m trn b ct trng, hng n nhau, hp vo lm mt th thng nht nhng khng chm nhau.\r\non tham quan v mua sm c sn ni ting ti c sn c Thnh, nh thng nc mm Hng c 1 / Khi Hon / Phng Hng, c sn kh, c s sn xut ngc trai Ph Quc - trng by cc trang sc bng ngc trai chnh hiu c nui cy ti Ph Quc.\r\nXe a Qu khch ra sn bay p chuyn bay tr v TP. H Ch Minh. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nLu :\r\nKhch c quc tch nc ngoi (tn nc ngoi & vit kiu  i tn hon ton): ph thu 850,000 VN/khch x 2 khch/phng\r\nTheo quy nh resort khch check-in cn t cc 1,000,000 /phng/m. S tin ny s c hon tr khi khch check-out.\r\nPh thu gi v tham quan i vi tr em di 12 tui cao trn 1m4 (gi c th thay i ph thuc nh cung cp)\r\n- Combo Hn Thm: ph thu 300,000 VN/khch\r\n- Combo Vinwonder + Safari: ph thu 300,000 VN/khch\r\ni vi cc khch khng ph thu khi mua tour, khi c pht sinh ti im tham quan, khch t chu chi ph pht sinh ti im tham quan.\r\nGi bay ph thuc vo hng hng khng, s ba n ph thuc vo gi bay. Cc ba n c th hon i  ph hp vi chng trnh.\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t\r\ny l chng trnh du lch trn gi, Vietravel khng c trch nhim hon tr chi ph chnh lch cho cc khch hng thuc din min gim hoc i tng u tin nh tr nh, ngi ln tui, ngi c cng vi cch mng Chnh sch min gim, u tin (nu c) ch dnh cho khch l ca cc im tham quan','Ngy 3: Ph Quc - Thnh ph H Ch Minh\r\n','S ba n: 02 (sng, tra)','T991-1257-6N5D'),(1854,1,'08h00: Xe v HDV n on ti im hn  khi hnh n vi vi mnh t Quy Nhn huyn thoi. on n tra trn ng i. n ni, Qu khch nhn phng v ngh ngi.\r\nBui chiu on tham quan:\r\n Khu du lch Ghnh Rng Tin Sa  ving m Hn Mc T: m nm da lng vo ni, nhn bao qut c di b bin Quy Nhn chy di trc mt, ht trn tm mt mt phn thnh ph Quy Nhn.\r\n Bi tm Hong Hu  Bi tm ni bt vi hng ngn vin  khng l hnh dng c o, nm xp ln nhau trn bi bin.\r\n18h30: Sau ba n ti, Qu khch t do do ph bin Quy Nhn v m, tr v khch sn ngh ngi.\r\nNgh m ti Quy Nhn','Ngy 1:  NNG  QUY NHN  GHNH RNG TIN SA (n 2 ba)','(sng, ti)','T552-2342-3N4D'),(1855,2,'Dng im tm sng ti khch sn. on bng qua Cu Th Ni n Bn o Phng Mai tham quan:\r\n K Co  c v nh Maldives ca Vit Nam vi mu nc trong xanh, bi ct trng di v mn cng nhng cn sng bin m i. Ti y, Qu khch c th tn mt chng kin mt cnh p thin nhin tuyt p, lm say m bit bao lng ngi. Qu khch tri nghim cano tham quan K Co.\r\nn tra v tm trng ti nh hng, bui chiu Qu khch tham quan:\r\n Eo Gi  mt ghnh  quanh nm lng gi. ng ti y, phng tm mt ra xa, Qu khch s c chim ngng bao qut c vng bin bao la rng ln, m say lng ngi.\r\non xut pht i Ph Yn, nhn phng v t do khm ph thnh ph Tuy Ho v m.\r\nNgh m ti Ph Yn','Ngy 2: QUY NHN  PH YN (n 3 ba)','(sng, ti)','T552-2342-3N4D'),(1856,3,'on dng im tm sng, lm th tc tr phng v khi hnh tham quan:\r\n Nh Th Mng Lng  ni lu gi cun kinh thnh bng ch Quc Ng u tin ca Vit Nam.\r\n Gnh  a  Thng cnh c nht v nh ca tnh Ph Yn v ca Quc Gia\r\nTrn ng i Qu khch cn c chim ngng cnh m  Loan. \r\nSau ba cm tra Qu khch khi hnh v  Nng. Chia tay on ti im hn. Kt thc chng trnh. Hn gp li Qu khch. \r\n ','Ngy 3: PH YN   NNG (n sng, tra, n nh ba ti)','(sng, ti)','T552-2342-3N4D'),(1857,1,'Qu khch tp trung ti im hn (S 3 Hai B Trng, Hon Kim, H Ni) trc 3 ting so vi gi bay. Xe v Hng dn vin n Qu khch ra sn bay Ni Bi p chuyn bay i Quy Nhn.\r\nn sn bay Ph Ct, xe v hng dn vin a phng n on n tra. Sau  i tham quan:\r\nCha Thin Hng: c v nh Phng Hong C trn thu nh ca Bnh nh.\r\nTiu chng vin Lng Sng: bng qua mt on ng vng vo, nh th Lng Sng hin ra gia nhng tn cy sao hng trm nm tui trong gi. Mang v ngoi c knh, m cht kin trc Gothic chu u vi nhng ng nt kiu vm nhn v nhiu ca s hin ha mang v p va nn th, va c knh gia thin nhin hu tnh.\r\nNh in ch Quc Ng: nm trong khun vin ca Tiu Chng Vin, ni gn vi s hnh thnh v pht trin ch quc ng. L mt trong ba c s in ch quc ng u tin ca Vit Nam, ni y cn lu gi li nhng t liu qu gi v s ra i ca nhng cun sch u tin bng ch quc ng.\r\nSau  on v nhn phng khch sn, n ti ti nh hng a phng. T do do ph bin v m.\r\nNgh m ti Quy Nhn','Ngy 1: H NI  QUY NHN (n tra, ti)','(sng, ti)','T552-5441-2N1D'),(1858,2,'Sau khi dng ba sng ti khch sn, Qu khch t do ngh ngi hoc la chn tham gia mt trong cc hot ng tri nghim sau:\r\nKDL Cn Chim (chi ph di chuyn v tham quan t tc): khng ch l khu bo tn chim, c v cc loi ng, thc vt bin phong ph a dng m ni y cn c bit n nh c o sinh thi xinh p vi mt mu xanh ngt bao quanh t nn tri, mu nc mnh mng n nhng cnh rng c ngt ngn tri di ta h mt bc tranh thy mc khng l. Qu khch s c tri nghim cc hot ng th v nh cu c, gi li lng cng ng dn m Th Ni v thng thc nhng mn n c o ca cn.\r\nK Co (chi ph di chuyn v tham quan t tc): vi mu nc trong xanh, bi ct trng di v mn, nhng cn sng bin m i chnh l im n l tng thu ht nhiu du khch trong thi gian gn y. Ngoi tm bin v a vui, qu khch cn c c hi n Bi San H ln ngm nhng rng san h t nhin v hng trm loi c y mu sc tung tng bi li.\r\non n ti ti nh hng a phng v t do do ph, khm ph thnh ph Quy Nhn v m.\r\nNgh m ti Quy Nhn','Ngy 2: QUY NHN  K CO (n sng, ti, t tc ba tra)','(sng, ti)','T552-5441-2N1D'),(1859,3,'n sng ti khch sn. Xe v HDV a on i tham quan:\r\nCha Linh Phong (Cha ng Ni): check in tng pht ngi 69m cao nht ng Nam  hin nay.\r\nKhu d ngoi Trung Lng v chim ngng b bin tri di ngt mt un ln qua cc ngn ni.\r\non n tra ti nh hng. Bui chiu, tip tc tham quan:\r\nEo Gi: check-in con ng i b ven bin hot nht. Eo Gi hoang s v k v khng thua bt k vng bin no  min Trung Vit Nam. N nh 1 iu k diu nm gia nhng rng ni .\r\nXe a on i qua chim ngng i ct Phng Mai  i ct p v ln nht Quy Nhn; bng qua cy cu vt bin ca Vit Nam  Cu Th Ni di gn 7 km ni thnh ph Quy Nhn vi bn o Phng Mai. T ni ny du khch c th thng ngon trn vn phong cnh ca m Th Ni vi nhiu gc  khc nhau.\r\nKhu du lch Ghnh Rng Tin Sa, ving M Hn Mc T: m nm da lng vo ni, nhn bao qut c di b bin Quy Nhn chy di trc mt, ht trn tm mt mt phn thnh ph Quy Nhn.\r\nn ti ti nh hng a phng. Thng thc mn Ch ram tm t  mt trong 121 mn m thc tiu biu ca Vit Nam.\r\nNgh m ti Quy Nhn','Ngy 3: I CT PHNG MAI  EO GI  KDN TRUNG LNG (n sng, tra, ti)','(sng, ti)','T552-5441-2N1D'),(1860,4,'Sau khi n sng, xe a on i thm quan thnh ph Quy Nhn:\r\nThp i: khng ch thu ht du khch bi kin trc c o, tinh t, sc so ca ngi dn Chm m ni y cn  li trong lng du khch nhng gi tr vn ha c sc.\r\nMua sm cc c sn Quy Nhn nh Ru Bu , Nem Ch Huyn, Bnh Hng, Tr Bnh nh, Bnh t L Gaiv lm qu.\r\non dng ba ti nh hng.\r\nSau  khi hnh ra sn bay p chuyn bay v H Ni. n sn bay Ni Bi xe n on v li im hn ban u. Chia tay v hn gp li Qu khch trong nhng chuyn du lch tip theo.\r\n***\r\n*Lu  :\r\n- Hnh trnh c th thay i th t im n ty vo iu kin thc t.\r\n- Lch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\n- Khch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\n- V nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh','Ngy 4: QUY NHN  H NI (n sng, tra)','(sng, ti)','T552-5441-2N1D'),(1861,1,'Qu khch tp trung ti Vietravel (S 3 Hai B Trng, Hon Kim, H Ni). Xe v Hng dn vin a on ra sn bay Ni Bi p chuyn bay i Ph Quc.\r\nn Ph Quc, Hng dn vin a on tham quan:\r\nDinh Cu: biu tng vn ho v tn ngng ca o Ph Quc. Ni ng dn a phng gi gm nim tin cho mt chuyn ra khi nh bt y p c khi tr v. Sau , on ving dinh B Thy Long Thnh Mu - th Thn N Kim Giao, ngi ph n c ngi dn Ph Quc rt mc tn knh v c cng khai ph huyn o ny.\r\nCha S Mun (Hng Long T): ngi cha c kin trc dn gian, nm trn trin ni, mt hng ra bin, xung quanh cy ci xanh tt. n y du khch cm nhn v p thanh tnh, bnh yn v cu nguyn s an lnh v hnh phc n vi gia nh.\r\nTri rn ng Tm 2: trung tm nghin cu v bo tn cc loi rn qu duy nht trn o. Ti y, Qu khch c nghe gii thiu v cc loi rn: rn h cha, rn cp nong, rn lc ui ,; xem biu din ly nc rn v tri nghim chp hnh vi nhng ch trn  c thun ha\r\nSui Tranh: dng sui mt lnh t trong khe ni len li chy qua rng cy, khe   cng ho vo dng chnh to nn dng sui Tranh hin ho.\r\nTr v khch sn, on t do khm ph o Ngc v m.\r\nNgh m ti Ph Quc\r\nLu : Trng hp chuyn bay trc 11h tra, Vietravel s h tr ba n tra','Ngy 1: H Ni - Ph Quc\r\n','S ba n: 01 (chiu)','T991-5166-4N3D'),(1862,2,'Sau khi n sng ti khch sn, Qu khch ln thuyn du ngon v cng nhau th ti cu c, tht l th v khi t tay Qu khch cu c nhng ch c M hay Trm... v y cng l dp c tri nghim cuc sng cn mn ca ngi dn ni hi o.\r\nNam o (giai on thng 5 - 9): on s c cu ca va tm bin tai Bai Sao - mt bi bin du m vi bi ct di tnh lng v nguyn s, c c gi CN Traveler bnh chn vo danh sch 10 bi bin hoang s nht th gii Ngoi tm bin, du khch c th tham gia nhng tr chi cm gic mnh trn bin nh: Jetsky, ca n d ko, mt nc (chi ph t tc)\r\nBc o (giai on thng 10 - 4): du khch cu ca va tm bin tai Bai ng Lang.\r\n* Lu : tri nghim cu c v ln ngm san h cn ph thuc vo iu kin thi tit thc t ti thi im on tham quan.\r\nBui chiu on tham quan:\r\nThin vin Trc Lm H Quc: ngi cha p v ln nht o ngc vi khung cnh hoang s, yn tnh  to nn mt bc tranh thin nhin c sc y v tn nghim v thanh tnh.\r\nQun th o Yn Ph Quc: ha vo khng gian xanh, du khch nghe gii thiu quy trnh s ch sn phm v mua sm c sn yn so b dng.\r\nNh t Ph Quc: ni y l minh chng hng hn cho cng cuc u tranh y gian kh v tinh thn bt khut ca nhn dn ta trong cc cuc u tranh chng gic ngoi xm.\r\nTm bnh yn trong hnh trnh i Theo nh Mt Tri ti Th trn Hong Hn - c thit k vi kin trc c o, rc r sc mu ca mt th trn chu u c knh:\r\nLng du trn con ng th trn, check-in 1001 kiu bc thang, ngm nhn Qung trng La M lp lnh di nh mai.\r\nSay p gia ngh thut ti Thp ng h cao 75m: ly  tng t thp chung St. Marks Campanile ca .\r\nLng ng vi k quan Khi Hon Mn nhum nh chiu t.\r\nChim ngng Kiss Bridge: cy cu ni ln nh mt di la gia b bin trong xanh, vi hai nhp cu vn mnh m trn b ct trng, hng n nhau, hp vo lm mt th thng nht nhng khng chm nhau. Ngm nhn bc tranh hong hn tuyt diu ang dn bung xung ng chn tri ni i dng xanh thm, y lng mn.\r\nSau khi n ti ti nh hng, Qu khch t do tham quan ch m Ph Quc\r\nNgh m ti Ph Quc','Ngy 2: Tri nghim cu c trn bin - Thin vin Trc Lm H Quc - Th trn Hong Hn\r\n','S ba n: 03 (sng, tra, chiu)','T991-5166-4N3D'),(1863,3,'Sau khi dng ba sng ti khch sn, Qu khch c th t do khm ph Ph Quc theo (1) trong (4) gi  sau (Qu khch t tc chi ph tham quan v phng tin di chuyn n im tham quan)\r\nLa chn 1:\r\n- Tri nghim hnh trnh tr v vi thin nhin ti Vinpearl Safari - thin ng bn hoang d ln nht Ph Quc: vi quy m 180 ha, hn 130 loi ng vt qu him, du khch thng thc cc chng trnh biu din, chp nh vi ng vt; tri nghim vn th m trong rng t nhin, gn gi v thn thin vi con ngi.\r\n- Hay tham quan khu vui chi gii tr VinWonders - cng vin ch  ln nht Vit Nam, quy m hng u Chu , Qu khch khm ph 12 nn vn minh nhn loi t c ch kim;\r\nCung nhit ti mt trong nhng cng vin nc ln nht ng Nam ;\r\nChinh phc du khch vi b 3 tr chi mi m y hp dn: Ngi lng Chin binh, Ni la Kinh hong v Li nguyn c long\r\nChong ngp trc th gii i dng huyn o vi tm nhn v cc qua tm knh acrylic khng l 8x25m bn trong Cung in Hi vng - thy cung hnh ra ln nht th gii.\r\nLa chn 2: Tri nghim b mn i b di y bin khm ph cng vin san h: do bc trn thm ct trng mn, hai bn li i l nhng rn san h theo dng hi lu ong a th v v m ra mt khung cnh tuyt vi trc mt vi v p mun mu ca hn 200 loi san h cng hng chc loi sinh vt bin c sc (du khch khng cn bit bi cng c th tham gia)\r\nLa chn 3: Versailles Mud Bath and Spa - thin ng bn khong u tin ti Ph Quc: tri nghim liu trnh tm bn tinh khit, va ngm phong cnh bin, va nghe giai iu du dng ca nhng con sng r ro, gip du khch c ln da mm mn v ti to nng lng mt cch hiu qu.\r\nLa chn 4: Qu khch t do ngh ngi ti khch sn hoc tm bin, khm ph Ph Quc.\r\nQu khch t tc dng ba tra\r\nBui chiu, xe a Qu khch n khm ph nhng hng mc ni bt ti Thnh ph khng ng Grand World nh:\r\nCng vin Ngh Thut ng i: s giao thoa c sc gia ngh thut ng i v thin nhin o Ngc.\r\nHuyn thoi Tre: cng trnh tre ln nht Vit Nam.\r\nTn b bn dng knh o Venice v nhn ngm nhng chic thuyn Gondola, khu ph shophouse lng ly sc mu, cng lu i trng l, ba cy cu vm bn nguyt mang m kin trc chu u ...\r\nH Tnh Yu Sc mu Venice a du khch phiu vi cu chuyn tnh yu lng mn c k li mt cch hon ho trn mt nc, s dng cng ngh 3D Mapping hin i bc nht th gii.\r\nNgh m ti Ph Quc','Ngy 3: Khm ph VinWonders - Vinpearl Safari - Grand World\r\n','S ba n: 02 (sng, chiu)','T991-5166-4N3D'),(1864,4,'Qu khch n sng, tr phng, xe a Qu khch tham quan v mua sm c sn ni ting ti nh thng nc mm Hng c 1, c sn c Thnh, c s sn xut ngc trai Ph Quc - trng by cc trang sc bng ngc trai chnh hiu c nui cy ti Ph Quc.\r\nXe a on ra sn bay Ph Quc, on v n sn bay Ni Bi, Hng dn vin n on v li im hn ban u.\r\n(Trng hp chuyn bay khi hnh sau 13h - Vietravel sp xp ba n tra cho qu khch)\r\n***\r\nLU \r\nThi gian bay c th thay i theo thng tin cp nht ca hng hng khng - nhn vin giao dch c trch nhim bo li cho khch hng ngay khi nhn c thng bo nu c\r\nHnh trnh c th thay i th t im n ty thuc vo iu kin thc t - lch trnh thm quan (tm bin, ngm hoa, tri nghim ) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong qu khch hiu v thng cm.\r\nTrong trng hp on gom di 10 khch th tour khng khi hnh. Cng ty s t vn cho Qu khch chuyn tour sang ngy khi hnh ln cn hoc thng bo chi ph pht sinh  khi hnh c on','Ngy 4: Ph Quc - H Ni\r\n','S ba n: 01 (sng)','T991-5166-4N3D'),(1865,1,'Qu khch tp trung ti Vietravel (190 Pasteur, Phng V Th Su, Qun 3, Tp.HCM), khi hnh i Chu c theo tuyn cao tc TP.HCM - Trung Lng v Trung Lng - M Thun ngm nhn nhng cnh ng la v mu xanh vn tc hai bn ng; Chinh phc cu Vm Cng: cu dy vng ln th hai ni lin i b Sng Hu, c khnh thnh trong s ho hc ca hng vn ngi dn sau bao nm ch mong.\r\nn Chu c, Qu khch tri nghim i tu trn sng Hu khm ph nt p bn a ca vng t An Giang\r\nLng b Chu c: lng ngh nui c ni ting An Giang rc r sc mu to ra mt trong nhng cung ng thu c o nht min Ty\r\nTham quan Nh dt Th Cm truyn thng hn 120 nm ca ngh nhn Mohamed; Qu khch c th thu trang phc Chm v check-in phng ci c o ca ngi Chm Islam (chi ph t tc)\r\nBui chiu, xe a Qu khch tham quan Miu B Cha X, Ty An C T, Lng Thoi Ngc Hu.\r\nNgh m ti Chu c.','Ngy 1: Tp.Hcm - Chu c - Miu B Cha X\r\n','n sng, tra, chiu','T889-2342-3N2D'),(1866,2,'on dng im tm v tr phng, khi hnh i tham quan:\r\nRng Trm Tr S: Bo tng Trm nhit i c tng din tch gn 1.500 hc-ta cng h sinh thi ng-thc vt a dng. Du khch di chuyn bng xung my hay nhng chic ghe  len li gia cc li i nh xuyn qua khu rng trm ngm nhn nhng mng bo xanh ngt tri di; check-in nh trng - mi, bn tu t chim ng nghnh, Cy Cu Tre Vn Bc di nht Vit Nam; c bit, bi cnh phim trng \'t rng phng Nam\'.\r\nKhi hnh n H Tin nhn phng khch sn ngh ngi. Bui chiu on tham quan:\r\nLng Mc Cu: ni th dng h Mc m khi u l ng Mc Cu - ngi  c cng khai ph mnh t H Tin.\r\nCha Ph Dung: ta lc di chn ni Bnh San.\r\nTm bin Mi Nai, t do thng thc hi sn a phng (chi ph t tc)\r\nNgh m ti H Tin.','Ngy 2: Chu c - Rng Trm Tr S - H Tin - Mi Nai\r\n','n sng, tra, chiu','T889-2342-3N2D'),(1867,3,'on n sng, tr phng v khi hnh ving thm:\r\nCha Tam Bo: c dng vo khong u th k XVIII, cha c triu nh nh Nguyn ban bin sc phong nn cn c gi l Sc T Tam Bo T. Ti in Pht vn cn c bi tr Pho tng c Pht A Di  bng ng cao 1,40m, do chnh ng Mc Cu th  cha.\r\nKhi hnh i Rch Gi, on tham quan:\r\nn th Nguyn Trung Trc : y l ngi nh th ng sm nht v ln nht trong chn n th  Kin Giang.\r\nKhi hnh i Cn Th on v khch sn nhn phng, ngh ngi. Sau khi n ti, Qu khch c th t do do ph m khm ph Ty  lung linh sc mu: ngm cnh Cu Cn Th v m; Check-in Cu Tnh Yu - Thit k un ln hnh ch S cng hai i sen v h thng n led rc r sc mu; Chp nh ti Cha ng c knh; Khm ph Ch m Ninh Kiu v Con ng Bch Ha Cn Th Xa V Nay - Ti hin nt p vn ha ca ngi dn Cn Th ni ring, vng ng bng sng Cu Long ni chung.\r\nNgh m ti Cn Th.','Ngy 3: H Tin - Rch Gi - Cn Th\r\n','n sng, tra, chiu','T889-2342-3N2D'),(1868,4,'on tr phng v khi hnh ra Bn Ninh Kiu, xung thuyn du ngon trn sng Cn Th, nghe gii thiu v Ch thy sn nc ngt Cn Th; tri nghim Ch ni Ci Rng - Mt hnh thc hp ch c trng ti cc ng sng ca vng ng bng sng Cu Long  c cng nhn Di Sn Vn Ha Phi Vt Th Quc Gia.\r\nTip tc, Qu khch tham quan:\r\nLng du lch M Khnh: im du lch sinh thi hp dn vi cc im tham quan Nh c Nam b hn 115 nm tui; Vn hoa M Khnh; Khu nh vn ho 4 dn tc Kinh - Hoa - Chm - Khmer; Lng ngh truyn thng \r\nTri nghim tr chi Thm trt Cu vng: chinh phc cu trt phao kh u tin ca min Ty vi  cao 20m, ng trt di 160m (chi ph t tc).\r\nThin Vin Phng Nam: mt trong nhng ngi thin vin rng nht ng bng sng Cu Long, tham quan lu trng, lu chung, l Pht ti chnh in.\r\nSau khi dng chn tham quan v mua sm ti siu th c sn v qu lu nim Hng o, on khi hnh v TP.HCM theo tuyn cao tc M Thun - Cn Th; Chim ngng cu M Thun 2 - D n trng im quc gia c chiu di 1,9km ni lin tnh Vnh Long v Tin Giang.\r\nKt thc chng trnh du lch ti im n ban u.\r\nLu : Chng trnh ca Vietravel l chng trnh trn gi, khng c p dng chnh sch min gim, u tin vo im tham quan (nu c) dnh cho tr em, ngi cao tui, ngi c cng vi cch mng v vy Vietravel s khng hon li phn chnh lch cho cc khch hng thuc din u tin ny.','Ngy 4: Cn Th - Ch Ni Ci Rng - Tp.Hcm\r\n','n sng, tra','T889-2342-3N2D'),(1869,1,'Qu khch tp trung, xe v Hng dn vin Vietravel n Qu khch ti s 03 Hai B Trng, khi hnh ra sn bay Ni Bi n chuyn bay i Nha Trang. \r\n(Vi chuyn bay trc 11h00, chng trnh s gm 01 ba tra)\r\nn sn bay Cam Ranh, Xe v Hng dn vin n on i tham quan: \r\nThp B Ponagar - con c tn goi khc l Yang Po In Nagar hay Yang P Ana Gar - L ngi n Chm Pa nm trn nh mt ngon i nh cao khong 10-12 mt so vi mc nc bin,  ca sng Ci (sng Nha Trang) ti Nha Trang - Khnh Ha.\r\nTrung tm sui khong nng I-resort (Ch bao gm chi ph tm khong  chi ph tm bn, hng liu t tc). Vi khng gian yn tnh, cy ci xanh ti, I-resort s hin ra nh mt bc tranh thin nhin m cht Vit, khu du lch c bao boc bi dng ni hng v, bn dng sng Ci th mng sn thu hu tnh khng u c c em n cho Qu khch nhng tri nghim mi v cuc sng vi dch v tm khong c o s to cho du khch cm gic tht thoi mi v th gin.\r\nSau ba ti Qu khch v khch sn ngh ngi hoc t do tham quan thnh ph Nha Trang v m.  \r\nNgh m ti Nha Trang','Ngy 1: H NI  NHA TRANG (n ti)','(sng, ti)','T556-2242-2N1D'),(1870,2,'Sau ba sng, Xe a on di chuyn n Ninh Thun v tham quan:\r\nHang Ri: c to thnh t  san h c c tui i hng triu nm, nm st mp bin, vi phn san h ni trn mt nc nh mt phin  khng l.\r\nVn nho Ninh Thun - thin ng nho Vit Nam - ta  checkin p nh m khin du khch say m qun li v. n y, Qu khch khng ch c nhng bc nh sng o p m cn c thng thc nhng qu nho cng mng, ngt lm tim.\r\nKhu du lch Natural Paradise: l im du lch sinh thi mang phong cch hin i kt hp vi nt c knh ca vn ho Chmpa. n y, Qu khch c th th gin, th hn vo khung cnh thin nhin tuyt p, check-in bn cu my, cu nc, vn hoa, thc nc hay c bit l cc ch cu xinh xn ti ng cu.\r\non tr v Nha Trang, trn ng i, Qu khch thng ngon khung cnh nn th ca Vnh Cam Ranh - mt trong nhng vnh bin p nht Vit Nam.\r\nCha T Vn: lm t hng triu vin  san h v v c  Cam Ranh (Khnh Ha) c chuyn trang du lch Culture Trip ca ngi l kho bu cho nhng du khch thch phiu lu. S hu khung cnh rt hp dn v n tng, thit k c l khng ch thu ht Pht t n hnh hng, m cn l im tham quan hp dn vi khch du lch. Qu khch s c cm gic th gin, cm nhn nt thanh tnh, yn bnh t nhng iu bnh d nht nh chnh in rp bng phi lao, thp Bo Tch cao 39m ni bt mang cu trc cu k vi 49 tiu thp bn ngoi, pha bn trong c hnh xon c ta h nh bc vo mt v s khng l hay con ng dn n a ngc di 500m c o,...\r\non dng ba ti v tr v khch sn ngh ngi.\r\nSau ba ti, Qu khch t do khm ph thnh ph bin Nha Trang: Skylight, Sailings club,\r\nNgh m ti Nha Trang','Ngy 2: HANG RI  NATURAL PARADISE  CHA T VN (n sng, tra, ti)','(sng, ti)','T556-2242-2N1D'),(1871,3,'Qu khch dng ba sng ti khch sn v la chn 1 trong 3 chng trnh sau:\r\n- La chn 1: T do khm ph thnh ph bin Nha Trang. Qu khch t do n tra.\r\n- La chn 2: Tham gia tour o, khm ph Nha Trang ti p.\r\n- La chn 3: Qu khch ng k chng trnh tham quan Th Gii Gii Tr VinWonders (chi ph t tc), tham gia cc tr chi: quay nho ln, u quay nga g, tu ln, ua xe, khm ph v tr. Qu khch t do n tra.\r\nVi quy m v hin i, c th snh ngang vi nhiu cng vin gii tr hng u trong khu vc. Khm ph nhng cng trnh tiu biu nh:\r\nDi chuyn sang o bng h thng cp treo vi tm nhn ngon mc m trn khung cnh vnh bin.\r\nDu ngon trong lng i dng nhn to chim ngng hng trm loi sinh vt bin a dng, phong ph, rc r sc mu ti Thy cung.\r\nTha sc tn hng cm gic vui nhn ti Khu tr chi trong nh hoc chinh phc th thch cao  t hng chc tr chi cm gic mnh ti Khu tr chi ngoi tri v Cng vin nc ngt trn bi bin u tin v duy nht ti Vit Nam.\r\nHa mnh theo nhng cu chuyn ly k hp dn ti phng chiu phim 4D, cm nhn s chn thc v sng ng nh s h tr ca cc hiu ng mi l, c bit\r\nm say trc v p lung linh, k o trong khng gian si ng honh trng ca chng trnh biu din nhc nc.\r\nDo b dc khu ph mua sm c thit k va m sc mu truyn thng m vn tinh t, hin i.\r\nChiu Qu khch t do thm quan thnh ph v mua sm  lu nim cho ngi thn v bn b.\r\non dng ba ti c bit, thng thc c sn a phng.\r\nNgh m ti Nha Trang','Ngy 3: VINWONDER NHA TRANG  MT NGY T DO (n sng, tra t tc, ti)','(sng, ti)','T556-2242-2N1D'),(1872,4,'on dng ba sng ti khch sn. Qu khch t do tm bin, lm th tc tr phng v i dng ba tra ti nh hng.\r\nTrn ng ra sn bay, Qu khch ngi trn xe ngm ton b khung cnh thnh ph Nha Trang ti p. n sn bay Cam Ranh, HDV h tr Qu khch lm th tc p chuyn bay tr v H Ni. Chia tay v hn gp li Qu khch!\r\n(*) Th t cc im thm quan c th thay i theo tnh hnh thc t ti thi im xut pht nhng vn m bo y  cc quyn li v cc im thm quan theo chng trnh.\r\n***\r\n*Lu  :\r\n- Thi gian bay c th thay i theo thng tin cp nht ca hng hng khng  nhn vin giao dch c trch nhim bo li cho khch hng ngay khi nhn c thng bo nu c\r\n- Trong trng hp on gom di 10 khch th tour khng khi hnh. Cng ty s t vn cho Qy khch chuyn tour sang ngy khi hnh ln cn hoc thng bo chi ph pht sinh  khi hnh c on.\r\n ','Ngy 4: NHA TRANG  H NI (n sng, tra)','(sng, ti)','T556-2242-2N1D'),(1873,1,'Qu khch tp trung ti ga i trong nc sn bay Tn Sn Nht. Hng dn vin h tr lm th tc cho on p chuyn bay i  Nng. Ti sn bay  Nng xe v Hng dn vin Vietravel n on v khch sn nhn phng ngh ngi.\r\nNgh m ti  Nng','Ngy 1: Tp. H Ch Minh -  Nng\r\n','00 ba n (ba ti t tc)','T444-1113-7N6D'),(1874,2,'Qu khch tr phng sm v khi hnh n Qung Bnh, trn ng dng chn dng ba tra ti nh hng a phng.\r\nn Qung Bnh, Qu khch bt u hnh trnh khm ph Phong Nha - K Bng\r\nng Phong Nha - c xem nh chn thn tin bi h thng ni  vi v sng ngm di nht th gii.\r\nQu khch dng ba ti v nhn phng khch sn ngh ngi.\r\nBui ti, Qu khch t do do ph m hoc tri nghim xe in tham quan tng i M Sut, Qung Bnh Quan, CKC Paradise Bar - mt trong nhng qun bar cao nht Qung Bnh, Qu khch ngm nhn ton cnh TP. ng Hi t trn cao bn dng sng Nht L th mng.\r\nNgh m ti Qung Bnh','Ngy 2:  Nng - Qung Bnh - ng Phong Nha\r\n','03 ba n (sng, tra, chiu)','T444-1113-7N6D'),(1875,3,'Qu khch dng ba sng, tr phng v khi hnh n Hu, trn ng dng chn tham quan\r\nThnh a La Vang - mt trong bn tiu vng cung thnh ng ti Vit Nam (giai on t 08/08 - 16/08 hng nm, Thnh a La Vang din ra \"i hi hnh hng c M La Vang\", nn cc tour khi hnh trong giai on ny s khng vo tham quan La Vang)\r\nn Hu, Qu khch dng ba tra. Bui chiu, on tip tc tham quan\r\ni Ni - chim ngng v p nguy nga, trng l v lu li nhng du mc vng son ca 13 i vua Nguyn.\r\nin Kin Trung - tm hiu Php lam ngh thut trang tr tht truyn 200 nm triu Nguyn c ti sinh\r\nVn Thiu Phng - chim ngng Thn Kinh Nh Thp Cnh vi kin trc vn t hi lang nh cao v khng gian trnh din cc ngh truyn thng ca Cung nh xa.\r\nLan Vin C Tch - nh vn tui i hn 200 tui c ch nhn chm cht vi nhiu mng xanh v nhng khng gian im nhn lm sng li mt nn vn ha Hu c xa.\r\nTm hiu ct cch rt ring ca ngi Hu qua khng gian sng v c li n, ting ni.\r\nKhm ph kho bu gm c di dng sng Hng; check-in bi cnh trong phim Em v Trnh.\r\nSau khi dng ba ti, Qu khch t do do ph, khm ph Hu v m rc r sc mu vi nhng hot ng:\r\nDo bc trn cu i b g lim ha cng v p lung linh cu Trng Tin.\r\nKhm ph khu ph Ty si ng, qun c ph xa DMZ, cng vui vi nhng mn n chi ca T Vt - qun n ni ting v m ca Hu.\r\nNgh m ti Hu','Ngy 3: Qung Bnh - Qung Tr - Hu\r\n','03 ba n (sng, tra, chiu)','T444-1113-7N6D'),(1876,4,'Qu khch dng ba sng, tr phng khi hnh n  Nng. Trn ng, Qu khch dng chn\r\nThng thc cafe Mui (min ph) tham quan mua sm ti VietPearl - thng hiu ngc trai cht lng cao, c ch tc tinh xo v mang m du n vn ha Vit.\r\nChim ngng Vnh Lng C - mt trong nhng vnh bin p nht th gii t mt gc nhn khc l ti trm gc xe la pha Bc Hi Vn.\r\nn  Nng, xe v HDV a on i tham quan Khu du lch B N (chi ph cp treo & n tra t tc) - on t do tham quan Xng bia th cng c v tr cao nht Vit Nam, Lng Php - Hi Ch Chu u, Cu Vng - c nht v nh, Cha Linh ng, Vn hoa bn ma, Khu vui chi Fantasy Park, \r\nQu khch dng ba ti ti nh hng a phng.\r\nBui ti, Qu khch t tc i do ph thng ngon cnh p ca  Nng v m ha mnh vo nhp sng nhn nhp ca cc khu ch m ni ting  Thnh nh Helio, Sn Tr \r\nNgh m ti  Nng','Ngy 4: Hu -  Nng - Khu du lch B N\r\n','02 ba n (sng, chiu)','T444-1113-7N6D'),(1877,5,'Bui sng, xe a Qu khch tham quan\r\nCha Linh ng - ni s hu mt trong nhng tng Pht Quan Th m cao nht Vit Nam.\r\nSau khi tr phng, xe a Qu khch khi hnh i n tra v mua sm c sn ph bin ti Giao Mart - vi hn 2000 sn phm c sn  Nng, min Trung v cc vng min ln cn, ni bt nht l ch b, b kh, v y  cc loi kh c,...\r\nQu khch tip tc hnh trnh n Qung Nam tham quan CSO Gallery - tri nghim vn ha Vit Nam v th gii qua nhng vt phm c trng by sng ng:\r\nKhm ph b su tp tin xu v tin giy c ca Vit Nam v th gii\r\nChim ngng quc bo vn hc qua b su tp truyn Kiu ln nht Vit Nam.\r\nTr v hi c sc mu Nghe nhng chic tem k chuyn lch s ca chnh mnh\r\nSau khi dng ba ti ti Hi An, Qu khch tham quan Ph C Hi An - vi Cha Cu, Nh c, Hi qun, do ph n lng cm nhn s yn bnh, c knh ca 1 trong 10 im n du lch hng u Chu .\r\nQu khch khi hnh v sn bay  Nng n chuyn bay tr v TP. H Ch Minh.\r\nChia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\n***KT THC CHNG TRNH  TM BIT QU KHCH***\r\nLu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim, ...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im','Ngy 5:  Nng - Hi An - Tp. H Ch Minh\r\n','03 ba n (sng, tra, chiu)','T444-1113-7N6D'),(1878,1,'06:15 AM: on tp trung ti trm dng chn An Bnh - Ph Giao Bnh Dng.\r\n07:00 AM: on lm l xut hnh.\r\n12:00 AM: on n dng chn thng thc ba tra ti H Ty k Mil - h nc p lng mn bc nht th trn.\r\n13:00 PM: on xut pht.\r\n14:30 PM: on n nhn phng khch sn.\r\n15:30 PM: on tham gia L Hi ng Ph ti Tng i Ng Su.\r\n18:45 PM: on dng ba ti ti nh hng.\r\n20:00 PM: Qu khch t do tham gia L khai mc - L hi c ph Bun Ma Thut ln th 9 vi ch  Bun Ma Thut - im n ca c ph th gii ti Qung trng 10/3.\r\non t do khm ph Thnh ph Bun Ma Thut v m.\r\nNgh m ti Bun Ma Thut','Ngy 1: Thnh ph H Ch Minh - Bun Ma Thut (10/3/2025)\r\n','02 ba n (tra, chiu)','T770-9408-2N1D'),(1879,2,'07:30 AM: on xut pht tham quan v tri nghim\r\n08:30 AM: Thc Dray Nur - khm ph bc tng nc khng l, mun ngn si nc trng xa qun qut, an xen, lung linh, huyn o, dng thc nghing mnh  xung sng su, to nn mt bc tranh thin nhin huyn diu. on s tham gia cc tri nghim:\r\np xe khm ph thc Gia Long qua con ng lng Bun Kup, ngm cuc sng bnh d di mi nh di ca ng bo  v MNng.\r\nLeo ni men theo nhng trin  c xa vi hnh th c o.\r\nCho thuyn vt dng sng Srpk huyn thoi Ty Nguyn v tm sng.\r\nThng thc ba tra vi nhn g mn n a phng bn dng sui nh: g nng cm lam - 121 mn n tiu biu Vit Nam, \r\n13:00 PM: on quay v thc Dray Nur v sinh c nhn v t do tham quan, chp nh.\r\n15:30 PM: on xut pht quay v khch sn ngh ngi.\r\n18:00 PM: on dng ba ti ti nh hng.\r\n19:00 PM: Qu khch t do tham gia L hi Nng dn ua ti ti Qung trng 10/03\r\non ngh ngi v t do khm ph Bun Ma Thut v m.\r\nNgh m ti Bun Ma Thut','Ngy 2: Bun Ma Thut - Dray Nur - Bun Ma Thut (11/3/2025)\r\n','03 ba n (sng, tra, chiu)','T770-9408-2N1D'),(1880,3,'07:30 AM: on xut pht tham quan v tri nghim\r\n08:30 AM: Qu khch tham gia Hi voi Bun n ti Khu du lch Cu treo Bun n (hot ng d kin) v tham quan tri nghim cc hot ng sau:\r\nTham quan cu treo v ngm dng sng Srpk huyn thoi.\r\nChim ngng Ngi nh sn c c nin i ln n 125 nm vi kin trc mang m vn ho ngi Lo.\r\nThm khu lng m ca vua voi Khun Yu Np v cu chuyn v cuc sn voi huyn thoi ca ngi dn ni y.\r\nChp nh vi vi nhng ch voi to ln hin ha (chi ph t tc).\r\nHa thn thnh nhng chng trai, c gi ni ni rng i ngn trong trang phc truyn truyn thng ngi -, Lo (chi ph t tc).\r\n12:00 PM: on dng ba tra ti khu du lch.\r\n13:00 PM: on khi hnh khm ph nng tri c ph Aeroco Coffee Farm nm st cnh h Eakao th mng. Qu khch s c dp c tri nghim cc hot ng\r\nLng nghe cu chuyn lch v loi cy c ph Arabica v Robusta\r\nTm hiu phng php rang c ph v thng thc ly c ph c pha theo cc phng php khc nhau\r\nMua sm cc mt hng c ph ti showroom v lm qu (chi ph t tc)\r\n***Nu on khi hnh vo ng dp, Qu khch c th chim ngng nhng bng hoa n r mang mt mu trng tinh khit v to ra hng thm c ph lm ngt ngy bao ngi trn khp mi no ng ni min t  bazan.\r\n18:30 PM: Qu khch tham d tic gala.\r\n22:00 PM: Ngh ngi ti khch sn.\r\nNgh m ti Bun Ma Thut','Ngy 3: Bun n - Hi voi Bun n - Hnh trnh tm v hng v c ph (12/03/2025)\r\n','03 ba n (sng, tra, chiu)','T770-9408-2N1D'),(1881,4,'08:00 AM: on lm th tc tr phng v khi hnh i tham quan Bo tng th gii c ph. Qu khch s c tri nghim:\r\nChim ngng cng trnh kin trc c bn Bo tng Th gii C ph v b su tp hn 11.000 hin vt v C ph Vit Nam v th gii.\r\nHa nhp cng chng trnh biu din vn ha bn a Ty Nguyn (khung gi biu din theo lch ca Bo tng)\r\nTham gia show tri nghim Vn minh c ph Thin.\r\n10:30 AM: on xut pht v TP. H Ch Minh, Qu khch dng chn thng thc c sn lu c lng sng Srpk.\r\non v n im n ban u, kt thc v cho tm bit.','Ngy 4: Bun Ma Thut - Bo tng Th gii C ph - Thnh ph H Ch Minh (13/03/2025)\r\n','02 ba n (sng, tra)','T770-9408-2N1D'),(1882,1,'Qu khch tp trung ti sn bay Cn Th, Hng dn vin lm th tc p chuyn bay i  Lt. n sn bay Lin Khng, on khi hnh v trung tm thnh ph  Lt. on i tham quan:\r\nCha Linh n - c xy dng theo th lng ta ni mt hng thy vi rng thng bt ngn bao quanh v trc mt l thc Voi hng v.\r\nTm Trnh Coffee - thng thc ly c ph thm ngon, tn hng khng kh trong lnh v cng lng nghe cu chuyn ngn v cc loi c ph\r\nXe a on v nhn phng khch sn ngh ngi v dng ba ti ti nh hng.\r\nBui ti Qu khch t do tn b ch  Lt v thng thc m thc a phng: lu b, lu g l , bnh t lng g, bnh cn,.... \r\nNgh m ti  Lt ','Ngy 1: Sn bay Cn Th -  Lt - Thnh ph ngn hoa\r\n','01 ba n (chiu)','T668-9659-3N2D'),(1883,2,' Lt cho n qu khch vi khng kh se lnh thoang thong mi sng sm mai, sau khi dng ba sng, xe a on tham quan:\r\nLc vo tri u ti Vn Chu u - Euro Garden ni s hu khung cnh bnh yn vi mun vn sc hoa ti Cu t, n y Qu khch c dp c:\r\n- Tha sc check-in bn tim cafe tu ha mu  cng nh ga kin trc Chu u\r\n- To dng chp nh bn ng hoa rc r sc mu \r\n- Do bc trong khung cnh lng mn ca tri xanh, my trng, i ch Cu t trm tui cng tua pin qut gi khng l\r\nTm hiu v thng thc ru vang ti Hm Vang  Lt, Qu khch s c: \r\n- Khm ph hm vang duy nht v ln nht t tiu chun chu u ti Vit Nam, vi nhng mi vm theo li kin trc Trung c v khng gian mi hng c o \r\n- Lng nghe nhng cu chuyn v ngi lm vang qua tng thi k y hp dn\r\n- Tri nghim 01 ly ru vang vi hng v thanh khit c ngm  trong nhng thng g si, s mang li cm gic tri nghim v mt hm vang Chu u c trng nht.\r\nQu khch dng ba tra ti nh hng. Bui chiu, on tip tc tham quan:\r\nThc Datanla - ti y Qu khch c th s dng dch v xe trt tham quan thc. Tip tc n i Robin i cp treo sang tham quan Thin Vin Trc Lm, H Tuyn Lm ngm cnh thin nhin - ni i - rng thng  Lt t cabin cp treo (Chi ph cp treo v mng trt t tc)\r\nThin vin Trc Lm - vi qun th cng trnh kin trc c o, du khch cn c ngm nhn cc vn hoa xinh p khoe sc v ton cnh h Tuyn Lm vi thin nhin, ni i, rng thng  Lt...\r\nQung trng Lm Vin - im nhn ca TP.  Lt bn b h Xun Hng vi cng trnh ngh thut bng hoa d qu v n hoa Atiso khng l c thit k bng knh mu, lp lnh phn chiu p mt bi nh sng.\r\nBui ti, on t do ung caf quanh khu vc H Xun Hng hay thng thc ly sa u nnh nng hi, bnh trng nng c sn  Lt khu vc Tng Bt H. \r\nNgh m ti  Lt','Ngy 2:  Lt - Vn Chu u - Hm Vang  Lt\r\n','03 ba n (sng, tra, chiu)','T668-9659-3N2D'),(1884,3,'Qu khch dng im tm sng, lm th tc tr phng khch sn. Sau  xe v HDV a khch tham quan:\r\nMua sm c sn  Lt ti c s mt Thanh Nhu - cc loi tri cy sy gin, sy do, nc ct du tm  du ti, tr atiso, tr hoa, ... (Chi ph t tc)\r\nTri nghim thm vn du Berry Valley (Farm 2) - c trng vi quy trnh cng ngh cao. Qu khch s t tay hi nhng tri du ty ti  n hoc  tng gia nh, bn b (Chi ph t tc)\r\nXe a on ra sn bay Lin Khng n chuyn bay v TP. Cn Th. Chia tay Qu khch, kt thc chng trnh du lch.','Ngy 3:  Lt - Sn Bay Lin Khng - TP. Cn Th\r\n','01 ba n (sng)','T668-9659-3N2D'),(1885,1,'Trc gi bay 3 ting, Qu khch tp trung ti S 03 Hai B Trng  Hon Kim  H Ni. Hng dn vin lm th tc cho Qu khch p chuyn bay i Nha Trang.\r\nn sn bay Cam Ranh, xe v hng dn vin ca Vietravel n v a on v thnh ph Nha Trang.\r\nTrn ng v thnh ph Nha Trang, Qu khch c th ngm nhn cung ng bin tuyt p ca tnh Khnh Ha\r\nDi chuyn ti thnh ph Nha Trang, qu khch tham quan:\r\nThp B Ponagar - con co tn goi khac la Yang Po In Nagar hay Yang P Ana Gar - ngi n Chm Pa nm trn nh mt ngn i nh cao khong 10-12 mt so vi mc nc bin,  ca sng Ci (sng Nha Trang) ti Khnh Ha.\r\nTrung tm sui khong nng I-resort (Chi ph tm bn v hng liu t tc) - vi khng gian yn tnh, cy ci xanh ti, I-resort s hin ra nh mt bc tranh thin nhin m cht Vit, khu du lch c bao bc bi dng ni hng v, bn dng sng Ci th mng sn thu hu tnh khng u c c em n cho Qu khch nhng tri nghim mi v cuc sng vi dch v tm khong c o s to cho du khch cm gic tht thoi mi v th gin.\r\nSau ba ti Qu khch t do tham quan thnh ph Nha Trang v m.\r\nNgh m ti Nha Trang','Ngy 1: H NI  NHA TRANG (n ti)','(sng, ti)','T668-5474-4N3D'),(1886,2,'Qu khch dng ba sng ti khch sn. Xe a Qu khch ra cng, ln tu v khi hnh tham quan:\r\nHn Lao - o Kh: Qu khch t do tm bin, th gin, tham quan xem chng trnh biu din xic kh, ua ch, kh bi li hoc tri nghim cc mn th thao trn bi bin v tr chi: can ko d, m t nc, ua xe cng thc 1, bn sng sn, ci  iu  (chi ph t tc).\r\nQu khch dng ba tra ti nh hng.\r\nBui chiu, on t do tham quan, khm ph vng t du lch si ng Nha Trang y nng hoc c th la chn cc chng trnh Option tour (chng trnh c th thay i theo lch Option tour Qu khch la chn v t tc ba ti):\r\nLa chn 1: Qu khch ng k chng trnh tham quan Th Gii Gii Tr VinWonders (chi ph t tc) - ngm ton cnh Vnh Nha Trang t nh vng xoay mt tri ln nht Vit Nam, tham quan b su tp k hoa, d tho ti i Vn Hoa, khu vn th m - vn Qu Vng, tham gia cc tr chi tng tc v lin hon ti Qung trng Thn Thoi hay Vng t yu thng, xem phim 4D ti lu i i Dng, khm ph khu tr chi cm gic mnh, khu tr chi trong nh hay tm bin, tm h bi ln nht ng Nam  v thng thc chng trnh biu din show nh sng ngh thut k v ti Qung trng thn thoi mi ti.\r\nLa chn 2: Tham gia tour o, khm ph Nha Trang ti p (chi ph t tc).\r\nLa chn 3: Du thuyn Sea Coral hin i hay Emperor c knh - Qu khch s c tn hng trn vn cc gic quan khi thng thc ba ti trong ting nhc du dng, trm bng ca ban nhc, bn ly cocktail nng nn gia khung cnh hng v ca vnh Nha Trang ang nhum mu hng cam ca nh hong hn khut dn sau rng ni (chi ph t tc).\r\nQu khch t do khm ph Nha Trang v m.\r\nNgh m ti Nha Trang\r\n ','Ngy 2: HN LAO - O KH  VINWONDERS  T DO (n 2 ba, ti t tc)','(sng, ti)','T668-5474-4N3D'),(1887,3,'Qu khch tr phng v n sng, xe Vietravel a Qu khch tham quan:\r\nLng Yn Mai Sinh: tn mt chim ngng m hnh hang Yn, tm hiu qu trnh chim Yn lm t, quy trnh thu hi, tinh ch, nm th cc sn phm lm t t Yn...\r\nQu khch di chuyn v thnh ph  Lt v dng ba tra ti nh hng.\r\nSau  on tip tc tham quan:\r\nQung trng Lm Vin - ni din ra Festival Hoa ca thnh ph, hin nay l biu tng ca thnh ph th mng  Lt.\r\nNh ga c  Lt - c thit k 3 chp ging ni Langbiang, l tuyn ng st c ni t  Lt n Sng Pha ca Phan Rang. ng st c 3 ng ray, c thit k theo kiu Thu S.\r\nCha Linh Phc - cn c gi l Cha Ve Chai v trong sn cha c con rng di 49m c lm bng 12.000 v chai l. Cha Linh Phc l mt cng trnh kin trc khm snh c sc ca thnh ph  Lt\r\non dng ba ti v v khch sn nhn phng ngh ngi. Qu khch t do khm ph  Lt v m.\r\nNgh m ti  Lt','Ngy 3: NHA TRANG   LT (n sng, tra, ti)','(sng, ti)','T668-5474-4N3D'),(1888,4,'Qu khch dng ba sng ti khch sn v khi hnh tham quan:\r\nnh LangBiang  ta  cao ca thnh ph  c 1 ci nhn toan cnh xung thnh ph mng m, ti y qu khch c th i b hoc dng xe Jeep  ln nh ( chi ph xe Jeep khng bao gm)\r\nNh th Domaine  theo dng n tu Bc i, ta lc trn i Mai Anh, ni bt vi mu hng sng rc. Qu khch c th chn cho mnh nhng mn  t len trong khun vin pha sau nh th\r\non dng ba tra ti nh hng. Bui chiu on tham quan:\r\nThin Vin Trc Lm: mt trong nhng thin vin ln nht ca Lm ng vi kin trc dn tc truyn thng kt hp hi ha vi cu trc ng i  ng c sc.\r\nMongo Land: mang v p hon ton mi l - mt \"tiu Mng C thu nh\" trong lng  Lt c thit k nh mt nng tri vi nhng chic lu  mu sc. Tt c u c bi tr c o, bt mt theo phong cch Mng C c trng. n y, ngoi vic tn hng bu khng kh trong lnh v chim ngng v p ca thin nhin hng v, Qu khch s c tri nghim:\r\n+ Tha thch chp nh ti lu mng c, xch u, nng tri u, thm c, sa mc xng rng,\r\n+ Ha mnh vo th gii ca ng vt: hu sao, d mini, cu, th Vit, th Holland Lop H Lan, th S T, chim Yn, Chinchilla, sc Chipmunk, v t tay cho th n (thc n s c Mongo Land chun b sn cho qu khch).\r\n+ Tham gia cc hot ng vui chi nh: trt c, bn cung\r\n+ Tri nghim cm gic siu  ti ng trt phao kh p v di nht  Lt\r\n+ Tr thnh nhng c nng, chng trai du mc thc th khi din trn mnh trang phc ngi Mng C. (Chi ph thu trang phc t tc).\r\nQu khch dng ba ti ti nh hng v v khch sn ngh ngi.\r\nNgh m ti  Lt','Ngy 4:  LT MNG M (n 3 ba)','(sng, ti)','T668-5474-4N3D'),(1889,5,'Sau ba sng, Qu khch tham quan:\r\nDinh III - cng trnh Bit in Vua Bo i hay cn gi l Dinh 3  Lt c mnh danh l mt Paris thu nh gia i thng  Lt, c xy dng nm gi khu rng i n, trn ngn i cao trn 1540 m so vi mc nc bin. Ni y chnh l ni m gia nh vua Bo i sinh hot v lm vic.\r\nCh  Lt mua c sn v lm qu cho bn b v ngi thn\r\nQu khch dng ba tra sau  xe tin on ra sn bay Lin Khng v li H Ni. V n H Ni, chia tay Qu khch. Kt thc chng trnh du lch.\r\n***\r\n*Lu  :\r\n- Thi gian bay c th thay i theo thng tin cp nht ca hng hng khng  nhn vin giao dch c trch nhim bo li cho khch hng ngay khi nhn c thng bo nu c\r\n- Hnh trnh c th thay i  th t im n ty thuc vo iu kin thc t - lch trnh thm quan (tm bin, ngm hoa, tri nghim ) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong qu khch hiu v thng cm.\r\n- Trong trng hp on gom di 10 khch th tour khng khi hnh. Cng ty s t vn cho Qy khch chuyn tour sang ngy khi hnh ln cn hoc thng bo chi ph pht sinh  khi hnh c on\r\n ','Ngy 5:  LT - H NI (n sng, tra)','(sng, ti)','T668-5474-4N3D'),(1890,1,'Qu khch tp trung ti Vietravel (190 Pasteur, P.V Th Su, Q. 3, TP.HCM), xe a on khi hnh i  Lt. Trn ng i Qu khch gh tham quan:\r\nThc Bobla - p nh mt bc tranh thin nhin vi dng thc nguyn s, hng v cao hn 40m, rng hn 20m, cng cnh quan c tn to tuyt p, lu gi nhiu cy c th hng trm nm tui, pha xa ht tm mt l nhng i ch, c ph xanh mt.\r\nThin Vin Trc Lm - mt trong nhng thin vin ln nht ca Lm ng vi kin trc dn tc truyn thng kt hp hi ha vi cu trc ng i  ng c sc..\r\nTip tc hnh trnh, Qu khch n vi thnh ph sng m  Lt mng m nhn phng ngh ngi v dng ba ti ti nh hng a phng. \r\nBui ti, Qu khch t do do ph thng thc m thc ni ting ph ni: Lu g l  Tao Ng, Lu b qun G, Bnh t lng g, c nhi tht, Xe lu buffet, Ngi BBQ  (chi ph t tc). \r\nNgh m ti  Lt','Ngy 1: TP. H Ch Minh -  Lt\r\n','3 ba n (sng, tra, chiu)','T556-9875-7N6D'),(1891,2,'Sau khi dng ba sng ti khch sn, Qu khch khi hnh i tham quan:\r\nng Hm t St - ni ting vi nhng tc phm iu khc bng t nung n tng nh: Ga xe la, Dinh Bo i, Nh th Con G, H v cc thu ht nhiu du khch n tham quan.\r\non dng ba tra v tr v khch sn ngh ngi. Bui chiu, Qu khch tip tc tham quan:\r\nKDL Cao Nguyn Hoa - ni bo tn a dng sinh hc c bit l cc lai hoa thn g. n y Qu khch s c tri nghim:\r\nTh gin ti qun Seven-T Coffee nm gia rng thng, b bi v cc gia rng nhit i \r\nTham gia tr chi  Lt Swing - xch u tin ln nht Vit Nam\r\nRose Garden - Vn hoa hng vi hng trm gc hng ngoi, hng ni, hng c th qu \r\nTho sc chp hnh vi dn siu xe cc cht, i mai anh o, i hu sng nile, i hoa sim tm, i hoa hong yn,\r\nTrang tri rau v hoa Vn Thnh - khm ph quy trnh trng nhng loi nng sn v tha sc chp hnh vi cc vn hoa hng, cm chng, lily, ng tin, cm t cu hay cc vn c chua, b khng l, da Pepino, du v cc loi rau trng thy canh (ty theo ma). \r\nMua sm c sn  Lt ti c s mt Thanh Nhu cc loi tri cy sy gin, sy do, nc ct du tm - du ti, tr atiso, tr hoa, ...\r\nQu khch dng ba ti ti nh hng v t do ngh ngi, khm ph  Lt v m.\r\nNgh m ti  Lt','Ngy 2:  Lt - Thnh Ph Ngn Hoa\r\n','03 ba n (sng, tra, chiu)','T556-9875-7N6D'),(1892,3,'Sau khi dng ba sng, on lm th tc tr phng v khi hnh tham quan:\r\nChp nh ti Qung trng Lm Vin - im nhn ca TP.  Lt vi cng trnh kin trc hoa d qu v n hoa Atiso khng l.\r\nFairytale Land & hm ru vang Vnh Tin - khu vn c tch ca nhng ch ln Hobbiton. Do mt vng quanh khu vn Qu khch s c dp thm hm ru vang vi hn 10.000 chai ang c trng by.\r\nQu khch dng ba tra v tip tc khi hnh i thnh ph bin Nha Trang. n ni on khm ph \"Vng 