Phc Hng ca Chu u v cc cng trnh c Vit Nam. Tm hiu Php lam - Ngh thut trang tr tht truyn 200 nm triu Nguyn c ti sinh.\r\n Cha Thin M: ngi cha c xem l biu tng x Hu v l ni lu gi nhiu c vt qu gi khng ch v mt lch s m cn c v ngh thut.\r\n\r\nSau ba ti, Qu khch t do do ph m tri nghim mt Hu v m khng h trm mc vi cc cng trnh tri theo chiu di lch s m nh mt thiu n tr trung khoc ln mnh b cnh sc mu cng trn nha sng vi ti Ph i b ven sng Hng hi ha vi v lung linh cu Trng Tin, tranh thu XQ, t do thng thc cc mn ng ph x Hu nh bnh m lc, ch Hu, ngm nhn thuyn rng ngc xui bn bn Ta Khm vng vng m vang iu h Hu. Khm ph khu ph Ty si ng v m vi nhiu qun x ng vui, nhng hng qu lu nim.\r\nNgh m ti Hu. ','Ngy 3:  NNG  M LP AN  HU S ba n: 03 ba (sng, tra, chiu)','(sng, ti)','T448-9816-4N3D'),(1899,4,'Dng ba sng khch sn. Qu khch khi hnh sm i Qung Bnh, on gh tham quan:\r\n\r\n ng Phong Nha: Nm trong qun th Di sn thin nhin th gii Phong Nha  K Bng, c xem nh chn thn tin bi h thng ni  vi v sng ngm di nht th gii.\r\n\r\n ng Thin ng: Mt trong nhng hang ng k v nht th gii, c xem nh hong cung di lng t, mt nhnh thuc Qun th di sn thin nhin th gii Vn Quc Gia Phong Nha K Bng. \r\n\r\nSau khi tham quan, on khi hnh v khch sn, nhn phng t do ngh ngi v khm ph Qung Bnh v m.\r\nNgh m ti Qung Bnh.  ','Ngy 4: HU  NG PHONG NHA & THIN NG S ba n: 03 ba (sng, tra, chiu)','(sng, ti)','T448-9816-4N3D'),(1900,5,'Dng ba sng ti khch sn. on khi hnh tr v Hu, trn ng nghe hng dn vin thuyt minh Khu phi qun s DMZ v Cu Hin Lng Sng Bn Hi (V tuyn 17)\r\n\r\n Thnh a La Vang: mt trong bn tiu vng cung thnh ng La M ti Vit Nam\r\n\r\n(Ghi ch: Giai on t 08/08  16/08 hng nm, Thnh a La Vang din ra \"i Hi Hnh Hng c M La Vang\" hng nm, nn cc tour khi hnh trong giai on ny s khng vo tham quan La Vang)\r\n\r\n Mua sm ti m xng Thin H.\r\n\r\nn sn bay Ph Bi (Hu) n chuyn bay tr v Tp.H Ch Minh. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.   \r\n-----------------o0o0o0o0o--------------\r\nLu :\r\n Hnh trnh c th thay i th t im n ty vo iu kin th