My (khng bao gm v tham quan).\r\nChng trnh tng v tri nghim tu ha leo ni Mng Hoa s khng c hon li chi ph v khng thay th dch v khc trong trng hp Qu khch khng tham gia hoc phi hy do iu kin khch quan v thi tit, cung ng, thng bo t n v cung ng.','Ngy 2: Sapa - Fansipan Legend - o  Quy H\r\n','03 ba n (sng, tra, chiu)','T001-6308-7N6D'),(1903,3,'Qu khch dng ba sng v tr phng khch sn. Xe khi hnh a Qu khch v H Ni, trn ng dng tham quan mua sm c sn v dng cm tra ti nh hng a phng. n H Ni, qu khch tham quan:\r\nHong thnh Thng Long: qun th cng trnh kin trc  s c cc triu vua xy dng trong nhiu giai on lch s v tr thnh di tch quan trng bc nht trong h thng cc di tch Vit Nam.\r\nQu khch dng cm ti v nhn phng khch sn ngh ngi hoc t do i tham quan khm ph ph c H Ni.\r\nNgh m ti H Ni','Ngy 3: Sapa - H Ni\r\n','03 ba n (sng, tra, chiu)','T001-6308-7N6D'),(1904,4,'Qu khch dng ba sng v tr phng. Xe khi hnh a Qu khch i tham quan:\r\nLng H Ch Tch (khng ving vo th 2, th 6 hng tun v giai on bo tr nh k hng nm 10/6 - 12/8) tham quan v tm hiu cuc i v s nghip ca v cha gi dn tc ti Nh Sn Bc H, Bo Tng H Ch Minh, Cha Mt Ct.\r\nTip tc hnh trnh, xe a Qu Khch i H Long, trn ng tham quan Danh thng Yn T:\r\nQu khch ln cp treo du ngon thng cnh thin nhin ng Yn T (chi ph cp treo t tc), ni cn lu gi nhiu di tch lch s mnh danh t t Pht gio Vit Nam, chim bi cha Mt Mi, cha Hoa Yn - ni tu hnh ca pht hong Trn Nhn Tng khai sinh ra dng mi Thin Phi Trc Lm, nm trn lng chng ni   cao 516m. Vo thng 2-3 hng nm, Ni Yn T s khoc ln mnh chic o c sa vng rc r ca i lo mai vng, thu ht hng ngn du khch n thng ngon phong cnh hng v ca dy Yn T. \r\nQu khch ng cm chiu v nhn phng khch sn ngh nghi. Bui ti, Qu khch t do khm ph nhiu hot ng dch v gii tr si ni ti ph c Bi Chy - nm cnh cng vin Sun World H Long t nhng m thc ng ph n cc qun c ph siu d thng nh Hn Gai Coffee & Lounge hay thoi mi bung xa ti The Mini Bar, Brothers Pub,\r\nNgh m ti H Long','Ngy 4: H Ni - Yn T - H Long\r\n','03 ba n (sng, tra, chiu)','T001-6308-7N6D'),(1905,5,'Qu khch dng im tm sng 