khch hiu v thng cm.\r\nKhch Sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.','Ngy 7: H Ni - SB Ni Bi - TP.HCM\r\n','01 ba n: (n sng hp mang i)','T001-6308-7N6D'),(1908,1,'Bui sng Hng dn vin Vietravel n Qu khch ti bn Ninh Kiu, xung thuyn du ngon trn sng Cn Th, ngm cu Quang Trung, n ch ni Ci Rng - mt hnh thc hp ch c trng ca vng ng Bng Sng Cu Long, Qu khch t do thng thc v chn mua c sn Min Ty (chi ph t tc).\r\non v li bn Ninh Kiu, tham quan cha ng - mt cng trnh va p va mang nt c knh hin nay vn cn nguyn vn. Xe on khach di chuyn n bn pha C Bc, trn ng tham quan nh c Bnh Thy - ngi nh c nm gian hai mi, kin trc kiu Php c gia nh h Dng xy vo nm 1870, theo kin trc nh kiu Php. Ni y cn lu gi nhiu  c qu gi. Nh c Bnh Thu cng l ni quay b phim ni ting \"Ngi tnh\" ca o din Php JJ.Annaud v nhiu b phim trong nc.\r\nn bn  C Bc, Qu khch i  qua sng tham quan cm du lch cng ng Cn Sn - ngi lng du lch cng ng c o gia lng ph th cng nhng tri nghim c bit:\r\nB C 7 Bon: tham quan m hnh nui c lng b, Th vin c nc ngt v ni bo tn nhng ging c qu him trn sng Hu hin ha. Thng thc sn phm lm t c tht lt cm, tn mt chim ngng c cung th v tri nghim massage chn bng c c vy.\r\nQu khch cng nhau thng thc ba cm gia nh - mi nh mt mn ngon vi \"thc n bay\" c trng ch c  Cn Sn.\r\nNh c tr v vi tui th t tri nghim lm bnh dn gian Nam b truyn thng (bnh l mt, bnh kp cun) qua s hin dn tn tnh ca cc ngh nhn cht phc. Thng thc nhng chic bnh t tay lm ra thm mi go, mi l, ha quyn nc ct da bo ngy.\r\non dng chn tham quan vn tri cy c sc theo ma: chm chm, nhn, v sa, i, bi (mi ma mi tri).\r\nThng thc i sch trng ti vn v tr hoa u bic; xem cc din vin c biu din \"C Lc Bay\" v \"C Tr G\" khng ni no c c.\r\nMc s th tit mc Xic ch th v; Thng thc bnh phu th nhn mn (gii nht bnh ngon Nam B 2015) v sm sm gii nhit c trng quanh vn ha quyn cng nc ct gng thm ngon.\r\nCheck-in cng l sen siu to khng l. Tham quan, tm hiu v \"Vn ha Ghe xung Nam B\" v mua sm cc sn phm OCOP\r\nQu khch cng nhau thng thc ba cm gia nh.\r\nBui chiu on quay li Bn  C Bc. Xe on khach khi hnh v im n ban u. Kt thc chng trnh. Hng dn vin chia tay v hn gp li Qu khch.','Ngy 1: Bn Ninh Kiu - Ch ni Ci Rng - Nh c Bnh Thy - nh Bnh Thy - Cn Sn\r\n','02 ba n (sng, tra)','T992-7573-2N1D'),(1909,1,'Hng dn vin Vietravel n Qu khch ti bn Ninh Kiu, xung thuyn du ngon trn sng Cn Th, ngm cu Quang Trung, nghe gii thiu Ch ni; tri nghim ch ni Ci Rng - mt hnh thc hp ch c trng ti cc ng sng ca vng ng bng sng Cu Long, ch ni quy t hng trm ghe xung, to thnh ni mua bn, giao thng cc loi tri cy, c sn sm ut trn sng nc. Ch ni Ci Rng  c cng nhn Di sn Vn ha Phi vt th Quc Gia. Qu khch t do thng thc v chn mua c sn Min Ty (chi ph t tc). \r\nTip tc, Qu khch tham quan:\r\nThin vin Phng Nam - ngi cha rng nht khu vc ng bng sng Cu Long, thm lu trng, lu chung, l Pht ti chnh in. Thin Vin c xy dng vi kin trc truyn thng, thanh tao, Qu khch s n tng vi ni tht bng g lim v cc loi g qu c mang v t Nam Phi, c bit l b tng pht c lm t g hai cy tng qu him vi ng knh hn 2m chiu ngang.\r\nKhu du lch M Khnh - nm bn dng sng Cn Th hin ho ca x s mit vn tru qu bn ma khp M Khnh - Phong in im du lch sinh thi hp dn vi cc tr chi dn gian vui nhn: cu c, cho thuyn trn sng, ua heo, tham quan nh c (chi ph t tc).  n tra ti M Khnh.\r\nTra Qu khch xung tu khi hnh v li bn Ninh Kiu. V n bn Ninh Kiu. Hng dn vin tm bit v chia tay vi on. Kt thc chng trnh du lch.\r\nKT THC CHNG TRNH - TM BIT QU KHCH!\r\n  iu kin nhn khch\r\n- Qu khch  hon thnh tim 2 mi vaccine nga Covid-19 v c th xanh hoc giy xc nhn tim chng (mi th 2  14 ngy so vi ngy khi hnh) hoc Qu khch  khi bnh c giy xc nhn trong vng 6 thng.\r\n- Qu khch cha tim c giy chng nhn kt qu PCR/ test nhanh m tnh hiu lc trong vng 72H p dng cho c ngi ln/ tr em.\r\n ','Ngy 1: Bn Ninh Kiu - Ch ni Ci Rng - KDL M Khnh - Thin vin Trc lm Phng Nam\r\n','02 ba n (sng, tra)','T992-1111-6N5D'),(1910,1,'Qu khch tp trung ti Vietravel H Ni (S 03 Hai B Trng, Hon Kim), khi hnh ra sn bay Ni Bi p chuyn bay i Cn Th.\r\nn Cn Th, xe a on n bn  C Bc (Cn Th), Qu khch i  qua sng tham quan Cn Sn - ngi lng du lch cng ng c o gia lng ph th cng nhng tri nghim bn a c bit:\r\nQu khch cng nhau thng thc ba cm gia nh - mi nh mt mn ngon vi \"thc n bay\" c trng ch c  Cn Sn.\r\nNh c tr v vi tui th t tri nghim lm bnh dn gian Nam b truyn thng (bnh l mt, bnh kp cun) qua s hin dn tn tnh ca cc ngh nhn cht phc. Thng thc nhng chic bnh t tay lm ra thm mi go, mi l, ha quyn nc ct da bo ngy.\r\non dng chn tham quan vn tri cy c sc theo ma: chm chm, nhn, v sa, i, bi (mi ma mi tri).\r\nThng thc i sch trng ti vn v tr hoa u bic; xem cc din vin c biu din \"c lc bay\" v \"c tr g\" khng ni no c c.\r\nMc s th tit mc xic ch th v; Thng thc bnh phu th nhn mn (gii nht bnh ngon Nam B 2015) v sm sm gii nhit c trng quanh vn ha quyn cng nc ct gng thm ngon.\r\nCheck-in cng l sen siu to khng l. Tham quan, tm hiu v \"Vn ha Ghe xung Nam B\" v mua sm cc sn phm OCOP.\r\nB c 7 Bon - tham quan m hnh nui c lng b, Th vin c nc ngt v ni bo tn nhng ging c qu him trn sng Hu hin ha.\r\nSau khi dng ba ti ti Thnh ph Cn Th, Qu khch t do do ph m khm ph Ty  lung linh sc mu: ngm cnh Cu Cn Th v m; Check-in Cu Tnh Yu - thit k un ln hnh ch S cng hai i sen v h thng n led rc r sc mu; Chp nh ti Cha ng c knh; Khm ph Ch m Ninh Kiu ...\r\nNgh m ti Cn Th','Ngy 1: H Ni - Cn Th - Cn Sn\r\n','02 ba n (tra, chiu)','T995-2394-6N5D'),(1911,2,'on n sng, tr phng v khi hnh ra bn Ninh Kiu, xung thuyn du ngon trn sng Cn Th, nghe gii thiu v ch thy sn nc ngt Cn Th; tri nghim ch ni Ci Rng - mt hnh thc hp ch c trng ti cc ng sng ca vng ng bng sng Cu Long, ch ni quy t hng trm ghe xung, to thnh ni mua bn, giao thng cc loi tri cy, c sn sm ut trn sng nc. Ch Ni Ci Rng  c cng nhn Di Sn Vn Ha Phi Vt Th Quc Gia.\r\nSau khi tham quan v mua sm ti siu th c sn, qu lu nim Hng o, on khi hnh i Bc Liu tham quan:\r\nNh cng t Bc Liu - do k s ngi Php thit k vo nm 1919, y c xem l ngi bit th b th nht  Nam k lc tnh lc by gi. on nghe k v giai thoi vng son mt thi ca cu Ba Huy -