Thi tham quan Sun World Hon Thom Nature Park vi nhng hot ng th v:\r\n- Tri nghim cp treo 3 dy vt bin di nht th gii - 7.899.9 mt.\r\n- Phn khch tt  cng th thch \"Mc X thnh n\" - tr chi tu ln bng g u tin ti Vit Nam, c tc  ti a 80km/h vi nhiu gc ln ngon mc; i quan st \"Mt i bng\" cao 120m - du khch nh c bay ln khng trung, thng ngon i dng xanh ngt bao la, nhng cnh rng nhit i xanh mt, nhng o nh nhp nh gia bin tri khong t (tr chi c th tm dng v lch bo tr)\r\n- Vui chi ti cng vin nc Aquatopia: mt trong nhng cng vin nc ch  hng u ng Nam , tri nghim 6 khu check-in ch  hp dn mang phong cch th dn huyn b.\r\nLng du trn con ng Th trn Hong Hn - c thit k vi kin trc c o, rc r sc mu ca mt th trn chu u c knh: check-in 1001 kiu bc thang, Qung trng La M, k quan Khi Hon Mn, Thp ng h cao 75m - ly  tng t thp chung St. Marks Campanile ca ; chim ngng Kiss Bridge - cy cu ni ln nh mt di la gia b bin trong xanh, vi hai nhp cu vn mnh m trn b ct trng, hng n nhau, hp vo lm mt th thng nht nhng khng chm nhau.\r\nBui ti, Qu khch c th t do khm ph mt s hng mc ni bt ti thnh ph khng ng Grand World nh:\r\n- Cng vin Ngh Thut ng i: s giao thoa c sc gia ngh thut ng i v thin nhin o Ngc.\r\n- Huyn thoi Tre: cng trnh tre ln nht Vit Nam.\r\n- Tn b bn dng knh o Venice v nhn ngm nhng chic thuyn Gondola, khu ph shophouse lng ly sc mu, cng lu i trng l, ba cy cu vm bn nguyt mang m kin trc chu u ...\r\n- Tham quan bo tng Gu Teddy: lu gi nhiu hin vt qu gi v ti hin chuyn phiu lu hi hc ca nh thm him ti ba Teddy Jones (chi ph t tc)\r\n- Mn nhn vi show din thc cnh Tinh Hoa Vit Nam quy t hn 200 din vin (chi ph t tc)\r\n- Thng thc ba tic nh sng nh cao vi show din Sc mu Venice\r\nNgh m ti Ph Quc.','Ngy 1: TP H CH MINH - PH QUC - HN THM - TH TRN HONG HN - GRAND WORLD\r\n','02 ba n (tra, chiu)','T991-2223-2N1D'),(1927,2,'Qu khch bt u hnh trnh tr v vi thin nhin ti Vinpearl Safari Ph Quc - Vn th bn hoang d u tin ti Vit Nam: vi quy m 180 ha, hn 130 loi ng vt qu him, du khch thng thc cc chng trnh biu din, chp nh vi ng vt; tri nghim vn th m trong rng t nhin, gn gi v thn thin vi con ngi.\r\nBui chiu, Qu khch tham quan khm ph Khu vui chi gii tr VinWonders - Cng vin ch  ln nht Vit Nam, quy m hng u Chu , du khch s c:\r\n- Tri nghim 12 nn vn minh nhn loi t c ch kim;\r\n- Khm ph 06 phn khu vi hn 100 hot ng gii tr siu c l;\r\n- Cung nhit ti Cng Vin Nc ln nht ng Nam ;\r\n- Chinh phc 20 tr chi mo him khng nht hnh tinh nh ng trt nhanh nht th gii Cn thnh n ca Zeus, ng trt kh Cuc chin Chn tinh cao 15m u tin ca Vit Nam, ng trt trong nh ti Chin binh i bng v Li nguyn c long - tr chi tng tc trong nh ti u tin ca Vit Nam,\r\n- Ng ngng vi show din triu  Once ng cp th gii;\r\n- Chong ngp trc th gii i dng huyn o vi tm nhn v cc qua tm knh acrylic khng l 8x25m bn trong Cung in Hi vng - thy cung hnh ra ln nht th gii.\r\nQu khch thng thc ba ti ti VinWonders.\r\nNgh m ti Ph Quc.','Ngy 2: VUI CHI THA THCH TI CNG VIN CH  VINWONDERS PH QUC - KHU BO TN THIN NHIN SAFARI\r\n','03 ba n (sng, tra, chiu)','T991-2223-2N1D'),(1928,3,'Qu khch dng ba sng, th gin ti khch sn n gi tr phng. Sau , xe a on tham quan v mua sm c sn ni ting ti Nh thng nc mm Hng c 1 / Khi Hon / Phng Hng, c sn c Thnh, C s sn xut ngc trai Ph Quc - Trng by cc trang sc bng ngc trai chnh hiu c nui cy ti Ph Quc.\r\nXe a Qu khch ra sn bay p chuyn bay tr v TP H Ch Minh. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nLu :\r\nKhch c quc tch nc ngoi (tn nc ngoi & vit kiu  i tn hon ton): ph thu 850,000 VN/khch x 2 khch/phng\r\nTheo quy nh resort khch check-in cn t cc 1,000,000 /phng/m. S tin ny s c hon tr khi khch check-out.\r\nPh thu gi v tham quan i vi tr em di 12 tui cao trn 1m4 (gi c th thay i ph thuc nh cung cp)\r\n- Combo Hn Thm: ph thu 300,000 VN/khch\r\n- Combo Vinwonder + Safari: ph thu 300,000 VN/khch\r\ni vi cc khch khng ph thu khi mua tour, khi c pht sinh ti im tham quan, khch t chu chi ph pht sinh ti im tham quan.\r\nGi bay ph thuc vo hng hng khng, s ba n ph thuc vo gi bay. Cc ba n c th hon i  ph hp vi chng trnh.\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t\r\ny l chng trnh du lch trn gi, Vietravel khng c trch nhim hon tr chi ph chnh lch cho cc khch hng thuc din min gim hoc i tng u tin nh tr nh, ngi ln tui, ngi c cng vi cch mng Chnh sch min gim, u tin (nu c) ch dnh cho khch l ca cc im tham quan','Ngy 3: PH QUC - TP H CH MINH\r\n','01 ba n (sng)','T991-2223-2N1D'),(1929,1,'on t tc di chuyn n khch sn nhn phng ngh ngi. T do khm ph Ph C H Ni v m.\r\nNgh m ti H Ni.','Ngy 1: Khch sn Ph C H Ni','(sng, ti)','T001-8875-4N3D'),(1930,2,'Sng: on n sng ti khch sn.\r\n08h00 Xe n Qu khch ti khch sn trung tm thnh ph H Ni i Cng Quc t H Long. \r\nn ni:\r\n12h30  12h45 T Cng tu khch Quc t H Long, Qu khch s c n bng xung chuyn ti  ln du thuyn Starlight. Sau khi nghe hng dn vin gii thiu, qu khch nhn cha kha phng ngh ca mnh v quay tr li nh hng  dng ba tra.\r\n13h00  15h30 Du thuyn nh neo ri bn  i thm quan. Du thuyn s phc v ba n tra v du thuyn s dng li gia trung tm ca vnh  bt u nhng hot ng khm ph H Long k o. \r\n15h30  16h30 Du khch c hng dn vin a on thm hang Sng St, mt trong nhng hang  ln nht, p nht vnh H Long. \r\n16h30  17h30 Qu khch tr li tu, thay qun o bi hoc mc trang phc ph hp  i xung nh ln tm bin hoc ngm cnh trn o Titov. \r\n17h30  19h00 Tr li du thuyn, ln sn thng, thng thc nhng mn  ung hp dn vi chng trnh Gi Vng: Mua 02 tng 01 (dnh cho cocktail v mocktails), th gin v ngm mt tri ln, tham gia tri nghim nu n cng u bp chuyn nghip. \r\n19h00 Qu khch dng ba ti. Giao lu vi cc khch hng khc hoc tham gia cc chng trnh nh cu mc, ht karaoke n 22h00. \r\nNgh m trn du thuyn. ','Ngy 2: H NI - CNG TU KHCH QUC T H LONG  VNH H LONG (n ba ba)','(sng, ti)','T001-8875-4N3D'),(1931,3,'06h00  07h30  Bt u mt ngy mi vi lp hc Thi Cc Quyn, ngm mt tri mc, m mnh trong khng kh trong lnh ca bui sng vi ly caf hay tr tht sng khoi. Qu khch cng c th n lt d ti nh hng nu thch. \r\n7h30  9h00 Qu khch tp hp  i theo hng dn vin ln xung nh i thm Hang Lun mt trong nhng hang nc xuyn qua lng ni  vi  vo mt ging  vi p nh tranh v. Qu khch hy la chn i bng  cho tay ca ngi a phng hoc t cho thuyn th thao kayak. \r\n09h30   n gi tr phng, qu khch gi hnh l v cha kha ti quy l tn\r\n09h30  11h15 Du thuyn di chuyn v b. Qu khch th gin, khm ph phong cnh v chp nhng bc cnh k nim tuyt p v H Long trc khi thng thc ba tra sm. \r\n11h30 Qu khch ri tu ti Cng tu khch Quc T H Long. Qu khch tm bit du thuyn Starlight. Kt thc chuyn hi trnh tham quan y n tng v cnh p v con ngi H Long. \r\nXe a on v li im n ban u. Kt thc chng trnh. Hn gp li qu khch!\r\n ','Ngy 3: VNH H LONG - CNG TU KHCH QUC T H LONG  H NI (n sng, tra)','(sng, ti)','T001-8875-4N3D'),(1932,1,'08h00: Qu khch tp trung ti VP Vietravel Vinh.\r\non di chuyn tham quan Nam n vi cac im n:\r\nHong Tr qu m v Lng Sen qu cha ca Bc. Ti y, qu khch dng hng tng nh, tham quan ngi nh tranh n s ca Bc, lng nghe thuyt minh v cuc i v s nghip ca Bc v ngi thn ca Bc.\r\nTham quan n Chung Sn - n th gia tin Ch tch H Ch Minh.\r\nn tra ti nh hng a phng\r\nChiu: Xe v HDV n on n huyn Thanh Chng tham quan c o ch - nhng qu i c ph bi mu xanh ngt ngt ngn ca nhng cy ch, an xen gia nhng khu i l nhng h nc c phn chiu mu ch. Khi nhng tia nng bt u ngy mi ta sng, c i ch tr nn p rc r cng ln khng kh trong lnh khin bn khng khi ngc nhin.\r\nSau khi tham quan, xe n on v li im hn ban u\r\nKt thc chng trnh. Chia tay v hn gp li on','Ngy 1: Vinh - KDT Kim Lin - i Ch Thanh Chng\r\n','03 ba n (sng, tra, chiu)','T440-1299-6N5D'),(1933,1,'Qu khch tp trung ti Vietravel (190 Pasteur, Phng V Th Su, Qun 3, TPHCM). Xe a on khi hnh n im n sng. Sau , theo ng dn vo cao tc, khm ph nhng cung ng cao tc mi ca khu vc pha Nam: TP.HCM  Long Thnh  Du Giy  Phan Thit  Vnh Ho. Trn ng i, Qu khch dng chn chp hnh ti: \r\nBin C N: mt trong nhng bi bin p nht min Trung, vn c mnh danh l Nng cng cha ng qun bi v p hoang s ca n.\r\nn tra ti Ninh Ch v tip tc hnh trnh n vi thnh ph bin Nha Trang. Trn ng i, on chim ngng v gh thm:\r\nCnh ng in gi m Ni: gn nh th G Sn, n y du khch s trng thy nhng cnh qut tuabin nh nhng ci xay gi khng l to nn khung cnh hng v, p n nao lng.\r\nGh thm cn nh c m p cha ng nhng mm cm mc mc ngy xa ti nh hng Nha Trang Xa. Qu khch tr v vi nhng k nim ca mt thi:\r\nCheck-in gc lng ngh truyn thng nui ln nhiu i ngi Nha Trang: dt chiu, c ng, an nn,...\r\nHo thn thnh cc giai nhn thi Nguyn vi tri nghim mc c phc t o di, o tc, nht bnh ti tm o nu(chi ph t tc)\r\nQuay v tui th vi cc tr chi dn gian:  n quan, nhy l c,\r\nThng thc m thc m v qu dn d ca X Trm Hng \r\nSau khi dng ba ti, on nhn phng ngh ngi hoc len vo nhng khu ch m, thng thc m thc dn d a phng hay n Qung trng 2/4, check in Thp Trm Hng  biu tng ca thnh ph Nha Trang.\r\n\r\nNgh m ti Nha Trang\r\n ','Ngy 1: TP. H Ch Minh - C N - Nha Trang Xa\r\n','03 ba (sng, tra, chiu)','T554-9275-3N2D'),(1934,2,'Sau khi dng ba sng ti khch sn, xe a on tham quan:\r\nThp B Ponagar: cng trnh tiu biu cho ngh thut kin trc v iu khc tn ngng tn gio bc nht ca dn tc Chm ti Nha Trang.\r\nHn Chng: ni bt vi nhng tng  ln nm chng cht ln nhau bao i nay nhng sng bin v ma gi khng th x ng.\r\nBui chiu, Qu khch t do khm ph thnh ph Nha Trang hoc t tc la chn tham quan 1 trong 2 chng trnh: \r\nVinWonders Nha Trang (chi ph v tham quan t tc): ngm ton cnh Vnh Nha Trang t nh vng xoay mt tri ln nht Vit Nam, tham quan b su tp k hoa, d tho ti i Vn Hoa, khu vn th m - vn Qu Vng, tham gia cc tr chi tng tc v lin hon ti Qung trng Thn Thoi hay Vng t yu thng, xem phim 4D ti lu i i Dng, v thng thc chng trnh biu din show nh sng ngh thut k v ti qung trng thn thoi mi ti.\r\nMua sm nhng mn qu dnh cho ngi thn, bn b ti The Gift Farm and Mori\r\nVinpearl Harbour (chi ph t tc): check in 1001 tm nh vi siu nhiu gc chp ta tri u, tho thch mua sm vi hng trm thng hiu ni ting, thng thc ba tic m thc phong ph ti Harbour Market, tn hng Party all night cng m nhc bng n v nhng cuc vui bt tn.\r\non t do dng ba ti ti Harbour Market v quay v t lin ngh ngi.\r\n(VTV h tr xe chiu i - chi ph v tham quan v xe chiu v t tc)\r\nNgh m ti Nha Trang','Ngy 2: Nha Trang - Thp B - Hn Chng - VinWonders\r\n','02 ba (sng, tra)','T554-9275-3N2D'),(1935,3,'Qu khch dng ba sng ti khch sn v lm th tc tr phng. on khi hnh i Ph Yn sm v dng chn tham quan:\r\nThp Nghinh Phong: l biu tng ca Ph Yn, khi ng  y, Qu khch c th c nghe bn nhc t nhin c nht khng bao gi lp li c vit nn bi nhng cn gi thi qua khe thp. \r\nCheck in Vn Nht, chp ngn nh xinh ti Canary Garden Ph Yn: \r\nTho thch th dng ti Vn hoa vn sc mu vi trm hoa ua n c chm cht t m theo tng ma Xun  H  Thu  ng.\r\nHo mnh vo khng gian Nht Bn ni bt vi Torii  Cng tri huyn b x Ph Tang, h c Koi, Fuji Hill mng m\r\nHo thn thnh nhng c gi, chng trai x s Mt tri mc vi trang phc truyn thng: Kimono, Yukata (chi ph trang phc t tc)\r\nThng thc bui tra ti m  Loan. Bui chiu, on khi hnh tham quan:\r\nNh Th Mng Lng: Ni cn lu gi cun kinh thnh bng ch Quc Ng u tin ca Vit Nam.\r\nGnh  Da: Thng cnh c nht v nh ca tnh Ph Yn v ca Quc Gia.\r\nSau khi dng ba ti ti thnh ph Tuy Ha, on v nhn phng khch sn v t do do mt ti Qung trng Mt Thng T ngm nhc nc hay ch m Tuy Ha thng thc cc mn n dn d.\r\n\r\nNgh m ti Ph Yn\r\n ','Ngy 3: Nha Trang - Ph Yn - Gnh  a - Nh th Mng Lng\r\n','03 ba (sng, tra, chiu)','T554-9275-3N2D'),(1936,4,'Sau khi dng ba sng ti khch sn. Qu khch tr phng, on khi hnh i tham quan:\r\nBi Mn  Mi in: mt bi bin vn cn kh hoang s, c hnh vng trng khuyt, ct trng mn, nc trong veo nh pha l. Xa xa, Qu khch chp hnh Mi in vi ngn hi ng vn ra bin, mt trong nhng ni n nh nng u tin ca T Quc.\r\nBn Tu Khng S Vng R: tm hiu v bit thm v lch s con tu huyn thoi, gip vn chuyn v kh t Bc vo Nam, on tu cng vi s chin u anh dng v kin cng ca nhng ngi lnh thi chin, ra sc bo v cho ha bnh ca dn tc.\r\nKDL Dc Lt: c to dng vi bi c xanh ngt v hng da c trng ca vng bin, ni m nh nng mt tri, ct trng v phong cnh  ha quyn vo nhau  lm nn mt khung cnh th mng cho khu du lch cao cp ny\r\nSau khi dng ba ti, Qu khch t do ngh ngi ti khch sn hoc t do do ph m.\r\nNgh m ti Nha Trang','Ngy 4: Ph Yn - Mi in - Dc Lt - Nha Trang\r\n','03 ba (sng, tra, chiu)','T554-9275-3N2D'),(1937,5,'Sau khi dng ba sng ti khch sn, xe a on khi hnh v Tp. H Ch Minh. Trn ng v Qu khch dng tham quan:\r\nCha Long Sn  ngi c t mang m du n kin trc  ng vi bc tng Pht trng to trn i Tri Thu. \r\nXe a on chinh phc tuyn cao tc mi Vnh Ho  Cam Lm  Nha Trang. on dng chn:\r\nMua sm c sn Phan Rang ti Vn nho Cng 2: tri nghim cm gic hi tn tay nhng chm nho ti ngon, mng nc ca min nng gi.\r\nChiu v n TP. H Ch Minh, xe a Qu khch v im n banu. Chia tay Qu khch v kt thc chng trnh du lch.\r\n  KT THC CHNG TRNH, TM BIT QU KHCH!\r\nLu :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t.\r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng \r\nbi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch sn c th  xa trung tm thnh ph vo cc ma Cao im.','Ngy 5: Nha Trang - TP. H Ch Minh\r\n','02 ba (sng, tra)','T554-9275-3N2D'),(1938,1,'Qu khch tp trung ti cng ty Vietravel (190 Pasteur, Q3, TP.HCM). on khi hnh i Bun Ma Thut, theo QL14 qua cc a danh ng Xoi, Sc Bom Bo, B ng, ng H Ch Minh. Qu khch dng ba tra ti Gia Ngha v dng chn tham quan:\r\nThc Dray Nur - mt thng cnh p nh s kt hp gia hai dng sng Krng N v Krng A Na m ngi d v ngi M\'Nng gi l sng Chng, sng V gp nhau m thnh. Thc Dray Nur nh mt bc thnh nc khng l, hng trng gia mt vng hoa nc long lanh.\r\nn Bun Ma Thut, Qu khch n chiu ti nh hng a phng v lm th tc nhn phng, t do ngh ngi, do ph m ha nhp cuc sng ca ngi dn ca Ty Nguyn.\r\nNgh m ti Bun Ma Thut','Ngy 1: TP. H Ch Minh - Bun Ma Thut\r\n','03 ba n (sng, tra, chiu)','T666-8473-4N3D'),(1939,2,'Sau ba sng, Qy khch tr phng khch sn v tip tc hnh trnh tri nghim khi n vi nng tri c ph. Khm ph nng tri c ph Aeroco Coffee Farm nm st cnh h Eakao th mng, nng tri Aeroco Coffee nh mt im nhn c bit trong bc tranh thin nhin dn d, mc mc v bnh yn ca vng t Ty Nguyn tr ph. n vi ni y, Qu khch s c dp c tri nghim cc hot ng nh:\r\nLng nghe cu chuyn lch v loi cy c ph v gii thiu v hai ging c ph chnh: Arabica v Robusta\r\nChia s v quy trnh canh tc v chm sc vn c ph\r\nTm hiu phng php rang c ph\r\nThng thc ly c ph c pha theo 2 phng php: my v hand drip\r\nMua sm cc mt hng c ph ti showroom v lm qu (chi ph t tc)\r\nLu : c bit mi  thng 2 - 4 hng nm, trn khp cc no ng ca min t  bazan Qu khch s khng l ma n r ca hoa c ph, loi hoa mang mt mu trng thanh khit pha cht hng thm lm say lng ngi.\r\non dng cm tra  nh hng a phng v khi hnh i Kon Tum. n ni, Qu khch dng chn tham quan:\r\nNh th Chnh Ta - c tui i hn 100 nm tui, c ngi dn gi thn mt l nh th g bi cng trnh c o ny c xy dng hon ton bng g, thit k theo li kin trc Roman c in kt hp vi kin trc nh sn truyn thng ca ng bo Ba Na ni y.\r\nCu treo Kon Klor - cy cu treo dy vng ln nht tnh Kon Tum bc ngang qua dng sng k Bla, mt dng sng gn vi nhiu huyn thoi ca ng bo dn tc Ba Na trong vng.\r\nNgm nhn nh rng Kon Klor - vn gi nguyn vn kin trc Ba Na c o vi mu g nu trm\r\nQu khch dng cm chiu v nhn phng ngh ngi, khm ph thnh ph Kon Tum v m.\r\nNgh m ti Kon Tum','Ngy 2: Bun Ma Thut - Kon Tum\r\n','03 ba n (sng, tra, chiu)','T666-8473-4N3D'),(1940,3,'Qy khch dng ba sng ti khch sn sau  tr phng. on khi hnh n vi huyn Ngc Hi  Kon Tum v lng nghe v cu chuyn Ng Ba ng Dng:\r\nNg ba ng Dng - Ct mc ba bin ni im tip gip gia ba nc Vit Nam, Lo v Campuchia. Ni y lu du bao bc chn ca du khch khp mi min t nc khng ch bi v th c bit ca vng t mt con g gy c ba nc u nghe m cn  v p thin nhin hoang s hng v cng bao cu chuyn lng ng tnh t, tnh ngi.\r\nQu khch chp hnh check-in Ct mc ba bin. C l vi bt k ai trong chng ta, vic c chm n ni tm bin ny v ngm nhn T quc mnh tht p bit bao u s cm thy thc s xc ng, may mn xen ln hnh phc\r\nChinh phc Ca Khu B Y - ni c ct mc lm bng  hoa cng, t trn nh ni c  cao 1.086m so vi mt bin, cao 2m, nng gn 900kg c hnh tr tam gic, mi mt quay v hng quc gia  u c tn nc v quc huy trang trng.\r\nQu khch dng ba tra ti nh hng, sau  on khi hnh n Mng en - c v nh Nng Th Mi Ca i Ngn vi nhiu h thc, sui  v cnh quan thin nhin cng vn ha bn a c sc. on tham quan:\r\nKhu hnh hng c M Mng en - ni ni ting linh thing thu ht hng trm lt khch ving thm mi ngy. Ti y du khch c nghe gii thiu v lch s ca tng c m.\r\nSau ba n ti, Qu khch t do ngh ngi v tn hng khng kh trong lnh ti Mng en.\r\nNgh m ti Mng en','Ngy 3: Kon Tum - Khm ph ng ba ng Dng - Mng en\r\n','03 ba n (sng, tra, chiu)','T666-8473-4N3D'),(1941,4,'Sau khi dng ba sng ti khch sn, Qu khch lm th tc tr phng. Xe v HDV a on i tham quan:\r\nKDL Sinh thi - Vn ha Thc Pa S qun th du lch bao gm khu vn tng vi hn 100 bc tng c c th cng bng g do cc ngh nhn ng bo bn a to nn, khu nh rng, nh sn v c bit nht l Thc Pa S vi dng thc tung bt trng xa, quyn r nh c gi p min sn cc\r\nKhi hnh v TP. Bun Ma Thut, on dng ba tra ti Pleiku v tham quan:\r\nBin h T Nng - ming ni la  ngng hot ng hng trm triu nm v c v nh i mt Pleiku lm say lng ngi bi v p th mng, mt nc mnh mng, my tri lng lng, nghe thong trong gi ting thng vi vu, tit tri du mt quanh nm. y cn l h cha nc ngt cung cp nc cho thnh ph Pleiku. Qu khch chim bi Bo Tng Quan m cao 15 mt c lm bng cht liu  cm thch trng.\r\nn Bun Ma Thut nhn phng khch sn v dng ba ti. Qu khch ngh ngi v t do khm ph thnh ph Bun Ma Thut cng nhiu hot ng nh: ha mnh vo nhp sng ca ngi dn ph ni nh thng thc ly c ph Ban M tr danh ngm ph ln n. Gh ch m Ng Su thng thc m thc ng ph nh bn , bn riu, bn gi, canh c dm hoc n gin l ngi nhm nhi ly sa nng trong tit tri se lnh.\r\nNgh m ti Bun Ma Thut','Ngy 4: Mng en - Pleiku - Bun Ma Thut\r\n','03 ba n (sng, tra, chiu)','T666-8473-4N3D'),(1942,5,'Sau ba sng, Qu khch tr phng khch sn. on tip tc tham quan:\r\nChp nh check-in vi biu tng Hai Ch Voi - Song Tng Thnh Vng ti khu EcoCity Premia, mt trong nhng im thu ht khch tham quan.\r\nMua sm c sn Ty Nguyn ti Qu Ph Qu Bun Ma Thut nh (chi ph t tc): cc loi c ph, tiu, ht n lin, cc loi bnh c sn, Macca, rau c sy gin, ru cn ,cc loi tr, cc mt hng qu lu nim Ty Nguyn,\r\nVn Caf Ru Phong - tn mt xem vn ca cao, loi tri cy c trng ch yu  ly ht lm nn cc sn phm kinh t cao trn th trng hin nay  l bt ca cao v chocolate. Ngoi ra, Qu khch s c thng thc c sn ca qun sinh t ca cao c lm t cm ca tri ca cao, v chua chua ngt ngt to nn mt thc ung gii nhit l ming nhng cng khng km phn hp dn.\r\nXe a Qu khch khi hnh v li TP. HCM, n tra trn cung ng v. Chiu v n TP. HCM chia tay Qu khch v kt thc chng trnh du lch, chia tay v hn gp li Qu Khch!\r\n*** Lu : cc im tham quan c th c sp xp li ty theo tnh hnh thc t.\r\nVn  tham quan cc im tn ngng/tn gio ph thuc vo tnh hnh m ca ca cc im ny.\r\n- Cn lu  khch tham quan phi chun b y  cc giy t c nhn (CCCD / H chiu)  xut trnh cho bin phng khi tham quan ti y (v y l khu vc bin gii).','Ngy 5: Bun Ma Thut - TP. H Ch Minh\r\n','02 ba n (sng, tra)','T666-8473-4N3D'),(1943,1,'Qu khch tp trung ti Vietravel Cn Th, on khi hnh i Chu c. on dng ba sng ti nh hng trn ng i (Qu khch t tc n sng).\r\n\r\nXe a Qu khch tham quan Rng trm Tr S - c tng din tch gn 1.500 hc-ta nm trong h thng cc khu rng c dng ca Vit Nam, c cng nhn l khu bo v cnh quan nm 2005. n y, Qu khch c th tham quan phong cnh thin nhin hoang s v h sinh thi a dng vi nhiu loi ng, thc vt hoang d. Qu khch c th cm nhn thm c nt c o khi n vi rng trm khi di chuyn bng xung my hay nhng chic ghe  len li gia cc li i nh xuyn qua khu rng. Ni bt nht l nhng mng bo xanh ngt tri di tng chng nh bt tn, nhng n c trng vi s lng hng ngn con u kn nhng vt rng trm c th. \r\n\r\non khi hnh i n tra. Sau khi dng ba tra, on tip tc di chuyn tham quan:\r\nMiu B Cha X, Ty An C T, Lng Thoi Ngc Hu - l mt im n tm linh c cng ng am m du lch ch  nht khu vc min Ty Nam B. y l mt im n lm nn s ni ting ca thnh ph Chu c trong bn  du lch An Giang nhiu mu sc.\r\nCha Hang Chu c An Giang - ngi cha ta lc ngay trn sn ni Sam. y l a im hp dn rt nhiu khch du lch tm n mi nm. Hin nay cha Hang  c cng nhn l Di tch Lch s - Vn ha cp Quc gia, iu  lm tng sc hp dn ca ngi cha trong lng du khch\r\nSau , xe a Qu khch khi hnh v li Cn Th. Ti v n Cn Th, Hng dn vin chia tay Qu khch kt thc chng trnh du lch.\r\nKT THC CHNG TRNH - TM BIT QU KHCH!\r\n* Lu : y l chng trnh du lch trn gi, Vietravel khng c trch nhim hon tr chi ph chnh lch cho cc khch hng thuc din min gim hoc i tng u tin nh tr nh, ngi ln tui, ngi c cng vi cch mng Chnh sch min gim, u tin (nu c) ch dnh cho khch l ca cc im tham quan.\r\n   ','Ngy 1: Cn Th - Chu c - Miu B Cha X - Rng trm Tr S - Cha Hang Chu c\r\n','01 ba n (tra)','T889-1712-3N2D'),(1944,1,'Qu khch tp trung ti Cng ty Vietravel (190 Pasteur, Phng V Th Su, Qun 3, TP.H Ch Minh) khi hnh i Ninh Thun theo cung ng cao tc mi Du Giy  Phan Thit  Vnh Ho. on n sng trn cung ng i v dng chn tham quan:\r\n\r\nBi bin C N - mt trong nhng bi bin p nht min Trung, vn c mnh danh l Nng cng cha ng qun bi v p hoang s ca n.\r\n\r\nSau ba tra, on tip tc hnh trnh theo cung ng ven bin  n vi Vnh Vnh Hy - mt trong nhng cung ng ven bin p ca Vit Nam lm n tim bao du khch. n ni Qu khch ln tu khm ph nt p Vnh Vnh Hy t y Qu khch s ln tu i chim ngng nhng cnh p ca vng vnh ni ting nht nh ti Vit Nam\r\n\r\nChp nh vi mun kiu sng o ti cc im nh: Mi C ng,  Robot, hang Yn, hn Ra \r\nTri nghim ha mnh vo th gii i dng v ln ngm nhng cm san h y mu sc, nhng n c, nhng con cu gai, nhng con sao bin, (thi gian tm bin v ln ngm khong 90 pht, ty vo iu kin thi tit thc t)\r\nTr v Bi Cc, Qu khch t do tham gia cc hot ng th thao di nc nh phao chui, m t nc, v thng thc hi sn bin ti sng (chi ph t tc). \r\n\r\n***Lu : Qu khch s c trang b knh ln, ng th, o phao v hng dn cch s dng dng c ln trc khi xung bin. Qu khch khng c nhu cu ln bin s  li tu tham quan v chp nh..\r\n\r\nHang Ri - mt trong nhng im check-in ni ting thu ht nhiu du khch, cm gic nh lc vo x s ca cu chuyn c tch bi v p gn nh hon ho t nhng hn  nhiu hnh th xp chng ln nhau to ra v s hang ng ln nh p mt. \r\nChp nh check-in vi vn nho  M Ly v mua sm c sn ca vng t nng gi Ninh Thun (chi ph t tc)\r\n\r\nTr v TP. Phan Rang  Thp Chm, on lm th tc nhn phng v t do thng thc m thc a phng, do ph v khm ph thnh ph bin v m. (chi ph n ti t tc)\r\n\r\nNgh m ti TP. Phan Rang  Thp Chm ','Ngy 1: Tp. H Ch Minh  C N  Ninh Ch\r\n','S ba n: 02 ba n (Sng, Tra)','T558-8877-3N2D'),(1945,2,'Qu khch dng ba sng ti khch sn. on lm th tc tr phng v khi hnh i tham quan:\r\nSay vi v p ca i ct nng bng mang tn Trinh N, ngm nhn bin h lp lnh nh bc di nh mt tri rc r cng s k v ca nhng cn ct trng xa. C  thng 05 - 08 nhng cnh hoa sen hng lp l sau chic l xanh mt to nn mt khung cnh thin nhin th mng.\r\nTri nghim y th v (chi ph t tc) vi xe Jeep tc  cao, thm trt ct, \r\non dng cm tra trn ng v v mua sm c Phan Thit ti c s Hi Thng (chi ph t tc) nh nc mm, cc loi c kh, mc kh...\r\nTip tc hnh trnh v Tp. H Ch Minh, Chia tay Qu khch v kt thc chng trnh du lch ti im n ban u.','Ngy 2: Ninh Ch - Tp. Hcm\r\n','02 ba n (Sng, Tra)','T558-8877-3N2D'),(1946,1,'Qu khch tp trung ti Sn bay Tn Sn Nht, ga i Trong Nc, Hng dn vin h tr lm th tc p chuyn bay i Ph Quc.\r\nn ni, xe v Hng dn vin n Qu khch tham quan\r\nDinh Cu: biu tng vn ho v tn ngng ca o Ph Quc. Ni ng dn a phng gi gm nim tin cho mt chuyn ra khi nh bt y p c khi tr v.\r\nCha S Mun: ngi c t uy nghim, thanh tnh nm trn trin ni, mt hng ra bin\r\nQu khch n tra v nhn phng khch sn ngh ngi.\r\nBui chiu, xe a Qu khch i khm ph thnh ph khng ng Grand World. Qu khch t do tri nghim cc cng trnh ni bt\r\nCng vin Ngh Thut: giao thoa gia ngh thut ng i v thin nhin\r\nHuyn thoi Tre: cng trnh tre ln nht Vit Nam.\r\nTn b bn dng knh o Venice ngm nhng chic thuyn Gondola, khu ph shophouse lng ly sc mu v cng lu i trng l mang m kin trc chu u ...\r\nTour Giao L Th Gii bao gm minishow bui chiu Tinh Hoa Vit Nam, Bo tng Gu & Vietnam One Stop (chi ph t tc)\r\nMn nhn show din thc cnh a phng tin Tinh hoa Vit Nam - Mt hnh trnh xuyn khng ti hin mt vn ha i Vit c (chi ph t tc)\r\nSc Mu Venice (min ph) show din thc cnh a phng tin trn mt nc ln nht Vit Nam\r\nNgh m ti Ph Quc.','Ngy 1: Thnh ph H Ch Minh - Ph Quc - Grand World\r\n','S ba n: 02 (tra, chiu)','T991-0091-4N3D'),(1947,2,'Qu khch bt u hnh trnh tr v vi thin nhin ti Vinpearl Safari Ph Quc - Vn th bn hoang d u tin ti Vit Nam: vi quy m 180 ha, hn 130 loi ng vt qu him, du khch thng thc cc chng trnh biu din, chp nh vi ng vt; tri nghim vn th m trong rng t nhin, gn gi v thn thin vi con ngi.\r\n\r\nBui chiu, Qu khch tham quan khm ph Khu vui chi gii tr VinWonders - cng vin ch  ln nht Vit Nam, quy m hng u Chu , du khch s c:\r\n- Tri nghim 12 nn vn minh nhn loi t c ch kim;\r\n- Khm ph 06 phn khu vi hn 100 hot ng gii tr siu c l;\r\n- Cung nhit ti Cng Vin Nc ln nht ng Nam ;\r\n- Chinh phc 20 tr chi mo him khng nht hnh tinh nh ng trt nhanh nht th gii Cn thnh n ca Zeus, ng trt kh Cuc chin Chn tinh cao 15m u tin ca Vit Nam, ng trt trong nh ti Chin binh i bng v Li nguyn c long - tr chi tng tc trong nh ti u tin ca Vit Nam,\r\n- Ng ngng vi show din triu  Once ng cp th gii;\r\n- Chong ngp trc th gii i dng huyn o vi tm nhn v cc qua tm knh acrylic khng l 8x25m bn trong Cung in Hi vng - thy cung hnh ra ln nht th gii.\r\n\r\nNgh m ti Ph Quc.','Ngy 2: VUI CHI THA THCH TI CNG VIN CH  VINWONDERS PH QUC - KHU BO TN THIN NHIN SAFARI (n sng, tra, chiu)','(sng, ti)','T991-0091-4N3D'),(1948,3,'n sng v tr phng khch sn. Xe n on i tham quan Sun World Hn Thm Nature Park vi nhng hot ng th v:\r\nTri nghim cp treo 3 dy vt bin di nht th gii - 7.899.9 mt.\r\nPhn khch tt  cng th thch Mc X thnh n - Tu ln bng g u tin v duy nht ti Vit Nam; chim ngng bu tri Hn Thm cng Mt i Bng - i quan st 120m vi gc nhn panorama c o (tr chi c th tm dng v lch bo tr)\r\nVui chi ti cng vin nc Aquatopia: mt trong nhng cng vin nc ch  hng u ng Nam , tri nghim 6 khu check-in ch  hp dn mang phong cch th dn huyn b.\r\nSau ba tra, on v li o. Xe n Qu khch ra sn bay p chuyn bay tr v TP H Ch Minh. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\n*****\r\nLu :\r\nKhch c quc tch nc ngoi (tn nc ngoi & vit kiu  i tn hon ton): ph thu 850,000 VN/khch x 2 khch/phng\r\nTheo quy nh resort khch check-in cn t cc 1,000,000 /phng/m. S tin ny s c hon tr khi khch check-out.\r\nGi bay ph thuc vo hng hng khng, s ba n ph thuc vo gi bay. Cc ba n c th hon i  ph hp vi chng trnh.\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t\r\ny l chng trnh du lch trn gi, Vietravel khng c trch nhim hon tr chi ph chnh lch cho cc khch hng thuc din min gim hoc i tng u tin nh tr nh, ngi ln tui, ngi c cng vi cch mng Chnh sch min gim, u tin (nu c) ch dnh cho khch l ca cc im tham quan\r\nGi tour p dng cho khch quc tch Vit Nam. Khch quc tch nc ngoi (bao gm khch Vit kiu  chnh tn nc ngoi hon ton) s c ph thu ty theo bn cung cp dch v\r\nNu lu tr khch sn Vinpearl Resort & Spa Ph Quc, gi tour khng p dng cho phng 3 khch. Ph thu khch ngi ln th 3 trong phng 1.800.000 VN (chi ph ph thu c th thay i ty thi im).','Ngy 3: Ph Quc - Sun World Hn Thm - Thnh ph H Ch Minh\r\n','S ba n: 02 (sng, tra)','T991-0091-4N3D'),(1949,1,'n Qu khch ti Vietravel 190 Pasteur, qun 3, thnh ph H Ch Minh, khi hnh i min Ty theo tuyn cao tc thnh ph H Ch Minh - Trung Lng, Trung Lng - M Thun v tuyn cao tc mi M Thun - Cn Th ngm nhn nhng cnh ng la v mu xanh vn tc hai bn ng; Chim ngng cu M Thun 2 - D n trng im quc gia c chiu di 1,9km ni lin tnh Vnh Long v Tin Giang.\r\n\r\nn bn  C Bc (Cn Th), Qu khch i  qua sng tham quan cm du lch cng ng Cn Sn - Ngi lng du lch cng ng c o gia lng ph th cng nhng tri nghim c bit:\r\nB C 7 Bon - tham quan m hnh nui c lng b, th vin c nc ngt v ni bo tn nhng ging c qu him trn sng Hu hin ha. Thng thc sn phm lm t c tht lt cm, tn mt chim ngng c cung th v tri nghim massage chn bng c c vy.\r\nQu khch cng nhau thng thc ba cm gia nh - mi nh mt mn ngon vi \"thc n bay\" c trng ch c  Cn Sn.\r\nNh c tr v vi tui th t tri nghim lm bnh dn gian Nam B truyn thng (bnh l mt, bnh kp cun) qua s hin dn tn tnh ca cc ngh nhn cht phc. Thng thc nhng chic bnh t tay lm ra thm mi go, mi l, ha quyn nc ct da bo ngy.\r\non dng chn tham quan vn tri cy c sc theo ma: chm chm, nhn, v sa, i, bi (mi ma mi tri).\r\nThng thc i sch trng ti vn v tr hoa u bic; xem cc din vin c biu din \"c lc bay\" v \"c tr g\" khng ni no c c.\r\nMc s th tit mc xic ch th v; thng thc bnh phu th nhn mn (gii nht bnh ngon Nam B 2015) v sm sm gii nhit c trng quanh vn ha quyn cng nc ct gng thm ngon.\r\nCheck-in cng l sen siu to khng l. Tham quan, tm hiu v \"Vn ha Ghe xung Nam B\" v mua sm cc sn phm OCOP.\r\n\r\nQuay tr v thnh ph Cn Th, on tip tc tham quan:\r\nn th vua Hng - vi hnh tng trng ng cch iu 18 cnh cung iu khc hoa vn i din cho 18 i Hng Vng (khch tham quan n th trang phc ph hp vi ni th t, th Hai hng tun n th ng ca  bo tr)\r\n\r\nSau khi dng ba ti ti thnh ph Cn Th, Qu khch t do do ph m khm ph Ty  lung linh sc mu, ngm cnh Cu Cn Th v m, check-in Cu Tnh Yu\r\n\r\nNgh m ti Cn Th','Ngy 1: Thnh ph H Ch Minh - Cn Th - Cn Sn\r\n','03 ba n (sng, tra, chiu)','T992-4790-3N2D'),(1950,2,'on tr phng v khi hnh ra bn Ninh Kiu, xung thuyn du ngon trn sng Cn Th, nghe gii thiu v ch thy sn nc ngt Cn Th; tri nghim ch ni Ci Rng - mt hnh thc hp ch c trng ti cc ng sng ca vng ng bng sng Cu Long  c cng nhn Di Sn Vn Ha Phi Vt Th Quc Gia.\r\nSau khi dng chn tham quan v mua sm ti siu th c sn v qu lu nim Hng o, on khi hnh i Bc Liu tham quan:\r\nNh cng t Bc Liu - do k s ngi Php thit k vo nm 1919, y c xem l ngi bit th b th nht  Nam k lc tnh lc by gi. on nghe k v giai thoi vng son mt thi ca cu Ba Huy - Ngi c mnh danh l Cng t Bc Liu.\r\nSau khi n tra, on khi hnh i C Mau. Trn ng i, on dng chn tham quan Nh th Tc Sy - ni y gn lin vi nhng cu chuyn cm ng v cuc i ca cha Trng Bu Dip.\r\nn C Mau, on nhn phng ngh ngi. \r\nNgh m  C Mau','Ngy 2: Cn Th - Ch ni Ci Rng - Bc Liu - C Mau\r\n','03 ba n (sng, tra, chiu)','T992-4790-3N2D'),(1951,3,'on tr phng v ln xe khi hnh n t Mi. n ni, on di chuyn bng cano len li trong rng c, khm ph khu rng ngp mn ln th hai th gii vi h sinh thi a dng, mang v p hoang di cng bu khng kh trong lnh.\r\nTi t Mi, Qu khch chinh phc cc Nam t quc, khm ph Ct mc ta  quc gia GPS 0001; Pano biu tng mi C Mau; im cui ng H Ch Minh 2436Km; n th Cha Lc Long Qun v tng M u C; chinh phc Ct c t Mi - chim ngng v p cm o Hn Khoai th mng nm gia bin ng\r\nQu khch mua sm v thng thc ba tra ti khu du lch cng ng Hong Hn vi nhng mn n c sn a phng: c thi li, vp\r\non khi hnh i Bc Liu, tham quan:\r\nCha Xim Cn - vi sc vng lng ly cng thit k nhiu hoa vn t m mang m du n Khmer Nam B. \r\nCnh ng in Gi - chim ngng v p nhng tua-bin gi khng l cao hn 80 m sng sng trn nn tri xanh vi  ngha to mt ngun nng lng sch v tn trn mt bin, gim thiu tc ng gy hiu ng nh knh \r\nNgh m  Bc Liu','Ngy 3: C Mau - t Mi - Bc Liu - Cnh ng in gi\r\n','03 ba n (sng, tra, chiu)','T992-4790-3N2D'),(1952,4,'Sau ba sng, Qu khch tham quan:\r\nQung Trng Hng Vng - hnh nh cy n km cch iu (cao 18,6 m) nhc c khng th thiu trong n ca ti t ci lng, biu tng vn ha ca tnh Bc Liu.\r\nKhu lu nim ngh thut n Ca Ti T Nam B v c nhc s Cao Vn Lu - mt cng trnh khi qut v thn th, s nghip ca c nhc s Cao Vn lu, ghi nhn cng lao v tn vinh nhng ng gp to ln ca ng cho ngh thut n ca ti t Nam b v l ngi sn sinh ra bn D c Hoi lang bt h.\r\non khi hnh i Sc Trng, tham quan hai ngi cha ni ting:\r\nCha S Ln - cn c gi l \"cha Chn Kiu\" th hin c nt vn ha c o ca ngi Khmer cng cch thit k sng to t hng vn mnh chn c p trn cc cng trnh kin trc ca cha.\r\nCha Ptum Wngsa Som Rng - mt qun th kin trc Pht gio rng ln, gm nhiu cng trnh nh: Chnh in, ngi bo thp vn ngi m p ta cha Arun ti Thi Lan, c bit, tng Pht Thch Ca nhp nit bn uy nghim vi kch thc chiu di 63 mt\r\non quay v thnh ph H Ch Minh, kt thc chng trnh ti im n ban u.\r\nLu : Chng trnh ca Vietravel l chng trnh trn gi, khng c p dng chnh sch min gim, u tin vo im tham quan (nu c) dnh cho tr em, ngi cao tui, ngi c cng vi cch mng v vy Vietravel s khng hon li phn chnh lch cho cc khch hng thuc din u tin ny.','Ngy 4: Bc Liu - Sc Trng - Thnh ph H Ch Minh\r\n','02 ba n (sng, tra)','T992-4790-3N2D'),(1953,1,'Qu khch tp trung ti cng ty Vietravel (190 Pasteur, Phng V Th Su, Qun 3, TP.HCM), khi hnh i  Lt. on dng ba sng trn ng i v c lng nghe HDV Vietravel k v cc cu chuyn gn lin vi nhng a danh ni ting m on i qua nh: o Chui,  Ba Chng, o Bo Lc,\r\n\r\nQu khch dng chn tham quan Khu du lch thc Tea Bobla vi cc tri nghim sau:\r\nChp nh vi dng thc nguyn s, hng v cun cun tun chy trng xa quanh nm v vui chi ti h bi v cc 4 tng\r\nNgm nhn cc loi ng vt qu him nh Cng bch tng, Vt ui di Nam M, Yn phng,\r\nTham quan nh trng by c vt, cy c th Khng th thiu nhau, khu trng by my bay v tn la\r\nThng thc ba tra ti nh hng bn dng thc v tn hng trong khng kh mt lnh, trong lnh ca vng t cao nguyn Di Linh\r\nTip tc hnh trnh, Qu khch n vi thnh ph sng m  Lt mng m nhn phng ngh ngi v dng ba ti ti nh hng a phng. \r\n\r\nBui ti, Qu khch t do ung caf quanh khu vc H Xun Hng hay thng thc ly sa u nnh nng hi, bnh trng nng c sn  Lt khu vc Tng Bt H. \r\nNgh m ti  Lt\r\n ','Ngy 1: Tp. H Ch Minh - Kdl Thc Tea Bobla -  Lt\r\n','S ba n: 3 ba n (sng, tra, chiu)','T668-6785-3N2D'),(1954,2,' Lt cho n Qu khch vi khng kh se lnh thoang thong mi sng sm mai, sau khi dng ba sng, xe a on tham quan:\r\nGa  Lt v tri nghim chuyn tu c  Lt - Tri Mt - cng hoi nim v mt  Lt xa, ngm nhn khung cnh ngoi   Lt lt qua bn ngoi  ca s. ( di 7km  di chuyn khong 30 pht)\r\nKhm ph kin trc c o cha Linh Phc hay cn gi l cha Ve Chai, l mt trong nhng ngi cha ni ting gi n 11 k lc c quc gia ghi nhn.\r\nXe n Qu khch tr v trung tm thnh ph n tra ti nh hng. Bui chiu on tip tc hnh trnh khm ph cao nguyn ngn hoa ti:\r\nNh Th Domain de Marie - theo dng n tu Bc i, ni bt vi mu hng sng rc ta lc trn i Mai Anh. \r\nKhm ph Mongo Land - mang v p hon ton mi l ca mt \"tiu Mng C thu nh\" trong lng  Lt. Qu khch s c: \r\nTri nghim cm gic siu  ti ng trt phao kh y sc mu\r\nTha thch chp nh ti lu mng c, xch u, nng tri u,\r\nHa mnh vo th gii ca ng vt: hu sao, d, cu, th Holland Lop H Lan,(thc n s c Mongo Land chun b sn).\r\nHa thn thnh nhng c nng, chng trai du mc thc th vi trang phc ngi Mng C. (Chi ph thu trang phc t tc).\r\non dng cm chiu ti nh hng Cm niu Nh Ngc ni ting ca thnh ph sng m vi cc mn n mang m bn sc thun Vit nh: ba ch chy cnh, salad organic trn, g nng da gin v xi chin, lu b,... v c bit Qu khch s c thng thc nhng mn trng ming c sc theo ma.\r\n\r\nQu khch t do tn b tham quan ch  Lt v m v khm ph m thc ng ph c o ca  Lt nh bnh trng nng ph Xun Diu, sa u nnh Tng Bt H, Kem B, xin nng,\r\nNgh m ti  Lt\r\n ','Ngy 2:  Lt  Tri Nghim Chuyn Tu C Xa\r\n','S ba n: 3 ba n (sng, tra, chiu)','T668-6785-3N2D'),(1955,3,'Sau khi dng ba sng ti khch sn, on khi hnh tham quan:\r\nFairytale Land & hm ru vang Vnh Tin - khu vn c tch ca nhng ch ln Hobbiton. Do mt vng quanh khu vn Qu khch s c dp thm hm ru vang vi hn 10.000 chai ang c trng by.\r\nLng nghe v tri nghim quy trnh sn xut socola ti La Dolce Vita - Qu khch s c dp c tm hiu v ht ca cao v t tay lm nhng thanh socola mang v lm qu tng cho ngi thng. \r\nMua sm c sn  Lt ti c s mt Thanh Nhu: cc loi tri cy sy gin, sy do, nc ct du tm  du ti, tr atiso, tr hoa, ...\r\non dng cm tra ti nh hng a phng. Bui chiu, Qu khch ngh ngi ti khch sn v t do khm ph thnh ph, hoc c th la chn tham gia mt trong cc hot ng sau (chi ph t tc):\r\nVo 16h30 n hong hn v thng thc ba tic m nhc cng Lululola Coffee vi khng gian ngoi tri (chi ph t tc)\r\nLc 20h00 thng thc nhng bn nhc tr tnh xa, nhc Trnh, nhc Bolero ti Phng tr Cung n Xa(chi ph t tc)\r\nTri nghim tm khong nng & xng hi ti Dlats gip bn th gin v ngh ngi, gii ta cng thng (chi ph t tc)\r\n***Lu : Chi ph v v i li t tc***\r\n\r\nBui ti, Qu khch t do tn b Ch  Lt v thng thc m thc a phng: lu b, lu g l , bnh t lng g, bnh cn,.... (n ti t tc)\r\nNgh m ti  Lt\r\n   ','Ngy 3:  Lt  Khm Ph Lng C Tch Fairytale Land  Lng ng Bn Khng Gian Nhc Trnh\r\n','S ba n: 2 ba n (sng, tra, n chiu t tc)','T668-6785-3N2D'),(1956,4,'Qu khch dng ba sng ti khch sn v lm th tc tr phng, hng dn vin a on i tham quan:\r\nCha Linh n - c xy dng theo th lng ta ni mt hng thy vi rng thng bt ngn bao quanh v trc mt l thc Voi hng v.\r\nTm Trnh Coffee - thng thc ly c ph thm ngon, tn hng khng kh trong lnh v cng lng nghe cu chuyn ngn v cc loi c ph\r\non khi hnh v TP. HCM v dng ti Bo Lc dng cm tra, sau  khi hnh v im n ban u. Chia tay on v kt thc chng trnh du lch.\r\n ','Ngy 4:  Lt - Tp. H Ch Minh\r\n','S ba n: 2 ba n (sng, tra)','T668-6785-3N2D'),(1957,1,'Qu khch tp trung ti sn bay Tn Sn Nht (Ga ni a), hng dn vin h tr khch lm th tc p chuyn bay i H Ni. n sn bay Ni Bi, xe v HDV Vietravel n Qu khch i H Ni nhn phng khch sn ngh ngi hoc t do i tham quan ph c H Ni.\r\n\r\nNgh m ti H Ni','Ngy 1: SB Ni Bi - H Ni\r\n','00 ba n (t tc n ngy u tin)','T001-3671-7N6D'),(1958,2,'Qu khch n sng v tr phng khch sn. Xe khi hnh a Qu khch i tham quan:\r\nLng H Ch Tch (khng ving vo th 2, th 6 hng tun v giai on bo tr nh k hng nm 15/6 - 15/8) tham quan v tm hiu cuc i v s nghip ca v cha gi dn tc ti Nh Sn Bc H, Bo Tng H Ch Minh, Cha Mt Ct.\r\nMt vng H Hon Kim ngm bn ngoi Thp Ra, n Ngc Sn, Cu Th Hc.\r\nTip tc hnh trnh, xe khi hnh a Qu khch n thnh ph bin H Long theo quc l 18, trn ng dng n tra v tham quan vng t thing Yn T: \r\n Tham quan chp hnh Lng Nng v dng ba tra ti Cm Qu \r\nQu khch ln cp treo du ngon thng cnh thin nhin ng Yn T (chi ph cp treo t tc), ni cn lu gi nhiu di tch lch s mnh danh t t Pht gio Vit Nam, chim bi cha Mt Mi, cha Hoa Yn - ni tu hnh ca pht hong Trn Nhn Tng khai sinh ra dng mi Thin Phi Trc Lm, nm trn lng chng ni   cao 516m. Theo du chn Pht Hong ving Cha ng c tn Thin Trc T (cha Ci Pht), ta lc  nh cao nht dy Yn T (1.068m) - ngi cha bng ng ln nht Vit Nam.\r\nQu khch nhn phng khch sn v dng cm chiu. Bui ti, Qu khch t do khm ph nhiu hot ng dch v gii tr si ni ti ph c Bi Chy - nm cnh cng vin Sun World H Long t nhng m thc ng ph n cc qun c ph siu d thng nh Hn Gai Coffee & Lounge hay thoi mi bung xa ti The Mini Bar, Brothers Pub,\r\nNgh m ti H Long\r\nHoc la chn mt s dch v khm ph H Long v m (t tc phng tin v chi ph tham quan):\r\nTri nghim dch v Cp Treo N Hong ti Sun World H Long Complex trn ni Ba o, chim ngng cnh p v m ca thnh ph H Long di nh n lung linh (thi gian hot ng cp treo d kin t 10h n 18h cc ngy th 7 v CN).','Ngy 2: H Ni - Yn T - H Long\r\n','01 ba n (sng)','T001-3671-7N6D'),(1959,3,'Qu khch n sng v tr phng khch sn. Xe khi hnh a Qu khch tham quan: \r\nChp hnh bn ngoi Bo tng Qung Ninh, Cung C Heo - Cung Quy Hoch, Hi Ch, Trin Lm V Vn Ha Qung Ninh.\r\nXung thuyn i du ngon Vnh H Long - Thng cnh thin nhin tuyt p v v cng sng ng, c UNESCO cng nhn l di sn thin nhin Th gii nm 1994.\r\nTham quan ng Thin Cung l mt trong nhng ng p nht  H Long. V p nguy nga v lng ly bi nhng lp thch nh v nhng lung nh sng lung linh. T trn tu ngm nhn cc hn o ln nh trong Vnh H Long: Hn G Chi, Hn L Hng.\r\nTham quan mua sm c sn ti Hi Sn Hng  H Long vi nhiu mt hng ni ting ch mc gi tay H Long, tht chng mm tp, ruc tm, s sng kh, c cm, c ch vng,..\r\nSau khi tham quan, xe n Qu khch ti bn thuyn khi hnh i Ninh Bnh - vng t mnh danh l Ni m n, chn mong v vi nhiu di tch vn ha, thin nhin v cng c sc. Qu khch dng cm ti v nhn phng khch sn ngh ngi.\r\n\r\nBui ti, Qu khch t do khm ph Ph c Hoa L, mt khng gian check-in c, p, trm mc p tr nn lung linh, huyn o hn vi sc mu ca nhng chic n lng v Bo Thp trn H K Ln; tri nghim nhiu hot ng tr chi dn gian v nhiu loi hnh vn ha ngh thut t dn tc nh ma ri nc, nhy ma Tc Xnh, ht xm, ... n nhng bui trnh din acoustic s c din ra vo cc bui ti ngy cui tun.\r\nNgh m ti Ninh Bnh','Ngy 3: H Ni - Yn T - H Long\r\n','01 ba n (sng)','T001-3671-7N6D'),(1960,4,'Qu khch n sng v tr phng khch sn. Xe a Qu khch i tham quan: \r\nKhu Du Lch Trng An - Qu khch ln thuyn truyn thng i tham quan thng cnh h thng ni  vi hng v v cc thung lng ngp nc, thng vi nhau bi cc dng sui to nn cc hang ng ngp nc quanh nm. im xuyn trong khng gian hoang s, tnh lng l hnh nh ru phong, c knh ca cc mi nh, n, ph nm np mnh di chn cc dy ni cao. \r\nVing Cha Bi nh - qun th cha vi nhiu k lc Vit Nam nh pho tng pht Di Lc bng ng nng 80 tn, hnh lang vi 500 tng v La Hn, ta Bo Thp cao 99m\r\nXe khi hnh a Qu khch ra sn bay Ni Bi lm th tc n chuyn bay v Tp.HCM. Chia tay Qu khch v kt thc chng trnh du lch ti sn bay Tn Sn Nht.\r\nKT THC CHNG TRNH, TM BIT QU KHCH!\r\n*Lu  :\r\nHnh trnh c th thay i th t im n ty vo iu kin thc t. \r\nLch trnh tham quan (tm bin, ngm hoa, tri nghim,...) rt d b nh hng bi thi tit. y l trng hp bt kh khng mong Qu khch hiu v thng cm.\r\nKhch sn c th  xa trung tm thnh ph vo cc ma Cao im.\r\nV nhng yu t khch quan trong giai on ny, im tham quan c th ng ca v c thay bng im khc ph hp vi chng trnh.\r\n ','Ngy 4: Ninh Bnh - SB Ni Bi\r\n','01 ba n (sng)','T001-3671-7N6D');
